var book = {
	"name": "အဇံၫခအ့လၭ",
	"numChapters": 48,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> တၭလၧအနံၪ့ၥၧၫ့ဆံၫနံၪ့လနံၪ့အဖၧၩ့နီၪ, လၩလံ ဘံၪ့လဘံၪ့လၩထၪ့ယဲနံၩလနံၩ လၧယအီၪလၧၦကဲၪ ဎီးအကျၩ လၧထံၫမိၡါခံဘၫအနဲၩ့နီၪ, ဆၧမၩအၥၭ လၧမူၭခိၪဝဲထၪ့အၥၭတၭ, ယဒၪဘၪဆၧလၧယၫလ",
			"2": "<sup>2</sup> ခီၫဘၪဆဲၫ့လၧယွၩလီၫ.- လၩထၪ့ယဲနံၩလနံၩလၧစဎွၩ",
			"3": "<sup>3</sup> ယဟီအခံၫ့ကဲၪဎီးယဲနံၪ့လနံၪ့အဖၧၩ့,- ယဟိဝၩအလူ လၩ့ဘၪတၡါစဘူၫဇဲၫအဖိၪခွၫ ၦလုဆၧစအဇံၫခအ့ လၭ,လၧၦခၫလဒံအၫဖိၪအခးဖၧၩ့ လၧထံၫမိၡါခံဘၫ အနဲၩ့တၭ, ယဟိဝၩအစူၪအီၪဝ့ၫလၧအလီၩ့ထီးနီၪ လီၫ.",
			"4": "<sup>4</sup> ယယိဆၧတၭ,ယိခွါ,လံၩၥဝံၭဂဲၫထၪ့လၧမုဖၩလ ခီၫ,ဆၧအုၪ့ဖၭဒိၪ, ဒဲမ့ၪလၪကျီၪမွံၩအၥၭတၭ, ဆၧ ယုၩ့ယဲအီၪဝၬဖီၩ့ဝ့ၫ, လၧအၥၭခံဖၧၩ့နီၪ ဆၧမၩအ ၥၭဘဲၫထီးဘၩ့ဆံၫ့အၥိၭ အီၪဝ့ၫလၧအၥၭခံဖၧၩ့နီၪ",
			"5": "<sup>5</sup> လီၫ.- လၧအၥၭခံဖၧၩ့နီၪဆၧအမၧၫ့လံဒုၩအခံးအဂၩ့ အီၪဝ့ၫလီၫ. တၭအဝ့ၫၥံၪဖျီၪထၪ့ဝ့ၫဘဲၫယီၩ, အီၪဝ့ၫ",
			"6": "<sup>6</sup> လၧၦၡၩအခံးအဂၩ့လီၫ.- လဒုၩလဒုၩအီၪဝ့ၫလၧအ မ့ၬလံခီၫ, လဒုၩလဒုၩအီၪဝ့ၫလၧအဒံၭလံခီၫဆုၬဆုၬ",
			"7": "<sup>7</sup> လီၫ.- အခၪ့နီၪလီၩ့ဝ့ၫ, အခၪ့ယၫၥၭမၩအၥၭဘဲၫချီ ဖိၪအခၪ့ယၫၥၭအၥိၭလီၫ. တၭယုၩ့ယဲဝ့ၫ ဘဲၫထီး",
			"8": "<sup>8</sup> ဘၩ့ထူၭဆံၫ့အၥၭအၥိၭလီၫ.- တၭၦၡၩအစူၪအီၪဝ့ၫ လၧအဒံၭအဖၫ့လၬ လၧအနဲၩ့ဖၭထံၭလံခီၫအလီၩ့ တၭ,လံခီၫနီၪအီၪဝ့ၫ လၧအမ့ၬဒဲအဒံၭလံခီၫလူၬလီၫ.",
			"9": "<sup>9</sup> အဒံၭလဖၪဘုၭထၬလိၬအၥၭလီၫ. ထီးအလ့ၩဆၧ တၭ,ကၠၪအၥၭအ့ၬ, လ့ၩဝ့ၫလၧအမ့ၬယၫလခီၫတီၩ",
			"10": "<sup>10</sup> တီၩလီၫ.- ဆၧလၧအမ့ၬအခံးအဂၩ့လံဒုၩနီၪ အီၪဝ့ၫ လၧၦၡၩအမ့ၬ, ဒဲဆၬလၥၧၫ့အမ့ၬလၧအစူၪထွ့ၪလခီၫ တၭ,ၦလံဒုၩနီၪအီၪဝ့ၫလၧချီဖၫအမ့ၬ လၧစူၪစ့ၪလခီၫ တၭ,ၦလံဒုၩနီၪ အီၪဆ့လၧလံၬကျီၫ့ကျီၫ့အမ့ၬလီၫ.",
			"11": "<sup>11</sup> အမ့ၬလဖၪအီၪဘဲၫနီၪတၭ, အဒံၭလဖၪယူၬထၪ့အၥၭ လၧထၭလခီၫး လဒုၩအီၪလၧအဒံၭနံၫဘံၪ့ ဘုၭထၬ လိၬအၥၭ, ဒဲနံၫဘံၪ့ချႃၬဘံၭအနၫ့ဆါဆုၬဆုၬလီၫ.",
			"12": "<sup>12</sup> အဝ့ၫၥံၪလ့ၩဝ့ၫတီၩတီၩ လၧအမ့ၬယၫကိၭဒုၩတၭ, ထီးဒၪဆၧအၥၭအီၪလၧအမိလ့ၩဝ့ၫတၭ, အဝ့ၫၥံၪလ့ၩ",
			"13": "<sup>13</sup> ဝ့ၫလီၫ. ထီးအလ့ၩဆၧနီၪကၠၪအၥၭအ့ၬ.- ဆၧအမၧၫ့ လဖၪအခံးအဂၩ့နီၪ အီၪဖျီၪဝ့ၫမၩအၥၭ ဘဲၫမ့ၪအၧၩ့ ဖၭအၥိၭ,မၩအၥၭဘဲၫမ့ၪဒိၩ့အၥိၭနီၪလီၫ. မ့ၪနီၪလ့ၩ ထၪ့ဂဲၫလၩ့လၧဆၧအမၧၫ့လဖၪအကျၩ, ဒဲမ့ၪခဲၩဖၩ့ ထၪ့,ဒဲလၫ့ဝဲအဒံၭစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧမ့ၪအကျၩလီၫ.",
			"14": "<sup>14</sup> တၭဆၧအမၧၫ့လဖၪနီၪစဲၪ့ဆၧတၭ, ဂဲၫထဲၩ့ဘဲၫလၫ့ဝဲ ဒံၭလဘျၩ့အၥိၭနီၪလီၫ.",
			"15": "<sup>15</sup> တၭယယိဆၧအမၧၫ့လဖၪအဘိၩ့ဘၭနီၪ ယိခွါ, လဲၪ့ပၪအီၪလၧဂၪ့ခိၪချိၫ့ လၧဆၧအမၧၫ့အီၪလၧအမ့ၬ",
			"16": "<sup>16</sup> လံခီၫအနဲၩ့ထံၭ,- လဲၪ့ပၪအခံးအဂၩ့, ဒဲဆၧတဲၩ့အ ၥၭလၧအဖၧၩ့နီၪ, မၩအၥၭဘဲၫထၫ့မျါဘၩ့ယ့ၫအၥိၭ နီၪတၭ,ဆၧလံဒုၩနီၪ အီၪဝ့ၫလၧအခံးအဂၩ့လမံၩ့ဎး အခံးအဂၩ့, ဒဲဆၧတဲၩ့အၥၭလၧအဖၧၩ့နီၪမၩအၥၭ ဘဲၫလဲၪ့ပၪလဘံၪ့အီၪဝ့ၫ လၧလဲၪ့ပၪလဘံၪ့ဒၪအဖၧၩ့",
			"17": "<sup>17</sup> အၥိၭနီၪလီၫ.- ထီးအလ့ၩဆၧတၭ,လ့ၩဝ့ၫလၧအနဲၩ့ ဖၩလံခီၫလီၫ. ထီးအလ့ၩဆၧတၭ,ကၠၪအၥၭအ့ၬ.",
			"18": "<sup>18</sup> တၭအဝ့ၫၥံၪအခွၩ့နီၪထၪ့ထီၫဝ့ၫ ထီးအမၩၥၭမဲၪဆၧ, အခွၩ့နီၪဎွ့ၩလၧအမ့ၬၥၪၥံၪဝၬဖီၩ့လံခွၩ့လီၫ.",
			"19": "<sup>19</sup> တၭထီးဆၧအမၧၫ့လ့ၩဆၧနီၪ, လဲၪ့ပၪလဖၪလ့ၩဝ့ၫ လၧအနဲၩ့ထံၭလီၫ. ထီးဆၧအမၧၫ့လဖၪဘၪဆၧဆိၬ ထၪ့ဝ့ၫလၧဂၪ့ခိၪအဖၫ့ခိၪတၭ, လဲၪ့ပၪၥံၪဘၪဆၧဆိၬ ထၪ့ဝ့ၫဒၪဆ့လီၫ.",
			"20": "<sup>20</sup> ထီးဒၪအလးလၧၥၭနီၪမိလ့ၩဆၧလစီၪ့စီၪ့, အဝ့ၫ ၥံၪလ့ၩဆ့, ထီးနီၪၥၭမိလ့ၩဝ့ၫး တၭလဲၪ့ပၪဘၪဆၧ ဆိၬထၪ့ဝ့ၫလၧအနဲၩ့ထံၭလီၫ. အဂဲးဘဲၫယီၩ ဆၧအ",
			"21": "<sup>21</sup> မၧၫ့နီၪအၥၭအီၪဝ့ၫလၧလဲၪ့ပၪအဖၧၩ့လီၫ.- ထီးအ ဝ့ၫၥံၪနီၪလ့ၩဝ့ၫတၭ, အဆၧလ့ၩဝ့ၫလီၫ. ထီးအဝ့ၫၥံၪ နီၪအီၪထီတၭ, အဆၧအီၪထီဝ့ၫလီၫ. ထီးအဝ့ၫၥံၪနီၪ ဘၪဆၧဆိၬထၪ့ဝ့ၫလၧဂၪ့ခိၪအဖၫ့ခိၪတၭ, လဲၪ့ပၪၥံၪ ဘၪဆၧဆိၬထၪ့ဝ့ၫလၧအနဲၩ့ထံၭလီၫ. အဂဲးဘဲၫယီၩ ဆၧအမၧၫ့နီၪအၥၭအီၪဝ့ၫလၧလဲၪ့ပၪအဖၧၩ့လီၫ.",
			"22": "<sup>22</sup> တၭလၧဆၧအမၧၫ့အခိၪဎွံၪအဖၫ့ခိၪနီၪ ဆၧဖျီၪဝ့ၫ မၩအၥၭဘဲၫမူၭဖိၭဖၫ့, ဘဲၫလိးဖျီၪၥလၩအၥိၭ, လၧ အမၩၥၭမဲၪဆၧနီၪ ပၠၪထၪ့အၥၭလၧအခိၪဎွံၪအဖၫ့ခိၪ",
			"23": "<sup>23</sup> လီၫ.- လၧမူၭဖိၭဖၫ့အဖၫ့လၬနီၪ,အဒံၭလဘံၪ့ဒဲလဘံၪ့ လီၩ့လိၬအၥၭတၭ, လဒုၩအီၪဝ့ၫလၧအဒံၭနံၫဘံၪ့လၧ အချႃၬဘံၭထၬအမိၡါအယီၩလခီၫ, လဒုၩအီၪလၧနံၫ ဘံၪ့လၧအချႃၬဘံၭထၬ အမိၡါအနီၪလခီၫ လဒုၩဘၪ",
			"24": "<sup>24</sup> လဒုၩဆုၬဆုၬလီၫ.- ထီးအလ့ၩဆၧတၭ, ယနါဂၧၫ့ ဆၧအဒံၭအၥီၫ, ဘဲၫထံၫဖၭဒိၪအၥီၫအၥိၭနီၪ, ဘဲၫဆၧ ၥ့ၪဆၧလူၬလဂၩအလူအၥိၭနီၪ, အလူအၥီၫနီၪမၩအ ၥၭဘဲၫဆၧၥုၭမုခမျၧးအၥီၫအၥိၭနီၪလီၫ. တၭထီးအ",
			"25": "<sup>25</sup> ဝ့ၫၥံၪအီၪထီနီၪ ထုၭလၩ့အဒံၭလီၫ.- ထီးဆၧအလူ လၩ့လၧမူၭဖိၭဖၫ့လၧအခိၪဎွံၪအဖၫ့ခိၪတၭ, အဝ့ၫၥံၪ အီၪထီဒဲထုၭလၩ့အဒံၭလီၫ.",
			"26": "<sup>26</sup> လၧမူၭဖိၭဖၫ့အဖၫ့ခိၪလၧအအီၪဝ့ၫ လၧအဝ့ၫၥံၪအ ခိၪဎွံၪလဖၪအဖၫ့ခိၪနီၪ, ဆၧဖျီၪထၪ့မၩအၥၭဘဲၫထၫ့ မျါနံၩလၩအၥိၭ,ဘဲၫဆၧအလးဆီၩ့ဆီအၥိၭနီၪ, ဒဲလၧ ဆၧဖျီၪထၪ့ မၩအၥၭဘဲၫဆၧအလးဆီၩ့ဆီအၥိၭအ ဖၫ့ခိၪနီၪလၧဆၧအခံးအဂၩ့ ဘဲၫၦၡၩအၥိၭနီၪအီၪဝ့ၫ",
			"27": "<sup>27</sup> လီၫ.- တၭယဒၪဘၪဆၧလၩ့ဂၬထီးဘၩ့ဆံၫ့,မၩအၥၭ ဘဲၫမ့ၪအီၪဝၬဖီၩ့ဝ့ၫလၧအဖၧၩ့အၥိၭ လၧအယးဒံၩ့အ ဖၫ့ခိၪနီၪလီၫ. တၭလၧအယးဒံၩ့အဖၫ့လၬနီၪယဒၪ ဘၪဆၧမၩအၥၭ ဘဲၫမ့ၪအၥိၭနီၪ, ဒဲအဆၧဂိးၡ့ၭဂိး ၡီၫအီၪဝၬဖီၩ့ဝ့ၫလီၫ.",
			"28": "<sup>28</sup> ဘဲၫလၫ့လၩ့အီၩထံၫ လၧဆၧအုၪ့လီၩ့လၧဆၧဂဲၫ ဆၧၩ့အမုလနံၩအၥိၭနီၪ, ဆၧယုၩ့ယဲဝၬဖီၩ့ဝ့ၫမၩအ ၥၭဘဲၫနီၪၥိၭလီၫ. အယီၩမၩအၥၭ ဘဲၫယဟိဝၩအ လၩအဖၩ့ အခံးအဂၩ့အၥိၭနီၪလီၫ. တၭလၧယဒၪ ဘၪဝ့ၫနီၪယလၩ့ထံၩဖါချႃၬလၩ့တၭ, ယနါဂၧၫ့ဆၧ လၧအချဲၩ့ဆၧလဂၩအလူလီၫ."
		},
		"2": {
			"1": "<sup>1</sup> အဝ့ၫဒၪစံၭယၧၩ, ၦၡၩအဖိၪခွၫဧ့,ဆၧၫ့ထုၪ့လၧနခၪ့ ဆံၭး တၭယမိချဲၩ့ဆၧလၧနၧၩလီၫ.",
			"2": "<sup>2</sup> ထီးအဝ့ၫဒၪချဲၩ့ဆၧလၧယၧၩတၭ, ၥၭနီၪဂဲၫနုၬလၧ ယဖၧၩ့တၭ, ဒုၭဆၧၫ့ထုၪ့ယၧၩလၧယခၪ့တၭ, ယနါ",
			"3": "<sup>3</sup> ဂၧၫ့ၦလၧအချဲၩ့ဆၧလၧယၧၩအလူနီၪ,- စံၭယၧၩ, ၦ ၡၩအဖိၪခွၫဧ့, ယအၪ့မၧၫ့လၩ့နၧၩ လၧၦအံၫစရ့လၭ ဖိၪအအီၪ, ၦပိၩ့ထၪ့ဆၧလဆၨၩလၧအပိၩ့ထၪ့ထၫ့ဒၩ ယၧၩလီၫ. အဝ့ၫၥံၪဒဲအဖါလဖၪနီၪ ပိၩ့ထၪ့ယၧၩထီၩ့",
			"4": "<sup>4</sup> လၩ့မုဆၫလနံၩယီၩလီၫ.- ဖိၪခွၫလဖၪလၧယအၪ့မၧၫ့ လၩ့နၧၩလၧအအီၪနီၪ, မွဲၦလၧအမၩကြၩ့ထမးဆၧ, ဒဲအၥၭနီၩ့လီၫ. ယအၪ့မၧၫ့လၩ့နၧၩ လၧအဝ့ၫၥံၪအ အီၪတၭ,နမိဘၪစံၭအဝ့ၫၥံၪ, ကဆါယဟိဝၩစံၭဘဲၫ",
			"5": "<sup>5</sup> ယီၩ,- ခိၭနၪဆၧမွဲဂ့ၩ, လခိၭနၪဘၪဝ့ၫမွဲဂ့ၩ, အဝ့ၫၥံၪ မိၥ့ၪယၫလၧမီၪလဂၩအီၪဝဲၩဝ့ၫ လၧအကျၩလီၫ. အ ဂဲးဘဲၫယီၩမွဲၦဂံၪ့ဖိၪ လၧအပိၩ့ထၪ့ဒၪဆၧလီၫ.",
			"6": "<sup>6</sup> ၦၡၩအဖိၪခွၫဧ့, နဝ့ၫဒၪယီၩထီးၥၭမဲၪအဝ့ၫၥံၪလ ဂ့ၩ,ၥၭမဲၪအဆၧချဲၩ့လဂ့ၩ, မွဲဆၧဆူၪဆၧမဲၪလၧနဂး, ဒဲနအ့ၪအီၪလါနၫ့ လၧဆၧကဲၪ့မ့အကျၩနီၪ, ထီးၥၭမဲၪ အဆၧချဲၩ့လဂ့ၩး အၪ့ယိၪဆၧလၧအမ့ၬအကၠီၩ့လဂ့ၩ,",
			"7": "<sup>7</sup> အဂဲးဘဲၫယီၩမွဲၦဂံၪ့ဖိၪလၧအပိၩ့ထၪ့ဆၧလီၫ.- မိခိၭ နၪဆၧမွဲဂ့ၩ, လခိၭနၪဘၪမွဲဂ့ၩ, လီၩဘၪအဝ့ၫၥံၪလၧ ယဆၧချဲၩ့ဆံၭ. အဂဲးဘဲၫယီၩမွဲၦပိၩ့ထၪ့ဆၧဆီၪ့ထုၬ လီၫ.",
			"8": "<sup>8</sup> ၦၡၩအဖိၪခွၫဧ့,အ့ၪမွဲနဝ့ၫဒၪ,ခိၭနၪဆၧလၧယလီၩ ဘၪနၧၩဆံၭ. ပိၩ့ထၪ့ဆၧဘဲၫၦဂၪ့ခိၪဖိၪ လၧအပိၩ့ ထၪ့ဆၧနီၪလဂ့ၩး အၩ့ထၪ့နနိၭတၭ,အၪ့ဆၧလၧယ",
			"9": "<sup>9</sup> မိဖ့ၪလၫ့နၧၩဆံၭ.- ယယိဆၧတၭ,ယိခွါ,ဆၧယူၬထၪ့ အစူၪလၧယအီၪတၭ, ယိခွါ,လံၬအထူၫလထူၫအီၪ",
			"10": "<sup>10</sup> ဝ့ၫလၧအစူၪဖၧၩ့လီၫ.- ပၠၪလၩ့ဝ့ၫလၧယမ့ၬယၫတၭ, ဆၧကွ့ၭအၥၭလၧအဖၧၩ့ ဒဲလၧအချိၫ့နီၪ, ဂၪ့ဆၧယၧၩ့ ဆၧ,ဒဲဆၧမီၪ့ဆၧမၭဒဲဆၧအၡၪ့အဂဲးအကၠီၪ့နီၪကွ့ၭ အၥၭလၧအဖၧၩ့လီၫ."
		},
		"3": {
			"1": "<sup>1</sup> လၧနီၪအမ့ၬယၫ, အဝ့ၫဒၪစံၭယၧၩ,ၦၡၩအဖိၪခွၫဧ့, အၪ့ဆၧလၧနဒၪနဝ့ၫဆံၭ. အၪ့လံၬအထူၫလထူၫယီၩ တၭ,လ့ၩချဲၩ့ဆၧ လၧအံၫစရ့လၭအၡၩဂံၪ့ဖိၪဆံၭ.",
			"2": "<sup>2</sup> အခိးမွဲယအၩ့ထၪ့ယနိၭတၭ, အဝ့ၫဒၪဖ့ၪအၪ့ယၧၩ",
			"3": "<sup>3</sup> လၧလံၬအထူၫလထူၫနီၪလီၫ.- အဝ့ၫစံၭယၧၩ, ၦၡၩ အဖိၪခွၫဧ့, အၪ့ဆၧတၭမၩဎွ့ၩနဂူၭဖိၫ့လၧလံၬအထူၫ လထူၫယီၩ လၧယဖ့ၪလၫ့နၧၩဆံၭ. ထီးနီၪလဖၧၫ့ယ အၪ့တၭ, ဆၧၫ့ဝ့ၫလၧယနိၭဖၧၩ့ ဘဲၫန့ၫစၩ့အၥိၭနီၪ",
			"4": "<sup>4</sup> လီၫ.- အဝ့ၫဒၪစံၭယၧၩ,ၦၡၩအဖိၪခွၫဧ့, လ့ၩဘီၪ, လ့ၩလၧအံၫစရ့လၭအၡၩဂံၪ့ဖိၪအအီၪတၭ, ချဲၩ့ဆၧ",
			"5": "<sup>5</sup> လၧအဝ့ၫၥံၪလၧယဆၧချဲၩ့ဆံၭ.- အဂဲးဘဲၫယီၩဆၧ အၪ့မၧၫ့လၩ့နၧၩလၧၦလခီၫဘၩ့မုးဖိၪအဆၧချဲၩ့, ဒဲၦ အဆၧချဲၩ့ကၪအအီၪအ့ၬး မွဲလၧအံၫစရ့လၭအၡၩဂံၪ့",
			"6": "<sup>6</sup> ဖိၪအအီၪး- လၧၦအၪဆၨၩ လၧအဆၧချဲၩ့လၩ့မဲၩ ဒဲ ချဲၩ့ဆၧချဲၩ့ကၪလၧနနၪဝ့ၫလၥ့ၪဘၪနီၪ, မွဲအ့ၬ. ယအ့ၪ အၪ့မၧၫ့လၩ့နၧၩလၧအဝ့ၫၥံၪအအီၪတၭ, မိခိၭနၪတၡါ",
			"7": "<sup>7</sup> နလူလီၫ.- မွဲလါနၫ့ၦအံၫစရ့လၭဖိၪအၡၩဂံၪ့ဖိၪခိၭနၪ နလူအ့ၬး အဂဲးဘဲၫယီၩခိၭနၪယလူအ့ၬ. အဂဲးဘဲၫ ယီၩအံၫစရ့လၭအၡၩဂံၪ့ဖိၪထီးအလူၬနီၪ, မၩကြၩ့",
			"8": "<sup>8</sup> ထမးဆၧ,ဒဲအၥၭနီၩ့လီၫ.- ယိခွါ,ယအီၪက့ၪဆီၪ့နမ့ၬ",
			"9": "<sup>9</sup> လၧအဝ့ၫၥံၪအမ့ၬထုးခိၪအလီၩ့လီၫ.- ယအီၪက့ၪနမ့ၬ ထုးခိၪဘဲၫလိးကျဲၩ့ထၫ့မျါအၥိၭ, နီၩ့နဲၪ့ဒံၭလိးမ့ၪလီၫ. အဝ့ၫၥံၪမွဲၦဂံၪ့ဖိၪပိၩ့ထၪ့ဆၧလါနၫ့တၭ, ထီးၥၭမဲၪအ ဝ့ၫၥံၪလဂ့ၩ, အၪ့ယိၪဆၧလၧအမ့ၬအကၠီၩ့လဂ့ၩ.",
			"10": "<sup>10</sup> လၧနီၪအမ့ၬယၫအဝ့ၫဒၪစံၭယၧၩ, ၦၡၩအဖိၪခွၫဧ့, ကယဲဆၧချဲၩ့လၧယမိချဲၩ့လၧနၧၩထီးအလူၬနီၪ, ဒိၭ",
			"11": "<sup>11</sup> န့လၧနၥၭခံဖၧၩ့တၭ, ခိၭနၪလၧနနါဆံၭ.- လ့ၩဘီၪ, လ့ၩလၧၦကဲၪဎီးလဖၪ, နၡၩခမျၧးဖိၪအအီၪတၭ, ချဲၩ့ ဆၧလၧအဝ့ၫၥံၪတၭ, မိခိၭနၪဆၧမွဲဂ့ၩ, လမိခိၭနၪဘၪ မွဲဂ့ၩ,ကဆါယဟိဝၩစံၭဘဲၫယီၩ, လီၩဘၪအဝ့ၫၥံၪ ဆံၭ.",
			"12": "<sup>12</sup> ထီးနီၪလဖၧၫ့ၥၭနီၪဆိၬထၪ့ယၧၩတၭ, ယနါဂၧၫ့ ဆၧၥီၫလၧယလးခဲၫ့ ဘဲၫၦခမျၧးလ့ၩဆၧဆီၪ့အၥိၭ တၭ,စံၭဝ့ၫဒၪ, ယဟိဝၩအလၩအဖၩ့နီၪ,မွဲအဘၪဆၧ",
			"13": "<sup>13</sup> ဆိၪဂ့ၩလၧအလးဖၧၩ့ဆံၭ.- ယနါဂၧၫ့ဆ့ဆၧအမၧၫ့ အဒံၭလၧအထိၭလိၬအၥၭအၥီၫ, ဒဲလဲၪ့ပၪလၧအနဲၩ့",
			"14": "<sup>14</sup> ထံၭအၥီၫ, ဒဲၦခမျၧးလ့ၩဆၧဆီၪ့အၥီၫလီၫ.- ထီးနီၪ လဖၧၫ့ၥၭနီၪဆိၬထၪ့ယၧၩတၭ, မၩန့ခွံၬယၧၩတၭ, ယ လ့ၩဆၧလၧယၥၭလမုၬဘၪလၧယၥၭခိလီၫ. တၭယ ဟိဝၩအစူၪအီၪဝ့ၫလၧယလီၩ့ဆီၪ့ဆီၪ့လ့ၬလီၫ.",
			"15": "<sup>15</sup> ထီးနီၪလဖၧၫ့ ယဂဲၫလၧၦလၧအကဲၪဎီးလၧတ့ၫလၫ ဘ့ၭအဖၧၩ့လၧအအီၪဝ့ၫလၧထံၫမိၡါ ခံဘၫအနဲၩ့ တၭ,ယအီၪထီးအဝ့ၫၥံၪအီၪဝ့ၫအလးနီၪ, ယအီၪလၩ့ ထးထီးနီၪလၧဆၧထီၫမံၫထီၫမၪအဖၧၩ့ လၧအဝ့ၫၥံၪ အကျၩနွ့ၫၥၫ့လီၫ.",
			"16": "<sup>16</sup> လၧနွ့ၫၥၫ့အထုၬနီၪ ဆၧမၩအၥၭလၧယဟိဝၩအလူ",
			"17": "<sup>17</sup> လၩ့ဘၪယၧၩတၭ,စံၭဝ့ၫ,- ၦၡၩအဖိၪခွၫဧ့, ယအီၪ က့ၪနၧၩလၧၦခိၭဆၧ လၧၦအံၫစရ့လၭအၡၩဂံၪ့ဖိၪအ ဂးတၭ,အခိးမွဲဘဲၫနီၪတၭ, ခိၭနၪဆၧချဲၩ့လၧယနိၭဒဲ",
			"18": "<sup>18</sup> ၥီၪ့ထဲၩ့အဝ့ၫၥံၪလၧယလူဆံၭ.- ထီးယအ့ၪစံၭၦလတီၩ လလီၩ့ဘၪနီၪ, နမိၥံၫတၡါတၭ, နအ့ၪလၥီၪ့ထဲၩ့ဘၪ ဝ့ၫ,ဒဲလချဲၩ့ဘၪဆၧဘဲၫၥိၭ ၦလတီၩလလီၩ့ဘၪမိကၠၪ ခွံၬအၥၭလၧအဖၧၩ့ၥၭလတီၩလလီၩ့ဘၪ ဘဲၫအၥၭ မိမၧၫ့ဝ့ၫအၥိၭနီၪ, ၦလတီၩလလီၩ့ဘၪနီၪ,မိၥံၫဝ့ၫလၧ အဆၧအၧၩ့အဖၧၩ့း အ့ၪမွဲယမိအၪ့ဎၬအၥွံၪလၧနစူၪ",
			"19": "<sup>19</sup> ဖၧၩ့လီၫ.- မွဲလါနၫ့တၭ,နအ့ၪၥီၪ့ထဲၩ့ၦလတီၩလလီၩ့ ဘၪနီၪ, အ့ၪလကၠၪခွံၬဘၪအၥၭလၧဆၧလတီၩလလီၩ့ ဘၪ,ဒဲလၧအဖၧၩ့ၥၭလတီၩလလီၩ့ဘၪနီၪ, မိၥံၫဝ့ၫလၧ အဆၧအၧၩ့အဖၧၩ့း အ့ၪမွဲနမၩဖီၩ့မၩဖျ့ၭယူၭ နၥၭ ယူၭလီၫ.",
			"20": "<sup>20</sup> မၩဒီၭလဖၧၫ့, ထီးၦအတီၩအလီၩ့အ့ၪကၠၪခွံၬအၥၭ လၧအဆၧတီၩဆၧလီၩ့, ဒဲမၩဆၧဒဲၩဘၭနီၪယအီၪ က့ၪဆၧဘၪထၧၩ့အလး လၧအမ့ၬယၫတၭ,မိၥံၫဝ့ၫ လီၫ.မွဲနလၥီၪ့ထဲၩ့ဘၪအဝ့ၫအကၠီၩ့တၭ, မိၥံၫဝ့ၫလၧ ဆၧဒဲၩဘၭအဖၧၩ့တၭ, အဆၧတီၩဆၧလီၩ့လၧအမၩ ဝ့ၫလဖၪနီၪဆၧနၪ့ထၪ့ထဲၩ့လၧၩ့အ့ၬး အ့ၪမွဲယမိအၪ့",
			"21": "<sup>21</sup> ဎၬအၥွံၪလၧနစူၪဖၧၩ့လီၫ.- မွဲလါနၫ့တၭ, နအ့ၪၥီၪ့ ထဲၩ့ၦအတီၩအလီၩ့ဘဲၫၥိၭၦတီၩၦလီၩ့နီၪ, ထီးမၩ ဆၧဒဲၩဘၭလဂ့ၩတၭ, ၦတီၩၦလီၩ့နီၪအ့ၪလမၩဘၪ ဆၧဒဲၩဘၭနီၪ,မိမၧၫ့ဝ့ၫတၡါလီၫ. အဂဲးဘဲၫယီၩမွဲအ ဘၪဆၧၥီၪ့ထဲၩ့အဝ့ၫဒၪ နဝ့ၫဒၪယီၩ နမၩဖီၩ့မၩဖျ့ၭ နၥၭဆ့လီၫ.",
			"22": "<sup>22</sup> တၭယဟိဝၩအစူၪအီၪဝ့ၫလၧယလီၩ့ ထီးနီၪတၭ, စံၭယၧၩဂဲထုၪ့လ့ၩလၧဆၧပျၩ့ဖၧၩ့တၭ, ယမိချဲၩ့ဆၧ",
			"23": "<sup>23</sup> လၧနၧၩထီးနီၪလီၫ.- ယဂဲထုၪ့လ့ၩလၧဆၧပျၩ့ဖၧၩ့ တၭ,ယိခွါ, ယဟိဝၩအလၩအဖၩ့ ဆၧၫ့ထုၪ့ထီးနီၪ ဘဲၫဆၧလၩဆၧဖၩ့လၧယဒၪဘၪ လၧထံၫမိၡါခံဘၫအ",
			"24": "<sup>24</sup> နဲၩ့အၥိၭနီၪတၭ,ယလၩ့ထံၩဖါချႃၬလၩ့လီၫ.- ထီးနီၪ လဖၧၫ့ၥၭနီၪဂဲၫနုၬဝ့ၫလၧယဖၧၩ့တၭ, ဒုၭဆၧၫ့ထုၪ့ ယၧၩနီၪချဲၩ့ဆၧလၧယၧၩတၭ, စံၭယၧၩ, လ့ၩအီၪက့ၪ",
			"25": "<sup>25</sup> ၥူၪနၥၭလၧနဂံၪ့ဖၧၩ့ဆံၭ.- နဝ့ၫဒၪ,ၦၡၩအဖိၪခွၫဧ့,ယိ ခွါ,အဝ့ၫၥံၪမိအီၪက့ၪဖျံၩစၧၩ့ထၬ လၧနလီၩ့တၭ, မိ စၧၩ့ထၬနၧၩလၧဆၧလဖၪနီၪတၭ, နလ့ၩထၪ့ဘၪလၧ",
			"26": "<sup>26</sup> ၦလဖၪနီၪအကျၩအ့ၬ.- ယမိဒုၭဘုၭထၬနဖျ့ၩ လၧ နထၫချၬတၭ, နမိအီၪအုၭအၭတၭ,ကဲၪထၪ့ၦအၪ့ၥီၪ့ ဆၧလၧအဂးအ့ၬ.အဂဲးဘဲၫယီၩမွဲဝ့ၫၦဂံၪ့ဖိၪလၧအ",
			"27": "<sup>27</sup> ပိၩ့ထၪ့ဒၪဆၧလီၫ.- မွဲလါနၫ့ဘိၩ, ထီးယအ့ၪချဲၩ့ဆၧ လၧနၧၩတၭ, ယမိဒုၭအၩ့ထၪ့နနိၭတၭ,နမိဘၪစံၭအ ဝ့ၫၥံၪ,ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ၦလၧအမိခိၭနၪ ဆၧနီၪ,မွဲအဝ့ၫခိၭနၪဒၪဆံၭး ၦလၧအလခိၭနၪဘၪနီၪ, မွဲအအီၪဒၪဝ့ၫဆံၭ. မွဲဝ့ၫၦဂံၪ့ဖိၪၥံၪလၧအပိၩ့ထၪ့ဆၧ လီၫ."
		},
		"4": {
			"1": "<sup>1</sup> နဝ့ၫဒၪဆ့,ၦၡၩအဖိၪခွၫဧ့, မၩန့အၩ့ကတဲၩလဘံၪ့ တၭ,အီၪက့ၪဝ့ၫလၧနမ့ၬယၫတၭ, ကွ့ၭဒိၩ့ယရုစလံၫ့",
			"2": "<sup>2</sup> အဂၩ့လၧအလီၩ့,- တၭဝၩ့ထၬထၫ့ဒၩအဝ့ၫ, မၩထၪ့ ထိၬထၫ့ဒၩအဝ့ၫ, ဒဲမၩထၪ့ခိၪဒၧၩ့ထၫ့ဒၩအဝ့ၫ,ဒဲၥုၪ့ တဲၩထၫ့ဒၩအဝ့ၫဆ့, ဒဲအီၪက့ၩစဲၭဘုၪ့ဖိးဆၧဝၬဖီၩ့ထၫ့",
			"3": "<sup>3</sup> ဒၩအဝ့ၫဆံၭ.- လၧနီၪအမ့ၬယၫနဝ့ၫဒၪယီၩမၩန့ဖၧၩ့ ထၭပၪပဲၪနးဘံၪ့တၭ, အီၪက့ၪအဝ့ၫလၧအခိၪဒၧၩ့ထၭ အဂးလၧနၧၩဒဲဒိၩ့အဘိၩ့ဆၧၩ့တၭ, အီၪက့ၪနမ့ၬလၧ အလီၩ့ဘဲၫၥိၭအမိဘၪဆၧဝၩ့ထၬဝ့ၫတၭ, ဝၩ့ထၬထၫ့ ဒၩအဝ့ၫဆံၭ. အဝ့ၫနီၪမိကဲၪထၪ့ဆၧမၩနဲၪ့လၧအံၫ စရ့လၭအၡၩဂံၪ့ဖိၪအဂးလီၫ.",
			"4": "<sup>4</sup> တၭနဝ့ၫဒၪယီၩ မံၫနၩ့ဒံၩ့ခံၫ့လၧစူၪစ့ၪလခီၫတၭ, အီၪက့ၪအံၫစရ့လၭအၡၩဂံၪ့ဖိၪ အဆၧအၧၩ့လၧနက ဖၩနီၪအလီၩ့ဆံၭ. နမိဘၪဆိၬဆၧအၧၩ့ဘဲၫမုနံၩလဖၪ လၧနမံၫနၩ့ဒံၩ့ခံၫ့ အဆၧဝံထၪ့နၬထၪ့အၥိၭနီၪလီၫ.",
			"5": "<sup>5</sup> အဂဲးဘဲၫယီၩလၧဆၧအၧၩ့အနံၪ့ လဖၪအဂးယအီၪ က့ၪလၩ့မုနံၩလဖၪလၧနဂး အနံၩၥၧၫ့ယၩခွံၫဆံၫလီၫ. တၭနမိဘၪဆိၬအံၫစရ့လၭအၡၩဂံၪ့ဖိၪ အဆၧအၧၩ့",
			"6": "<sup>6</sup> အနံၩဎွ့ၩနီၪလီၫ.- ထီးနမၩဎွ့ၩမုနံၩလဖၪဂီၩ့နီၪ,မံၫ နၩ့ဒံၩ့ခံၫ့ဒီၭလၧနစူၪထွ့ၪလခီၫဆံၭ. တၭနဘၪဆိၬယု ဒၫအၡၩဂံၪ့ဖိၪအဆၧအၧၩ့အနံၩလံဆံၫလီၫ. တၭယ အီၪက့ၪလၩ့န့နၧၩလၧမုလနံၩလၧနနံၪ့အဂး, မုလနံၩ လနံၪ့အဂးဆုၬဆုၬလီၫ.",
			"7": "<sup>7</sup> မၩအၥၭဘဲၫနီၪတၭ, အီၪက့ၪနမ့ၬတီၩလၧယရုစလံၫ့ လၧဆၧဝၩ့ထၬဝ့ၫတၭ, မၩအီၪဘိၪ့နစူၪဒူၪတၭ, ချဲၩ့",
			"8": "<sup>8</sup> ဆၧလၧမီၪအချိၬထၫ့ဒၩအဝ့ၫဆံၭ.- ယိခွါ, ယမိအီၪ က့ၪဆၧစၧၩ့ထၬ လၧနလီၩ့တၭ,ထီးနမၩဝၩ့ထၬဆၧ အမုနံၩလဖၪအ့ၪလဂီၩ့ဒံၭဘၪနီၪ, နကၠၪဘၪနၥၭလါ ခီၫလါခီၫအ့ၬ.",
			"9": "<sup>9</sup> နဝ့ၫဒၪယီၩမၩန့ဘုၪကၠိၩ့ဒဲဘုၪမုယီၩဆ့, ဒဲဘၩ့ဘၪ ၥၪ,ထိၭၥၪ,ဒဲၥွံၫၥၪ, ဒဲဘုၪကူၭစမ့ၭလဖၪလၧနဂးတၭ, ဒုၭလၩ့ဝ့ၫလၧဖၧၩ့လဖျိၪ့ဎးတၭ, မၩကိၪလၧအဝ့ၫၥံၪ လၧနဂးလၧမုနံၩလဖၪ လၧနမိမံၫနၩ့ဒံၩ့ခံၫ့ၥၧၫ့ယၩခွံၫ",
			"10": "<sup>10</sup> ဆံၫအထးဖၧၩ့နီၪဆံၭ.- ဆၧအၪ့လၧနမိအၪ့ဘၪနီၪနမိ ဘၪခံၫ့အဝ့ၫလၧလနံၩအဂးနီၪ ၡက့ၭလၭနံၫဆံၫလီၫ.",
			"11": "<sup>11</sup> နမိဘၪအၪ့အဝ့ၫလၧလဖၧၫ့ဘၪလဖၧၫ့လီၫ.- တိၪ့ထံၫ တၭ,နဘၪအီၩထံၫလဟံၫ့ဎူၫပိၩ့လပိၩ့လီၫ. နဘၪအီၩ",
			"12": "<sup>12</sup> ဝ့ၫလၧလဖၧၫ့ဘၪလဖၧၫ့လီၫ.- နမိဘၪအၪ့ဘုၪမုယီၩ အကိၪပၪပဲၪတၭ, နမိဘၪအၪ့ဎူလၧဆၧအ့ၪလၧအဂဲၫ လၩ့လၧၦၡၩအဖၧၩ့လၧအဝ့ၫၥံၪအမ့ၬယၫလီၫ.",
			"13": "<sup>13</sup> ယဟိဝၩစံၭဝ့ၫဒၪ, ဘဲၫနီၪၥိၭၦအံၫစရ့လၭဖိၪမိဘၪ အၪ့ကိၪလဆံၫ့ဘၪ လၧၦဆၨၩလဖၪအကျၩ,ထီးအ လးလၧယနၫ့စိၩအဝ့ၫၥံၪလီၫ.",
			"14": "<sup>14</sup> ယစံၭ,အၩလါ,ကဆါယဟိဝၩဧ့ၬ ယိခွါ,ယဝ့ၫဒၪ ယီၩယဘၪဆၧလဆံၫ့ဘၪနးကၠၪအ့ၬ. အဂဲးဘဲၫယီၩ ခီၫဒၪလၧယဖိၪၥၪခွၫထၪ့ ထီၩ့လၩ့ခီၩ့ဘိၩ့နဲၪ့ယီၩဒၪ လ့ၬ,ဆၧလၧအၥံၫဒၪဆၧမွဲဂ့ၩ, ဆၧလၧဆၧအဲၪ့ၡၫ့ခွံၬ မွဲဂ့ၩ,ယအၪ့ဘၪအ့ၬ. ဆၧယၪလဆံၫ့ဘၪနီၪနုၬလၧ ယနိၭဖၧၩ့ဆ့အ့ၬ.",
			"15": "<sup>15</sup> ထီးနီၪလဖၧၫ့အဆၧစံၭယၧၩ, ယိခွါ,ယအၪ့လဲၩခွံၬ ၦၡၩအအ့ၪ လၧချီအအ့ၪလၧနဂးတၭ, နမိဘၪအၪ့ဎူ ကိၪလၧအဝ့ၫလီၫ.",
			"16": "<sup>16</sup> တၭအဝ့ၫစံၭယၧၩ, ၦၡၩအဖိၪခွၫဧ့,ယိခွါ,ယမိ မၩခါခွံၬကိၪအနိၪထိၭဘီၩ့ လၧယရုစလံၫ့အဖၧၩ့တၭ, ၦၡၩမိဘၪအၪ့ကိၪ လၧၦခံၫ့ဝ့ၫအီၪလၧအၥုၪ့ခိအၥၭ ဝီၩ,ဒဲအီၩထံၫလၧၦတိၪ့ဝ့ၫ လၧအၥၭထီၫမံၫထီၫမၪ,",
			"17": "<sup>17</sup> ဘဲၫၥိၭအကိၪ ဒဲအထံၫလအၪဘၪတၭ, ထီၫမံၫထီၫမၪ ဝ့ၫလဂၩဒဲလဂၩတၭ, မိလူၬခွံၬဝ့ၫလၧအဆၧအၧၩ့အ ကၠီၩ့လီၫ."
		},
		"5": {
			"1": "<sup>1</sup> ၦၡၩအဖိၪခွၫဧ့, နဝ့ၫဒၪယီၩမၩန့ဒီၩလၧအနါအဲၪ့ ဝ့ၫလဘံၪ့, ၦလိၩ့ဆၧအဒီၩတၭ,လိၩ့ခွံၬနခိၪဒဲနခၪလၬ ဆီၪ့တၭ,မၩန့ခံၫ့ဘဲၫနမိခံၫ့ဆၧတၭ,အၪ့နၩ့ဖၭနခိၪၥူၫ",
			"2": "<sup>2</sup> ဒဲနခၪလၬဆီၪ့အဆၧၩ့ဆံၭ- ထီးဆၧဝၩ့ထၬဒိၩ့အမု နံၩလဖၪအ့ၪလူၬတၭ, ၥၧၫ့ပိၩ့လပိၩ့နီၪနဘၪဆူၭထၪ့ ခွံၬလၧမ့ၪလၧဒိၩ့အၥၭကျၩတၭ, နမိဘၪမၩန့ၥၧၫ့ပိၩ့ လပိၩ့တၭ,ကျီၪ့ထ့ၬဝ့ၫလၧနၭတၭ,ၥၧၫ့ပိၩ့လပိၩ့နီၪနမိ ဘၪမၩလၩ့ပြံၩပၩဝ့ၫ လၧလံၩအကျၩတၭ,ယမိဒုၭ",
			"3": "<sup>3</sup> ဖိၬအခဲၫ့လၧနၭလဘံၪ့လီၫ.- တၭနမိဘၪမၩန့ၡၩခိၬ ဘီၩ့တၭ,ဘီၪ့ထၪ့ဝ့ၫလၧနဆဲၫ့ခၪ့ထံၭ အဖၧၩ့လီၫ.",
			"4": "<sup>4</sup> ထီးနီၪလဖၧၫ့ လၧအဝ့ၫၥံၪအကျၩနီၪ နမိဘၪမၩန့ဒီၭ လနၩ့တၭ,ဖျႃၭလၩ့ဝ့ၫလၧမ့ၪဖၧၩ့တၭ, ဆူၭထၪ့ခွံၬဝ့ၫ လၧမ့ၪတၭ,မ့ၪမိဂဲၫထၪ့လၧဆၧနီၪဘၪအံၫစရ့လၭအ ၡၩဂံၪ့ဖိၪထီးအလူၬအကျၩလီၫ.",
			"5": "<sup>5</sup> ကဆါယဟိဝၩစံၭဘဲၫယီၩ, အယီၩမွဲယရုစလံၫ့ လီၫ.ယအီၪက့ၪလၩ့အဝ့ၫလၧၦဆၨၩလဖၪ, ဒဲထံၫၥံၪ",
			"6": "<sup>6</sup> ခးၥံၪအီၪဝၬဖီၩ့ဝ့ၫလဖၪအၥၭကျၩလီၫ.- တၭအဝ့ၫဒၪ ပိၩ့ထၪ့ယဆၧစ့ၩရၫ့ လၧဆၧလတီၩလလီၩ့ဘၪအဖၧၩ့ နီၪအၪနဲၪ့ဒံၭၦဆၨၩလဖၪ, ဒဲယၥနိၫလဖၪနီၪအၪနဲၪ့ဒံၭ ခးလဖၪလၧအအီၪဝၬဖီၩ့အဝ့ၫလီၫ. အဂဲးဘဲၫယီၩအ ဝ့ၫၥံၪခွံၬၡိၭယဆၧစ့ၩရၫ့ဒဲယၥနိၫလဖၪတၭ, လ့ၩဝ့ၫ",
			"7": "<sup>7</sup> လၧအဖၧၩ့အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ,ကဆါယဟိဝၩ စံၭဘဲၫယီၩ, မွဲနၥံၪပိၩ့ထၪ့ဆၧအၪနဲၪ့ဒံၭၦဆၨၩလဖၪ အီၪဝၬဖီၩ့နၥံၪ, ဒဲလလ့ၩဘၪလၧယၥနိၫလဖၪအဖၧၩ့, ဒဲလထီးန့ဘၪယဆၧစ့ၩရၫ့, ဒဲနၥံၪမၩဆၧဘဲၫၦဆၨၩ လဖၪအီၪဝၬဖီၩ့နၥံၪအထူၫအရူၫအၥိၭနီၪ, မွဲဆ့အ့ၬ.",
			"8": "<sup>8</sup> မၩအၥၭဘဲၫနီၪတၭ, ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ယိ ခွါ,ဆၧလၧယၧၩယီၩ,ယထၫ့ဒၩနၧၩတၭ, ယမၩဆၧ စ့ၩရၫ့လဖၪထၫ့ဒၩနၧၩ လၧၦဆၨၩလဖၪအမ့ၬယၫ",
			"9": "<sup>9</sup> လီၫ.- ယမိမၩနၧၩလၧဆၧလၧယလမၩဒံၭဘၪ,ဒဲဆၧ လၧယလမိမၩလၧၩ့ဘၪဘဲၫနီၪၥိၭ, မွဲလၧနဆၧၥၭလိၪ",
			"10": "<sup>10</sup> အလးထီးအလူၬအကၠီၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဖါလဖၪမိအၪ့အဖိၪခွၫလဖၪလၧနကျၩတၭ, ဖိၪခွၫလ ဖၪမိအၪ့အဖါလဖၪတၭ, ယမိမၩဆၧစ့ၩရၫ့လဖၪလၧ နကျၩတၭ,နဆၧအီၪလၩ့ထးထီးအလူၬနီၪ, ယမိမၩ လၩ့ပြံၩလၩ့ပၩဝ့ၫ လၧလံၩကိၭခီၫဒ့ၭအကျၩ ထီးအ",
			"11": "<sup>11</sup> လူၬလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယမၧၫ့ယဝ့ၫ,ကဆါ ယဟိဝၩစံၭဝ့ၫဒၪ, မွဲနမၩဘၪၥၭလိၪ ယလးဆံၫ့ဎံၪ လၧနဆၧလဆံၫ့ဘၪထီးအလူၬ, ဒဲလၧနဆၧၥၭလိၪအ လးထီးအလူၬနီၪး အခိးမွဲယမိဖ့ၬထ့ၬခွံၬနၧၩ,ဒဲယမ့ၬ ၥၪလီၫ့ကီၩ့လၧၩ့နၧၩအ့ၬး ဒဲယယၫ့ၥၭလၧၩ့နၧၩဆ့",
			"12": "<sup>12</sup> အ့ၬ.- ၦၥၧၫ့ပိၩ့လပိၩ့လၧနကျၩနီၪမိၥံၫလၧဆၧၥံၫချဲၫ့ တၭ,မိလူၬဝ့ၫလၧဆၧၥၭဝံလၩ့ဒိၩ လၧနကျၩတၭး ၦ ၥၧၫ့ပိၩ့လပိၩ့နီၪ မိလၩ့ထံၩဖါလၧနၭဝၬဖီၩ့နၧၩတၭး ယမိမၩပြံၩပၩ ၥၧၫ့ပိၩ့လပိၩ့ လၧလံၩကိၭစီၪ့ဒ့ၭအ ကျၩထီးအလူၬတၭ, ယမိဒုၭဖိၬအခဲၫ့လၧနၭလဘံၪ့",
			"13": "<sup>13</sup> လီၫ.- ယၥၭထၪ့မိလူၬခွံၬဝ့ၫဘဲၫနီၪတၭ,ယမိဒုၭအီၪ ထၪ့ယၥၭခဲၩထၪ့လၧအလီၩ့တၭ, ယၥၭမိမုၬထၪ့ထဲၩ့ လီၫ.တၭထီးအမၩလူၬခွံၬယၥၭ ခဲၩထၪ့လၧအလီၩ့နီၪ အဝ့ၫၥံၪမိၥ့ၪယၫဝ့ၫလၧယၧၩ, ယဟိဝၩယီၩ, ယချဲၩ့",
			"14": "<sup>14</sup> ယူၭလၧယၥၭဆီၪ့လီၫ.- လၧနီၪအမ့ၬယၫယမိမၩယူ နၧၩ,ဒဲဆၧဒုၪဒွ့ၪအလးလၧ ၦဆၨၩထီးအလူၬအကျၩ လၧအဝၬဖီၩ့နၧၩ, လၧကယဲၦလၧအလဲးလီၩ့ဝ့ၫလၧ",
			"15": "<sup>15</sup> နမ့ၬယၫထီးအလူၬလီၫ.- ထီးယအ့ၪမၩဆၧစ့ၩရၫ့လ ဖၪလၧယၥၭထၪ့, ဒဲလၧယၥၭခဲၩထၪ့အဆၧအၪ့ၥီၪ့ လၧနကျၩတၭ,နမိကဲၪထၪ့ဆၧဒုၪဒွ့ၪအလး, ဒဲဆၧစံၭ အၧၩ့အလး, ဆၧၥီၪ့ထဲၩ့အလး, ဒဲဆၧထီၫမံၫထီၫမၪ အလးလၧၦဆၨၩလဖၪအီၪဝၬဖီၩ့နၧၩအဂးလီၫ. ဆၧ",
			"16": "<sup>16</sup> လၧယၧၩ, ယဟိဝၩယီၩ,ယချဲၩ့ဆၧနီၪလီၫ.- ထီးယ အ့ၪဖျါခွံၬဆၧၥၭဝံလၩ့ဒိၩ အဖျါအၧၩ့လဖၪလၧနလီၩ့, လၧအဒုၭဂဲၫဆၧမၩဂၭဂီၩ့ လၧယမိအၪ့မၧၫ့အမၩဂၭ ဂီၩ့နၥံၪဒဲမၩဒိၪထၪ့ဆၧၥၭဝံလၩ့ဒိၩ လၧနၥံၪအကျၩ",
			"17": "<sup>17</sup> တၭ,မၩခါခွံၬနၥံၪအကိၪအနိၪထိၭဘီၩ့လီၫ.- ယမိအၪ့ မၧၫ့လၩ့ဆၧၥၭဝံလၩ့ဒိၩ ဒဲဆၧဖိၪဆၧဎါအဒဲၩ့လၧအမိ မၩလူၬခွံၬနဖိၪနလံၩတၭ, ဆၧၥံၫချဲၫ့, ဒဲဆၧၥွံၪနီၪမိခၫ့ ဂၬနၧၩ,ဒဲယမိဒုၭဘၪနၧၩ လၧဖၩ့ၥံၪနၭၥံၪလီၫ. ဆၧ လၧယၧၩယဟိဝၩယီၩ, ယချဲၩ့ယူၭဆၧယူၭ."
		},
		"6": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ, စံၭဝ့ၫဒၪ,ၦၡၩအ",
			"2": "<sup>2</sup> ဖိၪခွၫဧ့,- ဒိၭနမ့ၬတီၩလၧအံၫစရ့လၭအခိၪလီၩ့ထိၩ့ချိၬ ၥံၪတၭ,ချဲၩ့ဆၧလၧမီၪအချိၬ ထၫ့ဒၩအဝ့ၫၥံၪတၭ,စံၭ,",
			"3": "<sup>3</sup> အံၫစရ့လၭအခိၪလီၩ့ၥံၪဧ့, ခိၭနၪကဆါယဟိဝၩအ လူဆံၭ.ကဆါယဟိဝၩစံၭခိၪလီၩ့ၥံၪ, ဒဲဆၧစီၩ့ခိၪၥံၪ, ဒဲထံၫကၠီၪ့ၥံၪ, ဒဲခိၪလီၩ့ဆူၭၥံၪဘဲၫယီၩ, ယိခွါ,ယဝ့ၫ ဒၪ,ယမိဒုၭဘၪနၥံၪလၧနၭလဘံၪ့တၭ, ယမိမၩဂၭဂီၩ့",
			"4": "<sup>4</sup> နၥံၪအလးထၪ့ထီၫလဖၪလီၫ.- နၥံၪအဆၧလုလးလ ဖၪမိအီၪယူဒဲနၥံၪအဆၧဂၩ့လဖၪမိခါခွံၬတၭ, ယမိဖ့ၪ လၫ့ခွံၬနၥံၪလၧၦဘၪဆၧမၩၥံၫဝ့ၫ လၧနၥံၪအဆၧဂၩ့",
			"5": "<sup>5</sup> အမ့ၬယၫလီၫ.- ဒဲယမိအီၪက့ၪလၩ့ၦအံၫစရ့လၭဖိၪ အစွၪလဖၪလၧအဝ့ၫၥံၪအဆၧဂၩ့လဖၪ အမ့ၬယၫ တၭ,ယမိမၩလၩ့ပြံၩလၩ့ပၩအဎွံၪအနၧၩ့ လၧနၥံၪအ",
			"6": "<sup>6</sup> ဆၧလုအလးအနဲၩ့ထံၬဝၬဖီၩ့ဝ့ၫလီၫ.- လၧနၥံၪအီၪအ လးထီးအလူၬနီၪဆၧမိမၩလၩ့ဎီးဒိၩ့ၥံၪထၫ့ၥံၪ, ဒဲဆၧ အလးထၪ့ထီၫလဖၪနီၪ, မိအီၪယူဘဲၫၥိၭဆၧမၩလၩ့ ဎီးဒဲဆၧမၩယူဝ့ၫ, ဒဲနၥံၪအဆၧဂၩ့လဖၪမိခါခွံၬ,ဒဲထုၬ ဝ့ၫဒဲဘဲၫၥိၭဆၧမိခူၬလၩ့ခွံၬနၥံၪအဆၧဂၩ့လဖၪ ဒဲနၥံၪ",
			"7": "<sup>7</sup> အဆၧမၩလဖၪမိထီၩ့လၧဆၧဂၭဂီၩ့လီၫ.- ၦဘၪဆၧ မၩၥံၫဝ့ၫလဖၪမိလၩ့ထံၩဖါလၧနၥံၪအကျၩတၭ, နၥံၪ မိၥ့ၪယၫလၧယမွဲယဟိဝၩလီၫ.",
			"8": "<sup>8</sup> မွဲလါနၫ့တၭ, ယမိအီၪက့ၪလၩ့ထးဆၧအီၪလၩ့ထး ဘဲၫၥိၭထီးနၥံၪလၩ့ပြံၩလၩ့ပၩ လၧခးလဖၪအကျၩ တၭ,နၥံၪမိအီၪလၧၦလၧ အဖီၩ့ဖျ့ၭလၧနၭလၧၦဆၨၩ",
			"9": "<sup>9</sup> လဖၪအကျၩလနၩ့လီၫ.- ဒဲၦလၧအဖီၩ့ဖျ့ၭလၧနၥံၪအ ကျၩနီၪ,မိနၪ့ထၪ့ထဲၩ့ယၧၩ, လၧၦဆၨၩလဖၪအကျၩ ထီးၦမိဆိၬအၪ့မၧၫ့ဎီးဝ့ၫလီၫ. အဂဲးဘဲၫယီၩယမၩ ဂၭဂီၩ့ယူၭ အၥၭလဲးၥၭဘျၪလၧအစဲၪ့ဒၪယၧၩ,ဒဲအ မ့ၬၥၪလၧအလ့ၩလၧဆၧလဲးဆၧဘျၪ ဖိၬဆၧဂၩ့ဆၧ ဖၪ့အခဲၫ့လီၫ. တၭအဝ့ၫၥံၪမိၥၭဂဲၫ့လၩ့အၥၭလၧဆၧ အၧၩ့လၧအမၩဝ့ၫလၧအဆၧၥၭလိၪ ထီးအလူၬအကျၩ",
			"10": "<sup>10</sup> အကၠီၩ့လီၫ.- ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪမိၥ့ၪယၫဝ့ၫလၧ ယမွဲယဟိဝၩလၧယစံၭး ယမိမၩအဝ့ၫၥံၪလၧဆၧ",
			"11": "<sup>11</sup> အၧၩ့ယီၩပျီၩပျီၩအ့ၬ.- ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ဒိၪဆၧလၧနစူၪဒဲဆ့ၪနခၪ့ဆံၭ. တၭစံၭ,အၩလါ, လၧ အံၫစရ့လၭအၡၩဂံၪ့ဖိၪ အဆၧၥၭလိၪအအၧၩ့အၥၫ့ ထီးအလူၬအကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪမိလၩ့ ထံၩဖါလၧနၭၥံၪဖၩ့ၥံၪ, လၧဆၧၥၭဝံလၩ့ဒိၩ, ဒဲလၧ",
			"12": "<sup>12</sup> ဆၧၥံၫချဲၫ့လီၫ.- ၦအီၪဝ့ၫလၧအယဲၩ့နီၪမိၥံၫလၧဆၧ ၥံၫချဲၫ့,ဒဲၦအီၪဝ့ၫလၧအဘူၭနီၪ မိလၩ့ထံၩဖါလၧနၭၥံၪ ဖၩ့ၥံၪတၭ, ၦလၧအအီၪလၩ့ထး, လၧဆၧဝၩ့ထၬဝ့ၫနီၪ, မိၥံၫလၧဆၧၥၭဝံလၩ့ဒိၩလီၫ. ယမိမၩလူၬယၥၭခဲၩ",
			"13": "<sup>13</sup> ထၪ့လၧအလီၩ့ဘဲၫနီၪလီၫ.- ထီးအဝ့ၫၥံၪအၡၩအ့ၪ ဘၪဆၧမၩၥံၫဝ့ၫအီၪလၧအဆၧဂၩ့ဆၧဖၪ့အကျၩဝၬ ဖီၩ့အဆၧလုလး, လၧကယဲဆၧစီၩ့ခိၪထီၫအလီၩ့,လၧ ကယဲခိၪလီၩ့ထိၩ့ချိၬအဒၩ့ခိၪထီးအလူၬ, ဒဲလၧကယဲ ၥံၪ့ၥံၫ့ဆ့ၬအဖၫ့လၬ,ဒဲလၧကယဲၥံၪ့ထိၭဖၫၥံၫ့ဆ့ၬအဖၫ့ လၬကိၭထံၭဒ့ၭ, ထီးဒၪအလးလၧအမၩဘိၪ့အဆၧ ဂၩ့လၧဆၧနၧၫ့မၧၫ့တၭ, နၥံၪမိၥ့ၪယၫလၧယမွဲယဟိ",
			"14": "<sup>14</sup> ဝၩလီၫ.- ယမိယူၬထၪ့ယစူၪထၫ့ဒၩအဝ့ၫၥံၪဒဲမၩယူ ထံၫၥံၪခးၥံၪ,မွဲမၬ,ယမိမၩယူအဝ့ၫၥံၪ နၭနဲၪ့ဒံၭၡါ မုနၧၫ့ဖၫဒံဘလၭ, လၧအအီၪအလးထီးအလူၬအဖၧၩ့ တၭ, အဝ့ၫၥံၪၥ့ၪယၫလၧယမွဲယဟိဝၩလီၫ."
		},
		"7": {
			"1": "<sup>1</sup> လၧနီၪအမ့ၬယၫ ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,",
			"2": "<sup>2</sup> စံၭဝ့ၫဒၪ,- နဝ့ၫဒၪယီၩၦၡၩအဖိၪခွၫဧ့,ကဆါယဟိဝၩ စံၭ,လၧအံၫစရ့လၭအခးအဂဲး, ဘဲၫယီၩ, ဆၧအထုၬ",
			"3": "<sup>3</sup> ဘၪဝ့ၫ,ဆၧအထုၬဂဲၫဘၪခးလံနိၪ့လီၫ.- ဘိၩ့နဲၪ့ယီၩ, ဆၧအထုၬဘၪနၧၩလီၫ. အဂဲးဘဲၫယီၩ ယမိအၪ့မၧၫ့ ယၥၭထၪ့ဆီၪ့လၧနလီၩ့တၭ, ယမိစ့ၩရၫ့နၧၩဘဲၫနဖၧၩ့ ၥၭလဖၪအၥိၭတၭ, ယမိဖ့ၪထဲၩ့နၧၩလၧနဆၧၥၭလိၪ",
			"4": "<sup>4</sup> ၥံၪထီးအလူၬလီၫ.- ယမ့ၬၥၪမိလီၫ့ကီၩ့နၧၩအ့ၬ. ဒဲယ ယၫ့ၥၭဆၧဆ့အ့ၬ. တၭယမိဖ့ၪထဲၩ့နၧၩလၧနဖၧၩ့ၥၭ လဖၪဒဲနဆၧၥၭလိၪၥံၪနီၪ, မိအီၪဝ့ၫလၧနကျၩတၭ,နမိ",
			"5": "<sup>5</sup> ၥ့ၪယၫလၧယမွဲယဟိဝၩလီၫ.- ကဆါယဟိဝၩစံၭဘဲၫ ယီၩ,ဆၧအၧၩ့,န့ၫဆၧအၧၩ့လမံၩ့, ယိခွါ,ဂဲၫဝ့ၫလီၫ.",
			"6": "<sup>6</sup> ဆၧအထုၬဘၪဝ့ၫ, အထုၬနီၪဘၪဝ့ၫလီၫ. နၪ့ထၪ့အၥၭ",
			"7": "<sup>7</sup> ထၫ့ဒၩနၧၩ, ယိခွါ,ဘၪဝ့ၫလီၫ.- ၦလၧအအီၪလၧခး ဖၧၩ့ဧ့,မုဆဲၪ့ထၪ့န့နၧၩ, ဆၧအဆၧၫ့အထီဘၪယူၭ, ဆၧတုၩ့ထၪ့တုၩ့လၩ့အမုလနံၩအီၪဘူၭထၪ့ယူၭ,ခိၪ",
			"8": "<sup>8</sup> လီၩ့ထိၩ့ချိၬအဆၧၥၭထိၬအၥီၫနီၪမွဲအ့ၬ.- ဘိၩ့နဲၪ့ယီၩ ဘူၭလၧယမိဂါလၩ့ယၥၭခဲၩထၪ့လၧနလီၩ့, ဒဲမၩလူၬ ယၥၭခဲၩထၪ့လၧနလီၩ့, ယမိစ့ၩရၫ့နၧၩဘဲၫနဖၧၩ့ၥၭ လဖၪအၥိၭတၭ, ယဖ့ၪထဲၩ့နၧၩလၧနဆၧၥၭလိၪထီး",
			"9": "<sup>9</sup> အလူၬလီၫ.- ယမ့ၬၥၪလီၫ့ကီၩ့အ့ၬ,ဒဲယယၫ့ၥၭဆၧဆ့ အ့ၬးယမိဖ့ၪဆၧၫ့ထဲၩ့ဆၧလၧနၧၩ ဘဲၫနဖၧၩ့ၥၭလဖၪ အၥိၭနီၪ,ဒဲနဆၧၥၭလိၪလဖၪမိဘၪနၧၩတၭ, နၥံၪမိၥ့ၪ",
			"10": "<sup>10</sup> ယၫလၧယၧၩ,ယဟိဝၩယီၩ, ယကျီၪ့ခွံၬနၥံၪလီၫ.-ယိခွါ,မုလနံၩနီၪဘီၪ, ယိခွါ, ဘၪဝ့ၫ,မုဆဲၪ့ထၪ့ဝ့ၫ, နိၪထိၭဘီၩ့ဖီၫထၪ့ယူၭး ဆၧၥၭထၪ့ထီၫထိထၪ့ယူၭး",
			"11": "<sup>11</sup> ဆၧမၩန့ဆီၪ့နီၪကဲၪထၪ့ လၧဆၧလတီၩဆၧလလီၩ့ ဘၪ အနိၪထးယူၭး အဝ့ၫၥံၪမွဲဂ့ၩ, အၡၩခမျၧးမွဲဂ့ၩ, အ ဆၧအီၪကီၪ့မွဲဂ့ၩ, အီၪလၩ့ထးနးဂၩအ့ၬ, ၦဂၪ့လၧ",
			"12": "<sup>12</sup> အကၠီၩ့အ့ၬ.- အထီဘၪဝ့ၫ,မုလနံၩနီၪၥုၭဘူၭအၥၭ လီၫ.ၦလၧအဎွ့ၩဆၧနီၪ, မွဲအထီးၥၭထိၬလဂ့ၩ, ၦလၧ အအၪ့ဆၫခွံၬဆၧနီၪ,မွဲအထီးၥၭအုၭလဂ့ၩ, အဂဲးဘဲၫ",
			"13": "<sup>13</sup> ယီၩဆၧၥၭထၪ့ဘၪၦခမျၧးထီးအလူၬလီၫ.- အဂဲးဘဲၫ ယီၩၦအၪ့ဆၫဆၧနီၪအ့ၪမၧၫ့ဒံၭလါနၫ့တၭ, ထဲၩ့ထဲၩ့ လၧဆၧလၧအဘၪ ဆၧအၪ့ဆၫခွံၬဝ့ၫအအီၪအ့ၬ. အ ဂဲးဘဲၫယီၩ ဆၧဒၪလၧယၫလခီၫထၫ့ဒၩၦခမျၧးထီး အလူၬ,ဂဲၫထဲၩ့ဘၪနးဂၩအ့ၬး တၭၦမၩဆီၪ့ထၪ့အၥၭ",
			"14": "<sup>14</sup> မၧၫ့နီၪလၧအဆၧအၧၩ့အဖၧၩ့နးဂၩဆ့အ့ၬ.- အဝ့ၫၥံၪ အူၪထၪ့ခွ့ၩယူၭ, တဲၩ့ဝဲၩဆၧထီးအလူၬယူၭ,မွဲလါနၫ့ တၭ,ၦလ့ၩဒုၭၥုၭနးဂၩအ့ၬး အဂဲးဘဲၫယီၩယၥၭထၪ့ ဘၪအၡၩခမျၧးထီးအလူၬလီၫ.",
			"15": "<sup>15</sup> နၭၥံၪဖၩ့ၥံၪအီၪဝ့ၫ လၧခီၫ့တၭ,ဆၧၥံၫချဲၫ့ဒဲဆၧၥၭဝံ လၩ့ ဒိၩအီၪဝ့ၫလၧအဖၧၩ့လီၫ. ၦအီၪဝ့ၫလၧမံၩ့လါကျၩနီၪ မိၥံၫလၧနၭၥံၪဖၩ့ၥံၪ, ဒဲၦအီၪလၧဒိၩ့ဖၧၩ့နီၪ ဆၧၥၭဝံ",
			"16": "<sup>16</sup> လၩ့ဒိၩဒဲဆၧၥံၫချဲၫ့နီၪမိအၪ့ခွံၬအဝ့ၫၥံၪလီၫ.- ၦလၧအ ဖီၩ့ဖျ့ၭဆၧလၧအကျၩလဖၪနီၪမိဖီၩ့ဖျ့ၭတၭ, မိအီၪဝ့ၫ လၧခိၪလီၩ့ထိၩ့ချိၬ ဘဲၫထိၪလွံလၧခိၪလီၩ့ဆူၭဖၧၩ့အ ၥိၭနီၪလီၫ.မိၥုၪ့အုၭၥၭအုၭထီးအလူၬ လၧအဆၧအၧၩ့",
			"17": "<sup>17</sup> အကၠီၩ့ကိၭဂၩဒ့ၭလီၫ.- ၦအစူၪအဂဲးအဘၭမိလၩ့ဆါ ထီးအလူၬ, ဒဲၦခၪ့လုးခိၪမိကဲၪထၪ့ဘဲၫထံၫအၥိၭနီၪ",
			"18": "<sup>18</sup> ထီးအလူၬလီၫ.- မိခဲးထူၬအယးဒံၩ့လၧရၧၬအဆၧ ယၬတၭ,ဆၧမၩၥၭမဲၪဖၭဒိၪမိချႃၬဘံၭအဝ့ၫၥံၪတၭ, ဆၧ မ့ၬမဲမိအီၪဝ့ၫလၧၦထီးအလူၬအမ့ၬတၭ, ကယဲအခိၪ",
			"19": "<sup>19</sup> ဎွံၪထီးအလူၬနီၪမိချၩလီၫ.- အဝ့ၫၥံၪမိခွံၬၡိၭအစ့ၩ လၧဖၧၩ့ၥၭ,ဒဲအထီၫ့နီၪမိဘၪဆၧဆိၬခွံၬဝ့ၫလီၫ. အဝ့ၫ ၥံၪအကျိၪၥံၪစ့ၩၥံၪ ဒဲအထီၫ့ၥံၪလွ့ၫၥံၪ မၩဖီၩ့မၩဖျ့ၭ ဝ့ၫလၧယဟိဝၩအၥၭထၪ့အမုနံၩနီၪၥ့ၪအ့ၬ. အဝ့ၫၥံၪ အဆၧၥၭဝံလၩ့ဒိၩလဘျၪဘၪ, ဒဲအအီၩ့ဖၧၩ့နီၪဎွ့ၩ ဘၪဆ့အ့ၬ. အဂဲးဘဲၫယီၩမွဲအဝ့ၫၥံၪ အဆၧဒဲၩဘၭအ",
			"20": "<sup>20</sup> ဆၧဘၪထၧၩ့အလးလီၫ.- အဝ့ၫၥံၪအကယၧၩ့ကယီၫ ဎံၫလၩနီၪ, ဆၧအီၪက့ၪဝ့ၫလၧဆၧလၩဖၩ့အဂး,အ့ၪ မွဲအဝ့ၫၥံၪတဲၩ့ဆၧၥၭလိၪ ဒဲဆၧဂၩ့ၥံၪလၧဆၧၥၭဂဲၫ့ဝ့ၫ လဖၪလၧအဖၧၩ့လီၫ. မၩအၥၭဘဲၫနီၪတၭ,ယမိအီၪ",
			"21": "<sup>21</sup> က့ၪအဝ့ၫလၧဆၧလန့ကၩဘၪဆၧလၧအဂးလီၫ.- တၭယမိဖ့ၫလၫ့အဝ့ၫလၧ ၦလခီၫဘၩ့မုးဖိၪအစူၪဖၧၩ့လၧ အဆၧအၪ့ဂူၬဆီၪ့အဂး, ဒဲလၧဂၪ့ခိၪအၡၩလတီၩလ လီၩ့ဘၪလၧဆၧအၪ့ဂူၬန့အဂးတၭ, အဝ့ၫၥံၪနီၪမိမၩ",
			"22": "<sup>22</sup> စံၪစၪဝ့ၫလီၫ.- ယမိကၠၪခွံၬယမ့ၬလၧအဝ့ၫၥံၪတၭ, အ ဝ့ၫၥံၪမိမၩစံၪစၪယလးအီၪကဒုၩလီၫ. ထမျၬလဖၪမိ လ့ၩနုၬဒဲမၩစံၪစၪအဝ့ၫလီၫ.",
			"23": "<sup>23</sup> တဲၩ့ၥွ့ၫထၭနးဘီၩ့ဆံၭး အဂဲးဘဲၫယီၩထံၫၥံၪခးၥံၪ နီၪဎွ့ၩဝ့ၫလၧဆၧမၩၥံၫဆၧ လတီၩလလီၩ့ဘၪတၭ,",
			"24": "<sup>24</sup> ဒိၩ့နီၪဎွ့ၩဝ့ၫလၧဆၧမၩန့ဆီၪ့လီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,ယမိဒုၭဂဲၫနုၬၦဆၨၩလဖၪ လၧအအၧၩ့တၭ, အ ဝ့ၫၥံၪမိမၩန့နၥံၪအဂံၪ့နၥံၪအဎၫ့လီၫ. ယမိဒုၭထုၬၦ အဆီၪ့အၥၭထၪ့ထီၫတၭ, ၦမိမၩၥၭလိၪအလးဆံၫ့ဎံၪ",
			"25": "<sup>25</sup> လဖၪလီၫ.- ဆၧမၩဂၭဂီၩ့ဂဲၫဝ့ၫတၭ,ၦမိအၪ့ဎူၫအၪ့",
			"26": "<sup>26</sup> ဎၬဆၧဘၪလိၬအိၭလိၬနီၪဒၪန့ဝ့ၫအ့ၬ.- ဆၧၡၪ့ဆၧနၭ မိဘၪလၧဆၧၡၪ့ဆၧနၭအဖၫ့ခိၪ ဒဲဆၧအပရၧၫ့မိဘၪ လၧဆၧအပရၧၫ့အဖၫ့ခိၪလီၫ. တၭအဝ့ၫၥံၪမိအၪ့ဎူၫ အၪ့ဎၬဆၧဒၪဆၧလၧယၫလခီၫ လၧမီၪအအီၪလါနၫ့ နီၪ,ဆၧၥီၪ့ဆၧၥၫ့မိလၩ့မါလၧၦလုဆၧအအီၪ, ဒဲဆၧ",
			"27": "<sup>27</sup> ဒုၭကိၪ့ဆၧနီၪလၧၦၥၭၡါအအီၪလီၫ.- စဎွၩနီၪအၥုၪ့ မိအုၭအၥၭမိအုၭ,ဒဲၦဒိၪဖၭဒိၪလဂၩနီၪ မိကီၩ့ၥိၭဆၧ အီၪယူဝ့ၫ, ဒဲၦခးဖိၪၥံၪအစူၪမိဘၪဆၧခိဆၧဝီၩတၭ, ယမိမၩအဝ့ၫၥံၪဘဲၫအဖၧၩ့ၥုၪ့ဖၧၩ့ၥၭအၥိၭနီၪ, ဒဲဘဲၫ အဆၧစ့ၩရၫ့လဖၪကြၨၭဝ့ၫအၥိၭနီၪ, ယမိစ့ၩရၫ့အဝ့ၫ ၥံၪတၭ,အဝ့ၫၥံၪမိၥ့ၪယၫလၧယမွဲယဟိဝၩလီၫ."
		},
		"8": {
			"1": "<sup>1</sup> လၧဎူၫနံၪ့လၩဎူၫဘံၪ့လဘံၪ့, လၩထၪ့ယဲနံၩလနံၩ နီၪယဆၧၫ့နၩ့လၧယဂံၪ့ဖၧၩ့တၭ, ယုဒၫအၥုၪ့က့ၭၥၭ ၡါၥံၪဆၧၫ့နၩ့ဝ့ၫလၧယမ့ၬယၫနီၪ, ဆၧမၩအၥၭလၧ",
			"2": "<sup>2</sup> ကဆါယဟိဝၩအစူၪလၩ့ဘၪယၧၩထီးနီၪလီၫ.- ယ ယိဆၧတၭ,ယိခွါ, ဆၧအခံးအဂၩ့ မၩအၥၭ ဘဲၫမ့ၪ ဎၦၡၩၭအၥိၭ, ဆၧဖျီၪလၧအယးဒံၩ့ဖၫ့လၬ ဘဲၫမ့ၪအ",
			"3": "<sup>3</sup> ၥိၭ,ဒဲလၧအယးဒံၩ့ဖၫ့ခိၪနီၪ, ဘဲၫဆၧဖၩ့ယုၩ့ယဲအ ၥိၭ,ဘဲၫထီးဘၩ့ဆံၫ့အၥိၭနီၪလီၫ.- အဝ့ၫဒုၭဖျီၪထၪ့ ဆၧဘဲၫဆၧအစူၪအၥိၭတၭ, ဖီၪ့ထၬယခိၪၥူၫတၭး ၥၭနီၪၥိၫ့ထၪ့ယၧၩလၧမူၭခိၪ ဒဲဂၪ့ခိၪအဘိၩ့ဆၧၩ့တၭ, ဆိၬထၪ့ယၧၩ, လၧဆၧဒၪဆၧလၧယၫလခီၫ ဘၪဆဲၫ့ လၧယွၩ,ထီၩ့လၧယရုစလံၫ့, လၧတရၫ့ဖၭဒိၪလၧယၫ အတရၫ့ဖိၪလၧအဒိၭအၥၭလၧမုဖၩလခီၫ, ထီးဆၧ ၥၭကဲၪ့အဆၧဂၩ့ လၧအထိၪဂဲၩဆၧၥၭကဲၪ့နီၪ အီၪဝ့ၫ",
			"4": "<sup>4</sup> လီၫ.-ယိခွါ,အံၫစရ့လၭအယွၩအလၩအဖၩ့ အီၪဝ့ၫ ထီးနီၪဘဲၫဆၧဒၪဆၧလၧယၫလခီၫ လၧယဒၪဘၪလၧ ဆၧပျၩ့ဖၧၩ့အၥိၭနီၪလီၫ.",
			"5": "<sup>5</sup> ထီးနီၪလဖၧၫ့အဝ့ၫစံၭယၧၩ, ၦၡၩအဖိၪခွၫဧ့,စၪ့ထၪ့ နမ့ၬလၧဖၧၩ့ၥၭလၧမုဖၩလခီၫဆံၭ. ယစၪ့ထၪ့ယမ့ၬ လၧဖၧၩ့ၥၭလၧမုဖၩလခီၫတၭ, ယိခွါ,လၧဆၧလုလး အတရၫ့လၧမုဖၩလခီၫနီၪ ဆၧၥၭကဲၪ့ အဆၧဂၩ့အီၪ",
			"6": "<sup>6</sup> ဝ့ၫထီးဆၧလ့ၩနုၬ လၧအဖၧၩ့နီၪလီၫ.- အဝ့ၫဒၪစံၭ ယၧၩ,ၦၡၩအဖိၪခွၫဧ့, ၦမၩဝ့ၫဘဲၫၥ့ၪလဲၪ, ဘဲၫၥ့ၪလဲၪ နီၪ,မွဲနဒၪဘၪဆ့ဧၪ. ဆၧၥၭလိၪလၧအံၫစရ့လၭအၡၩ ဂံၪ့ဖိၪမၩထီးယီၩ ဘဲၫၥိၭယမိလ့ၩယဲၩ့လၧယလးဆံၫ့ ဎံၪနီၪ,မွဲဆၧဖၭဒိၪလီၫ. ကၠၪဒီၭနၥၭတၭ,နမိဒၪဒံၭဆၧ ၥၭလိၪဒိၪနဲၪ့ဒံၭအနီၪလီၫ.",
			"7": "<sup>7</sup> အဝ့ၫဒၪဆိၬယၧၩ လၧဆၧအဝၩ့အတရၫ့ထံၭတၭ, ယယိဆၧနီၪ, ယိခွါ,ယဒၪဆၧဖိးအီၪလၧဆၧဒီၪ့ဖၧၩ့",
			"8": "<sup>8</sup> လဖၧၩ့လီၫ.- ထီးနီၪလဖၧၫ့အဝ့ၫစံၭယၧၩ, ၦၡၩအဖိၪ ခွၫဧ့, ဘုၪ့ဖိးဆၧလၧအဆၧဒီၪ့နီၪဆံၭ. ယဘုၪ့ဖိးဆၧ",
			"9": "<sup>9</sup> ဒီၪ့နီၪ,ယိခွါ,တရၫ့လဘံၪ့လီၫ.- အဝ့ၫဒၪစံၭယၧၩ, လ့ၩနုၬဘီၪ, ယိဆၧၥၭလိၪအၧၩ့လဖၪလၧအဝ့ၫၥံၪမၩ",
			"10": "<sup>10</sup> ဝ့ၫနီၪဆံၭ.- ယလ့ၩနုၬတၭ, ယဒၪဘၪဆၧတၭ,ယိခွါ, ကယဲဆၧစွၩလမံၩ့လါလါ, ဒဲဆၧဖိၪဆၧဎါလဆံၫ့ ဘၪ,ဒဲအံၫစရ့လၭအၡၩဂံၪ့ဖိၪ အဆၧဂၩ့ဆၧဖၪ့လဖၪ",
			"11": "<sup>11</sup> နီၪကွ့ၭအၥၭလၧဆၧအဒီၪ့အလီၩ့ဝၬဖီၩ့ဝ့ၫလီၫ.- တၭ အံၫစရ့လၭအၡၩဂံၪ့ဖိၪ အၥုၪ့က့ၭၥၭၡါနွ့ၫဆံၫဆၧၫ့ ထုၪ့လၧအဝ့ၫၥံၪအမ့ၬယၫ, ဒဲစၡၫဖၫ့အဖိၪခွၫစယၭ ဇနဲၫအၫအီၪဝ့ၫလၧအၥၭကျၩတၭ, လဂၩအီၪဝ့ၫလၧ အဖၧၩ့မ့ၪ, လဂၩအီၪဝ့ၫလၧအဖၧၩ့မ့ၪ ဆုၬဆုၬတၭ,",
			"12": "<sup>12</sup> ဆၧဆူၭခဲၩနၧၫ့မၧၫ့အဆၧအုၪ့တၪ့ထၪ့ဝ့ၫလီၫ.- ထီးနီၪ လဖၧၫ့အဝ့ၫဒၪစံၭယၧၩ, ၦၡၩအဖိၪခွၫဧ့, ဆၧလၧအံၫ စရ့လၭအၡၩဂံၪ့ဖိၪအၥုၪ့က့ၭၥၭၡါမၩဝ့ၫ လၧဆၧခံၭ ကျၩလဂၩ လၧအဆၧဂၩ့အဒူၭဖၧၩ့ ဆုၬဆုၬနီၪနဒၪ ဘၪဆ့ဧၪ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪစံၭဝ့ၫ, ယဟိဝၩဒၪ ဘၪပၧၩအ့ၬး ယဟိဝၩစဲၪ့ဒၪယူၭ ထံၫၥံၪခးၥံၪယူၭ",
			"13": "<sup>13</sup> လီၫ.- အဝ့ၫဒၪစံၭယၧၩ,ကၠၪဒီၭနၥၭတၭ,နမိဒၪဘၪ ဒံၭဆၧဘၪၥၭလိၪလၧအဒိၪနဲၪ့ဒံၭ လၧအဝ့ၫၥံၪမၩဝ့ၫ",
			"14": "<sup>14</sup> လီၫ.- ထီးနီၪလဖၧၫ့အဝ့ၫဒၪဂဲၫဆိၬယၧၩ လၧယဟိ ဝၩအဂံၪ့အတရၫ့ဖၭဒိၪ အတရၫ့ဆံၭ အခၪ့ထံၭလၧ အအီၪဝ့ၫလၧမုဖၩလခီၫတၭ, ယိခွါ, ၦမုၪလဖၪဆၧၫ့ နၩ့ဂၪ့ဝ့ၫလၧတၫ့မၧၭအကၠီၩ့လီၫ.",
			"15": "<sup>15</sup> တၭအဝ့ၫဒၪစံၭယၧၩ, ၦၡၩအဖိၪခွၫဧ့, မွဲနဒၪဘၪ ဆ့ဧၪ,နမိဒၪဒံၭဆၧဘၪၥၭလိၪလဖၪဒိၪနဲၪ့ဒံၭအဝ့ၫ",
			"16": "<sup>16</sup> ၥံၪလီၫ.- အဝ့ၫဒၪဆိၬထၪ့ယၧၩလၧယဟိဝၩအဂံၪ့အ ဝၩ့လၧယၫလခီၫတၭ, ယိခွါ,ထီးယဟိဝၩအနီးအတ ရၫ့ထံၭလၧထိၬချိၫ့, ဒဲဆၧလုလးအဘိၩ့ဆၧၩ့နီၪ, ၦၡၩ နံၫဆံၫယဲဂၩကၪယူၭအီၪဝ့ၫတၭ, ကၠၪဒိၭချိၫ့အၥၭ လၧယဟိဝၩအနီးတၭ,ဒိၭအမ့ၬလၧမုထၪ့လခီၫတၭ, ဘၩထၪ့မုလၧမုထၪ့လခီၫလီၫ.",
			"17": "<sup>17</sup> တၭအဝ့ၫဒၪစံၭယၧၩ, ၦၡၩအဖိၪခွၫဧ့,နဒၪဘၪဆ့ ဧၪ.ဆၧဘၪၥၭလိၪလၧယုဒၫအၡၩဂံၪ့ဖိၪ မၩထီးယီၩ, မွဲဆၧအဆံၭလၧအဂးဆ့ဧၪ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪ မၩဎွ့ၩထံၫၥံၪခးၥံၪ, လၧဆၧမၩန့ဆီၪ့,ဒဲထိၪဂဲၩယၥၭ ထၪ့တၭ,ယိခွါ, အဝ့ၫၥံၪအီၪက့ၪၥံၪ့ထဲၩ့လၧအနၫဖူၫ",
			"18": "<sup>18</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ယမိမၩအဝ့ၫၥံၪဆ့လၧယ ၥၭခဲၩထၪ့လီၫ. ယမ့ၬၥၪမိလီၫ့ကီၩ့အဝ့ၫၥံၪအ့ၬး ယ မိယၫ့ၥၭဆၧဆ့အ့ၬး အ့ၪကိၭထၪ့လၧယနါဖၧၩ့လၧ အလူဖၭဒိၪလါနၫ့တၭ,ယခိၭနၪအလူအ့ၬ."
		},
		"9": {
			"1": "<sup>1</sup> အဝ့ၫဒၪကိၭထၪ့ဝ့ၫ လၧယနါဖၧၩ့လၧအလူဖၭဒိၪ တၭ,စံၭဝ့ၫဒၪး ၦလၧအပၧၩ့ဒိၩ့လဖၪနီၪ ဒုၭၥုၭဘူၭ ဝ့ၫလဂၩ,ဒဲလဂၩ, လၧအစူၪဝဲၩလၧအမၩဂၭဂီၩ့ဆၧ",
			"2": "<sup>2</sup> လၧအစူၪဖၧၩ့ဆုၬဆုၬဆံၭ.- တၭယိခွါ, ၦဎူၫဂၩဂဲၫ ဝ့ၫလၧတရၫ့လၧထၭလခီၫအဖၧၩ့ၥၭ, လၧအဖိးဝ့ၫလၧ မုဖၩလခီၫလဂၩ ဒဲလဂၩလၧအစူၪဝဲၩ မၩၥံၫဆၧလၧ အစူၪဖၧၩ့ဆုၬဆုၬလီၫ. တၭၦကီၩ့ၥိၭဆၧဘွၩဖျ့ၫလံၬ ကံၭအီၪဝ့ၫ, လၧၦကွ့ၭလံၬအၥံၪထံၫ ဆၧနိၩ့လဘီၩ့ လၧအယးဒံၩ့လီၩ့လဂၩ, အီၪဝ့ၫလၧအဝ့ၫၥံၪအကျၩ လီၫ.အဝ့ၫၥံၪလ့ၩနုၬတၭ, ဆၧၫ့ထုၪ့ဝ့ၫလၧဆၧလုလး",
			"3": "<sup>3</sup> ထီးဝီၩအနဲၩ့ထံၭလီၫ.- တၭအံၫစရ့လၭအယွၩအ လၩအဖၩ့နီၪ ထၪ့ဝ့ၫလၧခ့ၫရူၬအလီၩ့ ထီးအအီၪဝ့ၫ လၧဂံၪ့အတရၫ့ခၧၪ့လီၫ. တၭအဝ့ၫဒၪကိၭထၪ့လၧၦ ကီၩ့ၥိၭဆၧဘွၩဖျ့ၫလံၬကံၭ, အီၪလၧၦကွ့ၭလံၬအၥံၪ",
			"4": "<sup>4</sup> ထံၫဆၧနိၩ့လဘီၩ့လၧအယးဒံၩ့လဂၩ,- တၭယဟိဝၩ စံၭအဝ့ၫ,လ့ၩခၫ့ဂၬဒိၩ့အၥၭကျၩ, လၧယရုစလံၫ့အ ၥၭကျၩတၭ, မၩနဲၪ့ၦလၧအဂၪ့အုၩ့ဂၪ့ထိၬဒဲဂၪ့ကိၭ ၡၭထၪ့လၧဆၧဘၪၥၭလိၪ မၩအၥၭလၧအၥၭကျၩအ ကၠီၩ့လဖၪအမ့ၬထုးခိၪနီၪဆံၭ.",
			"5": "<sup>5</sup> အဝ့ၫဒၪစံၭၦဂူၫဂၩလၧယနါဖၧၩ့, လ့ၩနၥံၪဝ့ၫဖိၬ အဝ့ၫဒၪအခဲၫ့လၧဒိၩ့ဖၧၩ့တၭ, ကျီၪ့ဆၧဆံၭ, မွဲနၥံၪ အမ့ၬၥၪထီးလီၫ့ကီၩ့လဂ့ၩ, မွဲနၥံၪထီးယၫ့ၥၭဆၧလ",
			"6": "<sup>6</sup> ဂ့ၩ,- ၦၥၭၡါမွဲဂ့ၩ, ၦဖိၪၥၪခွၫမွဲဂ့ၩ,ၦမုၪနၩ့မွဲဂ့ၩ,ၦဖိၪ ဒံၩဖိၪၥၪမွဲဂ့ၩ, ဒဲၦမုၪလဖၪနီၪမၩၥံၫဆံၭ. မွဲလါနၫ့ၥုၭ ဘူၭနၥံၪအၥၭလၧၦလၧဆၧမၩနဲၪ့အီၪဝ့ၫ လၧအလီၩ့ နီၪနးဂၩလဂ့ၩး တၭမၩဆိၫဆၧထီးယလးဆံၫ့ဎံၪ နီၪဆံၭ.တၭအဝ့ၫၥံၪမၩဆိၫဝ့ၫလၧၦၥုၪ့က့ၭၥၭၡါလၧ",
			"7": "<sup>7</sup> အအီၪဝ့ၫလၧဂံၪ့အမ့ၬယၫလီၫ.- အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, မၩဘၪၥၭလိၪဂံၪ့နီၪဘီၪး ဒဲမၩဎွ့ၩဆၧအဝၩ့လၧၦ လၧအဘၪဆၧမၩၥံၫဝ့ၫဆံၭး စဲၪ့ထၪ့ဆံၭ. အဝ့ၫၥံၪ စဲၪ့ထၪ့ဝ့ၫတၭ,မၩၥံၫဆၧလၧဒိၩ့ဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> လၧအဝ့ၫၥံၪမၩၥံၫဆၧအဘိၩ့ဘၭနီၪ ယအီၪလၩ့ထး လဂၩဎးတၭ, ယထိၪလၩ့ထံၩဖါချႃၬလၩ့ယၥၭတၭ, ယကိၭထၪ့ဆၧနီၪ, ယစံၭ,ကဆါယဟိဝၩဧ့,နဂါလၩ့ နၥၭခဲၩထၪ့လၧယရုစလံၫ့အဖၫ့ခိၪအဘိၩ့ဘၭတၭ,နမိ မၩဂၭဂီၩ့ၦအံၫစရ့လၭဖိၪလၧအအီၪလၩ့ထးထီးအ",
			"9": "<sup>9</sup> လူၬဆ့ဧၪ,- ထီးနီၪလဖၧၫ့အဝ့ၫဒၪစံၭယၧၩ, အံၫစရ့ လၭဒဲယုဒၫအၡၩဂံၪ့ဖိၪ အဆၧဒဲၩဘၭနီၪဒိၪမၬလီၫ. ထံၫၥံၪခးၥံၪဎွ့ၩဝ့ၫလၧဆၧၥွံၪတၭ, ဒိၩ့နီၪဎွ့ၩဝ့ၫလၧ ဆၧမၩကဲၪ့ကီၪ့လီၫ. အဂဲးဘဲၫယီၩစံၭဝ့ၫဒၪ,ယဟိဝၩ စဲၪ့ဒၪယူၭထံၫၥံၪခးၥံၪတၭ, ယဟိဝၩဒၪဘၪဝ့ၫအ့ၬး",
			"10": "<sup>10</sup> မၩအၥၭဘဲၫနီၪတၭ, ယမ့ၬၥၪလီၫ့ကီၩ့ဆၧအ့ၬး ဒဲယၫ့ ၥၭဆၧဆ့အ့ၬ.ယမိဖ့ၪဆၧၫ့ထဲၩ့ အဝ့ၫၥံၪအဖၧၩ့ၥၭ",
			"11": "<sup>11</sup> လၧအခိၪဎွံၪဒၪဝ့ၫအဖၫ့ခိၪလီၫ.- ယိခွါ,ၦကီၩ့ၥိၭဆၧ ဖျ့ၫလံၬကံၭအီၪလၧၥံၪထံၫဆၧနိၩ့လဘီၩ့ လၧအယး ဒံၩ့အလီၩ့လဂၩ, ဖ့ၪထဲၩ့ဆၧချဲၩ့တၭ,စံၭဝ့ၫဒၪ,ယမၩ ယူၭဘဲၫနမၪလူၬယၧၩအၥိၭနီၪယူၭ."
		},
		"10": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ယယိဆၧတၭ, ယိခွါ,လၧမူၭဖိၭဖၫ့ လၧအအီၪဝ့ၫလၧခ့ၫရူၬလဖၪ အခိၪဎွံၪအဖၫ့ခိၪလခီၫ နီၪ,ဆၧဖျီၪလၧအဝ့ၫၥံၪအဖၫ့ခိၪ ဘဲၫထၫ့မျါနံၩလၩအ ၥိၭ,ဖျီၪထၪ့ဝ့ၫဘဲၫဆၧအလးဆီၩ့ဆီ အခံးအဂၩ့အၥိၭ",
			"2": "<sup>2</sup> နီၪလီၫ.- အဝ့ၫဒၪချဲၩ့ဆၧ လၧၦကီၩ့ဆၧဘွၩဖျ့ၫလံၬ ကံၭတၭ,စံၭဝ့ၫဒၪ, လ့ၩနုၬလၧလဲၪ့ပၪအဘိၩ့ဆၧၩ့လၧ ခ့ၫရူၬအဖၫ့လၬတၭ, မၩဎွ့ၩနစူၪယၫၥၭလၧမ့ၪအၧၩ့ ဖၭလၧအအီၪလၧခ့ၫရူၬအဘိၩ့ဆၧၩ့တၭ, မၩပြံၩပၩ ဝ့ၫလၧဒိၩ့အဖၫ့ခိၪနီၪဆံၭ. တၭအဝ့ၫလ့ၩနုၬလၧယ မ့ၬယၫလီၫ.",
			"3": "<sup>3</sup> ထီးၦၡၩလဂၩနီၪလ့ၩနုၬတၭ, ခ့ၫရူၬလဖၪဆၧၫ့ ထုၪ့လၧဂံၪ့အစူၪထွ့ၪလခီၫတၭ, ဆၧအုၪ့ဎွ့ၩဆၧအ",
			"4": "<sup>4</sup> ဝၩ့လၧယၫလစီၪ့လီၫ.- ထီးနီၪလဖၧၫ့ယဟိဝၩအလၩ အဖၩ့စဲၪ့ထၪ့ဝ့ၫလၧခ့ၫရူၬအအီၪ ထီၩ့လၧဂံၪ့အတရၫ့ ခၧၪ့တၭး ဂံၪ့နီၪဎွ့ၩဝ့ၫလၧဆၧအုၪ့, ဒဲဆၧအဝၩ့ဎွ့ၩ",
			"5": "<sup>5</sup> လၧယဟိဝၩ အလၩအဖၩ့အဆၧယုၩ့ယဲလီၫ.- တၭ ခ့ၫရူၬလဖၪ အဒံၭအၥီၫဂၧၫ့ထၪ့ဝ့ၫ ဖိးလၧဆၧအဝၩ့ လၧခီၫ့လစီၪ့ ဘဲၫယွၩၥ့ၪဆၧလူၬအလူ လၧအချဲၩ့ဆၧ အဘိၩ့ဘၭအၥိၭနီၪလီၫ.",
			"6": "<sup>6</sup> တၭထီးအမၪလူၬ ၦကီၩ့ၥိၭဆၧဘွၩဖျ့ၫလံၬကံၭ တၭ,စံၭဝ့ၫ,မၩန့မ့ၪလၧလဲၪ့ပၪအဘိၩ့ဆၧၩ့ ဒဲလၧခ့ၫ ရူၬအဘိၩ့ဆၧၩ့ဆံၭ, ဆၧမၩအၥၭလၧအလ့ၩနုၬတၭ,",
			"7": "<sup>7</sup> ဆၧၫ့ထုၪ့လၧလဲၪ့ပၪၥံၪအနဲၩ့ထံၭလီၫ.- ခ့ၫရူၬလဒုၩ ယူၬထၪ့အစူၪလၧခ့ၫရူၬလဖၪ အဘိၩ့ဆၧၩ့လၧမ့ၪလၧ အအီၪဝ့ၫလၧခ့ၫရူၬလဖၪအဘိၩ့ဆၧၩ့တၭ, မၩန့ဝ့ၫ တၭ,အီၪက့ၪလၩ့ဝ့ၫ လၧၦကီၩ့ၥိၭဆၧဘွၩဖျ့ၫလံၬကံၭ လဂၩအစူၪဖၧၩ့တၭ, အဝ့ၫဒၪမၩန့ဝ့ၫတၭ,စဲၪ့ထၪ့ခွံၬ",
			"8": "<sup>8</sup> ဝ့ၫလီၫ.- တၭၦၡၩအစူၪအခံးအဂၩ့အီၪဖျီၪထၪ့လၧ ခ့ၫရူၬအဒံၭအဖၫ့လၬလီၫ.",
			"9": "<sup>9</sup> ယယိဆၧတၭ, ယိခွါ,လဲၪ့အပၪလံဘံၪ့အီၪဝ့ၫလၧ ခ့ၫရူၬလဖၪအနဲၩ့ထံၭ, လဲၪ့ပၪလဘံၪ့အီၪဝ့ၫလၧခ့ၫ ရူၬလဒုၩအနဲၩ့ထံၭဒဲလဲၪ့ပၪလဘံၪ့ဒၪအီၪဝ့ၫ လၧခ့ၫ ရူၬလဒုၩဒၪအနဲၩ့ထံၭတၭ, လဲၪ့ပၪဖျီၪဝ့ၫမၩအၥၭ",
			"10": "<sup>10</sup> ဘဲၫထၫ့မျါဘၩ့ယ့ၫအၥိၭနီၪလီၫ.- တၭဆၧလံမံၩ့နီၪ အီၪဖျီၪဝ့ၫလၧအခံးအဂၩ့လမံၩ့ဎး မၩအၥၭဘဲၫလဲၪ့ ပၪလဘံၪ့လၧလဲၪ့ပၪလဘံၪ့ဒၪ အဖၧၩ့အၥိၭနီၪလီၫ.",
			"11": "<sup>11</sup> ထီးအဝ့ၫၥံၪလ့ၩဆၧတၭ, လ့ၩဝ့ၫလၧအနဲၩ့ဖၩလံခီၫ လီၫ.ထီးအလ့ၩဆၧတၭကၠၪအၥၭအ့ၬ. ထီးအလး လၧအခိၪတီၩနီၪလ့ၩဝ့ၫတၭ, ထီးအလ့ၩဆၧနီၪကၠၪ",
			"12": "<sup>12</sup> အၥၭအ့ၬ.- တၭအဖံၭအယၪထီးအလူၬ, ဒဲအချိၫ့ခိၪ, ဒဲအစူၪ,ဒဲအဒံၭ, ဒဲအလဲၪ့ပၪနီၪဎွ့ၩဝ့ၫလၧမ့ၬၥၪၥံၪဝၬ ဖီၩ့လဲၪ့ပၪလၧအအီၪဝ့ၫ လၧဆၧလံဒုၩဒၪလ့ၬနီၪလီၫ.",
			"13": "<sup>13</sup> လၧလဲၪ့ပၪလဖၪနီၪ, အဂဲးအကၠီၪ့ဆၧကိၭထၪ့ဝ့ၫလၧ",
			"14": "<sup>14</sup> ယနါဖၧၩ့စံၭ,လဲၪ့ပၪဧ့ၬ- လဒုၩလဒုၩအီၪဝ့ၫလၧအ မ့ၬလံခီၫဆုၬဆုၬလီၫ. ဆၧအမ့ၬလၧအခၪ့ထံၭလခီၫ နီၪ,မွဲခ့ၫရူၬအမ့ၬလီၫ. တၭဆၧအမ့ၬနံၫခီၫလခီၫနီၪ, မွဲၦၡၩအမ့ၬတၭ, ဆၧအမ့ၬၥၧၫ့ခီၫလခီၫနီၪ မွဲဆၬလ ၥၧၫ့အမ့ၬတၭ,ဆၧအမ့ၬလံခီၫလခီၫနီၪ မွဲလံၬကျီၫ့ကျီၫ့",
			"15": "<sup>15</sup> အမ့ၬလီၫ.- တၭခ့ၫရူၬလဖၪဘၪဆၧဆိၬထၪ့ဝ့ၫလီၫ. ဆၧနီၪမွဲဆၧအၥၭမၧၫ့ လၧယဒၪဘၪလၧထံၫမိၡါခံဘၫ အနဲၩ့ထံၭလီၫ.",
			"16": "<sup>16</sup> ထီးခ့ၫရူၬလဖၪလ့ၩဆၧတၭ, လဲၪ့ပၪနီၪလ့ၩဆၧလၧ အနဲၩ့ထံၭတၭ, ထီးခ့ၫရူၬယၩ့ထၪ့အဒံၭ ဘဲၫၥိၭအမိ ယူၩထၪ့လၧဂၪ့ခိၪအဖၫ့ခိၪတၭ, လဲၪ့ပၪကၠၪခွံၬအၥၭ",
			"17": "<sup>17</sup> လၧအနဲၩ့ထံၭဆ့အ့ၬ.- ထီးအဝ့ၫၥံၪအီၪထီဝ့ၫတၭ,အ ယီၩအီၪထီဝ့ၫဆ့, ထီးအဝ့ၫၥံၪဘၪဆၧဆိၬထၪ့အၥၭ တၭ,အယီၩဘၪဆၧဆိၬထၪ့အၥၭဆ့လီၫ. အဂဲးဘဲၫ ယီၩဆၧအမၧၫ့အၥၭအီၪဝ့ၫလၧအဖၧၩ့လီၫ.",
			"18": "<sup>18</sup> ထီးနီၪလဖၧၫ့ ယဟိဝၩအလၩအဖၩ့စဲၪ့ထၪ့ဝ့ၫလၧ ဂံၪ့အတရၫ့ခၧၪ့တၭ, ဆၧၫ့ထုၪ့ဝ့ၫလၧခ့ၫရူၬအဖၫ့ခိၪ",
			"19": "<sup>19</sup> လီၫ.- ခ့ၫရူၬလဖၪယၩ့ထၪ့အဒံၭတၭ,ထၪ့ဝ့ၫလၧဂၪ့ခိၪ အဖၫ့ခိၪလၧယမ့ၬယၫလီၫ. ထီးအဝ့ၫၥံၪစဲၪ့ထၪ့တၭ, လဲၪ့ပၪၥံၪအီၪဝ့ၫလၧအနဲၩ့ထံၭတၭ, အီၪထီဝ့ၫလၧ ယဟိဝၩအဂံၪ့အတရၫ့ လၧမုထၪ့လခီၫတၭ, အံၫစရ့",
			"20": "<sup>20</sup> လၭအယွၩအလၩအဖၩ့အီၪဝ့ၫလၧအဖၫ့ခိၪလီၫ.- အ နီၪမွဲဆၧအမၧၫ့လၧယဒၪဘၪ လၧအံၫစရ့လၭအယွၩ အဖၫ့လၬလၧထံၫမိၡါခံဘၫအနဲၩ့ထံၭတၭ, ယၥ့ၪယၫ",
			"21": "<sup>21</sup> လၧအမွဲခ့ၫရူၬလဖၪနီၪလီၫ.- လဒုၩလဒုၩအီၪဝ့ၫလၧ အမ့ၬလံခီၫဆုၬဆုၬတၭ, လဒုၩလဒုၩအီၪဝ့ၫလၧအဒံၭ လံဘံၪ့ဆုၬဆုၬတၭ, ၦၡၩအစူၪအခံးအဂၩ့နီၪအီၪဝ့ၫ",
			"22": "<sup>22</sup> လၧအဒံၭအဖၫ့လၬလီၫ.- တၭအမ့ၬအခံးအဂၩ့နီၪမွဲ ဆၧအမ့ၬလၧယဒၪဘၪ လၧထံၫမိၡါခံဘၫအနဲၩ့ထံၭ အခံးအဂၩ့, ဒဲအနၫ့ဆါဒၪဝ့ၫနီၪလီၫ. တၭလဒုၩဘၪ လဒုၩလ့ၩဝ့ၫတီၩတီၩလၧအမ့ၬယၫဆုၬဆုၬလီၫ."
		},
		"11": {
			"1": "<sup>1</sup> လၧနီၪအမ့ၬယၫၥၭနီၪဆိၬထၪ့ယၧၩတၭ, ၥိၫ့ယၧၩ လၧယဟိဝၩအဂံၪ့တရၫ့မုထၪ့, လၧအဒိၭအၥၭလၧ မုထၪ့လခီၫတၭ, ယိခွါ, ၦၡၩနံၫဆံၫယဲဂၩအီၪဝ့ၫလၧ တရၫ့ထံၭတၭ, ယဒၪဘၪ ၦၡၩခမျၧးအၦဒိၪဖၭဒိၪ စအၫဇၧၫအဖိၪခွၫစယၭဇနဲအၫ, ဒဲစဘံၫ့နအဲအၫအ",
			"2": "<sup>2</sup> ဖိၪခွၫစပ့ၫလတဲအၫ,လၧအကျၩလီၫ.- ထီးနီၪလဖၧၫ့ အဝ့ၫဒၪစံၭယၧၩ, ၦၡၩအဖိၪခွၫဧ့,ၦလဖၪယီၩမွဲၦလၧ အကိၪ့ဆၧမၩအၧၩ့, ဒဲဒုၭကိၪ့ဆၧအၧၩ့ လၧဒိၩ့ယီၩ",
			"3": "<sup>3</sup> အဖၧၩ့,- လၧအစံၭဝ့ၫ, အဆၧၫ့အထီဘၪဘူၭဒံၭလၧ ပမိၥုၪ့ဂံၪ့ဒံၭအ့ၬ. ဒိၩ့ယီၩမွဲဖၧၩ့ထၭဖၭဒိၪလဖျိၪ့တၭ,",
			"4": "<sup>4</sup> ပဝ့ၫဒၪယီၩမွဲဆၧယၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ချဲၩ့ ဆၧလၧမီၪအချိၬထၫ့ဒၩအဝ့ၫၥံၪ ၦၡၩအဖိၪခွၫဧ့, ချဲၩ့",
			"5": "<sup>5</sup> ဆၧလၧမီၪအချိၬဆံၭ.- ယဟိဝၩအၥၭလၩ့ဘၪယၧၩ တၭ,စံၭယၧၩ, ချဲၩ့ထၪ့ဆၧဆံၭး ယဟိဝၩစံၭဘဲၫယီၩ, အံၫစရ့လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့, နၥံၪစံၭယူၭဘဲၫနီၪလီၫ. အဂဲးဘဲၫယီၩ ဆၧဂဲၫထၪ့လၧနၥံၪအၥၭခံဖၧၩ့လမံၩ့",
			"6": "<sup>6</sup> လါလါနီၪယၥ့ၪယၫယဝ့ၫကိၭထံၪဒ့ၭလီၫ.- နၥံၪမၩ အၪထၪ့နၥံၪအၡၩ ဘၪဆၧမၩၥံၫဝ့ၫလၧဒိၩ့ဖၧၩ့ယီၩ တၭ,နၥံၪမၩဎွ့ၩအဖၧၩ့ၥၭလဖၪ လၧၦဘၪဆၧမၩၥံၫ",
			"7": "<sup>7</sup> ဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ကဆါယဟိဝၩစံၭဘဲၫ ယီၩ,နၥံၪအၡၩဘၪဆၧမၩၥံၫဝ့ၫ လၧနၥံၪအီၪက့ၪလၩ့ လၧအၥၭကျၩနီၪ,မွဲဆၧယၪတၭ, ဒိၩ့ယီၩမွဲဖၧၩ့ထၭ ဖၭဒိၪလဖျိၪ့နီၪးမွဲလါနၫ့တၭ, ယမိဒုၭစဲၪ့ထၪ့ခွံၬနၥံၪ",
			"8": "<sup>8</sup> လၧအကျၩလီၫ.- နၥံၪၥၭမဲၪယူၭနၭၥံၪဖၩ့ၥံၪတၭ,ယမိ ဒုၭဂဲၫဘၪနၥံၪလၧနၭၥံၪဖၩ့ၥံၪ, ကဆါယဟိဝၩစံၭဝ့ၫ",
			"9": "<sup>9</sup> ဒၪ.- တၭယမိဒုၭစဲၪ့ထၪ့ခွံၬနၥံၪလၧအကျၩတၭ,ယ မိဖ့ၪလၫ့ခွံၬနၥံၪ လၧၦလခီၫဘၩ့မုးဖိၪအစူၪဖၧၩ့တၭ,",
			"10": "<sup>10</sup> ယမိဒုၭအီၪဆၧစ့ၩရၫ့လဖၪလၧနၥံၪအကျၩလီၫ.- နၥံၪ မိလၩ့ထံၩဖါလၧနၭၥံၪဖၩ့ၥံၪး ယမိစ့ၩရၫ့နၥံၪလၧအံၫ စရ့လၭအခးအနဲၩ့ထံၭတၭ, နၥံၪမိၥ့ၪယၫလၧယမွဲ",
			"11": "<sup>11</sup> ယဟိဝၩလီၫ.- ဒိၩ့ယီၩမိကဲၪထၪ့နၥံၪအဖၧၩ့ထၭဖၭ ဒိၪအ့ၬ.တၭနၥံၪကဲၪထၪ့ဘၪဆၧယၪ လၧအဖၧၩ့ဆ့ အ့ၬ.ယမိစ့ၩရၫ့ နၥံၪလၧအံၫစရ့လၭအခးနဲၩ့ထံၭ",
			"12": "<sup>12</sup> လီၫ.- တၭနၥံၪမိၥ့ၪယၫလၧယမွဲယဟိဝၩလီၫ.အဂဲး ဘဲၫယီၩနၥံၪလလ့ၩဘၪလၧယၥနိၫလဖၪအဖၧၩ့,ဒဲလ မၩဘၪဘဲၫယဆၧစ့ၩရၫ့အၥိၭ, အ့ၪမွဲနၥံၪမၩဆၧဘဲၫ ၦဆၨၩလဖၪလၧအအီၪဝၬဖီၩ့နၥံၪအထူၫအရူၫအၥိၭ နီၪလီၫ.",
			"13": "<sup>13</sup> ထီးယချဲၩ့ဆၧလၧမီၪအချိၬတၭ, ဆၧမၩအၥၭလၧ စဘံၫ့နအဲအၫအဖိၪခွၫစပ့ၫလတဲအၫၥံၫဝ့ၫလီၫ. ထီးနီၪ လဖၧၫ့ယထိၪလၩ့ထံၩဖါချႃၬလၩ့ယၥၭ ဒဲကိၭထၪ့လၧ ယလူဖၭဒိၪယစံၭ,အၩလါ, ကဆါယဟိဝၩဧ့ၬနမိ မၩလူၬအံၫစရ့လၭအၡၩအီၪလၩ့ထးထီးအလူၬထူၬ",
			"14": "<sup>14</sup> ဆံၫ့ဘၩ့ဆ့ဧၪ.- ယဟိဝၩအလူလၩ့ဘၪဒီၭယၧၩတၭ,",
			"15": "<sup>15</sup> စံၭဝ့ၫဒၪ.- ၦၡၩအဖိၪခွၫဧ့,နထၧၫ့ဖုဝဲ, နထၧၫ့ဖုဝဲဒၪ လ့ၬၦၡၩလၧနဘူၭနထံးအကျၩ, ဒဲအံၫစရ့လၭအၡၩ ဂံၪ့ဖိၪထီးအလူၬနီၪ,မွဲၦလၧယရုစလံၫ့ဖိၪစံၭအဝ့ၫၥံၪ, လ့ၩနၥံၪဝ့ၫယဲၩ့လၧယဟိဝၩဆံၭ. အဂဲးဘဲၫယီၩဆၧ ဖ့ၪလၫ့ပၧၩလၧထံၫၥံၪခးၥံၪယီၩ ဘဲၫၥိၭၦမိန့ဘၪဝ့ၫ",
			"16": "<sup>16</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭစံၭ,ကဆါယဟိဝၩစံၭဘဲၫ ယီၩ,ယနၫ့ထၪ့ခွံၬအဝ့ၫၥံၪစိၩထံၫယဲၩ့ခးယဲၩ့ လၧၦ ဆၨၩလဖၪအကျၩလါနၫ့, ယမၩလၩ့ပြံၩလၩ့ပၩအ ဝ့ၫၥံၪလၧခးလဖၪအကျၩလါနၫ့ဘိၩ, ယမိကဲၪထၪ့လး ဆံၫ့ဎံၪလၧအဝ့ၫၥံၪအဂးလဆိဖိၪ လၧခးလဖၪအဖၧၩ့,",
			"17": "<sup>17</sup> ထီးအလးလၧအဂဲၫဝ့ၫနီၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, စံၭကဆါယဟိဝၩစံၭဘဲၫယီၩ, ယမိအၪ့ထုၫ့ကီၪ့နၥံၪ လၧၦခမျၧးအကျၩ ဒဲဒုၭအီၪကီၪ့နၥံၪလၧခးလဖၪထီး နၥံၪအီၪပြံၩအီၪပၩလၧအဖၧၩ့တၭ, ယမိဖ့ၪလၫ့နၥံၪ",
			"18": "<sup>18</sup> လၧအံၫစရ့လၭအခးလီၫ.- အဝ့ၫၥံၪမိဂဲၫထီးနီၪတၭ, မိမၩန့ထၪ့ခွံၬကယဲအဆၧၥၭဂဲၫ့အလး, ဒဲကယဲဆၧ",
			"19": "<sup>19</sup> ၥၭလိၪအလးထီးနီၪ ထီးအလူၬလီၫ.- ယမိဖ့ၪလၫ့အ ဝ့ၫၥံၪလၧအၥၭလဖျိၪ့ဎးတၭ, ယမိဒုၭနုၬအၥုၪ့ၥၫ့အ ၥၭၥၫ့လၧအဖၧၩ့တၭ, ယမိထုၭထၪ့ခွံၬအၥၭလိးလၧ အဖၧၩ့တၭ, ယမိဖ့ၪလၫ့အဝ့ၫၥံၪလၧအၥၭဆၧယၪ,",
			"20": "<sup>20</sup> ဘဲၫၥိၭအမိလ့ၩဆၧလၧယၥနိၫလဖၪအဖၧၩ့, ဒဲထီးန့ ယဆၧစ့ၩရၫ့ဒဲမၩဝ့ၫတၭ, အဝ့ၫၥံၪမိကဲၪထၪ့ယၡၩ",
			"21": "<sup>21</sup> ခမျၧးတၭ,ယမိကဲၪထၪ့အဝ့ၫၥံၪအယွၩလီၫ.- အ့ၪမွဲ ၦလၧအၥၭလ့ၩဆၧထီးဒၪ အဆၧၥၭဂဲၫ့အလး,ဒဲအ ဆၧၥၭလိၪလဖၪအလးအၥိၭနီၪ, ယမိဖ့ၪဆၧၫ့ထဲၩ့အ ဝ့ၫၥံၪအဖၧၩ့ၥၭ လၧအခိၪဎွံၪဒၪဝ့ၫအဖၫ့ခိၪကဆါယ ဟိဝၩစံၭဝ့ၫဒၪ.",
			"22": "<sup>22</sup> ထီးနီၪလဖၧၫ့ခ့ၫရူၬလဖၪယၩ့ထၪ့အဒံၭတၭ,လဲၪ့ ပၪၥံၪအီၪဝ့ၫလၧအနဲၩ့ထံၭတၭ, အံၫစရ့လၭအယွၩ",
			"23": "<sup>23</sup> အလၩအဖၩ့အီၪဝ့ၫလၧအဖၫ့ခိၪလီၫ.- ယဟိဝၩအလၩ အဖၩ့စဲၪ့ထၪ့ခွံၬဝ့ၫလၧဒိၩ့အၥၭကျၩနီၪ, ထၪ့ဆၧၫ့ထုၪ့ လၧခိၪလီၩ့အလီၩ့ လၧအအီၪလၧဒိၩ့အမုထၪ့လခီၫ လီၫ.",
			"24": "<sup>24</sup> လၧခဲၫ့ထဲၩ့ၥၭနီၪမၩန့ထၪ့ယၧၩတၭ, ဆိၬထၪ့ယၧၩ လၧယဟိဝၩအၥၭ လၧဆၧဒၪဆၧလၧယၫလခီၫလၧ ခးခၫလဒံအၫအဖၧၩ့, လၧၦကဲၪဎီးလဖၪအအီၪလီၫ. တၭဆၧဒၪဆၧလၧယၫလခီၫ လၧယဒၪဘၪဝ့ၫနီၪ,စဲၪ့",
			"25": "<sup>25</sup> ထၪ့ခွံၬဝ့ၫလၧယအီၪလီၫ.- ထီးနီၪလဖၧၫ့ယလီၩဘၪ ၦကဲၪဎီးလၧကယဲဆၧလၧယဟိဝၩ ဒုၭနဲၪယၧၩအဂဲး အကၠီၪ့လီၫ."
		},
		"12": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ, စံၭဝ့ၫဒၪ.",
			"2": "<sup>2</sup> ၦၡၩအဖိၪခွၫဧ့, နအီၪအလးလၧၦဂံၪ့ဖိၪ, လၧအပိၩ့ ထၪ့ဒၪဆၧအကျၩလၧအမ့ၬၥၪအီၪဘဲၫၥိၭအမိဒၪဘၪ ဆၧတၭ,ဒၪဘၪဝ့ၫအ့ၬ. အီၪဝ့ၫလၧအနါဘဲၫၥိၭအမိနါ ဂၧၫ့ဆၧတၭ,နါဂၧၫ့အ့ၬ. အဂဲးဘဲၫယီၩမွဲၦဂံၪ့ဖိၪလၧ",
			"3": "<sup>3</sup> အပိၩ့ထၪ့ဒၪဆၧလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,နဝ့ၫဒၪၦ ၡၩအဖိၪခွၫဧ့, တဲၩ့ဝဲၩနဆၧဖိၪဆၧလံၩလၧနမိစဲၪ့ထၪ့ ခွံၬလၧခးဖၧၩ့အဂးတၭ, စဲၪ့ထၪ့လၧမုဆၫလခီၫလၧအ ဝ့ၫၥံၪအမ့ၬယၫဆံၭ. မွဲမၬ, နမိစဲၪ့ထၪ့ခွံၬ လၧနလး ထီၩ့လၧအလးလစီၪ့ဒၪလၧအဝ့ၫၥံၪအမ့ၬယၫလီၫ.မွဲၦ ဂံၪ့ဖိၪလၧအပိၩ့ထၪ့ဒၪဆၧလါနၫ့တၭ, ဘၪလဘၪ",
			"4": "<sup>4</sup> မိယိဆီၫ့မီၪ့ဆၧလီၫ.- ထီးနီၪလဖၧၫ့နဘၪဆိၬထၪ့ဆၧ ဖိၪဆၧလံၩလၧမုဆၫလခီၫလၧအဝ့ၫၥံၪအမ့ၬယၫ, ဘဲၫ ဆၧဖိၪဆၧလံၩလၧၦမိစဲၪ့ဝ့ၫအဂးအၥိၭနီၪတၭ, စဲၪ့ ထၪ့လၧမုဂၪလၩ့လၧအမ့ၬယၫ, ဘဲၫၦလၧအလ့ၩကဲၪ",
			"5": "<sup>5</sup> ဎီးအၥိၭနီၪဆံၭ.- ဘုၪ့ဖိးဂံၪ့အဒီၪ့လၧအဝ့ၫၥံၪအမ့ၬ",
			"6": "<sup>6</sup> ယၫတၭ,ဆိၬထၪ့ခွံၬဆၧထီးနီၪဆံၭ.- ဆိၬဆၧလၧန ခိၬထံၭခိၪလၧအမ့ၬယၫတၭ, ဆိၬထၪ့ဆၧလၧဆၧခံၭ လၩ့မံၭမူၭဆံၭ. ချႃၬဘံၭနမ့ၬ ဘဲၫၥိၭနထီးဒၪဘၪဂၪ့ ခိၪလဂ့ၩ,အဂဲးဘဲၫယီၩယအီၪက့ၪယူၭနၧၩလၧဆၧ မၩနဲၪ့လမံၩ့ လၧအံၫစရ့လၭအၡၩဂံၪ့ဖိၪအဂးလီၫ.",
			"7": "<sup>7</sup> တၭယမၩဘဲၫဆၧမၪလူၬယၧၩအၥိၭနီၪလီၫ. ယဂဲၫ ဆိၬယဆၧဖိၪဆၧလံၩလၧမုဆၫလခီၫ, ဘဲၫဆၧဖိၪဆၧ လံၩလၧၦစဲၪ့ထၪ့ခွံၬလၧခးဖၧၩ့ ဆိၬထၪ့ခွံၬဝ့ၫအၥိၭ နီၪတၭ,လၧမုဂၪလၩ့နီၪယဘုၪ့ဖိးအဒီၪ့ လၧယစူၪ တၭးယဆိၬထၪ့ခွံၬဆၧ လၧဆၧခံၭလၩ့မံၭမူၭတၭ, ယဆိၬဝ့ၫလၧယခိၬထံၭခိၪ လၧအဝ့ၫၥံၪအမ့ၬယၫ လီၫ.",
			"8": "<sup>8</sup> လၧမုဆဲၪ့ထၪ့နီၪ ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,",
			"9": "<sup>9</sup> စံၭဝ့ၫဒၪ,- ၦၡၩအဖိၪခွၫဧ့,အံၫစရ့လၭအၡၩဂံၪ့ဖိၪ, ၦဂံၪ့ဖိၪလၧအပိၩ့ထၪ့ဒၪဆၧနီၪ, စံၭနၧၩ,နမၩယူၭနီၫ",
			"10": "<sup>10</sup> လဲၪနီၪ,မွဲအ့ၬဧၪ.- နဘၪစံၭအဝ့ၫၥံၪ,ကဆါယဟိဝၩ စံၭဘဲၫယီၩ, ဆၧအွံၪဆၧယိၭယီၩဘၪဆဲၫ့လၧၦဒိၪဖၭ ဒိၪလၧယရုစလံၫ့အဖၧၩ့, ဒဲကယဲအံၫစရ့လၭ အၡၩ",
			"11": "<sup>11</sup> ဂံၪ့ဖိၪထီးအလူၬလၧအအီၪဝ့ၫလၧအဖၧၩ့လီၫ.- စံၭ, ယမွဲနၥံၪအဆၧမၩနဲၪ့လီၫ. ဘဲၫယမၩယူၭဆၧအၥိၭ နီၪ,ဆၧမိမၩနၥံၪဘဲၫနီၪအၥိၭလီၫ. အဝ့ၫၥံၪမိစဲၪ့ထၪ့",
			"12": "<sup>12</sup> ဝ့ၫတၭ,မိလ့ၩကဲၪဎီးလီၫ.- တၭၦဒိၪဖၭဒိၪအီၪလၧ အကျၩနီၪမိဘၪဆိၬဆၧလၧအခိၬထံၭခိၪ လၧဆၧခံၭ လၩ့မံၭမူၭတၭ, မိစဲၪ့ထၪ့လီၫ. အဝ့ၫၥံၪမိဘုၪ့ဖိးဂံၪ့အ ဒီၪ့တၭ,ဆိၬထၪ့ဆၧထီးနီၪလီၫ. အဝ့ၫဒၪမိချႃၬဘံၭ အမ့ၬဘဲၫၥိၭ အထီးဒၪဘၪဂၪ့ခိၪ လၧအမ့ၬၥၪလဂ့ၩ",
			"13": "<sup>13</sup> လီၫ.- ယမိခွံၬယၡၬလၧအဖၫ့ခိၪတၭ, အဝ့ၫဒၪမိဘၪ ယဖျံၩခွၩ့တၭ, ယမိဆိၬအဝ့ၫဒၪလၧဘၭဘလၧၫ့လၧ ၦခၫလဒံအၫဖိၪအခးတၭး မွဲအမိၥံၫလါနၫ့ထီးနီၪဒၪ",
			"14": "<sup>14</sup> ဘၪဝ့ၫအ့ၬ.- ယမိမၩပြံၩမၩပၩၦမၩဆၧၩ့အဝ့ၫအီၪ ဝၬဖီၩ့ဝ့ၫထီးအလူၬ ဒဲအၡၩအဒီၪ့လဖၪထီးအလူၬနီၪ လၧလံၩကိၭခီၫဒ့ၭအကျၩတၭ, ယမိဒုၭဖိၬအခဲၫ့လၧနၭ",
			"15": "<sup>15</sup> လဘံၪ့ဘံၪ့လီၫ.- တၭထီးယမၩပြံၩမၩပၩအဝ့ၫၥံၪ လၧၦဆၨၩလဖၪအကျၩ, ဒဲမၩလၩ့မုလၩ့ဖၭအဝ့ၫၥံၪ လၧခးလဖၪအကျၩနီၪ, မိၥ့ၪယၫဝ့ၫလၧယမွဲယဟိဝၩ",
			"16": "<sup>16</sup> လီၫ.- မွဲလါနၫ့တၭ,ယမိအီၪက့ၪလၩ့ထးၦနီၪၡၩဂၩ ၥံၪလၧအကျၩ, လၧအဖီၩ့ဖျ့ၭနၭၥံၪဖၩ့ၥံၪ,ဒဲဆၧၥၭဝံ လၩ့ဒိၩဒဲလၧဆၧၥံၫချဲၫ့နီၪ, ဘဲၫၥိၭအမိလီၩလၩ့လၬ လၩ့အဆၧၥၭလိၪထီးအလူၬ လၧၦဆၨၩလဖၪအကျၩ ထီးအလးလၧအဂဲၫဝ့ၫတၭ,အဝ့ၫၥံၪမိၥ့ၪယၫဝ့ၫလၧယ မွဲယဟိဝၩလီၫ.",
			"17": "<sup>17</sup> လၧနီၪအမ့ၬယၫ ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,",
			"18": "<sup>18</sup> စံၭဝ့ၫဒၪ,- ၦၡၩအဖိၪခွၫဧ့,အၪ့နကိၪလၧဆၧၥၭ မဲၪအဖၧၩ့တၭ, အီၩနထံၫလၧဆၧဝၭထိၬဒဲဆၧၥုၪ့ခိၥၭဝီၩ",
			"19": "<sup>19</sup> ဆံၭ.- စံၭခးအၡၩခမျၧးနီၪ,ကဆါယဟိဝၩစံၭဘဲၫယီၩ လၧၦယရုစလံၫ့ဖိၪ, ဒဲၦလၧခးအံၫစရ့လၭအဖၧၩ့, မိအၪ့အကိၪလၧဆၧထီးလၩ့အၥၭတၭ, မိအီၩအထံၫ လၧဆၧထီၫမံၫထီၫမၪ, ဘဲၫၥိၭအခးဒဲကယဲဆၧအီၪ လၧအဖၧၩ့ထီးအလူၬ မိအီၪယူလၧၦမၩဆီၪ့ဆၧ",
			"20": "<sup>20</sup> လၧအအီၪဝ့ၫ လၧအဖၧၩ့လဖၪနီၪအကၠီၩ့လီၫ.- တၭ ဆၧမိမၩလူၬထူၬဒိၩ့လဖၪ လၧၦၡၩအီၪဝ့ၫလၧအဖၧၩ့ နီၪတၭ,ခးမိအီၪယူဝ့ၫတၭး နၥံၪမိၥ့ၪယၫလၧယမွဲ ယဟိဝၩလီၫ.",
			"21": "<sup>21</sup> ယဟိဝၩ အလူလၩ့ဘၪယၧၩတၭ, စံၭဝ့ၫဒၪ,",
			"22": "<sup>22</sup> ၦၡၩအဖိၪခွၫဧ့, ဆၧချဲၩ့အဒီၩ့လၧအအီၪလၧနၥံၪ, လၧခးအံၫစရ့လၭအဖၧၩ့ လၧအစံၭမုနံၩလဖၪနီၪ ၥုၭ နံၩၥုၭၥၫ့တၭ, ကယဲဆၧဒၪဆၧလၧယၫလခီၫ ထီးအ",
			"23": "<sup>23</sup> လူၬ, လူၬဝ့ၫနီၪ, မွဲအစံၭဝ့ၫဘဲၫၥ့ၪလဲၪ.- မၩအၥၭဘဲၫ နီၪတၭ, စံၭအဝ့ၫၥံၪကဆါယဟိဝၩစံၭဘဲၫယီၩ, ဆၧ ချဲၩ့ဒီၩ့လထံၪနီၪယမိဒုၭထုၬတၭ,ၦချဲၩ့ဒီၩ့လၩ့လၧၩ့ဆၧ လၧအဝ့ၫနီၪလၧအံၫစရ့လၭအဖၧၩ့အ့ၬ. အ့ၪမွဲစံၭအဝ့ၫ ၥံၪ,မုနံၩလဖၪနီၪ, ဒဲဆၧဒၪဆၧလၧယၫလခီၫထီးအလူၬ",
			"24": "<sup>24</sup> အီၪဘူၭထၪ့ယူၭ.- အဂဲးဘဲၫယီၩဆၧဒၪဆၧလၧယၫ ပျီၩပျီၩ,ဒဲအၪ့ဖၩ့ဆၧလၧအချဲၩ့မုၬနါဝ့ၫနီၪ, အီၪလၧၩ့",
			"25": "<sup>25</sup> လၧအံၫစရ့လၭအဂံၪ့ဖၧၩ့အ့ၬ.- အဂဲးဘဲၫယီၩ ယမွဲ ယဟိဝၩယမိချဲၩ့ဆၧတၭ, ဆၧချဲၩ့လၧယမိချဲၩ့နီၪ, မိမၩအၥၭတၭ,ၥုၭနံၩၥုၭၥၫ့လၧၩ့အ့ၬ. အဂဲးဘဲၫယီၩၦဂံၪ့ ဖိၪလၧအပိၩ့ထၪ့ဆၧၥံၪဧ့, လၧနၥံၪအမုနံၩလဖၪအ ဖၧၩ့နီၪ,ယမိချဲၩ့ဆၧတၭ, ယမိမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့ ဝ့ၫ,ကဆါယဟိဝၩစံၭဝ့ၫဒၪ. ယဟိဝၩအလူလၩ့ဘၪဒီၭယၧၩတၭ,စံၭဝ့ၫဒၪ,",
			"26": "<sup>26</sup> ၦ ၡၩအဖိၪခွၫဧ့,ယိခွါ, အံၫစရ့လၭအၡၩဂံၪ့ဖိၪစံၭဝ့ၫဒၪ, ဆၧလၧအဒၪဝ့ၫလၧယၫလခီၫလမံၩ့နီၪ အီၪဝ့ၫလၧအၪ နံၩအၪၥၫ့လၧကဲခိၬအဂးလီၫ. အဝ့ၫဒၪချဲၩ့ဆၧလၧမီၪ အချိၬလၧအဆၧၫ့အထီ လၧအယံၬဝ့ၫအဂဲးအကၠီၪ့",
			"28": "<sup>28</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,စံၭအဝ့ၫၥံၪ,ကဆါယဟိ ဝၩစံၭဘဲၫယီၩ, ယဆၧချဲၩ့ၥံၪမိၥုၭနံၩၥုၭၥၫ့ နးဆံၭ အ့ၬ.အ့ၪမွဲဆၧချဲၩ့လၧယချဲၩ့ယူၭနီၪမိမၩအၥၭ, ကဆါ ယဟိဝၩစံၭဝ့ၫဒၪ."
		},
		"13": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၩ့ဘၪဒီၭယၧၩတၭ,စံၭဝ့ၫဒၪ, ၦ ၡၩအဖိၪခွၫဧ့, ချဲၩ့ဆၧလၧမီၪအချိၬထၫ့ဒၩအံၫစရ့လၭ အမီၪလဖၪလၧအချဲၩ့ဆၧလၧမီၪအချိၬတၭ, စံၭၦလၧ အချဲၩ့ဆၧလၧမီၪအချိၬ လၧအၥၭဒၪဝ့ၫအဖၧၩ့နီၪ, ခိၭ",
			"3": "<sup>3</sup> နၪယဟိဝၩအလူဆံၭ.- ကဆါယဟိဝၩစံၭဘဲၫယီၩ, မီၪအဂီၩ့ၥံၪလၧအလီၩ့အၥၭဒၪဝ့ၫတၭ, ဒၪဆၧလၧအ",
			"4": "<sup>4</sup> လမွဲဘၪဆၧနးမံၩ့နီၪ,ဘၪအၡၪ့လီၫ.- အံၫစရ့လၭဧ့, နမီၪလဖၪမၩအၥၭ ဘဲၫထွံၪမံၩ့လၧၡါမုနၧၫ့ဖၫအၥိၭ",
			"5": "<sup>5</sup> နီၪလီၫ.- နၥံၪလ့ၩထၪ့ဘၪလၧဆၧဘုၪ့ဖိးအလး, ဒဲမၩ ဖီၩ့ဝၬဖီၩ့အံၫစရ့လၭအဂံၪ့, ဘဲၫၥိၭအမိအီၪခၧၫ့လၧ ဆၧဒုၭၥုၭအဖၧၩ့ လၧယဟိဝၩအမုလနံၩအဖၧၩ့အ့ၬ.",
			"6": "<sup>6</sup> အဝ့ၫၥံၪနီၪဒၪဆၧလၧယၫလခီၫ, ဒဲအၪ့ဖၩ့ဆၧလၧအ အၪ့လီၫဝ့ၫတၭ, ယဟိဝၩလအၪ့မၧၫ့လၩ့ဘၪအခဲၫ့လါ နၫ့တၭ,စံၭ, ယဟိဝၩစံၭဝ့ၫဒၪ,နီၪလီၫ. တၭဒုၭယိလါ",
			"7": "<sup>7</sup> ၦၡၩအဆၧချဲၩ့မိမၩအၥၭလီၫ.- နၥံၪဒၪဆၧပျီၩပျီၩ လၧယၫလခီၫမွဲအ့ၬဧၪ. နၥံၪချဲၩ့ဆၧလၧအၪ့ဖၩ့ဆၧ လၧအအၪ့လီၫဝ့ၫအဂဲး,မွဲအ့ၬဧၪ. တၭလၧယလချဲၩ့",
			"8": "<sup>8</sup> ဘၪတၭ,နၥံၪစံၭ,ယဟိဝၩချဲၩ့ဆၧနီၪမွဲအ့ၬဧၪ.- မၩ အၥၭဘဲၫနီၪတၭ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ,မွဲနၥံၪချဲၩ့ ဆၧပျီၩပျီၩ, ဒဲဒၪဆၧပျီၩပျီၩတၭ, ယိခွါ, ယထၫ့ဒုၪဒၩ",
			"9": "<sup>9</sup> နၥံၪ,ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.- တၭယစူၪမိထၫ့ဒုၪဒၩ မီၪလၧအဒၪဆၧပျီၩပျီၩ, ဒဲအၪ့ဖၩ့ဆၧလၧအအၪ့လီၫ ဝ့ၫလီၫ. အဝ့ၫၥံၪအီၪဘၪလၧယၡၩခမျၧးအကျၩအ့ၬ. ဒဲဆၧဆ့ၭလၩ့အမံၩ့လၧအံၫစရ့လၭအလံၬဖၧၩ့နီၪဆ့ အ့ၬ.တၭအဝ့ၫၥံၪလ့ၩနုၬဘၪ လၧခးအံၫစရ့လၭအ ဖၧၩ့ဆ့အ့ၬ. တၭနၥံၪမိၥ့ၪယၫလၧယမွဲကဆါယဟိ ဝၩလီၫ.",
			"10": "<sup>10</sup> အဂဲးဘဲၫယီၩ,မွဲမၬ, အဂဲးဘဲၫယီၩနၥံၪမၩဂၭဂီၩ့ ယၡၩခမျၧးလၧဆၧလဲးဆၧဘျၪအဖၧၩ့တၭ, စံၭဆၧ ဘၪလိၬအိၭလိၬအီၪဝ့ၫလီၫ. တၭဆၧဘၪလိၬအိၭလိၬ အီၪအ့ၬ,တၭၦလဂၩမၩထၪ့ဆၧအဒီၪ့တၭ,ယိခွါ, ၦ",
			"11": "<sup>11</sup> ဂူၫဂၩလဖၪဂုၪဝ့ၫလၧအၩ့ကထၨလဘုၭဘၪလီၫ.- စံၭ ၦလၧအဂုၪဝ့ၫလၧအၩ့ကထၨလဘုၭဘၪနီၪ, လၧအ ဆၧမိလၩ့ဎီးနီၪဆံၭ. ဆၧမိဂဲၫဆၧၩ့လုၬဘံၭဆၧတၭး မုၥၪဖၭဒိၪလဖၪဧ့, နၥံၪမိလၩ့ထ့ၬတၭ,လံၩမုမိမၩထ့",
			"12": "<sup>12</sup> ဖၭဝ့ၫလီၫ.- ယိခွါ,ထီးနၥံၪအဆၧဒီၪ့လၩ့ဎီးတၭ, ၦ ၡၩမိစံၭနၥံၪ, လၧဆၧဂုၪဆၧလၧနၥံၪဂုၪဝ့ၫနီၪ, မွဲအ",
			"13": "<sup>13</sup> အီၪခီၫခီၫလဲၪ,မွဲအ့ၬဧၪ.- မၩအၥၭဘဲၫနီၪတၭ,ကဆါ ယဟိဝၩစံၭဘဲၫယီၩ, ယမိမၩထ့ဖၭအဝ့ၫလၧလံၩမု လၧယၥၭခဲၩထၪ့တၭ, ဆၧမိဂဲၫဆၧၩ့လုၬဘံၭဆၧလၧ ယၥၭထၪ့တၭ,မုၥၪဖၭဒိၪမိမၩလူၬဝ့ၫ လၧယၥၭခဲၩ",
			"14": "<sup>14</sup> ထၪ့လီၫ.- ယမိမၩလၩ့ဎီးဆၧအဒီၪ့လၧနၥံၪဂုၪဝ့ၫလၧ အၩ့ကထၨလဘုၭဘၪတၭ, ဒုၭလၩ့ဒၩအဝ့ၫလၧဂၪ့ ခိၪလီၩ့တၭ, အခၪ့ထံၭမိအီၪဖျီၪထၪ့လီၫ.မိလၩ့ဎီးဝ့ၫ တၭ,နၥံၪမိလူၬလၧအၥၭကျၩတၭ, နၥံၪမိၥ့ၪယၫလၧ",
			"15": "<sup>15</sup> ယမွဲယဟိဝၩလီၫ.- ဘဲၫနီၪၥိၭယမိမၩလူၬယၥၭခဲၩ ထၪ့လၧဆၧအဒီၪ့အလီၩ့, ဒဲလၧၦလၧအဂုၪဝ့ၫလၧအၩ့ ကထၨလဘုၭဘၪလဖၪအလီၩ့တၭ, ယမိစံၭနၥံၪ,ဆၧ အဒီၪ့မွဲဂ့ၩ, ၦလၧအဂုၪဝ့ၫလၧအၩ့ကထၨလဘုၭဘၪ",
			"16": "<sup>16</sup> မွဲဂ့ၩ,အီၪလၧၩ့အ့ၬ.- ဘဲၫၦစံၭဆၧအၥိၭ,အံၫစရ့လၭ အမီၪလဖၪလၧအချဲၩ့ဆၧလၧမီၪအချိၬ လၧယရုစလံၫ့ အဂဲးအကၠီၪ့လၧအဒၪဆၧဘၪလိၬအိၭလိၬ လၧအဂး တၭ,ဆၧဘၪလိၬအိၭလိၬအီၪလၧအဂးအ့ၬ. ကဆါ ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"17": "<sup>17</sup> ဘဲၫနီၪၥိၭဆ့နဝ့ၫဒၪ, ၦၡၩအဖိၪခွၫဧ့, အီၪက့ၪနမ့ၬ ထၫ့ဒၩနၡၩခမျၧးအဖိၪမုၪၥံၪ လၧအချဲၩ့ဆၧလၧမီၪအ ချိၬလၧအၥၭဒၪဝ့ၫအဖၧၩ့, ဒဲနဝ့ၫဒၪချဲၩ့ဆၧလၧမီၪအ",
			"18": "<sup>18</sup> ချိၬထၫ့ဒၩအဝ့ၫၥံၪ,- တၭစံၭအဝ့ၫၥံၪ, ယဟိဝၩစံၭဘဲၫ ယီၩ,ၦမုၪလၧအဆၭခိၪခုၪ့ၥံၪ လၧၦကၠႃၪ့အၥၭအဂး, ဒဲဆၧချႃၬဘံၭမ့ၬဘၪဆဲၫ့ လၧကိၭဂၩဒ့ၭအခံးအဂၩ့နီၪ မိဘၪအၡၪ့လီၫၬ မွဲနၥံၪမိအၪ့ဎၬမၩဂၭဂီၩ့ယၡၩခမျၧး နီၪတၭ,အီၪက့ၪမၧၫ့နၥံၪအနၫ့ဆါဒၪ နၥံၪဝ့ၫဆ့ဧၪ.",
			"19": "<sup>19</sup> မွဲနၥံၪမၩၥံၫၦအၥၭ လၧအလကြၨၭၥံၫဘၪတၭ, ဒုၭ မၧၫ့ဒံၭၦအၥၭလၧအလကြၨၭမၧၫ့ဘၪ, မွဲနၥံၪချဲၩ့ဆၧ ကဘျံၭကဘျၪ လၧယၡၩခမျၧးလၧအခိၭနၪ နၥံၪအ ဆၧချဲၩ့ဘျံၭချဲၩ့ဘျၪအကၠီၩ့တၭ, နၥံၪမိမၩဘၪၥၭလိၪ ယၧၩလၧယၡၩခမျၧးအကျၩ, လၧဘုၪမုယီၩအထီၩ့ ဒူၪလဖၪအဂး, ဒဲလၧကိၪအလီၪ့လဖၪအဂးဆ့ဧၪ.",
			"20": "<sup>20</sup> မၩအၥၭဘဲၫနီၪတၭ, ကဆါယဟိဝၩစံၭဘဲၫယီၩ,ယိ ခွါ,ယထၫ့ဒၩခိၪခုၪ့နီၪ လၧနၥံၪအီၪလၧအလီၩ့ခိၭၥူၪ အၪ့လွ့ၫၦၡၩလၧဆၧဂၭဂီၩ့အဂးနီၪး ဘဲၫၥိၭအမိဖီၩ့ ဖျ့ၭနၥံၪတၭ,ယမိထုၭထၪ့ခွံၬခိၪခုၪ့နီၪ လၧနၥံၪအစူၪ ဒဲယမိမၩဖီၩ့မၩဖျ့ၭၦၥၭလဖၪ လၧနၥံၪအၪ့လံၬဝ့ၫ",
			"21": "<sup>21</sup> တၭ,အဝ့ၫၥံၪမိဖီၩ့ဖျ့ၭနၥံၪလီၫ.- ယမိထုၭထၪ့ခွံၬဆ့ နၥံၪအခိၪခုၪ့လဖၪနီၪတၭ, မၩဖီၩ့မၩဖျ့ၭယၡၩခမျၧး လၧနၥံၪအစူၪဖၧၩ့တၭး အဝ့ၫၥံၪအီၪလၧၩ့လၧနၥံၪအ စူၪဖၧၩ့အ့ၬ. ဘဲၫၥိၭနၥံၪထီးအၪ့လံၬလၧၩ့အဝ့ၫၥံၪလ",
			"22": "<sup>22</sup> ဂ့ၩတၭ,နၥံၪမိၥ့ၪယၫလၧယမွဲယဟိဝၩလီၫ.- အဂဲး ဘဲၫယီၩလၧဆၧချဲၩ့ဘျံၭချဲၩ့ဘျၪအကၠီၩ့နီၪ, နၥံၪဒုၭ ၥုၪ့အုၭၥၭအုၭၦအတီၩအလီၩ့ လၧယလဒုၭၥၭအုၭ ဘၪတၭ,မွဲနၥံၪလီၩဘၪၦလတီၩလလီၩ့ဘၪလၧအမိ မၧၫ့ဝ့ၫအကၠီၩ့နီၪ, နၥံၪမၩဆီၪ့ထၪ့အစူၪဘဲၫၥိၭအထီး ကၠၪခွံၬအၥၭ လၧအဖၧၩ့ၥၭ လတီၩလလီၩ့ဘၪနီၪလ",
			"23": "<sup>23</sup> ဂ့ၩတၭး- မၩအၥၭဘဲၫနီၪတၭ,နၥံၪမိဒၪလၧၩ့ဆၧပျီၩ ပျီၩအ့ၬးဒဲမိအၪ့ဖၩ့လၧၩ့ဆၧနးမံၩ့အ့ၬ. အဂဲးဘဲၫ ယီၩယမိမၩဖီၩ့မၩဖျ့ၭယၡၩခမျၧးလၧနၥံၪအစူၪဖၧၩ့ တၭ,နၥံၪမိၥ့ၪယၫလၧယမွဲယဟိဝၩလီၫ."
		},
		"14": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့ ၦလၧအံၫစရ့လၭအၥုၪ့က့ၭၥၭၡါအ ကျၩလနၩ့ဂဲၫလၧယအီၪတၭ, ဆၧၫ့နၩ့လၧယမ့ၬယၫ",
			"2": "<sup>2</sup> လီၫ.- တၭယဟိဝၩအလူလၩ့ဘၪယၧၩ, စံၭဝ့ၫဒၪ,",
			"3": "<sup>3</sup> ၦၡၩအဖိၪခွၫဧ့, ၦၡၩလဖၪယီၩအီၪက့ၪယူၭဆၧဂၩ့ ဆၧဖၪ့လၧအၥၭခံဖၧၩ့တၭ, အီၪက့ၪယူၭအဆၧဒဲၩ ဘၭအဆၧဘၪထၧၩ့အလး လၧအဝ့ၫၥံၪအမ့ၬယၫ ယူၭ.ထီးအဝ့ၫၥံၪအ့ၪအၪ့စၪ့ဆၧလၧယၧၩတၭ, မွဲယ",
			"4": "<sup>4</sup> မိခိၭနၪအလူဆ့ဧၪ.- မၩအၥၭဘဲၫနီၪတၭ,ချဲၩ့ဆၧလၧ အဝ့ၫၥံၪတၭ, စံၭအဝ့ၫၥံၪ, ကဆါယဟိဝၩစံၭဘဲၫ ယီၩ,ၦလဂၩဂၩလၧအံၫစရ့လၭအၡၩဂံၪ့ဖိၪအကျၩ လၧအအီၪက့ၪဆၧဂၩ့ လၧအၥၭခံဖၧၩ့ ဒဲအီၪက့ၪအ ဆၧဒဲၩဘၭအဆၧဘၪထၧၩ့အလး လၧအမ့ၬယၫတၭ, ဂဲၫဝ့ၫလၧမီၪအအီၪနီၪ, ယၧၩယဟိဝၩယီၩ, မိစံၭဆၧၫ့",
			"5": "<sup>5</sup> အဝ့ၫဘဲၫအဆၧဂၩ့အၪဒုၩအၥိၭနီၪ,- ဘဲၫၥိၭယမိမၩ န့အံၫစရ့လၭအၡၩဂံၪ့ဖိၪ လၧအၥၭဒၪဝ့ၫး အဂဲးဘဲၫ ယီၩလၧဆၧဂၩ့ၥံၪအကၠီၩ့နီၪ, အဝ့ၫၥံၪကိၭဂၩဒ့ၭကဲၪ ထၪ့ဝ့ၫလၧၦလခီၫဘၩ့မုးဖိၪ လၧယမ့ၬယၫလီၫ.",
			"6": "<sup>6</sup> မၩအၥၭဘဲၫနီၪတၭ, စံၭအံၫစရ့လၭအၡၩဂံၪ့ဖိၪ, ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ကၠၪခွံၬနၥံၪအၥၭ, ကၠၪခွံၬ နၥံၪအၥၭ လၧနၥံၪအဆၧဂၩ့ၥံၪ,ဒဲကၠၪခွံၬနၥံၪအမ့ၬ",
			"7": "<sup>7</sup> လၧနၥံၪအဆၧၥၭလိၪလဖၪ အအီၪဆံၭ.- အဂဲးဘဲၫ ယီၩၦလဂၩဂၩလၧအံၫစရ့လၭ အၡၩဂံၪ့ဖိၪအကျၩ, ဒဲလၧၦလခီၫဘၩ့မုးဖိၪလၧအအီၪလၧၦအံၫစရ့လၭ ဖိၪအကျၩလၧအမၩ လၩ့မုလၩ့ဖၭ လၩ့အၥၭလၧ ယၧၩ,ဒဲအီၪက့ၪဆၧဂၩ့ၥံၪလၧအၥၭခံဖၧၩ့ ဒဲအီၪက့ၪ ဆၧဒဲၩဘၭအဆၧဘၪထၧၩ့အလးလၧအမ့ၬယၫ,ဒဲဂဲၫ ဝ့ၫလၧမီၪအအီၪ ဘဲၫၥိၭအမိအၪ့စၪ့ဆၧလၧယၧၩနီၪ, ယၧၩယဟိဝၩယီၩ ယမိစံၭဆၧၫ့အဝ့ၫ လၧယနၫ့ဆါ",
			"8": "<sup>8</sup> ဒၪယဝ့ၫလီၫ.- ယမိအီၪက့ၪယမ့ၬထၫ့ဒုၪဒၩ ၦလဂၩ နီၪတၭ, ယမိအီၪက့ၪၦလဂၩနီၪလၧဆၧမၩနဲၪ့, ဒဲဆၧ ချဲၩ့ဒီၩ့အလးတၭ, ယမိဒၪ့ထ့ၬခွံၬအဝ့ၫ လၧယၡၩ ခမျၧးအကျၩတၭ, နၥံၪမိၥ့ၪယၫ လၧယမွဲယဟိဝၩ",
			"9": "<sup>9</sup> လီၫ.- မီၪလဂၩထီးအချဲၩ့ဆၧတၭ,ဘၪဆၧအၪ့လီၫဝ့ၫ တၭ,ယၧၩယဟိဝၩယီၩ ယအၪ့လီၫန့ယူၭမီၪလဂၩ နီၪ,ယမိယၩ့ထၪ့ယစူၪလၧအလီၩ့ ဒဲမၩဂၭဂီၩ့အဝ့ၫ",
			"10": "<sup>10</sup> လၧယၡၩခမျၧးအံၫစရ့လၭအကျၩလီၫ.- တၭအဝ့ၫ ၥံၪမိဘၪထိးအဆၧဒဲၩဘၭနီၪး မီၪမိဘၪထိးဆၧဒဲၩ ဘၭ,ဘဲၫၦလၧအအၪ့စၪ့ဆၧ လၧအဝ့ၫဘၪထိးဆၧဒဲၩ",
			"11": "<sup>11</sup> ဘၭအၥိၭနီၪ,- ဘဲၫၥိၭအံၫစရ့လၭအၡၩဂံၪ့ဖိၪထီး ဂၭဖျိၭလၧၩ့လၧယအီၪလဂ့ၩတၭ, ဘဲၫၥိၭအထီးဘၪ လၧၩ့ဘၪ ဆၧၥၭလိၪလၧအမၩမၪဆၧထီးအလူၬအ ဖၧၩ့လဂ့ၩး မွဲဘဲၫၥိၭအမိကဲၪထၪ့ယၡၩခမျၧးတၭ, ယ မိကဲၪထၪ့အဝ့ၫၥံၪအယွၩ, ကဆါယဟိဝၩ စံၭဝ့ၫဒၪ.",
			"12": "<sup>12</sup> ယဟိဝၩအလူလၩ့ဘၪဒီၭယၧၩတၭ, စံၭဝ့ၫဒၪ,",
			"13": "<sup>13</sup> ၦၡၩအဖိၪခွၫဧ့,ထီးခးလဘံၪ့အ့ၪမၩဆၧဒဲၩဘၭ, ဒဲ မၩမၪဘၪယၧၩနၭနၭလ့ၬတၭ, ယမိယၩ့ထၪ့ယစူၪ လၧအဖၫ့ခိၪတၭ, ယမိမၩခါ အကိၪအနိၪထိၭဘီၩ့ တၭ,ယမိအၪ့မၧၫ့လၩ့ ဆၧၥၭဝံလၩ့ဒိၩ လၧအအီၪ တၭ,ယမိဒၪ့ထ့ၬခွံၬၦၡၩ ဒဲဆၧဖိၪဆၧဎါလၧအဖၧၩ့",
			"14": "<sup>14</sup> တၭ,- စနိအၫ,ဒဲစဒၫ့နအ့လၭ, ဒဲစယိဘၭၥၧၫ့ဂၩနီၪ အ့ၪအီၪလၧအဖၧၩ့လါနၫ့တၭ, အဝ့ၫၥံၪမိမၩဖီၩ့ဖျ့ၭ န့ၫအၥၭမၧၫ့ဒၪဝ့ၫလၧအဆၧတီၩဆၧလီၩ့အကၠီၩ့, က ဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"15": "<sup>15</sup> ထီးယအ့ၪအၪ့မၧၫ့ ဆၧဖိၪဆၧဎါအဒဲၩ့ခၫ့ဂၬထံၫ ၥံၪခးၥံၪနီၪတၭ, အဝ့ၫၥံၪမၩဂၭဂီၩ့ဝ့ၫ, ဒဲအအီၪယူ ဝ့ၫထီးၦၡၩလခၫ့ဂၬဘၪဝ့ၫ လၧဆၧဖိၪဆၧဎါအကၠီၩ့",
			"16": "<sup>16</sup> တၭ,- ၦၥၧၫ့ဂၩနီၪ အ့ၪအီၪဝ့ၫလၧအဖၧၩ့လါနၫ့တၭ, ယမၧၫ့ယဝ့ၫ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ,ဖိၪမုၪၥံၪမွဲဂ့ၩ, ဖိၪခွၫၥံၪမွဲဂ့ၩ, ၦၡၩနီၪ မၩဖီၩ့မၩဖျ့ၭ ၥ့ၪနးဂၩအ့ၬ, မၩဖီၩ့န့ၫအနၫ့ဆါဒၪဝ့ၫလီၫ. တၭအခးနီၪမိအီၪယူဝ့ၫ လီၫ.",
			"17": "<sup>17</sup> ထီးယအ့ၪဒုၭဂဲၫဘၪခးနီၪ လၧနၭလဘံၪ့တၭ,စံၭ, နၭဧ့,လ့ၩခၫ့ဂၬခးနီၪဆံၭ. တၭယမိဒၪ့ထ့ၬခွံၬၦၡၩ",
			"18": "<sup>18</sup> ဆၧဖိၪဆၧဎါလၧအဖၧၩ့တၭ,- ၦၥၧၫ့ဂၩနီၪအ့ၪအီၪ လၧအဖၧၩ့လါနၫ့တၭ, ယမၧၫ့ယဝ့ၫ,ကဆါယဟိဝၩ စံၭဝ့ၫဒၪ, ဖိၪမုၪၥံၪမွဲဂ့ၩ, ဖိၪခွၫၥံၪမွဲဂ့ၩ, ၦၡၩနီၪမၩ ဖီၩ့မၩဖျ့ၭဘၪအ့ၬ. မိဖီၩ့ဖျ့ၭန့ၫအဝ့ၫၥံၪ အနၫ့ဆါဒၪ ဝ့ၫနီၪလီၫ.",
			"19": "<sup>19</sup> ထီးယအ့ၪအၪ့မၧၫ့လၩ့ဆၧၥံၫချဲၫ့ လၧခးနီၪအဖၧၩ့, ဒဲလူၫလၩ့ယၥၭခဲၩထၪ့လၧဆၧၥွံၪအဖၫ့ခိၪ, ဘဲၫၥိၭ ယမိဒၪ့ထ့ၬခွံၬၦၡၩ ဒဲဆၧဖိၪဆၧဎါလၧအဖၧၩ့တၭ,",
			"20": "<sup>20</sup> စနိအၫ,ဒဲစဒၫ့နအ့လၭ, ဒဲစယိဘၭအ့ၪအီၪလၧအဖၧၩ့ လါနၫ့, ယမၧၫ့ယဝ့ၫ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ, ဖိၪမုၪ ၥံၪမွဲဂ့ၩ,အဖိၪခွၫၥံၪမွဲဂ့ၩ, ၦၡၩနီၪမၩဖီၩ့မၩဖျ့ၭအ့ၬ, မိမၩဖီၩ့မၩဖျ့ၭလၧအဆၧတီၩဆၧလီၩ့အကၠီၩ့ န့ၫအ",
			"21": "<sup>21</sup> ဝ့ၫၥံၪအနၫ့ဆါဒၪဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ကဆါ ယဟိဝၩ,စံၭဝ့ၫဘဲၫယီၩ, ထီးယအ့ၪအၪ့မၧၫ့လၩ့ယ ဆၧစ့ၩရၫ့အၧၩ့လံမံၩ့ လၧယရုစလံၫ့အဖၫ့ခိၪနၭၥံၪဖၩ့ ၥံၪ,ဒဲဆၧၥၭဝံလၩ့ဒိၩ,ဒဲဆၧဖိၪဆၧဎါအဒဲၩ့,ဒဲဆၧၥံၫ ချဲၫ့ဘဲၫၥိၭအမိဒၪ့ထ့ၬခွံၬၦၡၩ ဒဲဆၧဖိၪဆၧဎါလၧအ",
			"22": "<sup>22</sup> ဖၧၩ့,မွဲနၭနဲၪ့ဒံၭအနီၪဆံၭအၪလဲၪး- မွဲလါနၫ့ဘဲၫနီၪ တၭ,ယိခွါ,ဆၧမိအီၪက့ၪလၩ့ထးၦလၧအမိဖီၩ့ဖျ့ၭလ နၩ့လၧအဖၧၩ့တၭ,ဆၧမိဒုၭစဲၪ့ထၪ့အဝ့ၫ, ၦမုၪၥံၪဒဲၦ ခွၫၥံၪလီၫ. ယိခွါ,အဝ့ၫၥံၪမိဂဲၫထၪ့ လၧနၥံၪအအီၪ တၭ,နၥံၪမိဒၪဘၪအဖၧၩ့ၥၭ ဒဲအမၩဆၧတၭ, နၥံၪမိ ဘၪဆၧမၩမုၬထၪ့ထဲၩ့ နၥံၪလၧဆၧအၧၩ့အဂဲးအကၠီၪ့ လၧယဒုၭဂဲၫဘၪယရုစလံၫ့, လၧကယဲဆၧလၧယဒုၭ",
			"23": "<sup>23</sup> ဂဲၫဘၪဝ့ၫအဂဲးအကၠီၪ့လီၫ.- ထီးနၥံၪအ့ၪဒၪဘၪအဝ့ၫ ၥံၪအဖၧၩ့ၥၭ ဒဲအမၩဆၧတၭ, မိမၩမုၬထၪ့ထဲၩ့နၥံၪ အၥၭတၭ, နၥံၪမိၥ့ၪယၫလၧယမၩအဝ့ၫလၧဆၧထီး အလူၬတၭ, မွဲအဂဲးလအီၪဘၪလၧယမၩနီၪမွဲအ့ၬ. ကဆါယဟိဝၩစံၭဝ့ၫဒၪ."
		},
		"15": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ, စံၭဝ့ၫဒၪ, ၦၡၩအဖိၪခွၫဧ့, စဘံၭမုအၥံၪ့ဂ့ၩနဲၪ့ၥံၪ့အဂူၫဂၩ လၧ ဆၧနီၪလဲၪ. မွဲၥံၪ့ထဲၩ့လၧၥံၪ့ၥံၪလၧၡါမုနၧၫ့ဖၫအကျၩ",
			"3": "<sup>3</sup> နီၪမွဲအ့ၬဧၪ.- ၦၡၩမိမၩန့အၥံၪ့ ဘဲၫၥိၭအမိတဲၩ့ဆၧလ မံၩ့မံၩ့လၧအဝ့ၫဆ့ဧၪ. ၦမိမၩန့နိၪစဲၩလဘီၩ့ လၧအ ဖၧၩ့ဘဲၫၥိၭအဘျၭထၪ့ဆၧလမံၩ့မံၩ့ လၧအလီၩ့ဆ့",
			"4": "<sup>4</sup> ဧၪ.- ယိခွါ,ၦဖျႃၭလၩ့ဝ့ၫလၧၥံၪ့မုအဂးလၧမ့ၪကျၩ တၭ,မ့ၪအၪ့ခွံၬအထိၭနၫနံၫခီၫလူၬ ဒဲအၥၭကျၩနီၪ ခိဎီၩဆ့လီၫ.အနီၪတၭ, ဂ့ၩဝ့ၫဘၪဝ့ၫလၧတဲၩ့ဆၧလ",
			"5": "<sup>5</sup> မံၩ့မံၩ့အဂးဆ့ဧၪ.- ယိခွါ, လၧအအီၪထၧၫ့ဘီၩ့ယၫနီၪ ဂ့ၩလၧတဲၩ့ဆၧနးမံၩ့အ့ၬး ထီးမ့ၪအၪ့ခွံၬ,ဒဲခိဎီၩဝ့ၫ နီၪ,မိဂ့ၩမိဘၪလၧတဲၩ့ဆၧလမံၩ့မံၩ့အဂး ဘဲၫၥ့ၪလဲၪၬ",
			"6": "<sup>6</sup> မၩအၥၭဘဲၫနီၪတၭ, ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ဘဲၫစဘံၭမုအၥံၪ့ လၧၥံၪ့ၥံၪဝၪၥံၪ လၧၡါမုနၧၫ့ဖၫအ ကျၩလၧယဖ့ၪလၫ့ဝ့ၫ လၧမ့ၪလၧၥံၪ့မုအဂးအၥိၭနီၪ,",
			"7": "<sup>7</sup> ယမိဖ့ၪလၫ့ခွံၬၦယရုစလံၫ့ဖိၪဘဲၫနီၪၥိၭလီၫ.- မွဲမၬ, ယမိအီၪက့ၪယမ့ၬထၫ့ဒၩအဝ့ၫၥံၪတၭ, အဝ့ၫၥံၪမိစဲၪ့ ထၪ့ခွံၬလၧမ့ၪအီၪလစီၪ့တၭ, မ့ၪလစီၪ့ဒၪနီၪမိအၪ့ခွံၬ ဝ့ၫဒၪလီၫ. ထီးယအ့ၪအီၪက့ၪယမ့ၬထၫ့ဒၩ အဝ့ၫၥံၪ",
			"8": "<sup>8</sup> တၭ,နၥံၪမိၥ့ၪယၫလၧယမွဲယဟိဝၩလီၫ.- ယမိမၩ ယူထံၫၥံၪခးၥံၪနီၪ လၧအမၩမၪဆၧနၭနၭလ့ၬအကၠီၩ့, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ."
		},
		"16": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၩ့ဘၪဒီၭယၧၩတၭ, စံၭဝ့ၫဒၪ,",
			"2": "<sup>2</sup> ၦၡၩအဖိၪခွၫဧ့, ဒုၭၥ့ၪယၫယရုစလံၫ့လၧအဆၧၥၭ",
			"3": "<sup>3</sup> လိၪလဖၪ,- တၭစံၭ,ကဆါယဟိဝၩစံၭ,ယရုစလံၫ့ဘဲၫ ယီၩ, နအီၪအလးလၧအခၪ့ထံၭး ဒဲနအီၪဖျဲၪအလးနီၪ, မွဲခးကၫနအၫ့လီၫ. နဖါမွဲၦအၫမိၫဖိၪ,ဒဲနမိမွဲၦဟံၥၭ",
			"4": "<sup>4</sup> ဖိၪလီၫ.- ဆၧလၧနအီၪဖျဲၪအမုနံၩနီၪ ဆၧလကူၭထ့ၬ ဘၪနဒ့ၩလၧမုလနံၩလၧနအီၪဖျဲၪနီၪ, ဆၧၥူၫဝၭဆံၫ့ နၧၩလၧထံၫလၧနဆံၫ့ထၪ့အ့ၬ. ဆၧလဎွံၪဘၪနၧၩလၧ ထံၫလၪတၭ, ဆၧဘီၪ့ထၪ့နၧၩလၧဆၧယၬဘီၪ့ဆၧနီၪ",
			"5": "<sup>5</sup> ဆ့အ့ၬ.- ဆၧအမ့ၬၥၪလလီၫ့ကီၩ့ဘၪနၧၩ, ထီးအမိ ယၫ့ၥၭနၧၩ, ဘဲၫၥိၭအမိမၩဆၧလမံၩ့မံၩ့နီၪလၧနဂး အ့ၪမွဲလၧမုလနံၩ လၧနအီၪဖျဲၪနီၪ ဆၧခွံၬၡိၭခွံၬနၧၩ လၧဆၧပျၩ့ဖၧၩ့ ထီးနၥၭလိၪလၩ့ နနၫ့ဆါဒၪနဝ့ၫလီၫ.",
			"6": "<sup>6</sup> ထီးယလ့ၩဖီၩ့ခွံၬနၧၩတၭ, ယဒၪဘၪနၧၩလၧနဘၪ ဆၧစံၪစၪ လၧနၥွံၪဒၪနဝ့ၫအဖၧၩ့တၭ,လၧနအီၪလၧန ၥွံၪဒၪနဝ့ၫအဖၧၩ့နီၪ,ယစံၭနၧၩ,မၧၫ့ဆံၭ. မွဲမၬ,ယစံၭ",
			"7": "<sup>7</sup> နၧၩလၧနအီၪလၧနၥွံၪဖၧၩ့နီၪ,မၧၫ့ဆံၭ.- ယဒုၭအၪ ထၪ့ယူၭနၧၩအထီၫ့ၥံၪ ဘဲၫဆၧအမဲၪထၪ့လၧမံၩ့လၬ ကျၩအၥိၭနီၪတၭး နဒိၪထၪ့ ဒဲနဂၩ့ထီၫထၪ့တၭ, န ကဲၪထၪ့ဝ့ၫ ၦအီၪလၧအဎံၫအလၩလၩ့မဲၩဒၪဆၧလီၫ. နနူဒိၭထၪ့ဒဲနခိၪၥူၫထီၫထၪ့တၭ, အ့ၪမွဲနအီၪဘိၪ့နီၪ,",
			"8": "<sup>8</sup> နကီၩ့နၥိၭအီၪအ့ၬ.- ထီးယလ့ၩဖီၩ့ခွံၬနၧၩနီၪ ယဒၪ ဘၪနၧၩတၭ, ယိခွါ,နဆၧၫ့နထီမွဲဆၧအဲၪအဆၧၫ့အ ထီလီၫ. ယဒၩလၩ့ယဖၬဘဲၩ့လၧနလီၩ့ ဒဲချႃၬဘံၭန ဆၧအီၪဘိၪ့တၭ, ယဆိၪလၩ့ယၥၭလၧနၧၩ, ဒဲယအုၩ့ လၩ့ဆၧလၧနၧၩတၭ, နကဲၪထၪ့ယဆၧ, ကဆါယဟိ",
			"9": "<sup>9</sup> ဝၩစံၭဝ့ၫဒၪ.- ထီးနီၪလဖၧၫ့ ယၥူၫဝၭနၧၩ လၧထံၫး မွဲမၬ,ယၥူၫဝၭဆံၫ့ခွံၬနၥွံၪလၧနလီၩ့ဆံၫ့တၭ, ယဂုၪ",
			"10": "<sup>10</sup> နၧၩလၧၥိၪလီၫ.- ယဒုၭကီၩ့ၥိၭနၧၩ လၧဆၧကီၩ့ဆၧ ၥိၭဆၭကံၪအၥၭ ဒဲဖျၪ့နခၪ့လၧခၪ့ဖံၭဆၧဖံၭ, ဒဲယခဲး ထူၬနယးဒံၩ့ လၧဆၧဘွၩဖျ့ၪလံၬကံၭ ယဒုၭလုၬဘံၭ",
			"11": "<sup>11</sup> နၧၩလၧထိလီၫ.- ယအီၪက့ၪကယၧၩ့နၧၩ လၧဆၧက ယၧၩ့ကယီၫတၭ, ယဒုၭၥိၭနစူၪလၧထဲၩ့ဎွံၪ, ဒဲယဒုၭ",
			"12": "<sup>12</sup> လံၬနခိၬလၧၥွ့ၫ,- ဒဲယဒုၭထူထၪ့နၧၩလၧနၫခွၩ့,ဒဲယ ဒုၭဒံၭထၪ့နၧၩလၧနါဒံၭ, ဒဲယဒုၭချႃၬနၧၩလၧၥရဖူၩအ",
			"13": "<sup>13</sup> ဎံၫအလၩလီၫ.- နဘၪယူၭဆၧအီၪက့ၪကယၧၩ့ကယီၫ နၧၩ လၧထီၫ့ၥံၪလွ့ၫၥံၪကျိၪၥံၪစ့ၩၥံၪတၭ, နကီၩ့နၥိၭ မွဲဆၧဘွၩဖျ့ၫလံၬကံၭဒဲထိ, ဒဲဆၧဆၭကံၪအၥၭလီၫ. နအၪ့ကိၪအမုၬ, ဒဲန့ၫစၩ့,ဒဲၥိၪ,နဎံၫနလၩဂ့ၩမၬလီၫ. တၭနဘီၪထၪ့ယီၫထၪ့ ထီးနကဲၪထၪ့နးဎွၩမုၪလီၫ.",
			"14": "<sup>14</sup> နမံၩ့ဂၧၫ့ထၪ့ၥၩလၩ့လၧနဎံၫနလၩအကၠီၩ့ လၧၦဆၨၩ လဖၪအကျၩလီၫ. အဂဲးဘဲၫယီၩမွဲအလၧၫ့အဎွ့ၩလၧ ဆၧအဂ့ၩအဘၪလၧယအီၪက့ၪ လၧနလီၩ့အကၠီၩ့နီၪ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"15": "<sup>15</sup> မွဲလါနၫ့တၭ, နဒိၭနဲၩ့နၥၭလၧနဎံၫနလၩအဖၧၩ့, ဒဲနမၩဒီၩ့ၦမဲၩဎွဲၩမုၪ လၧနမံၩ့ဂၧၫ့ထၪ့ၥၩလၩ့အကၠီၩ့, ဒဲနမၩဆၧလဲးဆၧဘျၪအၪမၬ, လၧကယဲၦလၧအလဲး",
			"16": "<sup>16</sup> လီၩ့လၧနအီၪလီၫ. အနီၪမွဲအဆၧလီၫ.- နမၩန့ဆၧ လၧနကီၩ့နၥိၭအကျၩတၭ, နမၩဆၧအလးထၪ့ထီၫ ကယၧၩ့ကယီၫဒဲဆၧကံၪကဲၩ့တၭ, နကဲၪၦမဲၩဎွဲၩမုၪ လၧအဖၫ့ခိၪလီၫ. ဆၧဘဲၫနီၪၥိၭလဂဲၫဘၪနးဆိၭတၭ,",
			"17": "<sup>17</sup> မိမၩလၧၩ့အၥၭဆ့အ့ၬ.- နမၩန့နကယၧၩ့ကယီၫ အဎံၫအလၩလၧယထီၫ့ၥံၪလွ့ၫၥံၪ ဒဲယကျိၪၥံၪစ့ၩၥံၪ အကျၩ,လၧယဖ့ၪလၫ့ယူၭနၧၩတၭ, နတဲၩ့ၦခွၫအဂၩ့ လၧအဝ့ၫလၧနဂးတၭ,နမၩဆၧလဲးဆၧဘျၪလၧအဝ့ၫ",
			"18": "<sup>18</sup> ၥံၪ,- နမၩန့နကီၩ့နၥိၭဆၭကံၪအၥၭတၭ,မၩဘံၭအ ဝ့ၫၥံၪတၭ,နအီၪက့ၪယၥိၪၥံၪချၫၥံၪ, ဒဲယဆၧဆူၭခဲၩ",
			"19": "<sup>19</sup> နၧၫ့မၧၫ့လၧအမ့ၬယၫလီၫ.- ယဆၧအၪ့လၧယဖ့ၪလၫ့ နၧၩ,ကိၪမုၬဒဲၥိၪ, ဒဲန့ၫစၩ့လၧယလုအၪ့နၧၩနီၪ, နအီၪ က့ၪလၩ့လၧအဝ့ၫၥံၪအမ့ၬယၫ လၧဆၧနၧၫ့မၧၫ့မုၬအ ဂးလီၫ. တၭဆၧမၩအၥၭဘဲၫနီၪ ကဆါယဟိဝၩစံၭ",
			"20": "<sup>20</sup> ဝ့ၫဒၪ.- လၧနီၪအမ့ၬယၫနမၩန့နဖိၪမုၪၥံၪဒဲနဖိၪခွၫၥံၪ လၧနအီၪဖျဲၪန့လၧယဂးတၭ,လုထၪ့ဆၧဂၩ့နီၪလၧအ ဝ့ၫၥံၪလၧဆၧမိအၪ့ခွံၬအဝ့ၫၥံၪအဂဲးလီၫ. နမၩဆၧလဲး",
			"21": "<sup>21</sup> ဆၧဘျၪနီၪအ့ၪလအၪဘၪတၭ,- မွဲနမၩၥံၫယဖိၪလဖၪ တၭ,ဖ့ၪလၫ့ခွံၬအဝ့ၫၥံၪဘဲၫၥိၭအမိခၫ့ဂၬမ့ၪလၧဆၧ",
			"22": "<sup>22</sup> ဂၩ့အဂးနီၪဆ့ဧၪ.- လၧနဆၧဘၪၥၭလိၪထီးအလူၬအ ဖၧၩ့,ဒဲလၧနမၩဆၧလဲးဆၧဘျၪ ထီးအလူၬအဖၧၩ့နီၪ, နလနၪ့ထၪ့ထဲၩ့ဘၪ လၧနဖိၪၥၪဒံၭအမုနံၩလဖၪ,ထီး နအီၪဘိၪ့ဒဲနကီၩ့နၥိၭလအီၪဘၪတၭ, နဘၪဆၧစံၪစၪ ယူၭလၧနၥွံၪဖၧၩ့လီၫ.",
			"23": "<sup>23</sup> နဘၪအၡၪ့,နဘၪအၡၪ့လီၫ. ကဆါယဟိဝၩစံၭ",
			"24": "<sup>24</sup> ဝ့ၫဒၪ,လၧနဆၧအၧၩ့ထီးအလူၬအလးခဲၫ့နီၪ,- ဆၧမၩ အၥၭလၧနမၩဆၧခိၪၥိၭထၪ့အၥၭလၧနဂး, ဒဲမၩဆၧ အလးထၪ့ထီၫ လၧဖၧၩ့ၥၭမုကိၭဘီၩ့ဒ့ၭအဖၧၩ့လၧန",
			"25": "<sup>25</sup> ဂးလီၫ.- နမၩနလးထၪ့ထီၫလၧကယဲဖၧၩ့ၥၭအခၪ့ထံၭ, ဒဲဒုၭၥၭလိၪနဎံၫနလၩတၭ, နထၩ့ထါနခၪ့လၧကယဲ ၦလၧအလဲးလီၩ့လၧနၧၩလဂၩလါလါအဂး, ဒဲမၩ",
			"26": "<sup>26</sup> အၪထၪ့နဆၧလဲးဆၧဘျၪလဖၪလီၫ.- နမၩမၪမုၪမၩ မၪခွၫလၧၦအံဇံၭဖိၪၥံၪ ၦအီၪဝ့ၫလၧနနဲၩ့ထံၭ, အဖံၭ အယၪဖၭဒိၪးဒဲနမၩအၪထၪ့နဆၧလဲးဆၧဘျၪၥံၪ လၧ",
			"27": "<sup>27</sup> နမိထိၪဂဲၩယၥၭထၪ့အဂဲးလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယိခွါ,ယယၩ့ထၪ့ယူၭယစူၪထၫ့ဒၩနၧၩ, ဒဲမၩၡၩလၩ့ နဆၧအၪ့ဆၧအီၩး ဒဲဖ့ၪလၫ့ခွံၬနၧၩထီးဒၪၦအၥၭလၧ အၥၭဂဲၫ့နၧၩ, ၦဖလံၡၫဖိၪမုၪလၧအမ့ၬမဲ လၧနဆၧ လဲးဆၧဘျၪအဖၧၩ့ၥၭအကၠီၩ့လီၫ.",
			"28": "<sup>28</sup> နမၩဒီၩ့အ့ၭကံၫမုၪ လၧၦအစံရအၫဖိၪအၥိၭနီၪ, လၧနမၩဘျဲၩလၥ့ၪဘၪအကၠီၩ့လီၫ. မွဲမၬ,နမၩဒီၩ့မဲၩ",
			"29": "<sup>29</sup> ဎွဲၩမုၪလၧအဝ့ၫၥံၪလါနၫ့တၭ, နမၩဘျဲၩၥ့ၪအ့ၬ.- န မၩအၪထၪ့ နဆၧလဲးဆၧဘျၪ လၧခးကၫနအၫ့ဖိးလၧ",
			"30": "<sup>30</sup> ခၫလဒံအၫလါနၫ့တၭ, နမၩဘျဲၩၥ့ၪအ့ၬ.- နမၩဆၧခိၪ ၥိၭထၪ့အၥၭ လၧဖၧၩ့ၥၭကိၭဘီၩ့ဒ့ၭအခၪ့ထံၭတၭ, မၩဆၧအလးထၪ့ထီၫ လၧဖၧၩ့ၥၭမု ကိၭဘီၩ့ဒ့ၭအ ဖၧၩ့,နမၩဆၧထီးအလူၬနီၪ လၧၦအ့ၭကံၫမုၪလၧအ အီၪက့ၪဒူၩအၥၭတၭ, နၥၭလဲးၥၭဘျၪဘဲၫၥ့ၪလဲၪၬ က",
			"31": "<sup>31</sup> ဆါယဟိဝၩစံၭဝ့ၫ,- နမီၪ့ဎီၩ့လၧမဲၩဎွဲၩမုၪအ့ၬ. အဂဲး",
			"32": "<sup>32</sup> ဘဲၫယီၩနထိးဆၧအလံၩ့အလဲၫအ့ၬ.- မွဲဘဲၫၦအမၫ လၧအအဲၪဘိၩ့အဝၩအၥိၭနီၪ လၧအမၩန့ၦဂူၫဂၩလၧ",
			"33": "<sup>33</sup> အဝၩအလးလီၫ.- ၦခွၫဖ့ၪဆၧအလံၩ့အလဲၫ လၧၦ အ့ၭကံၫမုၪထီးအလူၬလီၫ. အ့ၪမွဲနဝ့ၫဒၪယီၩ နဖ့ၪက ယဲၦလၧအအဲၪနၧၩ လၧအလံၩ့အလဲၪတၭ, နအၪ့မၧၫ့ လံၩ့အဝ့ၫလၧစ့ၩ ဘဲၫၥိၭအမိဂဲၫ လၧကိၭခီၫဒ့ၭလၧန",
			"34": "<sup>34</sup> အီၪလၧနမၩဆၧလဲးဆၧဘျၪအဂးလီၫ.- တၭလၧနမၩ ဆၧလဲးဆၧဘျၪအဖၧၩ့နီၪ, နလၩ့မဲၩနဲၪ့ဒံၭၦမုၪအဂူၫ ဂၩလီၫ.ၦဖိၬနခဲၫ့ဘဲၫၥိၭ အမိမၩဆၧလဲးဆၧဘျၪနး ဂၩအ့ၬ.နဖ့ၪလၫ့ဆၧအလံၩ့အလဲၫတၭ, ဆၧလဖ့ၪ လၫ့ဘၪနလံၩ့နလဲၫ မၩအၥၭဘဲၫနီၪတၭ, နလၩ့မဲၩ ဒၪဆၧလီၫ.",
			"35": "<sup>35</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦမဲၩဎွဲၩမုၪဧ့,ခိၭနၪယဟိဝၩ",
			"36": "<sup>36</sup> အလူဆံၭ.- ကဆါယဟိဝၩစံၭဘဲၫယီၩ, မွဲနဆၧစံၪစၪ ဂါလၩ့အၥၭတၭ, နဆၧအီၪဘိၪ့အီၪဖျီၪလၧနမၩဆၧ လဲးဆၧဘျၪလၧ ၦလၧအအဲၪနၧၩလဖၪအၥိၭ, ဒဲလၧန ဆၧဂၩ့ၥံၪအဆၧၥၭလိၪအဖၧၩ့, ဒဲလၧနဖိၪလဖၪအၥွံၪ",
			"37": "<sup>37</sup> လၧနဖ့ၪလၫ့အဝ့ၫၥံၪအကၠီၩ့တၭ,- ယိခွါ, မၩအၥၭ ဘဲၫနီၪတၭ, ယမိဒုၭအီၪကီၪ့ ၦလၧအအဲၪနၧၩထီးအ လူၬ,ၦလၧအဘၪအၥၭလၧနၧၩ, ကယဲၦလၧနအဲၪဝ့ၫ အီၪလၧကယဲၦလၧနၥၭဂဲၫ့ဝ့ၫတၭ, ယမိဒုၭအီၪကိၩ့ အီၪကီၪ့ဝၬဖီၩ့ထၫ့ဒၩနၧၩတၭ, ယမိနဲၪဖျီၪထၪ့နဆၧ အီၪဘိၪ့လၧအဝ့ၫၥံၪအမ့ၬယၫ, ဘဲၫၥိၭအမိဒၪဘၪန အီၪဘိၪ့ထီးအလူၬလီၫ.",
			"38": "<sup>38</sup> ယမိစ့ၩရၫ့နၧၩဘဲၫၦမုၪလၧအအဲၪဘိၩ့အဝၩ,ဒဲဂါ လၩ့အၥွံၪလဖၪ ဘၪဆၧစ့ၩရၫ့ဝ့ၫအၥိၭနီၪတၭ, ယမိ ဖ့ၪလၫ့နၧၩ လၧဆၧၥွံၪ လၧယၥၭခဲၩထၪ့ဒဲယၥၭကဲၪ့",
			"39": "<sup>39</sup> လီၫ.- ယမိဖ့ၪလၫ့ခွံၬနၧၩလၧအဝ့ၫၥံၪအစူၪဖၧၩ့,ဒဲမိ မၩလၩ့ဎီးခွံၬနဆၧခိၪၥိၭထၪ့အၥၭ, ဒဲမိမၩဂၭဂီၩ့ခွံၬ နလးထၪ့ထီၫလဖၪ, ဒဲမိဘဲၪ့လၩ့ခွံၬနကီၩ့နၥိၭ,ဒဲမိမၩ န့ထၪ့ခွံၬနကယၧၩ့ကယီၫ လၧအဎံၫအလၩ,ဒဲမိအီၪ",
			"40": "<sup>40</sup> က့ၪလၩ့နၧၩအီၪဘိၪ့တၭ, နကီၩ့နၥိၭအီၪအ့ၬ.- အဝ့ၫ ၥံၪမိဂဲၫထၪ့လၧၦလဒီၪ့ဒဲထၫ့ဒၩနၧၩ, မိခွံၬနၧၩလၧလိး",
			"41": "<sup>41</sup> ဒဲဆ့ၭဖျီၫ့နၧၩလၧနၭလီၫ.- မိဆူၭထၪ့ခွံၬ နဂံၪ့လဖၪ လၧမ့ၪဒဲမၩဆၧစ့ၩရၫ့လဖၪလၧနၧၩ လၧၦမုၪအၪဂၩ အမ့ၬယၫတၭ, ယမိမၩပထုၬနၧၩ လၧနမၩဒီၩ့ၦမဲၩ ဎွဲၩမုၪတၭ,နမိဖ့ၪဘၪလၧၩ့ ဆၧအလံၩ့အလဲၫအ့ၬ.",
			"42": "<sup>42</sup> ယမိဒုၭအီၪပွံၭယၥၭခဲၩထၪ့လၧနလီၩ့, ဒဲယၥၭကဲၪ့ မိစဲၪ့ဒၪနၧၩတၭ,ယမိအီၪလၩ့မါပံၭတၭ, ယၥၭထၪ့",
			"43": "<sup>43</sup> လၧၩ့အ့ၬ.- မွဲနလနၪ့ထၪ့ဘၪနဖိၪၥၪဒံၭအမုနံၩလဖၪ နီၪ,အ့ၪမွဲနထိၪဂဲၩယၥၭထၪ့ လၧဆၧထီးအလူၬအ ကၠီၩ့နီၪတၭးယိခွါ, မၩအၥၭဘဲၫနီၪတၭ,ယမိဖ့ၪထဲၩ့ နဖၧၩ့ၥၭလၧနခိၪဎွံၪအဖၫ့ခိၪနီၪ, ကဆါယဟိဝၩစံၭ ဝ့ၫဒၪ.တၭနမိမၩဘၪဆၧလဲးဆၧဘျၪယီၩ လၧနဆၧ ၥၭလိၪထီးအလူၬအဖၫ့ခိၪနီၪအ့ၬ.",
			"44": "<sup>44</sup> ယိခွါ,ကယဲၦလၧအချဲၩ့ဒီၩ့လၩ့ဆၧနီၪ, မိချဲၩ့ ဆၧလၧနဂဲးတၭ,စံၭ, ဘဲၫမိအၥိၭနီၪ,ဖိၪမုၪမွဲဘဲၫ",
			"45": "<sup>45</sup> နီၪအၥိၭဆ့လီၫ.- နဝ့ၫဒၪယီၩနမွဲနမိအဖိၪမုၪ လၧအ ၥၭလိၪအဝၩဒဲအဖိၪအလံၩတၭ, နမွဲထၧၫ့ဖုဝဲမုၪလ ဖၪအထၧၫ့ဖုဝဲမုၪ လၧအဝ့ၫၥံၪၥၭလိၪ အဝၩၥံၪ, ဒဲအဖိၪအလံၩလီၫ. နမိမွဲၦဟံၥၭဖိၪ, ဒဲနဖါမွဲ",
			"46": "<sup>46</sup> ၦအၫမိၫဖိၪလီၫ.- တၭနဝဲမုၪနီၪမွဲစမ့ရအၫအီၪဝ့ၫ လၧအဖိၪမုၪၥံၪ လၧအအီၪဝ့ၫလၧနစူၪစ့ၪလခီၫ, ဒဲန ဖုမုၪလၧအအီၪလၧနစူၪထွ့ၪလခီၫနီၪ, မွဲစီဒၧၫ့အီၪဝ့ၫ",
			"47": "<sup>47</sup> လၧအဖိၪမုၪၥံၪနီၪလီၫ.- မွဲလါနၫ့တၭ,နဖိၬဘၪအဝ့ၫ ၥံၪအဖၧၩ့ၥၭအ့ၬ. တၭနမၩဘၪဘဲၫအဆၧၥၭလိၪအ ၥိၭနီၪဆ့အ့ၬ. အနီၪနအီၪက့ၪလၧဆၧအဆံၭလၨၪ တၭ,နအၧၩ့နဲၪ့ အဝ့ၫၥံၪ လၧနဖၧၩ့ၥၭဖၧၩ့ဒံၭလီၫ.",
			"48": "<sup>48</sup> ယမၧၫ့ယဝ့ၫ ကဆါယဟိဝၩစံၭဝ့ၫဒၪ, နဖုမုၪ စီဒၧၫ့အဝ့ၫဒၪမွဲဂ့ၩ, အဖိၪမုၪမွဲဂ့ၩ, မၩဆၧဘဲၫနမၩ",
			"49": "<sup>49</sup> နဝ့ၫဒဲနဖိၪမုၪၥံၪအၥိၭနီၪအ့ၬ.- ယိခွါ, နဖုမုၪ စီဒၧၫ့အဆၧဒဲၩဘၭမွဲအယီၩ,အီၪက့ၪအၥၭထၪ့ထီၫ, အၪ့ဆၧဘျဲၩအၪ့တၭ, အီၪကၠႃၪ့အၥၭအၪအၪလ့ၬနီၪ အီၪဝ့ၫလၧအဖၧၩ့, အဝ့ၫဒၪဒဲအဖိၪမုၪၥံၪတၭ, မၩဆီၪ့",
			"50": "<sup>50</sup> ထၪ့ၦၡၪ့ဖိၪယၬဖိၪ,ဒဲၦဘၪၡၪ့ဘၪနၭအစူၪအ့ၬ.- တၭ အဝ့ၫၥံၪအီၪက့ၪဖိၫလိၫအၥၭတၭ, မၩဆၧဘၪၥၭ လိၪလၧယမ့ၬယၫလီၫ. ထီးယဒၪဆၧတၭ,ယခွံၬၡိၭ",
			"51": "<sup>51</sup> အဝ့ၫၥံၪလီၫ.- မၩမၪဆၧဘဲၫနမၩမၪဆၧအၥိၭနီၪ, စမ့ရအၫမၩဖိၭဖၫ့ဝါအ့ၬ. မွဲနမၩအၪထၪ့နဆၧၥၭ လိၪနီၪအၪနဲၪ့ဒံၭအဝ့ၫၥံၪတၭ, နအီၪက့ၪတီၩနထၧၫ့ ဖုဝဲမုၪၥံၪလၧကယဲ နဆၧဘၪၥၭလိၪလဖၪအဖၧၩ့",
			"52": "<sup>52</sup> လၧနမၩနဝ့ၫလီၫ.- နဝ့ၫဒၪယီၩ, အီၪဒၪဆ့လၧနမ့ၬ မဲဒၪနဝ့ၫလၧနစ့ၩရၫ့ နထၧၫ့ဖုဝဲမုၪဆံၭ. အဂဲးဘဲၫ ယီၩအဝ့ၫၥံၪနီၪတီၩနဲၪ့ဒံၭနၧၩ, လၧနဆၧ ဒဲၩဘၭလၧ နမၩဆၧၥၭလိၪနၭနဲၪ့ဒံၭ အဝ့ၫၥံၪအကၠီၩ့လီၫ. မွဲမၬ, အီၪက့ၪမဲနမ့ၬဒဲအီၪဒၪဆၧ, ဒဲမ့ၬမဲဆံၭ.",
			"53": "<sup>53</sup> ထီးယအ့ၪဒုၭဂဲၫထဲၩ့အၡၩလ့ၩကဲၪဎီး, စီဒၧၫ့ဒဲ အဖိၪမုၪလဖၪလၧအလ့ၩကဲၪဎီး, ဒဲစမ့ရအၫဒဲအဖိၪမုၪ ၥံၪလၧအလ့ၩကဲၪဎီးနီၪ, ထီးနီၪလဖၧၫ့ယမိဒုၭဂဲၫထဲၩ့",
			"54": "<sup>54</sup> နၧၩလၧနလ့ၩကဲၪဎီးလၧအကျၩ,- ဘဲၫၥိၭနမိအီၪဒၪ ဆၧလၧနမ့ၬမဲဒၪနဝ့ၫ,ဒဲနမိအီၪက့ၪမဲနမ့ၬ လၧကယဲ ဆၧလၧနမၩဆၧအကၠီၩ့, လၧနမၩမုၬထၪ့ထဲၩ့အဝ့ၫၥံၪ",
			"55": "<sup>55</sup> အကၠီၩ့လီၫ.- နထၧၫ့ဖုဝဲမုၪစီဒၧၫ့ဒဲအဖိၪမုၪၥံၪအ့ၪထဲၩ့ ထဲၩ့ဝ့ၫလၧအလး လၧအအီၪဝ့ၫအခၪ့ထံၭ,ဒဲစမ့ရအၫ ဒဲအဖိၪမုၪၥံၪ မိထဲၩ့ထဲၩ့ဝ့ၫလၧအလးလၧအခၪ့ထံၭ, ဒဲနဝ့ၫဒၪဆ့ ဒဲနဖိၪမုၪၥံၪမိထဲၩ့ထဲၩ့လၧနၥံၪအလးလၧ",
			"56": "<sup>56</sup> အခၪ့ထံၭလီၫ.- လါနၫ့တၭ, လၧနအီၪက့ၪထၪ့ထီၫ နၥၭအမုနံၩ လၧနဆၧဒဲၩဘၭလချႃၭအီၪဖျီၪဒံၭဘၪနီၪ",
			"57": "<sup>57</sup> နဎွံၩ့ဘၪနထၧၫ့ဖုဝဲမုၪစီဒၧၫ့အမံၩ့လၧနနိၭအ့ၬ.- ဘဲၫန ဘၪဆၧဒုၪဒွ့ၪလၧၦစံရအၫအဖိၪမုၪၥံၪ လၧကယဲၦအီၪ ဝၬဖီၩ့အဝ့ၫ, ဒဲလၧၦဖလံၡၫဖိၪအဖိၪမုၪၥံၪ လၧအမၩ",
			"58": "<sup>58</sup> ကြၩ့ထမးနၧၩ ကိၭစီၪ့ဒ့ၭအၥိၭနီၪလီၫ.- နထိးဘၪ ယူၭနဆၧၥၭလဲးၥၭဘျၪ, ဒဲနဆၧဘၪၥၭလိၪလဖၪနီၪ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"59": "<sup>59</sup> အဂဲးဘဲၫယီၩ ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ယ မိမၩနၧၩ ဘဲၫနမၩဆၧအၥိၭ, နလဒူၩလယၪ့ဘၪဆၧ ဆိၪလၩ့အၥၭနီၪတၭ, နမၩဂၭဂီၩ့ဆၧအုၩ့လၩ့ လၧန",
			"60": "<sup>60</sup> မၩဝ့ၫနီၪလီၫ.- မွဲလါနၫ့တၭ, ယမိနၪ့ထၪ့ထဲၩ့ ယ ဆၧအုၩ့လၩ့လၧနၧၩ လၧနၥၭဘၪ့ဒံၭအမုနံၩလဖၪ နီၪတၭ,ယမိဒုၭအီၪဂုးအီၪခၧၫ့နၧၩ လၧဆၧအုၩ့လၩ့",
			"61": "<sup>61</sup> အဆိၩအကၠၪလီၫ.- ထီးနအ့ၪထိးဆၧၫ့နထၧၫ့ဖုဝဲ မုၪလဖၪ, နဝဲမုၪဒဲနဖုမုၪတၭ, ယမိဖ့ၪလၫ့အဝ့ၫၥံၪ ဘဲၫၥိၭအမိကဲၪထၪ့ နဖိၪမုၪလါနၫ့တၭ,လမွဲဘၪလၧ နဆၧအုၩ့လၩ့အဖၧၩ့နီၪ, နမိနၪ့ထၪ့ထဲၩ့နဖၧၩ့ၥၭလ",
			"62": "<sup>62</sup> ဖၪတၭ,နမ့ၬမိမဲလီၫ.- ယမိဒုၭအီၪဂုးအီၪခၧၫ့ယဆၧ အုၩ့လၩ့လၧနၧၩတၭ, နမိၥ့ၪယၫလၧယမွဲယဟိဝၩ",
			"63": "<sup>63</sup> လီၫ.- ဘဲၫၥိၭထီးယအ့ၪဖျါခွံၬကယဲဆၧလၧနမၩတၭ, နမိနၪ့ထၪ့ထဲၩ့ဆၧ, ဒဲဆၧထီၫမံၫထီၫမၪ,ဒဲလၧနမ့ၬမဲ အကၠီၩ့နီၪ, ထီးအၩ့ထၪ့လၧၩ့နနိၭလဂ့ၩ, ကဆါယ ဟိဝၩစံၭဝ့ၫဒၪ."
		},
		"17": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,စံၭဝ့ၫဒၪ, ၦၡၩ အဖိၪခွၫဧ့, ၡီၩ့ၡါဆၧ ဒဲချဲၩ့ဒီၩ့လၩ့ဆၧ လၧအံၫစရ့",
			"3": "<sup>3</sup> လၭအၡၩဂံၪ့ဖိၪဘီၪ.- စံၭ,ကဆါယဟိဝၩစံၭဘဲၫယီၩ, လံၬကျီၫ့ကျီၫ့ဖၭဒိၪလဘံၪ့အီၪလၧအဒံၭဖၭလဲ, ဒဲအ ဒံၭဖၭထီၫ, ဒဲဎွ့ၩဝ့ၫလၧဆီၪ့ၥံၪလၧအကံၪကဲၩ့ဂဲၫထီၩ့ လၧလ့ၭဘနၧၫ့တၭ, မၩန့ၥံၪ့ၡိၫအ့ရ့ၭ အထဲၩ့လထဲၩ့",
			"4": "<sup>4</sup> လၧအထီၫထုၬလီၫ.- အၪ့ဒ့ၭဝ့ၫလၧအထဲၩ့ဖိၪၥံၪအထိၭ နၫတၭ,ဆိၬဝ့ၫလၧၦမၩဖနံၬဖိၪအခးဖၧၩ့တၭ, အီၪ",
			"5": "<sup>5</sup> က့ၪလၩ့ဝ့ၫလၧၦမၩဖနံၬအဒိၩ့ဖၧၩ့လီၫ.- မၩန့ခးအချံၫ အၥၪဆ့တၭ,ၥုၪ့ဝ့ၫလၧဂၪ့ခိၪအဝၩ့ လၧအဒုၭၥၪထၪ့ ဝ့ၫလီၫ.ၥုၪ့လၩ့ဝ့ၫ လၧထံၫဖၭဒိၪအနဲၩ့, အီၪက့ၪဝ့ၫ",
			"6": "<sup>6</sup> ဘဲၫၥံၪ့ဖံစလီၫ့အၥိၭနီၪလီၫ.- ဒိၪထၪ့လဲထၪ့ဝ့ၫတၭ, ကဲၪထၪ့စဘံၭမုအဖၨၪတၭး အထဲၩ့လဖၪကၠၪအၥၭ လၧအအီၪတၭ, အဝံလဖၪအီၪဝ့ၫ လၧအဖၫ့လၬလီၫ. ကဲၪထၪ့ဝ့ၫလၧစဘံၭမုလမုတၭ, ထဲၩ့ဖၫ့ထၪ့တၭ,ဒိၪ",
			"7": "<sup>7</sup> ထၪ့ဝ့ၫဒၪလီၫ.- လံၬကျီၫ့ကျီၫ့ဖၭဒိၪအဂူၫဂၩလဘံၪ့ အီၪဝ့ၫလၧအဒံၭဖၭလဲ, ဒဲလၧအဆီၪ့အၪအၪလ့ၬလီၫ. တၭယိခွါ, စဘံၭမုလမုနီၪဆဲၩလၩ့စိၩအဝံလၧအအီၪ, ဆဲၩလၩ့စိၩအထဲၩ့လၧအအီၪ ဘဲၫၥိၭအဆၧမိအၪ့ထုၫ့ ကီၪ့ထံၫလၧအဝ့ၫလၧထံၫချိၬ ထီးဆၧအလးလၧအၥုၪ့",
			"8": "<sup>8</sup> လၩ့အၥၭလၧအဖၧၩ့နီၪလီၫ.- ဘၪဆၧၥုၪ့လၩ့အၥၭ လၧဂၪ့ခိၪဂ့ၩလဝၩ့အဖၧၩ့ လၧထံၫဖၭဒိၪအနဲၩ့ ဘဲၫ ၥိၭအမိထဲၩ့ဖၫ့ထၪ့,ဒဲၥၪထၪ့တၭ, ကဲၪထၪ့စဘံၭမုလမု",
			"9": "<sup>9</sup> လၧအဎံၫအလၩလီၫ.- စံၭနဝ့ၫ, ကဆါယဟိဝၩစံၭ ဘဲၫယီၩ, မိဘီၪထၪ့ယီၫထၪ့ဆ့ဧၪ.ဆၧမိထ့ၭထၪ့ခွံၬ အဝံလဖၪ,ဒဲမိဒၪ့ထ့ၬခွံၬအၥၪ, ဘဲၫၥိၭအမိလၩ့ယံၭ နီၪ,မွဲအ့ၬဧၪ. အထဲၩ့ဖၫ့ထၪ့အဒိၭအလၪ ထီးအလူၬ မိလၩ့ယံၭဝ့ၫလီၫ. မွဲလါနၫ့ဆၧအစီၩ့အမၩ့လအီၪဘၪ, ဒဲၦၡၩခမျၧးအၪဂၩ လအီၪဘၪတၭ,မိထ့ၭထၪ့ခွံၬအ",
			"10": "<sup>10</sup> ဝ့ၫလၧအဝံလီၫ.- မွဲမၬ,ယိခွါ,ဘၪဆၧၥုၪ့လၩ့ယူၭအ ၥၭယူၭလါနၫ့တၭ,မိဘီၪထၪ့ယီၫထၪ့ဆ့ဧၪ. ထီးလံၩ လၧမုထၪ့လခီၫ ဘၪအဝ့ၫတၭ,မိလၩ့ယံၭထၧၫ့မုယၫ မွဲအ့ၬဧၪ. မိလၩ့ယံၭလၧဆၧအကၠီၪ့အဖၧၩ့ထီးအလး လၧအမဲၪထၪ့ဝ့ၫလီၫ.",
			"11": "<sup>11</sup> ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,စံၭဝ့ၫဒၪ. စံၭ ၦဂံၪ့ဖိၪလၧအပိၩ့ထၪ့ဆၧ, ဆၧနီၪလဖၪမွဲဘဲၫၥ့ၪလဲၪ နီၪ,နၥံၪၥ့ၪယၫအ့ၬဧၪ. စံၭ, ယိခွါ, ဘၭဘလၧၫ့အ စဎွၩဂဲၫဝ့ၫလၧယရုစလံၫ့တၭ, မၩန့အစဎွၩဒဲအၦဒိၪ ဖၭဒိၪလဖၪတၭ, ဆိၬထၪ့ဝ့ၫလၧအနၫ့ဆါဒၪဝ့ၫအၥိၭ",
			"13": "<sup>13</sup> ထီၩ့လၧဘၭဘလၧၫ့,- တၭမၩန့ၦလၧစဎွၩအချံၫအ ၥၪအကျၩလဂၩတၭ, အုၩ့လၩ့ဆၧလၧအဝ့ၫ,ဒဲဒုၭဆိၪ",
			"14": "<sup>14</sup> လၩ့အၥၭဒဲမၩန့ထၪ့ခွံၬၦအဆီၪ့လၧခးဖၧၩ့,- ဘဲၫၥိၭ အမိဒုၭဆၪ့လၩ့ဘၩ့မုးအၥၭ, လၧအဆၧထီးအီၪက့ၪ ထၪ့ထီၫအၥၭလဂ့ၩ. ဘဲၫၥိၭအမိထီးန့ ဆၧအုၩ့လၩ့",
			"15": "<sup>15</sup> တၭ,အဆၧမိအီၪဂုးအီၪခၧၫ့လီၫ.- မွဲလါနၫ့တၭ,အဝ့ၫ ဒၪအၪ့မၧၫ့လၩ့အၥီၫ့လဖၪ လၧခးအံဇံၭ,ဘဲၫၥိၭအဝ့ၫ ၥံၪမိဖ့ၪလၫ့အဝ့ၫလၧကၥ့ၪ, ဒဲၦခမျၧးအၪဂၩအကၠီၩ့ တၭ,ပိၩ့ထၪ့ဝ့ၫလီၫ. မွဲအမိဘီၪထၪ့ယီၫထၪ့ဆ့ဧၪ.တၭ ၦလၧအမၩဆၧဘဲၫနီၪမိဖျ့ၭဆ့ဧၪ. အ့ၪမိမၩဂၭဂီၩ့ဆၧ",
			"16": "<sup>16</sup> အုၩ့လၩ့နီၪ,မွဲအမိဖီၩ့ဖျ့ၭဆ့ဧၪ.- ယမၧၫ့ယဝ့ၫ,ကဆါ ယဟိဝၩစံၭဝ့ၫဒၪ,မွဲမၬ, ထီးစဎွၩအီၪဝ့ၫအလးလဂၩ လၧအအီၪက့ၪအဝ့ၫလၧစဎွၩ, ၦလၧအလဒူၩလယၪ့ ဘၪအဆၧဆိၪလၩ့အၥၭ, ဒဲမၩဂၭဂီၩ့အဆၧအုၩ့လၩ့ နီၪမိၥံၫဝ့ၫလၧအဝ့ၫအၥိၭဒၪလ့ၬ, လၧဘၭဘလၧၫ့အ",
			"17": "<sup>17</sup> ၥၭကျၩလီၫ.- ထီးအမၩစီၩ့ထၪ့ဆၧ,ဒဲမၩထၪ့ထိၬၥံၪ ဘဲၫၥိၭအမိဒၪ့ထ့ၬခွံၬ ၦအၪဂၩတၭ, ဖၫရိၫဒဲအၥုၭမု ခမျၧးဒဲၦခမျၧးဖၭဒိၪနီၪ မၩဘၪလၧအဂးလၧဆၧဒုၭ",
			"18": "<sup>18</sup> ၥုၭအဖၧၩ့နးမံၩ့အ့ၬ.- မွဲအလဒူၩလယၪ့ဘၪအဆၧ ဆိၪလၩ့အၥၭတၭ,မၩဂၭဂီၩ့ဆၧအုၩ့လၩ့လီၫ. ယိခွါ, ဖ့ၪလၫ့ယူၭအစူၪလါနၫ့တၭ, မၩဆၧထီးအလူၬနီၪတၭ",
			"19": "<sup>19</sup> ဖီၩ့ဖျ့ၭဘၪဝ့ၫအ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ,ကဆါယဟိ ဝၩစံၭဘဲၫယီၩ, ယမၧၫ့ယဝ့ၫ,မွဲမၬ, ယဆၧဆိၪလၩ့ ယၥၭလၧအလဒူၩလယၪ့ဘၪဝ့ၫ, ဒဲယဆၧအုၩ့လၩ့ လၧအမၩဂၭဂီၩ့ဝ့ၫအကၠီၩ့နီၪ, ယမိဖ့ၪထဲၩ့ဆၧလၧအ",
			"20": "<sup>20</sup> ဝ့ၫလၧအခိၪဎွံၪဒၪဝ့ၫအဖၫ့ခိၪနီၪလီၫ.- ယမိခွံၬယၡၬ လၧအဖၫ့ခိၪတၭ, အဝ့ၫမိဘၪယဖျံၩခွၩ့တၭ,ယမိဆိၬ ထၪ့အဝ့ၫ ထီၩ့လၧဘၭဘလၧၫ့တၭ, ယမိချဲၩ့ခွးလၧ အဝ့ၫထီးနီၪလၧအဆၧမၪ လၧအမၩမၪဘၪယၧၩအ",
			"21": "<sup>21</sup> ကၠီၩ့နီၪလီၫ.- အၡၩလၧအစဲၪ့ဆၧဒဲအၥုၭမုထီးအလူၬ နီၪမိလၩ့ထံၩဖါလၧနၭၥံၪဖၩ့ၥံၪ, ဒဲၦအီၪလၩ့ထးလဖၪ နီၪမိလၩ့ပြံၩလၩ့ပၩ လၧလံၩကိၭခီၫဒ့ၭအကျၩလီၫ. တၭနၥံၪမိၥ့ၪယၫလၧယၧၩ, ယဟိဝၩယီၩယချဲၩ့ဆၧ လီၫ.",
			"22": "<sup>22</sup> ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ယမိမၩန့ၥံၪ့ၡိၫအ့ရ့ၭ ထီၫနီၪ အထဲၩ့ထီၫထုၬ လထဲၩ့တၭ,ယမိၥုၪ့လၩ့ဝ့ၫ တၭ,ယမိအၪ့မၩန့ခွံၬဆၧအဒိၭ လၧအထဲၩ့ထီၫထုၬ အခံၫတၭ, ယမိၥုၪ့လၩ့ဝ့ၫလၧခိၪလီၩ့ထၪ့ထီၫဒဲဖၭထီၫ",
			"23": "<sup>23</sup> လၩ့မဲၩဒၪဆၧလဖျိၪ့အလီၩ့လီၫ.- လၧအံၫစရ့လၭအ ခိၪလီၩ့ထၪ့ထီၫအလီၩ့နီၪ ယမိၥုၪ့လၩ့အဝ့ၫတၭ, ၥၪ ထၪ့ဒဲကဲၪထၪ့ၥံၪ့ၡိၫအ့ရ့ၭအဂ့ၩလထုၪ့တၭ, ထိၪၥံၪ လံၪၥံၪကိၭအမံၩ့ဒ့ၭ မိအီၪလၧအဖၫ့လၬ, ဒဲလၧအထဲၩ့",
			"24": "<sup>24</sup> လဖၪလၧအလၩဒုၩအကျၩနီၪ,မိအီၪဝ့ၫလီၫ.- ကယဲ ၥံၪ့လၧမံၩ့လၬကျၩ ထီးအလူၬနီၪမိၥ့ၪယၫဝ့ၫဆၧလၧ ယၧၩယဟိဝၩယီၩ, ယမၩလၩ့ဖၨၪၥံၪ့အထီၫ, ဒဲအီၪ က့ၪထီၫၥံၪ့အဖၨၪ, ဒဲယဒုၭဎဲၫ့ထၪ့ခွံၬၥံၪ့အၥံၫ့ဆ့ၬ, ဒဲ ယဒုၭဒိၭထၪ့ထဲၩ့ၥံၪ့ဎဲၫ့နီၪလီၫ. ဆၧလၧယၧၩယဟိ ဝၩယီၩ,ယချဲၩ့ဆၧတၭ,ယမၩယဝ့ၫလီၫ."
		},
		"18": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၩ့ဘၪဒီၭယၧၩတၭ, စံၭဝ့ၫဒၪ,",
			"2": "<sup>2</sup> ဖါလဖၪအၪ့စဘံၭၥၪဆဲၪ့တၭ, ဖိၪၥၪၥံၪအမဲၪအၥွၪ ဎံၩ့နီၪ,နၥံၪလၧအချဲၩ့ဒီၩ့လၩ့ဆၧနီၪ, လၧခးအံၫစရ့",
			"3": "<sup>3</sup> လၭအဂဲး,မွဲနၥံၪစံၭဘဲၫၥ့ၪလဲၪ.- ယမၧၫ့ယဝ့ၫ,ကဆါ ယဟိဝၩစံၭဝ့ၫဒၪ, နၥံၪချဲၩ့ဒီၩ့လၩ့ဆၧယီၩလၧအံၫစ",
			"4": "<sup>4</sup> ရ့လၭအဖၧၩ့,အလးမိအီၪလၧၩ့အ့ၬ.- ယိခွါ,ၦအၥၭ ထီးအလူၬမွဲယဆၧး ဘဲၫဖါအၥၭအၥိၭနီၪ, ဖိၪခွၫနီၪ မွဲယဆၧဘဲၫနီၪၥိၭဆ့လီၫ. ၦအၥၭလၧအမၩဆၧဒဲၩ ဘၭနီၪမိၥံၫဝ့ၫဒၪလီၫ.",
			"5": "<sup>5</sup> အ့ၪမွဲၦအ့ၪတီၩအ့ၪလီၩ့ ဒဲမၩဆၧစ့ၩရၫ့ဒဲဆၧတီၩ",
			"6": "<sup>6</sup> ဆၧလီၩ့နီၪ,- ဒဲလအၪ့ဘၪဆၧလၧခိၪလီၩ့,ဒဲအ့ၪလစၪ့ ထၪ့ဘၪအမ့ၬ လၧအံၫစရ့လၭအၡၩဂံၪ့ဖိၪအဆၧဂၩ့ အအီၪ, ဒဲအ့ၪလမၩစံၪစၪဘၪၦလၧအနဲၩ့ထံၭအမၫ, ဒဲအ့ၪလၥုၭဘူၭဘၪအၥၭ လၧၦမုၪလၧအထူၫအရူၫ",
			"7": "<sup>7</sup> ဘၪဝ့ၫအအီၪ,- ဒဲအ့ၪလမၩအၧၩ့ဘၪၦနးဂၩ, ဒဲအ့ၪ ဖ့ၪထဲၩ့ၦလၧအဒ့ၪအမါအီၪအဆၧပီၩ့လၩ့, ဒဲအ့ၪလ မၩန့ဆီၪ့ဘၪၦဂူၫဂၩအဆၧ, အ့ၪဖ့ၪလၫ့အဆၧအၪ့ လၧၦလၧအၥၭဝံအၥၭ, ဒဲအ့ၪချႃၬဘံၭၦအီၪဘိၪ့လၧ",
			"8": "<sup>8</sup> ဖၬဘဲၩ့လဘံၪ့,- တၭအ့ၪလဖ့ၪလၫ့ဘၪဆၧလၧစ့ၩအ အ့ၪအဂး, ဒဲအ့ၪလအၪ့မၩန့ဘၪစ့ၩအအ့ၪနီၪအ့ၪထုၭ ထဲၩ့အစူၪလၧဆၧအၧၩ့, ဒဲအ့ၪစ့ၩရၫ့ဆၧတီၩလၧၦၡၩ",
			"9": "<sup>9</sup> ဒဲၦၡၩအဘိၩ့ဆၧၩ့,- တၭအ့ၪလ့ၩဆၧလၧယဆၧမၪ လူၬအဖၧၩ့တၭ, အ့ၪထီးန့ယဆၧစ့ၩရၫ့နီၪ ဘဲၫၥိၭအ မိမၩဆၧအမွဲအတီၩတၭ, အဝ့ၫဒၪမွဲအတီၩအလီၩ့ တၭ,မိမၧၫ့ဝ့ၫတၡါ , ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"10": "<sup>10</sup> အ့ၪမွဲအဝ့ၫဒၪ အ့ၪထၪ့ဖိၪအဖိၪခွၫလဂၩလၧအမွဲ ၦထမျိၭထမျၬ, ၦလူၫလၩ့ဆၧၥွံၪတၭ အ့ၪမၩဆၧဘဲၫ",
			"11": "<sup>11</sup> ဆၧနီၪလမံၩ့မံၩ့အၥိၭ,- တၭအ့ၪလထီးန့ဘၪဆၧထီး အလူၬနီၪတၭ, အ့ၪအၪ့ဆၧလၧခိၪလီၩ့အလီၩ့တၭ,အ့ၪ",
			"12": "<sup>12</sup> မၩစံၪစၪၦလၧအနဲၩ့ထံၭအမၫ,- အ့ၪမၩအၧၩ့ၦၡၪ့ဖိၪ ယၬဖိၪ,ဒဲၦဘၪၡၪ့ဘၪနၭ, အ့ၪမၩဆီၪ့ၦဂူၫဂၩအဆၧ တၭ,အ့ၪလဖ့ၪထဲၩ့ဘၪဆၧပီၩ့လၩ့, အ့ၪယိထၪ့ဆၧ",
			"13": "<sup>13</sup> လၧဆၧဂၩ့အအီၪ, အ့ၪမၩဆၧၥၭလိၪ,- အ့ၪဖ့ၪလၫ့ ဆၧလၧစ့ၩအအ့ၪအဂး, ဒဲမၩန့စ့ၩ အအ့ၪနီၪ,မွဲအမိ မၧၫ့ဝ့ၫဆ့ဧၪ,မၧၫ့ဝ့ၫအ့ၬ. မၩယူၭဆၧၥၭလိၪထီးအ လူၬနီၪယူၭ,မိၥံၫတၡါတၭ,အၥွံၪမိအီၪဝ့ၫလၧအလီၩ့ ဒၪဝ့ၫလီၫ.",
			"14": "<sup>14</sup> မွဲလါနၫ့တၭ,ယိခွါ, အဝ့ၫဒၪအ့ၪထၪ့ဖိၪအဖိၪခွၫလ ဂၩလၧအဒၪဘၪအဖါအဆၧဒဲၩဘၭ ထီးအလူၬလၧအ",
			"15": "<sup>15</sup> မၩဝ့ၫ,အ့ၪဒၪဘၪဝ့ၫ,ဒဲလမၩဘၪဘဲၫနီၪတၭ,- အ့ၪလ အၪ့ဘၪဆၧလၧခိၪလီၩ့အလီၩ့, အ့ၪလယိထၪ့ဘၪလၧ အံၫစရ့လၭအၡၩဂံၪ့ဖိၪအဆၧဂၩ့အအီၪ, အ့ၪလမၩ",
			"16": "<sup>16</sup> စံၪစၪဘၪၦလၧအနဲၩ့ထံၭအမၫတၭ,- အ့ၪလမၩအၧၩ့ ဘၪၦနးဂၩ, အ့ၪလမၩန့ဘၪဆၧပီၩ့လၩ့, အ့ၪလမၩ န့ဆီၪ့ဘၪၦဂူၫဂၩအဆၧ, အ့ၪဖ့ၪလၫ့အဆၧအၪ့လၧၦ ၥၭဝံအၥၭ, အ့ၪချႃၬဘံၭၦအီၪဘိၪ့လၧဖၬဘဲၩ့လဘံၪ့,",
			"17": "<sup>17</sup> အ့ၪလအီၪက့ၪဘၪအစူၪ လၧၦၡၪ့ဖိၪယၬဖိၪအလီၩ့, အ့ၪလမၩန့ဘၪစ့ၩအအ့ၪ, ဒဲဆၧအၪထၪ့, အ့ၪမၩယ ဆၧစ့ၩရၫ့, ဒဲလ့ၩဆၧလၧယဆၧမၪလူၬအဖၧၩ့နီၪတၭ, အဝ့ၫဒၪမိၥံၫဘၪ လၧအဖါအဆၧဒဲၩဘၭအကၠီၩ့အ့ၬး",
			"18": "<sup>18</sup> မိမၧၫ့တၡါလီၫ.- ဆၧလၧအဖါလဂၩနီၪ,မွဲအမၩအၧၩ့ ဆၧ,အၥၭနီၩ့တၭ, မၩန့ဆီၪ့အထၧၫ့ဖုဝဲအဆၧတၭ, မၩဆၧလၧအလဂ့ၩလဘၪ လၧအၡၩခမျၧးအကျၩ, ယိခွါ,အဝ့ၫဒၪမိၥံၫဝ့ၫ လၧအဆၧဒဲၩဘၭအဖၧၩ့လီၫ.",
			"19": "<sup>19</sup> မွဲလါနၫ့နၥံၪစံၭ,မွဲဘၪလဲၪ, ဖိၪခွၫထိးဘၪဖါအဆၧ ဒဲၩဘၭနီၪ,မွဲအ့ၬဧၪ, ထီးဖိၪခွၫအ့ၪမၩဆၧစ့ၩရၫ့ဒဲဆၧ တီၩဆၧလီၩ့, ထီးန့ဝ့ၫလၧယမၪလူၬဆၧထီးအလူၬ,",
			"20": "<sup>20</sup> ဒဲမၩဝ့ၫနီၪ, မိမၧၫ့တၡါလီၫ.- ၦၡၩလၧအမၩဆၧဒဲၩ ဘၭနီၪ,အဝ့ၫဒၪမိၥံၫလီၫ. ဖိၪခွၫထိးဘၪဖါအဆၧဒဲၩ ဘၭအ့ၬ.တၭအဖါ ထိးဘၪအဖိၪခွၫအဆၧဒဲၩဘၭဆ့ အ့ၬ.ၦတီၩၦလီၩ့အဆၧတီၩဆၧလီၩ့နီၪ, မိအီၪဝ့ၫလၧ အလီၩ့, ဒဲၦလတီၩလလီၩ့ဘၪ အဆၧလတီၩလလီၩ့",
			"21": "<sup>21</sup> ဘၪနီၪ မိအီၪဝ့ၫလၧအလီၩ့ဆ့လီၫ.- ၦလတီၩလလီၩ့ ဘၪအ့ၪကၠၪခွံၬအၥၭ လၧဆၧဒဲၩဘၭထီးအလူၬလၧ အမၩဝ့ၫတၭ, အ့ၪထီးန့ယဆၧမၪလူၬထီးအလူၬနီၪ, ဒဲမၩဆၧစ့ၩရၫ့ဒဲဆၧတီၩဆၧလီၩ့နီၪ, မိမၧၫ့တၡါ,ၥံၫ",
			"22": "<sup>22</sup> ဘၪအ့ၬ.- အဆၧမၪလၧအမၩဝ့ၫနီၪ, ဆၧနၪ့ထၪ့ထၫ့ ဒၩဝ့ၫအ့ၬး အဆၧတီၩဆၧလီၩ့လၧအမၩဝ့ၫနီၪမိမၧၫ့",
			"23": "<sup>23</sup> ဝ့ၫလၧအဖၧၩ့လီၫ.- ၦလတီၩလလီၩ့ဘၪၥံၫဝ့ၫနီၪ,မွဲ အဘၪယၥၭဆ့ဧၪး ကဆါယဟိဝၩစံၭဝ့ၫဒၪ. လၧအ မိကၠၪခွံၬအၥၭလၧအဖၧၩ့ၥၭတၭ, မၧၫ့ဝ့ၫနီၪ ဘၪယ ၥၭ,မွဲအ့ၬဧၪ.",
			"24": "<sup>24</sup> ထီးၦတီၩၦလီၩ့အ့ၪကၠၪခွံၬအၥၭ လၧအဆၧတီၩ ဆၧလီၩ့,ဒဲမၩဆၧဒဲၩဘၭတၭ, မၩကယဲဆၧၥၭလိၪ ဘဲၫၦလတီၩလလီၩ့ဘၪ မၩဝ့ၫအၥိၭနီၪတၭ,မွဲအမိ မၧၫ့ဝ့ၫဆ့ဧၪ. ဆၧနၪ့ထၪ့ထဲၩ့အဆၧတီၩဆၧလီၩ့လၧ အမၩဝ့ၫလၧအဂးနးမံၩ့အ့ၬ. လၧအဆၧမၪလၧအမၩ ဝ့ၫအဖၧၩ့ ဒဲလၧအဆၧဒဲၩဘၭ, လၧအမၩဝ့ၫအဖၧၩ့ နီၪ,မိၥံၫဝ့ၫလၧအဖၧၩ့နီၪလီၫ.",
			"25": "<sup>25</sup> မွဲလါနၫ့တၭ,နၥံၪစံၭ, ယဟိဝၩအဖၧၩ့ၥၭနီၪတီၩ အ့ၬ,ဘၪအ့ၬ, အံၫစရ့လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့, ခိၭနၪ ဆံၭ.ယဖၧၩ့ၥၭတီၩအ့ၬဧၪ, ဘၪအ့ၬဧၪ. နၥံၪအဖၧၩ့ၥၭ",
			"26": "<sup>26</sup> လဖၪလတီၩလလီၩ့ဘၪနီၪ,မွဲအ့ၬဧၪ.- ထီးၦတီၩၦ လီၩ့ကၠၪခွံၬအၥၭလၧဆၧတီၩဆၧလီၩ့တၭ, မၩဆၧ ဒဲၩဘၭတၭ,ၥံၫဝ့ၫလၧအဖၧၩ့နီၪ, လၧအဆၧဒဲၩဘၭ",
			"27": "<sup>27</sup> လၧအမၩဝ့ၫအကၠီၩ့နီၪ မိၥံၫဝ့ၫလီၫ.- ထီးၦလတီၩ လလီၩ့ဘၪအ့ၪကၠၪခွံၬအၥၭ လၧအဆၧလတီၩလလီၩ့ ဘၪလၧအမၩဝ့ၫတၭ, မၩဆၧစ့ၩရၫ့ဒဲဆၧတီၩဆၧလီၩ့",
			"28": "<sup>28</sup> တၭ,အၥၭမိမၧၫ့ဝ့ၫလီၫ.- မွဲအယိဆီၫ့မီၪ့တၭ, ကၠၪခွံၬ အၥၭလၧအဆၧမၪ လၧအမၩဝ့ၫနီၪတၭ, မိမၧၫ့တၡါ",
			"29": "<sup>29</sup> တၭ,ၥံၫဘၪအ့ၬ.- မွဲလါနၫ့တၭ,အံၫစရ့လၭအၡၩဂံၪ့ ဖိၪစံၭဝ့ၫဒၪ, ယဟိဝၩအဖၧၩ့ၥၭလတီၩလလီၩ့ဘၪ လီၫ.အံၫစရ့လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့, ယဝ့ၫဒၪယဖၧၩ့ ၥၭလဖၪနီၪ,မွဲအတီၩအ့ၬဧၪ. နၥံၪအဖၧၩ့ၥၭလဖၪလ",
			"30": "<sup>30</sup> တီၩဘၪနီၪ,မွဲအ့ၬဧၪ.- မၩအၥၭဘဲၫနီၪတၭ,အံၫစရ့ လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့, ယမိစ့ၩရၫ့နၥံၪ လဂၩဘၪလ ဂၩဘဲၫအဖၧၩ့ၥၭဒၪဝ့ၫအၥိၭနီၪဆုၬဆုၬ, ကဆါယဟိ ဝၩစံၭဝ့ၫဒၪ. ကၠၪခွံၬနၥံၪအၥၭ, ကၠၪခွံၬနၥံၪအၥၭလၧ နၥံၪအဆၧမၪထီးအလူၬနီၪဆံၭ. တၭဆၧဒဲၩဘၭကဲၪ ထၪ့နၥံၪအဆၧလၩ့ထံၩဖါအလးအ့ၬ.",
			"31": "<sup>31</sup> ခွံၬၡိၭခွံၬနၥံၪအဆၧမၪလၧနၥံၪမၩမၪဝ့ၫထီးအလူၬ တၭ,မၩအီၪထၪ့နၥံၪအၥုၪ့ၥၫ့ၥၭၥၫ့ဆံၭ. အဂဲးဘဲၫ ယီၩအံၫစရ့လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့, နၥံၪမိၥံၫနီၪမွဲဘၪ",
			"32": "<sup>32</sup> လဲၪ.- အဂဲးဘဲၫယီၩထီးၦၥံၫတၭ, ၥံၫဝ့ၫနီၪဘၪယၥၭ နးဆံၭအ့ၬ. ကဆါယဟိဝၩစံၭဝ့ၫဒၪ. မၩအၥၭဘဲၫနီၪ တၭ,ကၠၪခွံၬနၥံၪအၥၭတၭ,မၧၫ့နၥံၪဝ့ၫဆံၭ."
		},
		"19": {
			"1": "<sup>1</sup> နဝ့ၫဒၪယီၩ,ဆၧလၧအံၫစရ့လၭ အၦဒိၪဖၭဒိၪလ",
			"2": "<sup>2</sup> ဖၪအကၠီၩ့နီၪ, ဂၪ့ဆၧယၧၩ့ဆၧနဝ့ၫဆံၭး- တၭစံၭ, နမိနီၪမွဲဆၧနီၫလဲၪ. မွဲဆၬလၥၧၫ့မိလဒုၩလီၫ. ခိၬလၩ့ လၧဆၬလၥၧၫ့အကျၩ, ဘုၪအၪ့အဖိၪလၧဆၬလၥၧၫ့",
			"3": "<sup>3</sup> အၥၭဘၪ့အကျၩလီၫ.- ဘုၪအၪ့အဖိၪလဒုၩနီၪး ကဲၪထၪ့ဝ့ၫလၧဆၬလၥၧၫ့ဖၫဖျဲၪလဒုၩတၭ, မၩလိၪအၪ့ဂူၬ",
			"4": "<sup>4</sup> ဆီၪ့ဆၧ, အၪ့ခွံၬၦၡၩလီၫ.- ၦဆၨၩလဖၪနါဂၧၫ့ဆၧ လၧအဂဲးလီၫ. အဝ့ၫၥံၪဖီၪ့န့ဝ့ၫလၧအဆၧဖၧၩ့, ဒဲမီၩ့",
			"5": "<sup>5</sup> ထၪ့ဝ့ၫလၧၥွ့ၫထၭ လၧခးအံဇံၭအဖၧၩ့လီၫ.- အမိနီၪ ဒၪဘၪဝ့ၫလၧအအီၪခိၭဆၧပျီၩပျီၩတၭ, အဆၧမုလါ အဂးဂၭဂီၩ့ဝ့ၫတၭ, မၩန့အဖိၪ အဂူၫဂၩလဒုၩတၭ,",
			"6": "<sup>6</sup> အီၪက့ၪဝ့ၫလၧဆၬလၥၧၫ့ဖၫဖျဲၪလဒုၩလီၫ.- အဆၧစဲၪ့ ဝံၩ့ဝၩ့လၧဆၬလၥၧၫ့အကျၩတၭ, ကဲၪထၪ့ဆၬလၥၧၫ့ ဖၫဖျဲၪလဒုၩတၭ, မၩလိၪအၪ့ဂူၬဆီၪ့ဆၧအၪ့ခွံၬၦၡၩ",
			"7": "<sup>7</sup> လီၫ.- အဝ့ၫဒၪၥ့ၪယၫအဝ့ၫၥံၪအၡၩမုၪမဲၫလဖၪဒဲမၩ ဂၭဂီၩ့လူၬခွံၬအဒိၩ့လဖၪ, ဒဲထံၫၥံၪခးၥံၪ,ဒဲအဆၧမၩ ဎွ့ၩဝ့ၫနီၪအီၪယူဝ့ၫလၧအယုၩ့ဆၧအၥီၫ အကၠီၩ့နီၪ",
			"8": "<sup>8</sup> လီၫ.- ထီးနီၪလဖၧၫ့ၦဆၨၩလဖၪ အီၪက့ၪအၥၭထၫ့ဒၩ အဝ့ၫအီၪဖီၩ့အခးလဖၪအဖၧၩ့တၭ, ခွံၬအၡၬလၧအ",
			"9": "<sup>9</sup> ဖၫ့ခိၪတၭ,ဖီၪ့န့အဝ့ၫလၧအဆၧဖၧၩ့လီၫ- ဒုၭနုၬအဝ့ၫ အီၪလၧၥွ့ၫထၭလၧဆၧအဖၧၩ့တၭ, ဆိၬဝ့ၫထီၩ့လၧ ဘၭဘလၧၫ့အစဎွၩအအီၪတၭ, ဒုၭနုၬဝ့ၫလၧထီၫ့ဖၧၩ့, ဘဲၫၥိၭဆၧထီးနါဂၧၫ့လၧၩ့အလူ လၧအံၫစရ့လၭအခိၪ လီၩ့ထိၩ့ချိၬအကျၩလဂ့ၩလီၫ.",
			"10": "<sup>10</sup> နမိမွဲဘဲၫနနၫ့ဆါဒၪနဝ့ၫအၥိၭ, မၩအၥၭဘဲၫစဘံၭမု ၥုၪ့လၩ့အၥၭလၧထံၫနဲၩ့အၥိၭနီၪလီၫ. မွဲထံၫအီၪအၪအ ကၠီၩ့တၭ,ၥၪထၪ့ဝ့ၫတၭ, ဎွ့ၩဝ့ၫလၧအထဲၩ့အဖၫ့လီၫ.",
			"11": "<sup>11</sup> အီၪဝ့ၫလၧအနိၪထိၭဘီၩ့ လၧၦလၧအပၧၩ့ဆၧအနိၪ ထိၭစဎွၩအဂးတၭ, အမုထၪ့ဝ့ၫလၧထဲၩ့လဖၪအကျၩ တၭ,အီၪဖျီၪထၪ့ထီၫထီၫလ့ၬ လၧအထဲၩ့အၪထဲၩ့အ",
			"12": "<sup>12</sup> ကျၩလီၫ.- မွဲလါနၫ့တၭဆၧထ့ၭထၪ့ခွံၬဝ့ၫလၧဆၧၥၭ ခဲၩထၪ့,ဆၧမၩလၩ့ဒၩအဝ့ၫလၧဂၪ့ခိၪအလီၩ့တၭ,လံၩ ဂဲၫထၪ့လၧမုထၪ့လခီၫ မၩဎဲၫ့ထၪ့ခွံၬအဆၧၥၪ, အနိၪ ထိၭဘီၩ့ခၧၫ့လဖၪခါဝ့ၫတၭ,ဎဲၫ့လၩ့ဝ့ၫနီၪး မ့ၪအၪ့ခွံၬ",
			"13": "<sup>13</sup> ဝ့ၫလီၫ.- ဘိၩ့နဲၪ့ယီၩဘၪဆၧၥုၪ့လၩ့ဝ့ၫလၧဂၪ့ခိၪဎဲၫ့,",
			"14": "<sup>14</sup> ဒဲဆၧဎဲၫ့ထၬအဖၧၩ့လၧၡါမုနၧၫ့ဖၫအဖၧၩ့လီၫ.- တၭ မ့ၪဂဲၫထၪ့ယူၭလၧအနိၪဘီၩ့လဘီၩ့အဖၧၩ့ လၧအထဲၩ့ ကျၩတၭ,အၪ့ခွံၬယူၭအဆၧၥၪယူၭ. အီၪလၧနိၪထိၭ ခၧၫ့နိၪထိၭစဎွၩလၧအမိပၧၩ့ဆၧအဂးနးဘီၩ့အ့ၬ. အ နီၪမွဲဂၪ့ဆၧယၧၩ့ဆၧတၭ, မိဘၪအီၪဝ့ၫလၧဂၪ့ဆၧ ယၧၩ့ဆၧအဂးဆ့လီၫ."
		},
		"20": {
			"1": "<sup>1</sup> လၧနံၪ့နွ့ၫနံၪ့လနံၪ့လၩယဲဘံၪ့လဘံၪ့, လၩထၪ့ဆံၫ နံၩလနံၩနီၪ ဆၧမၩအၥၭ လၧအံၫစရ့လၭ အၥုၪ့က့ၭ ၥၭၡါလနၩ့ ဂဲၫအၪ့စၪ့ယဟိဝၩတၭ, ဆၧၫ့နၩ့ဝ့ၫလၧ",
			"2": "<sup>2</sup> ယမ့ၬယၫလီၫ.- ထီးနီၪလဖၧၫ့ယဟိဝၩအလူလၩ့ဘၪ",
			"3": "<sup>3</sup> ယၧၩတၭ,စံၭဝ့ၫဒၪ,- ၦၡၩအဖိၪခွၫဧ့,ချဲၩ့ဆၧလၧအံၫ စရ့လၭအၥုၪ့က့ၭၥၭၡါတၭ, စံၭအဝ့ၫၥံၪကဆါယဟိ ဝၩစံၭဘဲၫယီၩ,နၥံၪဂဲၫအၪ့စၪ့ယၧၩဆ့ဧၪ. ယမၧၫ့ယ ဝ့ၫကဆါယဟိဝၩစံၭဝ့ၫဒၪ, ယဒိၭဆၧအၪ့စၪ့လၧနၥံၪ",
			"4": "<sup>4</sup> အ့ၬ.- နမိစ့ၩရၫ့အဝ့ၫၥံၪဆ့ဧၪ, ၦၡၩအဖိၪခွၫဧ့,နမိစ့ၩ ရၫ့အဝ့ၫၥံၪဆ့ဧၪ, ဒုၭၥ့ၪယၫအဝ့ၫၥံၪလၧအဖါလဖၪ",
			"5": "<sup>5</sup> အဆၧၥၭလိၪဆံၭ.- စံၭအဝ့ၫၥံၪ, ကဆါယဟိဝၩစံၭ ဘဲၫယီၩ,မုလနံၩလၧယရွံန့အံၫစရ့လၭ, ဒဲယူၬထၪ့ ယစူၪလၧစယၫကူၭအၡၩဂံၪ့ဖိၪအချံၫအၥၪ,ဒဲနဲၪဖျီၪ ထၪ့အၥၭလၧအဝ့ၫၥံၪအမ့ၬယၫ လၧခးအံဇံၭအဖၧၩ့, ဒဲယယူၬထၪ့ယစူၪလၧအအီၪတၭ, စံၭ,ယမွဲယဟိဝၩ နၥံၪအယွၩလီၫ.",
			"6": "<sup>6</sup> မုလနံၩနီၪယယူၬထၪ့ယစူၪလၧအအီၪတၭ,ယဆိၪ လၩ့ယၥၭလၧယမိဒုၭစဲၪ့ထၪ့ခွံၬအဝ့ၫၥံၪလၧ ခးအံဇံၭ အဖၧၩ့ လ့ၩနုၬလၧခးလဘံၪ့ လၧယအၪ့ဎၬယူၭလၧ အဂးလၧအယွၩဝ့ၫလၧဆၧနူထံၫ ဒဲန့ၫစၩ့လၧအမွဲခး",
			"7": "<sup>7</sup> ကိၭဘံၪ့ဒ့ၭၥံၪအဎံၫအလၩလီၫ.- တၭယစံၭအဝ့ၫၥံၪ, လဂၩဘၪလဂၩအမ့ၬၥၪအဆၧၥၭလိၪနီၪ,မွဲအခွံၬၡိၭ ခွံၬကိၭဂၩဒ့ၭဆုၬဆုၬဆံၭ.မၩဘၪၥၭလိၪနၥံၪအၥၭ လၧအံဇံၭအဆၧဂၩ့ဆၧဖၪ့လဂ့ၩ, ယဝ့ၫဒၪယီၩယမွဲ",
			"8": "<sup>8</sup> ယဟိဝၩနၥံၪအယွၩလီၫ.- မွဲလါနၫ့တၭ,အဝ့ၫၥံၪပိၩ့ ထၪ့ယၧၩခိၭနၪယလူအ့ၬ. ခွံၬၡိၭလဂၩဘၪလဂၩအ မ့ၬၥၪအဆၧၥၭလိၪဆုၬဆုၬအ့ၬ. တၭစဲၪ့ဒၪအံဇံၭအ ဆၧဂၩ့ဆၧဖၪ့ဆ့အ့ၬ. ထီးနီၪလဖၧၫ့ယစံၭ, ယမိဂါ လၩ့ယၥၭခဲၩထၪ့လၧအလီၩ့,ဘဲၫၥိၭယမိမၩလူၬခွံၬ ယၥၭထၪ့လၧအဖၩ့ခိၪ လၧခးအံဇံၭအၥၭကျၩလီၫ.",
			"9": "<sup>9</sup> မွဲလါနၫ့တၭယမၩဆၧလၧယမံၩ့အကၠီၩ့ဘဲၫၥိၭအထီး ဘၪၥၭလိၪ ဆၧလၧၦဆၨၩလဖၪအမ့ၬယၫ လၧအဝ့ၫ ၥံၪအီၪဝ့ၫလၧအကျၩလဂ့ၩနီၪ,ဒဲလၧယဒုၭစဲၪ့ထၪ့အ ဝ့ၫၥံၪလၧခးအံဇံၭအဖၧၩ့တၭ, ယနဲၪဖျီၪထၪ့ယၥၭ လၧအဝ့ၫၥံၪအမ့ၬယၫလီၫ.",
			"10": "<sup>10</sup> ယဒုၭစဲၪ့ထၪ့အဝ့ၫၥံၪလၧခးအံဇံၭအဖၧၩ့တၭ, ၥိၫ့ဝ့ၫ",
			"11": "<sup>11</sup> လၧၡါမုနၧၫ့ဖၫလီၫ.- ယဖ့ၪလၫ့အဝ့ၫၥံၪလၧယဆၧမၪ လူၬလဖၪတၭ, ယဒုၭၥ့ၪယၫအဝ့ၫၥံၪ လၧယဆၧစ့ၩ ရၫ့လၧၦအ့ၪထီးန့ဝ့ၫတၭ, မိမၧၫ့ဝ့ၫလၧအဖၧၩ့လီၫ.",
			"12": "<sup>12</sup> ယဖ့ၪလၫ့ဆ့အဝ့ၫၥံၪလၧယမးၥံၫအနံၩလဖၪလၧအ ကဲၪထၪ့ဆၧမၩနဲၪ့လၧယၧၩ ဒဲအဝ့ၫၥံၪအဘိၩ့ဆၧၩ့, ဘဲၫၥိၭအမိၥ့ၪယၫလၧယၧၩ ယဟိဝၩယီၩယအီၪက့ၪ",
			"13": "<sup>13</sup> ဆံၫ့ဎံၪအဝ့ၫၥံၪလီၫ.- မွဲလါနၫ့ဘိၩအံၫစရ့လၭအၡၩ ဂံၪ့ဖိၪပိၩ့ထၪ့ယၧၩလၧၡါမုနၧၫ့ဖၫလီၫ. အဝ့ၫၥံၪလ့ၩ လၧယဆၧမၪလူၬအဖၧၩ့အ့ၬ. လဒူၩလယၪ့ဘၪယဆၧ စ့ၩရၫ့လၧၦအ့ၪထီးန့ဝ့ၫမိမၧၫ့လၧအဖၧၩ့, ဒဲမၩဘၪၥၭ လိၪယမးၥံၫအနံၩလဖၪနၭမၬလီၫ. ထီးနီၪလဖၧၫ့ယ စံၭ,ယမိဂါလၩ့ယၥၭခဲၩထၪ့လၧအလီၩ့ လၧၡါမုနၧၫ့",
			"14": "<sup>14</sup> ဖၫဘဲၫၥိၭယမိမၩလူၬခွံၬဝ့ၫအဂဲးလီၫ.- မွဲလါနၫ့ဘိၩ လၧၦဆၨၩၥံၪလၧယဒုၭစဲၪ့ထၪ့ခွံၬ ၦၡၩလၧအမ့ၬယၫ နီၪ,ယမၩဆၧလၧယမံၩ့အကၠီၩ့, ဘဲၫၥိၭအထီးဘၪၥၭ",
			"15": "<sup>15</sup> လိၪလၧအကျၩလဂ့ၩလီၫ.- ယယူၬထၪ့ယစူၪလၧအ အီၪလၧၡါမုနၧၫ့ဖၫတၭ, ယဆိၪလၩ့ယၥၭလၧယမိ ဒုၭဂဲၫနုၬအဝ့ၫၥံၪလၧခးဖၧၩ့ လၧယဖ့ၪလၫ့ယူၭအဝ့ၫ ၥံၪလၧအလၩ့ယွၩဝ့ၫလၧဆၧနူထံၫဒဲန့ၫစၩ့ လၧအမွဲခး",
			"16": "<sup>16</sup> ကိၭဘံၪ့ဒ့ၭၥံၪအဆၧဎံၫဆၧလၩလီၫ.- အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪလဒူၩလယၪ့ဘၪ ယဆၧစ့ၩရၫ့လဖၪတၭ,လ့ၩ လၧယဆၧမၪလူၬလဖၪအဖၧၩ့အ့ၬ. အ့ၪမွဲမၩဘၪၥၭ လိၪယမးၥံၫအနံၩလဖၪလီၫ. အဂဲးဘဲၫယီၩအၥၭလ့ၩ",
			"17": "<sup>17</sup> ဖိၬအဆၧဂၩ့လဖၪအခဲၫ့လီၫ.- မွဲလါနၫ့ဘဲၫနီၪယမ့ၬၥၪ ၥံၪလီၫ့ကီၩ့အဝ့ၫၥံၪ, ယလမၩဂၭဂီၩ့ဘၪအဝ့ၫၥံၪ,ဒဲ",
			"18": "<sup>18</sup> ယလမၩလူၬခွံၬဘၪအဝ့ၫၥံၪလၧၡါမုနၧၫ့ဖၫလီၫ.- အ့ၪ မွဲယစံၭအဝ့ၫၥံၪအဖိၪအလံၩလၧၡါမုနၧၫ့ဖၫနီၪ, ထီး လ့ၩဆၧလၧနၥံၪအဖါၥံၪ အထူၫအရူၫအဖၧၩ့လဂ့ၩ, ဒဲထီးန့အဝ့ၫၥံၪအဆၧစ့ၩရၫ့လဂ့ၩး ဒဲနၥံၪထီးမၩဘၪ ၥၭလိၪနၥံၪအၥၭလၧအဝ့ၫၥံၪအဆၧဂၩ့ဆၧဖၪ့လဂ့ၩ.",
			"19": "<sup>19</sup> ယဝ့ၫဒၪယီၩယမွဲယဟိဝၩနၥံၪအယွၩတၭ, လ့ၩလၧ ယဆၧမၪလူၬအဖၧၩ့တၭ, ထီးန့ယဆၧစ့ၩရၫ့လဖၪဒဲ",
			"20": "<sup>20</sup> မၩဝ့ၫဆံၭ.- အီၪက့ၪဆံၫ့ဎံၪယမးၥံၫအနံၩလဖၪဆံၭ. ဆၧမိကဲၪထၪ့ဆၧမၩနဲၪ့လၧယၧၩ ဒဲနၥံၪအဘိၩ့ဆၧၩ့ ဘဲၫၥိၭနၥံၪမိၥ့ၪယၫ လၧယမွဲယဟိဝၩနၥံၪအယွၩ",
			"21": "<sup>21</sup> လီၫ.- မွဲလါနၫ့တၭအဖိၪအလံၩပိၩ့ထၪ့ယၧၩဒဲလလ့ၩ ဘၪလၧယဆၧမၪလူၬလဖၪအဖၧၩ့, ဒဲလထီးန့ဘၪယ ဆၧစ့ၩရၫ့လဖၪ ဘဲၫၥိၭအမိမၩဝ့ၫအဂး,လၧၦအ့ၪမၩ ဝ့ၫတၭ,မိမၧၫ့ဝ့ၫလၧအဖၧၩ့နီၪး တၭအဝ့ၫၥံၪမၩဘၪ ၥၭလိၪယမးၥံၫအနံၩလဖၪလီၫ. ထီးနီၪလဖၧၫ့ယစံၭ, ယမိဂါလၩ့ယၥၭခဲၩထၪ့လၧအလီၩ့ ဘဲၫၥိၭယမိမၩ",
			"22": "<sup>22</sup> လူၬခွံၬယၥၭထၪ့အဝ့ၫၥံၪလၧၡါမုနၧၫ့ဖၫလီၫ.- မွဲလါ နၫ့တၭ,ယထုၭထဲၩ့ယစူၪ, ဒဲမၩဆၧလၧယမံၩ့အကၠီၩ့, ဘဲၫၥိၭအထီးဘၪၥၭလိၪ လၧၦဆၨၩလဖၪအမ့ၬယၫ",
			"23": "<sup>23</sup> လၧယဒုၭစဲၪ့ထၪ့ခွံၬအဝ့ၫၥံၪလၧအမ့ၬယၫလီၫ.- ယ ယၩ့ထၪ့ဆ့ယစူၪလၧအအီၪလၧၡါမုနၧၫ့ဖၫ, ဒဲယဆိၪ လၩ့ယၥၭလၧယမိမၩပြံၩပၩအဝ့ၫၥံၪ လၧၦဆၨၩလ ဖၪအကျၩ, ဒဲမၩလၩ့မုလၩ့ဖၭဝ့ၫလၧခးလဖၪအဖၧၩ့",
			"24": "<sup>24</sup> လီၫ.- အဂဲးဘဲၫယီၩအဝ့ၫၥံၪလမၩဘၪယဆၧစ့ၩရၫ့, ဒဲလဒူၩလယၪ့ဘၪ ယဆၧမၪလူၬလဖၪ, ဒဲမၩဘၪၥၭ လိၪယမးၥံၫအနံၩလဖၪတၭ, အမ့ၬၥၪလဖၪယိထွ့ၫ",
			"25": "<sup>25</sup> အဖါၥံၪအဆၧဂၩ့ဆၧဖၪ့အခဲၫ့လီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,ယဖ့ၪလၫ့ဆ့အဝ့ၫၥံၪ လၧဆၧအထူၫအရူၫလၧ အလဂ့ၩဘၪ,ဒဲဆၧစ့ၩရၫ့လၧအလမၧၫ့ဘၪဝ့ၫလၧအ",
			"26": "<sup>26</sup> ဖၧၩ့,- ဒဲယမၩဘၪၥၭလိၪအဝ့ၫၥံၪလၧအဆၧမၩဘိၪ့ ဒၪဝ့ၫအဖၧၩ့, လၧအဒုၭခၫ့ဂၬကယဲၦအဖိၪဝဲၡါလၧမ့ၪ ဖၧၩ့အကၠီၩ့, ဘဲၫၥိၭယမိမၩဂၭဂီၩ့အဝ့ၫၥံၪ, လၧအမိ ၥ့ၪယၫလၧယမွဲယဟိဝၩအဂဲးလီၫ.",
			"27": "<sup>27</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦၡၩအဖိၪခွၫဧ့,ချဲၩ့ဆၧလၧ အံၫစရ့လၭအၡၩဂံၪ့ဖိၪတၭ, စံၭအဝ့ၫၥံၪ, ကဆါယ ဟိဝၩစံၭဘဲၫယီၩ, လါနၫ့လၧဆၧယီၩအဖၧၩ့နၥံၪအ",
			"28": "<sup>28</sup> ဖါလဖၪဒုၪဒွ့ၪယၧၩ, ဒဲမၩမၪဘၪယၧၩလီၫ.- အဂဲး ဘဲၫယီၩထီးယဂဲၫဒုၭနုၬ အဝ့ၫၥံၪလၧခးဖၧၩ့ လၧယ ယူၬထၪ့ယစူၪ, ဒဲဆိၪလၩ့ယၥၭလၧယမိဖ့ၪလၫ့အဝ့ၫ ၥံၪတၭ, အဝ့ၫၥံၪဒၪဘၪဝ့ၫ လၧဆၧစီၩ့ခိၪထီၫ ထီးအ လူၬ,ဒဲၥံၪ့အတၪ့ထီးအလူၬတၭ, လုထၪ့အဆၧလုထီး နီၪ,ဒဲမၩဘိၪ့ဆၧလၧအထိၪဂဲၩဆၧၥၭထၪ့, ဒဲမၩဘိၪ့ အဆၧနၧၫ့မၧၫ့မုၬထီးနီၪ, ဒဲလူၫလၩ့အဆၧလုအီၩထီး",
			"29": "<sup>29</sup> နီၪလီၫ.- ထီးနီၪလဖၧၫ့ယစံၭအဝ့ၫၥံၪ, ဆၧအလးထၪ့ ထီၫထီးနၥံၪလ့ၩဆၧနီၪ, မွဲဘဲၫၥ့ၪလဲၪ. လါနၫ့တၭ, အမံၩ့မွဲဆၧအလးထၪ့ထီၫ ထီးမုဆၫလနံၩယီၩလီၫ.",
			"30": "<sup>30</sup> မၩအၥၭဘဲၫနီၪတၭ, စံၭအံၫစရ့လၭအၡၩဂံၪ့ဖိၪ, က ဆါယဟိဝၩစံၭဘဲၫယီၩ, နၥံၪဘၪၥၭလိၪဘဲၫနၥံၪအ ဖါအၥိၭ,ဒဲနၥံၪမၩဆၧလဲးဆၧဘျၪ ဖိၬအဆၧဘၪၥၭ",
			"31": "<sup>31</sup> လိၪအခဲၫ့အ့ၬဧၪ.- ထီးနၥံၪမၩဘိၪ့နၥံၪအဆၧ ဒဲထီး နၥံၪဒုၭခၫ့ဂၬနၥံၪအဖိၪခွၫၥံၪလၧမ့ၪဖၧၩ့တၭ, နၥံၪမၩ ဘၪၥၭလိၪနၥံၪအၥၭ လၧနၥံၪအဆၧဂၩ့ဆၧဖၪ့ ထီး လၧမုဆၫလနံၩယီၩတၭး ယမိဒိၭဆၧအၪ့စၪ့လၧနၥံၪ ဆ့ဧၪ. အံၫစရ့လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့, ယမၧၫ့ယဝ့ၫ, ကဆါယဟိဝၩ စံၭဝ့ၫဒၪ, ယဒိၭဆၧအၪ့စၪ့လၧနၥံၪ",
			"32": "<sup>32</sup> အ့ၬ.- ဆၧဂဲၫထၪ့လၧနၥံၪအၥၭဖၧၩ့, ထီးနၥံၪစံၭ,ပမိ မၩဘဲၫၦဆၨၩလဖၪအၥိၭ, ဘဲၫထံၫၥံၪခးၥံၪအဂံၪ့ဒီၪ့ လဖၪလၧအမၩၥံၪ့ၥံၪဝၪၥံၪ, ဒဲလိးၥံၪလဲၫ့ၥံၪအဆၧမၩ အၥိၭနီၪကဲၪထၪ့ဆၧအ့ၬ.",
			"33": "<sup>33</sup> ယမၧၫ့ယဝ့ၫကဆါယဟိဝၩစံၭဝ့ၫဒၪ,မွဲမၬ, ယမိ ပၧၩ့နၥံၪလၧယစူၪဆီၪ့, ဒဲယစူၪဒူၪယၩ့ထၪ့အၥၭ,ဒဲ",
			"34": "<sup>34</sup> လၧယၥၭခဲၩထၪ့ဂါလၩ့အၥၭလီၫ.- ယမိဒုၭစဲၪ့ထၪ့ ခွံၬနၥံၪလၧၦဆၨၩလဖၪအကျၩတၭ, ယမိအၪ့ထုၫ့ ကီၪ့နၥံၪလၧခးလဖၪအဖၧၩ့ ထီးနၥံၪအီၪပြံၩပၩလၧ အဖၧၩ့လၧယစူၪဆီၪ့ဒဲယစူၪဒူၪယၩ့ထၪ့အၥၭး ဒဲလၧ",
			"35": "<sup>35</sup> ယၥၭခဲၩထၪ့ဂါလၩ့အၥၭလီၫ.- ယမိဒုၭဂဲၫနၥံၪလၧ ၦဆၨၩလဖၪအၡါမုနၧၫ့ဖၫတၭ, ယချဲၩ့ခွးယိမ့ၬခီၫမ့ၬ",
			"36": "<sup>36</sup> လၧနၥံၪထီးနီၪလီၫ.- ဘဲၫယစ့ၩရၫ့နၥံၪအဖါ လၧခး အံဇံၭအၡါမုနၧၫ့ဖၫအၥိၭနီၪ, ယမိစ့ၩရၫ့နၥံၪ ဘဲၫနီၪ",
			"37": "<sup>37</sup> ၥိၭ,ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.- ယမိဒုၭခၫ့ဂၬနၥံၪလၧ နိၪထးအဖၫ့လၬတၭ, ယမိဒုၭဂဲၫနုၬနၥံၪလၧဆၧအုၩ့",
			"38": "<sup>38</sup> လၩ့အဆၧစၧၩ့ထၬအဖၧၩ့လီၫ.- ယမိဒုၭစဲၪ့ထၪ့ခွံၬ ၦပိၩ့ထၪ့ဆၧ,ဒဲၦလၧအမၩမၪဘၪယၧၩ လၧနၥံၪအ ကျၩတၭ, ယမိဒုၭစဲၪ့ထၪ့အဝ့ၫၥံၪ လၧခးဖၧၩ့ထီးအ အီၪဝ့ၫလၧအဖၧၩ့တၭ, လ့ၩနုၬဘၪလၧခးအံၫစရ့လၭ အဖၧၩ့အ့ၬ. တၭနၥံၪမိၥ့ၪယၫလၧယမွဲယဟိဝၩလီၫ.",
			"39": "<sup>39</sup> ဆၧလၧနၥံၪဝ့ၫယီၩ, အံၫစရ့လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့,က ဆါယဟိဝၩစံၭဘဲၫယီၩ, နၥံၪအ့ၪလခိၭနၪဘၪယလူ တၭ,လ့ၩဘီၪ, မၩနၥံၪဝ့ၫ လၧဆၧဂၩ့ဆၧဖၪ့အဆၧ လၧယၫကိၭဂၩဒ့ၭဆုၬဆုၬဆံၭ. မွဲလါနၫ့တၭ,မၩဘၪ ၥၭလိၪလၧၩ့ယမံၩ့ဆံၫ့ဎံၪလၧနၥံၪအဆၧမၩဘိၪ့, ဒဲန",
			"40": "<sup>40</sup> ၥံၪအဆၧဂၩ့နီၪလဂ့ၩ.- အဂဲးဘဲၫယီၩလၧယခိၪလီၩ့ ဆံၫ့ဎံၪအလီၩ့ လၧအံၫစရ့လၭအခိၪလီၩ့ထီၫအလီၩ့ နီၪအံၫစရ့လၭအၡၩဂံၪ့ဖိၪထီးအလူၬ, ဒဲကယဲၦလၧ အအီၪလၧခးဖၧၩ့ ထီးအလူၬနီၪ မိမၩယဆၧထီးနီၪ လီၫ.ယမိထိးဆၧၫ့အဝ့ၫၥံၪထီးနီၪတၭ, ယမိအၪ့ကံၩ့ နၥံၪအဆၧမၩဘိၪ့, ဒဲနၥံၪအဆၧမၩဘိၪ့အဆၧၥၪဆိၫ,",
			"41": "<sup>41</sup> ဒဲဆၧလၧနၥံၪအီၪက့ၪဆံၫ့ဎံၪထီးအလူၬနီၪလီၫ.- ထီး ယအ့ၪဒုၭစဲၪ့ထၪ့ခွံၬ နၥံၪလၧၦဆၨၩလဖၪအကျၩ, ဒဲ အၪ့ထုၫ့ကီၪ့နၥံၪလၧကယဲခးလၧနၥံၪအီၪပြံၩပၩလၧ အဖၧၩ့တၭ, ယမိထိးဆၧၫ့နၥံၪဘဲၫဆၧနၧၫ့မၧၫ့အၥိၭ လီၫ.တၭဆၧမိအီၪက့ၪဆံၫ့ဎံၪယၧၩလၧနၥံၪအကၠီၩ့",
			"42": "<sup>42</sup> လၧၦဆၨၩလဖၪအမ့ၬယၫလီၫ.- ထီးယဒုၭဂဲၫနုၬနၥံၪ လၧခးအံၫစရ့လၭအဖၧၩ့ လၧယယူၬထၪ့ယစူၪဒဲဆိၪ လၩ့ယၥၭလၧယမိဖ့ၪလၫ့ဝ့ၫ လၧနၥံၪအဖါလဖၪတၭ,",
			"43": "<sup>43</sup> နၥံၪမိၥ့ၪယၫလၧယမွဲယဟိဝၩလီၫ.- ထီးနီၪနၥံၪမိနၪ့ ထၪ့ထဲၩ့နၥံၪအဖၧၩ့ၥုၪ့ဖၧၩ့ၥၭ ဒဲနၥံၪမၩဆၧထီးအ လူၬလၧနၥံၪဘၪၥၭလိၪ လၧအဖၧၩ့တၭ,နၥံၪမိၥၭဂဲၫ့ လၩ့နၥံၪအၥၭလၧကယဲနၥံၪမၩဆၧအၧၩ့ လၧနၥံၪမၩ",
			"44": "<sup>44</sup> ဝ့ၫအကၠီၩ့လီၫ.- ထီးယမၩဆၧလၧနၥံၪ လၧယမံၩ့အ ကၠီၩ့လမွဲဘၪဘဲၫနၥံၪအဖၧၩ့ၥၭအၧၩ့အၥိၭ, ဒဲလမွဲဘၪ ဘဲၫနၥံၪမၩဆၧဘၪၥၭလိၪအၥိၭတၭ, နၥံၪမိၥ့ၪယၫ လၧယမွဲယဟိဝၩ, အံၫစရ့လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့, က ဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"45": "<sup>45</sup> လၧနီၪအမ့ၬယၫ ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,",
			"46": "<sup>46</sup> စံၭဝ့ၫဒၪ,- ၦၡၩအဖိၪခွၫဧ့, ဒိၭနမ့ၬ လၧမုခံၫ့လခီၫ ဆံၭ.ဒုၭလၩ့ဆၩ့နဆၧချဲၩ့လၧမုခံၫ့တၭ, ချဲၩ့ဆၧလၧ မီၪအချိၬထၫ့ဒၩၥံၪ့လဒီၪ့ လၧမံၩ့လၬကျၩ လၧမုခံၫ့လ",
			"47": "<sup>47</sup> ခီၫနီၪဆံၭ.- တၭစံၭၥံၪ့လဒီၪ့လၧမုခံၫ့လခီၫ, ခိၭနၪယ ဟိဝၩအလူဆံၭ. ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ယိခွါ, ယမိဆူၭခဲၩထၪ့မ့ၪလၧနကျၩ လၧအမိအၪ့ခွံၬကယဲၥံၪ့ ၥံၫ့ဆ့ၬဒဲကယဲၥံၪ့ဎဲၫ့လထုၪ့ လါလါလၧနကျၩလီၫ. မ့ၪလၪလၩ့ဖံၭဘၪအ့ၬး မိအၪ့ခွံၬ ကယဲၦမ့ၬၥံၪလၧမု",
			"48": "<sup>48</sup> ခံၫ့ဖိးလၧမုဖၩနီၪထီးအလူၬး- ကယဲဆၧဖံၭဆၧယၪ မိဒၪဘၪဝ့ၫလၧယၧၩ, ယဟိဝၩယီၩ ယဆူၭခဲၩခွံၬအ",
			"49": "<sup>49</sup> ဝ့ၫၥံၪတၭ, လၩ့ဖံၭဘၪအ့ၬ.- ထီးနီၪလဖၧၫ့ ယစံၭ, အၩလါ,ကဆါယဟိဝၩဧ့ၬၦစံၭလၧအဂဲးနီၪ, အဝ့ၫ ဒၪချဲၩ့ဆၧချဲၩ့အဒီၩ့မွဲအ့ၬဧၪ."
		},
		"21": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,စံၭဝ့ၫဒၪ, ၦၡၩ အဖိၪခွၫဧ့, ဒိၭနမ့ၬလၧယရုစလံၫ့တၭ, ဒုၭလၩ့ဆၩ့ နဆၧချဲၩ့လၧဆၧအလးဆံၫ့ဎံၪလဖၪအအီၪ, ဒဲချဲၩ့ဆၧ",
			"3": "<sup>3</sup> လၧမီၪအချိၬထၫ့ဒၩအံၫစရ့လၭအခး,- တၭစံၭခးအံၫ စရ့လၭယဟိဝၩစံၭဘဲၫယီၩ,ယိခွါ, ယထၫ့ဒၩနၧၩ တၭ,ယမိထုၭထၪ့ခွံၬယနၭလၧအကၠိၭဖၧၩ့, ယမိဒၪ့",
			"4": "<sup>4</sup> ထ့ၬခွံၬၦအတီၩဒဲၦလတီၩဘၪလၧနကျၩလီၫ.- မွဲယမိ ဒၪ့ထ့ၬခွံၬၦအတီၩ, ဒဲၦလတီၩဘၪလၧနကျၩတၭ,ယ နၭမိဂဲၫထၪ့လၧအကၠိၭဖၧၩ့ ထၫ့ဒၩဆၧဖံၭဆၧယၪထီး",
			"5": "<sup>5</sup> အလူၬလၧမုခံၫ့ဖိးလၧမုဖၩလီၫ.- တၭဆၧဖံၭဆၧယၪ ထီးအလူၬမိၥ့ၪယၫဆၧလၧယၧၩ, ယဟိဝၩယီၩ, ယ ထုၭထၪ့ခွံၬယူၭယနၭ လၧအကၠိၭဖၧၩ့တၭ, မိဖျၪ့နုၬ",
			"6": "<sup>6</sup> လၧၩ့အၥၭအ့ၬ.- တၭနဝ့ၫဒၪယီၩ, ၦၡၩအဖိၪခွၫဧ့, ဂၪ့အုၩဂၪ့ထိၬဆံၭ, ဂၪ့အုၩဂၪ့ထိၬနၭနၭလ့ၬ,ဒဲနယး",
			"7": "<sup>7</sup> ဒံၩ့ခါလၧအဝ့ၫၥံၪအမ့ၬယၫဆံၭ.- ထီးၦစံၭနၧၩ,နဂၪ့ အုၩဂၪ့ထိၬမွဲဘၪလဲၪနီၪတၭ, ဆၧမၩအၥၭလၧနမိဘၪ စံၭ,ဆၧလၧဆၧပရၧၫ့အကၠီၩ့နီၪ လၧအဂဲၫဝ့ၫအကၠီၩ့ လီၫ.တၭၦၡၩအၥၭ မိဖံၪထၪ့ကိၭဂၩဒ့ၭ,ဒဲၦအစူၪမိ လၩ့ဆါထီးအလူၬ, ဒဲၦအၥၭမိလၩ့ဘဲၩကိၭဂၩဒ့ၭ,ဒဲ ၦအခၪ့လုးခိၪမိကဲၪထၪ့ဘဲၫထံၫအၥိၭ ထီးအလူၬလီၫ. ယိခွါ,ဆၧဂဲၫဝ့ၫတၭ, မိမၩအၥၭ, ကဆါယဟိဝၩစံၭ ဝ့ၫဒၪ.",
			"8": "<sup>8</sup> ယဟိဝၩအလူလၩ့ဘၪဒီၭယၧၩတၭ, စံၭဝ့ၫဒၪ,",
			"9": "<sup>9</sup> ၦၡၩအဖိၪခွၫဧ့, ချဲၩ့ဆၧလၧမီၪအချိၬတၭ, စံၭ, ယဟိ ဝၩစံၭဘဲၫယီၩ,စံၭ,နၭလဘံၪ့, နၭလဘံၪ့ကျဲၩ့ယူၭအ",
			"10": "<sup>10</sup> ၥၭ,ဒဲကျဲၩ့ဖျ့ၫယူၭအၥၭယူၭ.- ကျဲၩ့ယူၭအၥၭဘဲၫၥိၭ အမိမၩၥံၫဆၧနၭနၭလ့ၬတၭ, ကျဲၩ့ဖျ့ၫယူၭအၥၭဘဲၫ ၥိၭအမိယုၩ့ယဲလီၫ. အ့ၪလမွဲဘၪဘဲၫနီၪတၭ ပမိၥၭ ထိၬဆ့ဧၪ. ယဖိၪခွၫအနိၪထိၭဘီၩ့ မၩကြၩ့ထမးနိၪ",
			"11": "<sup>11</sup> ထိၭကိၭဘီၩ့ဒ့ၭလီၫ.- ဖ့ၪလၫ့ဝ့ၫဘဲၫၥိၭပမိကျဲၩ့ဖျ့ၫ လၧၦမိမၩဆၧလၧအဝ့ၫလီၫ. နၭလဘံၪ့နီၪကျဲၩ့ယူၭ အၥၭ,ဒဲကျဲၩ့ဖျ့ၫယူၭအၥၭ ဘဲၫၥိၭအမိဖ့ၪလၫ့အဝ့ၫ",
			"12": "<sup>12</sup> လၧၦမၩၥံၫဆၧအစူၪဖၧၩ့လီၫ.- ၦၡၩအဖိၪခွၫဧ့,ကိၭ ထၪ့ဒဲအိၩ့ယိၩ့ထၪ့ဆံၭ. အဂဲးဘဲၫယီၩ မိဘၪယၡၩ ခမျၧးအလီၩ့, မိဘၪအံၫစရ့လၭအၦဒိၪဖၭဒိၪထီးအ လူၬအလီၩ့လီၫ. ဆၧဖ့ၪလၫ့ခွံၬအဝ့ၫၥံၪ လၧနၭၥံၪဖၩ့ ၥံၪအီၪဝ့ၫလၧယၡၩခမျၧးလီၫ. မၩအၥၭဘဲၫနီၪတၭ,",
			"13": "<sup>13</sup> ဒိၪလၩ့နကံၪဒူၪဆံၭ.- အဂဲးဘဲၫယီၩ ဆၧမၩခွါယူၭ ဆၧယူၭ,နိၪထိၭလၧအမၩကြၩ့ထမးလဘီၩ့နီၪအ့ၪလ အီၪလၧၩ့ဘၪတၭ, မွဲဘဲၫၥ့ၪလဲၪ,ကဆါယဟိဝၩစံၭဝ့ၫ",
			"14": "<sup>14</sup> ဒၪ.- နဝ့ၫဒၪၦၡၩအဖိၪခွၫဧ့,ချဲၩ့ဆၧလၧမီၪအချိၬတၭ, ဒဲၩနစူၪဆံၭ. အဂဲးဘဲၫယီၩနၭၥံၪဖၩ့ၥံၪဂဲၫဝ့ၫနံၫဘျၩ့ ၥၧၫ့ဘျၩ့လီၫ. နၭလဘံၪ့လၧအမၩၥံၫဆၧ, နၭလဘံၪ့ လၧအမၩၥံၫဆၧအၪအၪလ့ၬ လၧအအီၪဝၬဖီၩ့ဝ့ၫကိၭ",
			"15": "<sup>15</sup> ခီၫဒ့ၭလီၫ.- ယအီၪက့ၪနၭ လၧအမၩၥၭမဲၪဆၧလၧ အတရၫ့ထီးအလူၬအလီၩ့, ဘဲၫၥိၭအၥၭမိလၩ့ဘဲၩ ဒဲ အဆၧလၩ့ဎီးအလးမိအၪထၪ့လီၫ. ယအီၪက့ၪနၭအ မၩၥၭမဲၪဆၧဆဲၫဎၩ့ ဒဲအတရၫ့ထီးအလူၬလီၫ. အၩ လါၬ ဆၧမိဒုၭယုၩ့ယဲဝ့ၫဘဲၫၥ့ၪလဲၪ. ကျဲၩ့ဖျ့ၫအၥၭလၧ",
			"16": "<sup>16</sup> မၩၥံၫဆၧအဂးလီၫ.- အီၪလစီၪ့ဎးကျီၪ့ဆၧလၧနစူၪ ထွ့ၪလခီၫဆံၭ. တဲၩ့ဝဲၩနၥၭကျီၪ့ဆၧလၧနစူၪစ့ၪထီး",
			"17": "<sup>17</sup> နဒိၭနမ့ၬနီၪဆံၭ,- ယဝ့ၫဒၪယီၩယမိဒဲၩဆ့ယစူၪတၭ, ယၥၭခဲၩထၪ့မိထုၬလီၫ. ယၧၩယဟိဝၩယီၩ ယချဲၩ့ ဆၧလီၫ.",
			"18": "<sup>18</sup> ယဟိဝၩအလူလၩ့ဘၪဒီၭယၧၩတၭ, စံၭဝ့ၫဒၪ,",
			"19": "<sup>19</sup> ၦၡၩအဖိၪခွၫဧ့, ဘဲၫၥိၭဘၭဘလၧၫ့အစဎွၩအနၭလ ဘံၪ့မိဂဲၫဝ့ၫတၭး အီၪက့ၪဖၧၩ့ၥၭနံၫဘီၩ့နီၪ လၧနဂး ဆံၭ.နံၫဘီၩ့လူၬနီၪ မိဘၪဂဲၫထၪ့လၧခးလဘံၪ့ဎးအ ဖၧၩ့လီၫ. ရွံန့ဆၧအလးလစီၪ့တၭ, ရွံန့ဝ့ၫနီၪလၧဖၧၩ့",
			"20": "<sup>20</sup> ၥၭလ့ၩလၧဒိၩ့ဖၧၩ့လဘီၩ့ အခၪ့ထံၭနီၪဆံၭ.- အီၪ က့ၪဖၧၩ့ၥၭလဘီၩ့ဘဲၫၥိၭနၭလဘံၪ့နီၪ မိဂဲၫလၧၦအၫ မၧၫ့ဖိၪလၧရၭဘၭအဖၧၩ့, ဒဲလၧယုဒၫဖိးလၧယရုစလံၫ့",
			"21": "<sup>21</sup> ဒိၩ့လဖျိၪ့အီၪလၧအခိၪဒၧၩ့နီၪဆံၭ.- အဂဲးဘဲၫယီၩ ဘၭဘလၧၫ့အစဎွၩ ဆၧၫ့ထုၪ့ဝ့ၫ ထီးဖၧၩ့ၥၭထဲၩ့ဖၭ လၧဖၧၩ့ၥၭနံၫဘီၩ့အခၪ့ထံၭ, ဘဲၫၥိၭအမိအၪ့ဖၩ့ဆၧ လီၫ.မၩဆၧအူၪဆၧပီၩတၭ, အဝ့ၫမၩယုၩ့ယဲအဖျါ လဖၪ,အဝ့ၫအၪ့စၪ့ဆၧလၧဆၧဂၩ့လဖၪတၭ, ယိဝ့ၫလၧ",
			"22": "<sup>22</sup> ဆၧအၥုၪ့လီၫ.- မိမၩန့ဆၧအူၪဆၧပီၩလၧယရုစလံၫ့ အဂး,လၧအစူၪထွ့ၪနီၪ, ဘဲၫၥိၭ, ၦမိအီၪက့ၪလၩ့စဲၭ ဘုၪ့ဖိးဆၧ, ဘဲၫၥိၭၦမိအၩ့ထၪ့အနိၭ, ဒဲကိၭၡၭထၪ့ ဘဲၫၥိၭပမိထုၭထၪ့အလူ, ဘဲၫၥိၭပမိအီၪက့ၪစဲၭဘုၪ့ ဖိးဆၧအီၪဆဲၫဎၩ့လၧတရၫ့လဖၪနီၪ, ဒဲဘဲၫၥိၭပမိမၩ",
			"23": "<sup>23</sup> ထိၬနီၪလီၫ.- ၦလဖၪနီၪဆိၪလၩ့အၥၭ လၧအဝ့ၫအ ကၠီၩ့တၭ, အဝ့ၫနီၪမိမၩအၥၭဘဲၫ ဆၧအၪ့ဖၩ့အၪ့လီၫ ဆၧလၧအဝ့ၫၥံၪအမ့ၬယၫအၥိၭလီၫ. မွဲလါနၫ့တၭ,မိ ဒုၭနၪ့ထၪ့ထဲၩ့အဝ့ၫၥံၪအဆၧဒဲၩဘၭ, ဘဲၫၥိၭအမိဘၪ",
			"24": "<sup>24</sup> ဆၧမၩန့ဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ကဆါယဟိ ဝၩစံၭဘဲၫယီၩ, မွဲနၥံၪအဆၧမၪအီၪဖျီၪထၪ့တၭ, နၥံၪ ဒုၭနၪ့ထၪ့ထဲၩ့နၥံၪအဆၧဒဲၩဘၭလီၫ. နၥံၪအဆၧဒဲၩ ဘၭအီၪဖျီၪဝ့ၫလၧနၥံၪမၩဆၧ ထီးအလူၬအကျၩလီၫ. ယစံၭမွဲနၥံၪနၪ့ထၪ့ထဲၩ့ယူၭနၥံၪအၥၭယူၭတၭ, ဆၧ မိမၩန့နၥံၪလၧဆၧအစူၪလီၫ.",
			"25": "<sup>25</sup> နဝ့ၫဒၪယီၩ အံၫစရ့လၭအၦဒိၪဖၭဒိၪ အအၧၩ့လ တီၩလလီၩ့ဘၪ, လၧအမုနံၩလနံၩဘၪယူၭ ထီးအ",
			"26": "<sup>26</sup> ဆၧၫ့အထီလၧဆၧဒဲၩဘၭမိလူၬဝ့ၫ, လဂၩဧ့,- ကဆါ ယဟိဝၩစံၭဘဲၫယီၩ, ဘဲၪ့လၩ့ခွံၬဖျံၩပၪပဲၪတၭ, ထုၭ လၩ့ထဲၩ့ၥရဖူၩဆံၭ. မွဲလၧၩ့နဆၧအ့ၬ. ယအီၪက့ၪ ထၪ့ထီၫၦလၧအဆၪ့လၩ့အၥၭတၭ, ယဆၪ့လၩ့ၦလၧ",
			"27": "<sup>27</sup> အအီၪက့ၪထၪ့ထီၫအၥၭလီၫ.- ယမိချႃၬလၩ့, ချႃၬလၩ့, ချႃၬလၩ့ဝ့ၫလီၫ. ဆၧလမိအီၪလၧၩ့ဘၪထီးၦလဂၩလၧ အမွဲအဆၧတီၩမိဂဲၫထီၩ့တၭ, ယမိဖ့ၪလၫ့ လၧအဝ့ၫ နီၪလီၫ.",
			"28": "<sup>28</sup> နဝ့ၫဒၪၦၡၩအဖိၪခွၫဧ့, ချဲၩ့ဆၧလၧမီၪအချိၬတၭ, စံၭ,ကဆါယဟိဝၩစံၭ ၦအၫမၧၫ့ဖိၪအဂဲး, ဒဲလၧအ ဆၧဒုၪဒွ့ၪအဂဲးဘဲၫယီၩ, နစံၭနဝ့ၫ, နၭၥံၪဖၩ့ၥံၪထုၭ ထၪ့ခွံၬယူၭအၥၭယူၭ, ကျဲၩ့ဖျ့ၫယူၭအၥၭယုၩ့ယဲဖၩ့ ထၪ့လၧဆၧမၩၥံၫဆၧအဂး လၧဆၧမၪလူၬဆၧအဂး",
			"29": "<sup>29</sup> လီၫ.- အဝ့ၫၥံၪဒၪဆၧပျီၩပျီၩလၧနဂး, ဒဲချဲၩ့ဘျံၭချဲၩ့ ဘျၪလၧမီၪအချိၬလၧနဂး, ဘဲၫၥိၭအမိဒုၭလၩ့ဘၪနၧၩ လၧၦလတီၩလလီၩ့ဘၪအခိၬ လၧအဘၪဆၧမၩၥံၫ ဝ့ၫ,ၦလၧအမုလနံၩဘၪ ထီးအဆၧၫ့အထီလၧဆၧဒဲၩ",
			"30": "<sup>30</sup> ဘၭမၩလူၬဆၧလီၫ.- ဖျၪ့နုၬထဲၩ့နၭလၧအကၠိၭဖၧၩ့ ဆံၭ.ယမိစ့ၩရၫ့နၧၩ ထီးအလးလၧဆၧတဲၩ့လၩ့နၧၩ",
			"31": "<sup>31</sup> လၧအဖၧၩ့,လၧနအီၪဖျဲၪအခးဖၧၩ့လီၫ.- ယမိဂါလၩ့ ယၥၭထၪ့ဆီၪ့လၧနဖၫ့ခိၪ, ယမိအူၪဘၪနၧၩလၧယ ၥၭခဲၩထၪ့အမ့ၪတၭ, ယမိဖ့ၪလၫ့ခွံၬနၧၩလၧၦဘၪဆဲၫ့ လၧဆၧဖိၪဆၧဎါအစူၪဖၧၩ့ လၧအမၩဂၭဂီၩ့ဆၧၥ့ၪ",
			"32": "<sup>32</sup> လီၫ.- နမိကဲၪထၪ့ၥံၪ့မုလၧမ့ၪအဂး,နၥွံၪမိအီၪလၧခး အၥၭကျၩလီၫ. ၦၡၩမိနၪ့ထၪ့ထဲၩ့လၧၩ့နၧၩအ့ၬ. အ ဂဲးဘဲၫယီၩဆၧလၧယၧၩယဟိဝၩယီၩ ယချဲၩ့ဆၧလီၫ."
		},
		"22": {
			"1": "<sup>1</sup> လၧနီၪအမ့ၬယၫ, ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,",
			"2": "<sup>2</sup> စံၭဝ့ၫဒၪ,- နဝ့ၫဒၪယီၩၦၡၩအဖိၪခွၫဧ့,နမိစ့ၩရၫ့ဒိၩ့ အီၪလၧဆၧၥွံၪနီၪဧၪ. မွဲမၬ,ဒုၭၥ့ၪယၫအဝ့ၫလၧအ",
			"3": "<sup>3</sup> ဆၧဘၪၥၭလိၪထီးအလူၬနီၪဆံၭ.- တၭစံၭ,ကဆါယ ဟိဝၩစံၭဘဲၫယီၩ, ဒိၩ့လၧအဂါလၩ့ဆၧၥွံၪလၧအၥၭ ကျၩဘဲၫၥိၭအဆၧၫ့အထီမိဘၪ, ဒဲတဲၩ့အဆၧဂၩ့ဘဲၫ",
			"4": "<sup>4</sup> ၥိၭအမိဘၪၥၭလိၪအၥၭလဖျိၪ့ဧ့,- နဘၪဆၧဒဲၩဘၭ လၧဆၧၥွံၪလၧနဂါလၩ့ဝ့ၫအကၠီၩ့, ဒဲမၩဘၪၥၭလိၪန ၥၭလၧနဆၧဂၩ့ လၧနတဲၩ့ဝ့ၫအကၠီၩ့, နဒုၭဂဲၫဘူၭနမု နံၩလဖၪတၭ, နဒုၭဘၪနနံၪ့နလၩလီၫ. မၩအၥၭဘဲၫ နီၪတၭ,ယအီၪက့ၪနၧၩ လၧဆၧဒုၪဒွ့ၪအလး လၧၦ ဆၨၩလဖၪအကျၩ, ဒဲဆၧမၩကြၩ့ထမးအလးလၧခး",
			"5": "<sup>5</sup> ထီးအလူၬအဖၧၩ့လီၫ.- ၦအီၪဘူၭ, ဒဲၦအီၪယဲၩ့လၧ နၧၩ,မိမၩကြၩ့ထမးနၧၩ, ဘဲၫၦလၧအမံၩ့ဘၪၥၭလိၪ,",
			"6": "<sup>6</sup> ၦဘၪဆၧခိဆၧဝီၩအၪအၪလ့ၬအၥိၭနီၪလီၫ.- ယိခွါ, အံၫစရ့လၭအၦဒိၪဖၭဒိၪလဖၪနီၪ အီၪဝ့ၫလၧနဖၧၩ့, လဂၩဘၪလဂၩ ဘဲၫအစီၩ့အမၩ့အီၪဝ့ၫအၥိၭနီၪ, အ",
			"7": "<sup>7</sup> စူၪအီၪလၧအမိဂါလၩ့ဆၧၥွံၪဆုၬဆုၬလီၫ.- ၦမၩကြၩ့ ထမးအမိဒဲအဖါလၧနဖၧၩ့နီၪ, ၦမၩၡၪ့မၩနၭၦလခီၫ ဘၩ့မုးဖိၪလၧနဖၧၩ့နီၪ, ဒဲၦမၩအၧၩ့ၦဖိၪဎွ့ၪဒဲၦမုၪမဲၫ",
			"8": "<sup>8</sup> လၧနဖၧၩ့နီၪဆ့လီၫ.- နလဒူၩယယၪ့ဘၪယဆၧဆံၫ့ ဎံၪလဖၪတၭ, နမၩဘၪၥၭလိၪ ယမးၥံၫအနံၩ လဖၪ",
			"9": "<sup>9</sup> လီၫ.- ၦလ့ၩချဲၩ့ခဲၪဆၧဘဲၫၥိၭအမိဂါလၩ့ဆၧၥွံၪအီၪ ဝ့ၫလၧနဖၧၩ့လီၫ. ၦအၪ့ဆၧလၧခိၪလီၩ့အလီၩ့ လၧန",
			"10": "<sup>10</sup> ဖၧၩ့တၭး ၦမၩဆၧလဲးဆၧဘျၪလၧနဖၧၩ့လီၫ.- ၦနဲၪ ဖျီၪအဖါအဆၧအီၪဘိၪ့လၧနဖၧၩ့လီၫ. ၦဆၪ့လၩ့ၦ မုၪလၧအလဆံၫ့ဘၪ လၧအအီၪလၧဆၧလၩ့ဖၭအဖၧၩ့",
			"11": "<sup>11</sup> လီၫ.- ၦလဂၩမၩဆၧဘၪၥၭလိၪလၧၦအီၪလၧအနဲၩ့ ထံၭအမၫ, ဒဲအလဂၩဒၪနီၪမၩစံၪစၪအဒဲၪလၧအၥၭ လဲးၥၭဘျၪတၭ, ၦအဂူၫဂၩလဂၩဆၪ့လၩ့အထၧၫ့ဖုဝဲ",
			"12": "<sup>12</sup> မုၪ,လၧအမွဲအဖါအဖိၪမုၪလၧနဖၧၩ့လီၫ.- ၦမၩန့လၬ ဆီၪ့လၧနဖၧၩ့ဘဲၫၥိၭအမိဂါလၩ့ဆၧၥွံၪလီၫ. တၭနမၩ န့စ့ၩအအ့ၪ,ဒဲဆၧအၪထၪ့တၭ, လၧနအၪ့ဘျံၭအၪ့ဘျၪ ၦလၧနနဲၩ့ထံၭအဆၧအကၠီၩ့နီၪ, နမၩအၪထၪ့နဆၧ တၭ,နၥၭနၪ့ယၧၩ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"13": "<sup>13</sup> မၩအၥၭဘဲၫနီၪတၭ, ယိခွါ,ယဒဲၩယစူၪလၧနအၪ့ ဘျံၭအၪ့ဘျၪဆၧလၧနန့ဝ့ၫအလီၩ့, ဒဲလၧၦအၥွံၪလၧ",
			"14": "<sup>14</sup> အဂါလၩ့အၥၭလၧနၥၭကျၩအလီၩ့လီၫ.- မုလနံၩလၧ ယမိမၩနၧၩနီၪမွဲနထိးမိကဲၪဧၪ. နစူၪမိဆီၪ့ဆ့ဧၪ.ဆၧ လၧယၧၩယဟိဝၩယီၩ, ယချဲၩ့ဆၧတၭ,ယမိမၩလီၫ.",
			"15": "<sup>15</sup> ယမိမၩလၩ့ပြံၩလၩ့ပၩနၧၩ လၧၦဆၨၩလဖၪအကျၩ ဒဲမၩလၩ့မုလၩ့ဖၭနၧၩလၧခးလဖၪအဖၧၩ့တၭ, ယမိ",
			"16": "<sup>16</sup> မၩလူၬခွံၬနဆၧအၧၩ့လၧနဖၧၩ့လီၫ.- နမိမၩၥၭလိၪ လၩ့နၥၭလၧၦဆၨၩလဖၪအမ့ၬယၫတၭ, နမိၥ့ၪယၫ လၧယမွဲယဟိဝၩလီၫ.",
			"17": "<sup>17</sup> ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,စံၭဝ့ၫဒၪ, ၦၡၩ အဖိၪခွၫဧ့, အံၫစရ့လၭအၡၩဂံၪ့ဖိၪကဲၪထၪ့လၧဆၧအ အ့ၪလၧယဂးလီၫ. အဝ့ၫၥံၪထီးအလူၬမွဲထီးဒဲၡၬ,ထၭ ဒဲၡၬၥၧၫ့လၧမ့ၪဖံၫ့ချၪအဖၧၩ့နီၪတၭး မွဲစ့ၩအအ့ၪလီၫ.",
			"19": "<sup>19</sup> မၩအၥၭဘဲၫနီၪတၭ, ကဆါယဟိဝၩစံၭဘဲၫယီၩ,မွဲန ၥံၪထီးအလူၬကဲၪထၪ့ဆၧအအ့ၪတၭ, မၩအၥၭဘဲၫနီၪ တၭ,ယိခွါ,ယမိဒုၭအီၪကီၪ့နၥံၪ လၧယရုစလံၫ့အၥၭ",
			"20": "<sup>20</sup> ကျၩလီၫ.- ဘဲၫၦအီၪက့ၪကီၪ့စ့ၩ,ဒဲထီၫ့,ဒဲထၭ, ဒဲၡၬ ၥၧၫ့,ဒဲၡၬလၧမ့ၪဖံၫ့ချၪအၥၭကျၩ ဘဲၫၥိၭအမိအူၪဘၪ မ့ၪလၧအဖၫ့ခိၪ, ဒဲမၩဖံၪထၪ့ဝ့ၫအၥိၭ, ယမိအီၪက့ၪ ကီၪ့နၥံၪလၧယၥၭထၪ့ ဒဲလၧယၥၭခဲၩထၪ့အဖၧၩ့တၭ, ယမိအီၪက့ၪလၩ့နၥံၪထီးနီၪတၭ, မၩဖံၪထၪ့နၥံၪဘဲၫ",
			"21": "<sup>21</sup> နီၪၥိၭလီၫ.- မွဲမၬ,ယမိအီၪက့ၪကီၪ့နၥံၪတၭ, ယမိအူၪ ဘၪနၥံၪလၧယၥၭခဲၩထၪ့အမ့ၪတၭ, နၥံၪမိဖံၪထၪ့လၧ",
			"22": "<sup>22</sup> အကျၩလီၫ.- ဘဲၫစ့ၩဖံၪထၪ့လၧမ့ၪဖံၫ့ချၪအကျၩအၥိၭ နီၪ,နၥံၪမိဖံၪထၪ့လၧအကျၩဘဲၫနီၪၥိၭတၭ, နၥံၪမိၥ့ၪ ယၫလၧယၧၩ, ယဟိဝၩယီၩ, ယဂါလၩ့ယၥၭခဲၩထၪ့ လၧနၥံၪအလီၩ့လီၫ.",
			"23": "<sup>23</sup> ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,စံၭဝ့ၫဒၪ, ၦၡၩ အဖိၪခွၫဧ့, စံၭအဝ့ၫ,နမွဲခးလဘံၪ့လၧဆၧလမၩဆံၫ့ ဘၪတၭ, ဆၧဂဲၫဆၧၩ့လၩ့လၧအဖၫ့ခိၪလၧယၥၭခဲၩ",
			"25": "<sup>25</sup> ထၪ့အမုလနံၩအဖၧၩ့အ့ၬ.- မီၪလဖၪအဆၧအုၩ့လၩ့ အအၧၩ့အီၪဝ့ၫလၧအဖၧၩ့လီၫ. ဘဲၫဆၬလၥၧၫ့လၧအ ယုၩ့ဆၧတၭ, အဲၪ့ၡၫ့ဆၧလၧအအၪ့ဂူၬန့ဝ့ၫအၥိၭနီၪး အဝ့ၫၥံၪအၪ့ခွံၬၦအၥၭၡီၩ့တၭ, အဝ့ၫၥံၪမၩန့ဆၧအီၪ က့ၪကီၪ့အၥၭဒဲအဆၧလူဒိၪဎွ့ၩဒိၪနီၪ, ဒဲအဝ့ၫၥံၪဒုၭ",
			"26": "<sup>26</sup> ကဲၪထၪ့ၦမုၪမဲၫအၪဂၩလၧအကျၩလီၫ.- အၡၩလုဆၧ လဖၪနီၪလုခၫ့ဖၬယဆၧၥီၪ့ဆၧၥၫ့တၭ, မၩဘၪၥၭလိၪ ယဆၧဆံၫ့ဎံၪလဖၪ, ဒဲဒုၭနဲၪဆၧအဆံၫ့ ဒဲဆၧလဆံၫ့ ဘၪအဆၧၫ့နးစီၪ့အ့ၬ. အီၪက့ၪကဒုၩအမ့ၬၥၪလၧယ မးၥံၫအနံၩလဖၪတၭ, မၩဘၪၥၭလိၪယၧၩလၧအကျၩ",
			"27": "<sup>27</sup> လီၫ.- အၦဒိၪဖၭဒိၪလၧအဖၧၩ့နီၪ မၩအၥၭဘဲၫထွံၪ မံၩ့အဲၪ့ၡၫ့ဆၧလၧအအၪ့ဂူၬန့ဝ့ၫအၥိၭနီၪလီၫ. ဂါလၩ့ ဆၧၥွံၪ,ဒဲမၩဂၭဂီၩ့ၦအၥၭၡီၩ့, ဘဲၫၥိၭအမိန့အၪထၪ့",
			"28": "<sup>28</sup> အဆၧလတီၩဘၪလီၫ.- အမီၪလဖၪ ဂုၪဆၧလၧအၩ့ ကထၨလဘုၭဘၪဒၪဘၪဆၧပျီၩပျီၩ, ဒဲအၪ့ဖၩ့ဆၧ အဘျံၭအဘျၪလၧအဝ့ၫၥံၪအဂးတၭ, စံၭ, ကဆါယ",
			"29": "<sup>29</sup> ဟိဝၩစံၭဘဲၫယီၩတၭ,ယဟိဝၩချဲၩ့ဆၧအ့ၬ.- ထံၫၥံၪ ခးၥံၪအၡၩခမျၧးမၩအၧၩ့ဆၧ, ဒဲအၪ့ဂူၬဆီၪ့ဆၧတၭ, နၥံၪမိမၩခိမၩဝီၩ ၦၡၪ့ဖိၪယၬဖိၪ, ဒဲၦဘၪၡၪ့ဘၪနၭ တၭ,မွဲမၬ,မၩအၧၩ့ၦလခီၫဘၩ့မုးဖိၪတၭ, ဆၧစ့ၩရၫ့",
			"30": "<sup>30</sup> အီၪအ့ၬ.- ယအၪ့ဎၬယူၭၦလၧအကျၩလဂၩလၧအမိ ဝၩ့ထၬဝ့ၫ, ဒဲဆၧၫ့ထုၪ့လၧဆၧဘုၪ့ဖိးအလးလၧယမ့ၬ ယၫလၧခးအဂး, ဘဲၫၥိၭယထီးမၩဂၭဂီၩ့အဝ့ၫလဂ့ၩ,",
			"31": "<sup>31</sup> လါနၫ့တၭ,ယဒၪန့နးမံၩ့အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, ယဂါလၩ့ယူၭ ယၥၭဆီၪ့လၧအဖၫ့ခိၪ ယမၩလူၬခွံၬ ယူၭအဝ့ၫၥံၪလၧယၥၭခဲၩထၪ့အမ့ၪယူၭလီၫ. ယဖ့ၪ ဆၧၫ့ထဲၩ့ယူၭ အဝ့ၫၥံၪအဖၧၩ့ၥၭဒၪဝ့ၫ လၧအခိၪဎွံၪ လဖၪအလီၩ့, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ."
		},
		"23": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၩ့ဘၪဒီၭယၧၩတၭ,စံၭဝ့ၫဒၪ. ၦ ၡၩအဖိၪခွၫဧ့,ၦမုၪနံၩဂၩ,အမိလဂၩဎးအီၪဝ့ၫလဖၧၫ့",
			"3": "<sup>3</sup> လီၫ. - တၭအဝ့ၫၥံၪမၩဆၧလဲးဆၧဘျၪလၧခးအံဇံၭ အဖၧၩ့, မၩဆၧလဲးဆၧဘျၪလၧအၥၭဘၪ့အဘိၩ့ဘၭ လီၫ. ထီးနီၪဘၪဆၧဘံၭအနူ ထီးနီၪၦဘံၭဆၫ ၦမုၪ",
			"4": "<sup>4</sup> နၩ့အနူခံၫလီၫ.- အဝဲလဂၩအမံၩ့မွဲနးအဟိလၫ, အဖု လဂၩအမံၩ့မွဲနးအဟိလဘၫလီၫ. ကဲၪထၪ့ယဆၧတၭ, ဆီၫ့အီၪန့ဖိၪခွၫလဖၪ, ဒဲဖိၪမုၪလဖၪလီၫ. ဆၧလၧအ မံၩ့နီၪ, နးအဟိလၫမွဲစမ့ရအၫ, ဒဲနးအဟိလဘၫ,မွဲ",
			"5": "<sup>5</sup> ယရုစလံၫ့လီၫ.- ထီးအမွဲယဆၧနီၪ နးအဟိလၫမၩ ဒီၩ့ ၦမဲၩဎွဲၩမုၪလီၫ. အဲၪလၧအၥၭလဲးၥၭဘျၪ ၦလၧ အအဲၪအဝ့ၫ, ၦလၧအနဲၩ့ထံၭ,ၦအစံရအၫဖိၪလဖၪ,",
			"6": "<sup>6</sup> ကီၩ့ၥိၭဆၧလၫ, ၦၥုၭခိၪၥံၪ,ဒဲၦဒိၪၥံၪ,ၦဖိၪၥၪခွၫလၧ အဘၪၦအၥၭထီးအလူၬ, ၦထူၬကၥ့ၪလဖၪနီၪမွဲလၧ အထူၬကၥ့ၪလီၫ.",
			"7": "<sup>7</sup> ဘဲၫနီၪၥိၭမၩဆၧလဲးဆၧဘျၪလၧအဝ့ၫၥံၪ, လၧက ယဲအစံရအၫ အၡၩရွံန့ဖိၪ ထီးအလူၬ, ဒဲလၧကယဲၦ လၧအအဲၪဝ့ၫ လၧအၥၭလဲးၥၭဘျၪ,မၩဘၪၥၭလိၪအ",
			"8": "<sup>8</sup> ၥၭလၧအဆၧဂၩ့ဆၧဖၪ့ထီးအလူၬလီၫ.- စဲၪ့ဒၪခွံၬအ ဆၧလဲးဆၧဘျၪဘၪဆဲၫ့လၧခးအံဇံၭနီၪဆ့အ့ၬ. အဂဲး ဘဲၫယီၩအဝ့ၫၥံၪမံၫဎုၬလၧအၥိၭလၧအၥၭဘၪ့အဘိၩ့ ဘၭတၭ, အဝ့ၫၥံၪဘံၭဆၫအမုၪနၩ့အနူတၭ, ဂါလၩ့",
			"9": "<sup>9</sup> အဆၧလဲးဆၧဘျၪလၧအလီၩ့လီၫ.- မၩအၥၭဘဲၫနီၪ တၭ, ယဖ့ၪလၫ့ခွံၬအဝ့ၫ လၧၦလၧအအဲၪအဝ့ၫအစူၪ ဖၧၩ့လၧၦအစံရအၫဖိၪလၧအအဲၪဝ့ၫလၧအၥၭလဲးၥၭ",
			"10": "<sup>10</sup> ဘျၪအစူၪဖၧၩ့လီၫ.- အဝ့ၫၥံၪနဲၪဖျီၪထၪ့အဆၧအီၪဘိၪ့ လီၫ. မၩန့အဖိၪခွၫၥံၪ,ဒဲအဖိၪမုၪၥံၪတၭ, မၩၥံၫအဝ့ၫ ဒၪလၧနၭတၭ,အမံၩ့အၧၩ့ဂၧၫ့ထၪ့ၥၩလၩ့ဝ့ၫလၧၦမုၪ အကျၩလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪမၩဝ့ၫလၧအဆၧ",
			"11": "<sup>11</sup> စ့ၩရၫ့လီၫ.- အထၧၫ့ဖုဝဲမုၪ နးအဟိလဘၫဒၪဘၪဆၧ နီၪလါနၫ့, အဲၪအဆၧလၧအၥၭလဲးၥၭဘျၪ နၭနဲၪ့ဒံၭအ ဝ့ၫလဂၩလီၫ. မၩအဆၧလဲးဆၧဘျၪနီၪ နၭနဲၪ့ဒံၭအ",
			"12": "<sup>12</sup> ထၧၫ့ဖုဝဲမုၪအဆၧလဲးဆၧဘျၪနီၪလီၫ.- ၦအစံရအၫဖိၪ အီၪလၧအနဲၩ့ထံၭနီၪ, အဲၪဝ့ၫလၧအၥၭလဲးၥၭဘျၪ, မွဲ ၦၥုၭခိၪၥံၪ, ဒဲၦဒိၪၥံၪ, ကီၩ့ၥိၭဆၧလၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩ, ၦထူၬကၥ့ၪလဖၪနီၪမွဲအထူၬကၥ့ၪ,ၦဖိၪၥၪခွၫလၧအ",
			"13": "<sup>13</sup> ဘၪၦအၥၭထီးအလူၬလီၫ.- ထီးနီၪလဖၧၫ့ယဒၪဘၪ လၧအဘၪၥၭလိၪ,လၧၦနံၫဂၩနီၪဖိၬဖၧၩ့ၥၭလဘီၩ့ဎး,",
			"14": "<sup>14</sup> လါနၫ့တၭ,- ၦမုၪနီၪမၩအၪထၪ့အဆၧလဲးဆၧဘျၪ လီၫ. အဂဲးဘဲၫယီၩ ဒၪဘၪၦခွၫအဂၩ့ အီၪကွ့ၭအၥၭ လၧဆၧဒီၪ့အလီၩ့, ၦခၫလဒံအၫဖိၪအဂၩ့ ကွ့ၭအၥၭ",
			"15": "<sup>15</sup> လၧၥံၪထံၫအဝီၩ,- ခဲးထူၬအယးဒံၩ့လၧခၧၩ့ယး,အီၪ ဝ့ၫလၧအခိၪဖုၪ့ကံၪကဲၩ့ဖျီၪဝ့ၫဘဲၫၦဒိၪဖၭဒိၪထီးအ လူၬအၥိၭ,ဘဲၫၦဘၭဘလၧၫ့ဖိၪလၧခၫလဒံအၫအဖၧၩ့",
			"16": "<sup>16</sup> အအီၪဖျဲၪအခးလီၫ.- ထီးအဒၪဘၪဝ့ၫလၧအမ့ၬတၭ, အဲၪဝ့ၫလၧအၥၭလဲးၥၭဘျၪတၭ, အၪ့မၧၫ့အၥီၫ့လဖၪ",
			"17": "<sup>17</sup> လ့ၩလၧအအီၪလၧခးခၫလဒံအၫအဖၧၩ့လီၫ.- ဘၭ ဘလၧၫ့အဖိၪခွၫလဖၪဂဲၫဝ့ၫလၧအအီၪ လၧဆၧအဲၪ အလးမံၫဖၧၩ့တၭ,မၩဘၪၥၭလိၪဝ့ၫလၧဆၧလဲးဆၧ ဘျၪတၭ, အဆၧဘၪၥၭလိၪလၧအဝ့ၫ, အၥၭလၩ့ၡၪ",
			"18": "<sup>18</sup> လၧအဝ့ၫလီၫ.- နဲၪဖျီၪထၪ့အဆၧလဲးဆၧဘျၪတၭ,နဲၪ ဖျီၪထၪ့အဆၧအီၪဘိၪ့လီၫ.- ထီးနီၪလဖၧၫ့ယၥၭလၩ့ ၡၪလၧအဝ့ၫ, ဘဲၫယၥၭလၩ့ၡၪယူၭလၧအထၧၫ့ဖုဝဲမုၪ",
			"19": "<sup>19</sup> အၥိၭနီၪလီၫ.- အဂဲးဘဲၫယီၩမွဲအနၪ့ထၪ့ထဲၩ့အၥၭ ဘၪ့အမုနံၩ ထီးအမၩဆၧလဲးဆၧဘျၪ လၧခးအံဇံၭ အဖၧၩ့အကၠီၩ့တၭ,မၩအၪထၪ့ဆၧလဲးဆၧဘျၪလီၫ.",
			"20": "<sup>20</sup> တၭအဲၪဝ့ၫၦအၥံၪဝၩ လၧအဖံၭအယၪ မၩအၥၭဘဲၫ ကၥ့ၪယီၩ့အဖံၭအယၪအၥိၭ ဒဲအဆၨၩအဆၬနီၪ မၩ",
			"21": "<sup>21</sup> အၥၭဘဲၫကၥ့ၪအဆၨၩအဆၬအၥိၭနီၪလီၫ.- တၭနနၪ့ ထၪ့ထဲၩ့နၥၭဘၪ့အၥၭလဲးၥၭဘျၪထီးၦအံဇံၭဖိၪဘံၭ ဆၫနနူခံၫလၧနၥၭဘၪ့အနူအကၠီၩ့လီၫ.",
			"22": "<sup>22</sup> မၩအၥၭဘဲၫနီၪတၭ, နးအဟိလဘၫဧ့,ကဆါယဟိ ဝၩစံၭဘဲၫယီၩ, ယိခွါ, ယမိထိၪဂဲၩၦလၧအအဲၪနၧၩ ထၫ့ဒၩနၧၩ ၦလၧနၥၭလၩ့ၡၪလၧအဝ့ၫတၭ, ယမိဒုၭဂဲၫ",
			"23": "<sup>23</sup> အဝ့ၫထၫ့ဒၩနၧၩဝၬဖီၩ့ဝ့ၫ,- ၦဘၭဘလၧၫ့ဖိၪ,ဒဲၦ ခၫလဒံအၫဖိၪထီးအလူၬ, ဖံကီၭ,ဒဲၡိအၫ,ဒဲကိအၫ,ဒဲ အစံရအၫဖိၪထီးအလူၬအီၪလၧအၥိၭ,အဝ့ၫၥံၪ ထီး အလူၬနီၪမွဲၦဖိၪၥၪခွၫလၧအဘၪၦအၥၭ,ၦၥုၭခိၪၥံၪ ဒဲၦဒိၪၥံၪ, ဒဲၦဒိၪဖၭဒိၪလဖၪ,ၦလၧအမံၩ့ဂၧၫ့ထၪ့ၥၩ",
			"24": "<sup>24</sup> လၩ့လဖၪ,အဝ့ၫၥံၪထီးအလူၬထူၬကၥ့ၪလီၫ.- တၭအ ဝ့ၫၥံၪမိဂဲၫထၪ့ထၫ့ဒၩနၧၩ အီၪလၧလဲၪ့ၥုၭၥံၪ, ဒဲလဲၪ့ ၥံၪ,ဒဲၦခမျၧးအဒီၪ့ဖၭဒိၪလဖၪလီၫ. တၭအဝ့ၫၥံၪအီၪ က့ၪထၫ့ဒုၪဒၩနၧၩ လၧထၩ့ဖံၭဖၭဒိၪ,ဒဲထၩ့ဖံၭဖိၪ, ဒဲ ခိၪလူၬၥုၭဝၬဝၬတၭ,ယမိအီၪက့ၪဆၧစ့ၩရၫ့လၧအဝ့ၫ ၥံၪအမ့ၬယၫတၭ,အဝ့ၫၥံၪမိစ့ၩရၫ့နၧၩ,ဘဲၫအဝ့ၫၥံၪ အဆၧစ့ၩရၫ့အထူၫအရူၫအီၪဝ့ၫအၥိၭနီၪလီၫ.",
			"25": "<sup>25</sup> ယမိအီၪက့ၪယၥၭကဲၪ့ ထၫ့ဒၩနၧၩတၭ,အဝ့ၫၥံၪမိ မၩနၧၩလၧအၥၭခဲၩထၪ့လီၫ. မိမၩန့ထၪ့ခွံၬနနၫဖူၫဒဲ နနါၥံၪတၭ, နဆၨၩနဆၬမိလၩ့ထံၩဖါလၧနၭလီၫ.အ ဝ့ၫၥံၪမိမၩန့နဖိၪခွၫၥံၪဒဲနဖိၪမုၪၥံၪတၭ, မ့ၪမိအၪ့ခွံၬန",
			"26": "<sup>26</sup> ဆၨၩနဆၬလီၫ.- အဝ့ၫၥံၪမိဘဲၪ့လၩ့ခွံၬနကီၩ့နၥိၭ, ဒဲ",
			"27": "<sup>27</sup> မၩန့ထၪ့ခွံၬနကယၧၩ့ကယီၫအဎံၫအလၩလီၫ.- ယ မိဒုၭထုၬနၥၭလဲးၥၭဘျၪ ဒဲနမၩဆၧလဲးဆၧဘျၪ ဘၪ ဆဲၫ့လၧခးအံဇံၭတၭ, နစၪ့ထၪ့လၧၩ့နမ့ၬၥၪလၧအခး",
			"28": "<sup>28</sup> ဒဲနၪ့ထၪ့ထဲၩ့လၧၩ့အံဇံၭဆ့အ့ၬ.- အဂဲးဘဲၫယီၩ က ဆါယဟိဝၩစံၭဘဲၫယီၩ, ယိခွါ,ယမိဖ့ၪလၫ့ခွံၬနၧၩ လၧၦလၧနၥၭဂဲၫ့ဝ့ၫအစူၪဖၧၩ့, လၧၦလၧနၥၭလၩ့ၡၪ",
			"29": "<sup>29</sup> လၧအဝ့ၫအစူၪဖၧၩ့လီၫ.- အဝ့ၫၥံၪမိမၩနၧၩလၧအၥၭ ဂဲၫ့ဆၧတၭ,မိမၩန့ထၪ့ခွံၬ နမၩဆၧထီးအလူၬတၭ, မိ စဲၪ့ဒၪနၧၩလၧနအီၪဘိၪ့တၭ,နကီၩ့နၥိၭအီၪအ့ၬ. နဆၧ လဲးဆၧဘျၪအဆၧအီၪဘိၪ့,ဒဲနၥၭလဲးၥၭဘျၪ, ဒဲနမၩ",
			"30": "<sup>30</sup> ဆၧလဲးဆၧဘျၪနီၪမိအီၪဖျီၪထၪ့လီၫ.- ယမိမၩနၧၩ လၧဆၧနီၪလဖၪ လၧနလ့ၩမၩဆၧလဲးဆၧဘျၪ ဖိၬၦ ဆၨၩလဖၪအခဲၫ့အကၠီၩ့, လၧနဘၪၥၭလိၪလၧဆၧဂၩ့",
			"31": "<sup>31</sup> လဖၪအကၠီၩ့လီၫ.- နဖိၬနထၧၫ့ဖုဝဲမုၪအဖၧၩ့ၥၭတၭ, ယမိဖ့ၪလၫ့အဝ့ၫဒၪ အလိၫ့လဖျိၪ့လၧနစူၪဖၧၩ့လီၫ.",
			"32": "<sup>32</sup> ကဆါယဟိဝၩစံၭဘဲၫယီၩ, နမိဘၪအီၩနထၧၫ့ဖုဝဲမုၪ အလိၫ့လၧအယိၬ ဒဲအဒိၪလီၫ. နမိဘၪကဲၪထၪ့ဆၧ နံဘၪဒုၪဒွ့ၪအလး, ဒဲဆၧမၩကြၩ့ထမး အလးတၭ,",
			"33": "<sup>33</sup> ဆၧထီဝ့ၫအၪမၬလီၫ.- နမိဎွ့ၩလၧဆၧအီၩမၧၩ့နၥၭ, ဒဲဆၧၥုၪ့အုၭၥၭအုၭလီၫ. ဆၧထီၫမံၫထီၫမၪဒဲဆၧအီၪ ယူအလိၫ့နီၪ, မွဲနထၧၫ့ဖုဝဲမုၪ စမ့ရအၫအလိၫ့လဖျိၪ့",
			"34": "<sup>34</sup> လီၫ.- နမိဘၪအီၩဝ့ၫ,ဒဲအၪ့ဆူၭထၪ့ခွံၬ,ဒဲအဲၪ့ကျိၩလိၫ့ အကဲၩ့အခီၫ,ဒဲထုၭထ့ၬခွံၬနနူဒၪနဝ့ၫလီၫ. အဂဲးဘဲၫ ယီၩ,ယချဲၩ့ယူၭဆၧယူၭ ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"35": "<sup>35</sup> ကဆါယဟိဝၩစံၭဝ့ၫဘဲၫယီၩ,မွဲနၥၭနၪ့ယၧၩ, ဒဲခွံၬ ၡိၭယၧၩလၧနချိၫ့အကၠီၩ့, မၩအၥၭဘဲၫနီၪတၭ, ထိး ဒၪနဆၧလၧနၥၭလဲးၥၭဘျၪ, ဒဲနမၩဆၧလဲးဆၧဘျၪ နီၪဆံၭ.",
			"36": "<sup>36</sup> ယဟိဝၩစံၭယၧၩ, ၦၡၩအဖိၪခွၫဧ့,မွဲနမိစ့ၩရၫ့နး အဟိလၫဒဲနးအဟိလဘၫၥံၪဆ့ဧၪ.မွဲမၬ, ဒုၭနဲၪအ",
			"37": "<sup>37</sup> ဝ့ၫၥံၪ,လၧအဆၧဘၪၥၭလိၪလဖၪနီၪဆံၭ.- လၧအ အဲၪဘိၩ့မၫအဲၪဘိၩ့ဝၩအကၠီၩ့တၭ, ဆၧၥွံၪအီၪလၧအ ဝ့ၫၥံၪအစူၪဖၧၩ့နီၪး လၧအအဲၪဘိၩ့မၫအဲၪဘိၩ့ဝၩလၧ အဆၧဂၩ့လဖၪတၭ,အၪ့မၧၫ့အဖိၪခွၫၥံၪ လၧအဆီၫ့ အီၪန့လၧယဂးလဖၪ ခၫ့ဂၬမ့ၪလၧဆၧမိအၪ့ခွံၬဝ့ၫအ",
			"38": "<sup>38</sup> ဂဲးလီၫ.- မၩဆ့ယၧၩလၧဆၧယီၩ,မၩဘၪၥၭလိၪယ လးဆံၫ့ဎံၪတၭ, မၩကြၩ့ထမးယမးၥံၫအနံၩလဖၪလ",
			"39": "<sup>39</sup> နံၩဎးလီၫ.- အဂဲးဘဲၫယီၩထီးအမၩၥံၫအဖိၪအလံၩ လၧဆၧဂၩ့လဖၪအဂးတၭ, ဂဲၫလၧယလးဆံၫ့ဎံၪအ ဖၧၩ့လၧအမၩဘၪၥၭလိၪဝ့ၫလနံၩဎးတၭး ယိခွါ,မၩ",
			"40": "<sup>40</sup> ယူၭဝ့ၫဘဲၫနီၪလၧယဂံၪ့အၥၭခံဖၧၩ့နီၪယူၭ.- လၧနီၪ အမ့ၬယၫနၥံၪအၪ့မၧၫ့လၩ့ၦၡၩဂဲၫလၧအယဲၩ့, နၥံၪ အၪ့မၧၫ့လၩ့အၥီၫ့လဖၪ လ့ၩလၧအအီၪတၭ, ယိခွါ, ဂဲၫဝ့ၫလီၫ. နၥူၫဝၭဆံၫ့နၥၭလၧအဂး, နဂုၪနမ့ၬဒဲနက",
			"41": "<sup>41</sup> ယၧၩ့ကယီၫနၥၭ,- နဆၧၫ့နၩ့လၧဆၧအလးမံၫအဎံၫ အလၩ,ဒဲတဲၩ့ဝဲၩစပွဲလၧအမ့ၬယၫတၭ, နအီၪက့ၪယ",
			"42": "<sup>42</sup> ဆၧနၧၫ့မၧၫ့ဒဲယၥိၪထီးနီၪလီၫ.- ၦၡၩခမျၧးအီၪမုၬအ ၥီၫအီၪဝ့ၫလၧအဝ့ၫလစီၪ့ဎးတၭ, ၦဂဲၫဆိၬၦအီၩလၨၪ ဆၧလၧၡါမုနၧၫ့ဖၫလၧအၥိၭလၧအစူၪလၧထဲၫ့ဎွံၪ ဒဲချႃၬ အခိၪလူၬအဎံၫအလၩ အီၪလၧအခိၪဎွံၪအလီၩ့လီၫ.",
			"43": "<sup>43</sup> ထီးနီၪလဖၧၫ့ယစံၭလၧအၥၭၡါယူၭ လၧဆၧအဲၪ ဘိၩ့မၫအဲၪဘိၩ့ဝၩအဖၧၩ့လဂၩအဂဲး, ဘိၩ့နဲၪ့ယီၩမွဲ အဝ့ၫၥံၪမိမၩ ဆၧလဲးဆၧဘျၪ လၧအဝ့ၫလၧအနၫ့ဆါ",
			"44": "<sup>44</sup> ဒၪလ့ၬဆ့ဧၪ.- အဝ့ၫၥံၪလ့ၩနုၬလၧအအီၪ, ဘဲၫၦလ့ၩ နုၬလၧမဲၩဎွဲၩမုၪ အအီၪအၥိၭနီၪလီၫ. တၭလ့ၩနုၬ လၧၦမုၪလၧအၥၭလဲးၥၭဘျၪနးအဟိလၫ, ဒဲနးအဟိ လဘၫအအီၪဘဲၫနီၪၥိၭလီၫ.",
			"45": "<sup>45</sup> ၦၡၩအတီၩအလီၩ့လဖၪနီၪ, ၦမိစ့ၩရၫ့ဘဲၫၦအဲၪဘိၩ့ ဝၩဘၪဆၧစ့ၩရၫ့အၥိၭ, ဘဲၫၦမုၪလၧအဂါလၩ့ဆၧၥွံၪ ဘၪဆၧစ့ၩရၫ့အၥိၭလီၫ. အဂဲးဘဲၫယီၩမွဲၦအဲၪဘိၩ့",
			"46": "<sup>46</sup> ဝၩတၭ,ဆၧၥွံၪအီၪလၧအစူၪဖၧၩ့လီၫ.- အဂဲးဘဲၫ ယီၩ,ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ယမိဒုၭဂဲၫထၫ့ဒၩ အဝ့ၫၥံၪလၧၦလဒီၪ့ဖၭဒိၪတၭ, ယမိဖ့ၪလၫ့ခွံၬဝ့ၫလၧ",
			"47": "<sup>47</sup> ၦမၩခိမၩဝီၩဝ့ၫ, ဒဲအၪ့ဂူၬဆီၪ့အဆၧလီၫ.- ၦလဒီၪ့ နီၪမိခွံၬဝ့ၫလၧလိး ဒဲဒၪ့ထ့ၬခွံၬဝ့ၫလၧနၭတၭ, မိမၩ ၥံၫအဖိၪခွၫၥံၪဒဲအဖိၪမုၪၥံၪ, ဒဲဆူၭခွံၬအဂံၪ့ၥံၪလၧမ့ၪ",
			"48": "<sup>48</sup> လီၫ.- ယမိဒုၭထုၬဆၧၥၭလဲးၥၭဘျၪလၧခးဖၧၩ့, ဘဲၫ ၥိၭၦမုၪထီးအလူၬမိထီးလၩ့အၥၭ, ဘဲၫၥိၭအထီးမၩ",
			"49": "<sup>49</sup> ဖိၬအဝ့ၫၥံၪအၥၭလဲးၥၭဘျၪအခဲၫ့လဂ့ၩလီၫ.- အဝ့ၫ ၥံၪမိဖ့ၪထဲၩ့နၥံၪအၥၭလဲးၥၭဘျၪ လၧနၥံၪအလီၩ့တၭ, နၥံၪမိဘၪထိးနၥံၪအဆၧဂၩ့လဖၪ အဆၧဒဲၩဘၭတၭ, နၥံၪမိၥ့ၪယၫလၧယမွဲကဆါယဟိဝၩလီၫ."
		},
		"24": {
			"1": "<sup>1</sup> လၧခွံၫနံၪ့လနံၪ့, လၩဆံၫဘံၪ့လဘံၪ့,လၩထၪ့ဆံၫ နံၩလနံၩနီၪ, ယဟိဝၩအလူလၩ့ဘၪဒီၭယၧၩတၭ, စံၭ",
			"2": "<sup>2</sup> ဝ့ၫဒၪ,- ၦၡၩအဖိၪခွၫဧ့, ကွ့ၭလၧနဂးမုလနံၩအမံၩ့, မွဲလနံၩယီၩဒၪလ့ၬဆံၭ. ဘၭဘလၧၫ့အစဎွၩအီၪက့ၪ လၩ့အၥၭထၫ့ဒၩယရုစလံၫ့လၧမုလနံၩယီၩလနံၩဎး",
			"3": "<sup>3</sup> လီၫ.- ချဲၩ့ဒီၩ့လၩ့ဆၧလၧၦဂံၪ့ဖိၪ အပိၩ့ထၪ့ဒၪဆၧ တၭ,စံၭအဝ့ၫၥံၪ, ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ဒီၩ့ ထၪ့ဖၧၩ့တၭ, ဒီၩ့ထၪ့ဝ့ၫဒဲဂါလၩ့ထံၫလၧအဖၧၩ့ဆံၭ,",
			"4": "<sup>4</sup> အၪ့ထုၫ့ကီၪ့တၭ, ဒုၭနုၬဆၧအလီၪ့လဖၪလၧအဖၧၩ့, ကယဲဆၧအလီၪ့လၧအဂ့ၩဒၪလ့ၬ, ကံၪဒူၪဒဲခိၬထံၭခိၪ, မၩဎွ့ၩအဝ့ၫ လၧဆၧအဎွံၪအနၧၩ့ လၧအဂ့ၩအဘၪ",
			"5": "<sup>5</sup> ဆံၭ.- တၭမၩန့ဆၧအဂ့ၩထုၬလၧၥိၪ ဒဲဘ့ၪအကျၩ တၭ,မၩဆၧလပိၩ့လၧအဖၫ့လၬ လၧဆၧအဎွံၪအနၧၩ့ အဂး,ဒုၭလၬထၪ့ဝ့ၫအ့ၪဂ့ၩ,အၪ့ဎွံဆၧဎွံၪလဖၪလၧ အဖၧၩ့ဆံၭ.",
			"6": "<sup>6</sup> မၩအၥၭဘဲၫနီၪတၭ, ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ဒိၩ့အီၪလၧဆၧၥွံၪး ဖၧၩ့လၧအအ့ၪအီၪဝ့ၫလၧအဖၧၩ့, အအ့ၪလစဲၪ့ထၪ့ခွံၬဘၪလၧအအီၪနီၪ, ဘၪအၡၪ့လီၫ. ဂဲၫဆိၬထၪ့ဝ့ၫ လလီၪ့ဘၪလလီၪ့ဆံၭ. မွဲၦထီးဖၭလၧ",
			"7": "<sup>7</sup> အဂးလဂ့ၩ.- အဂဲးဘဲၫယီၩ ဆၧအၥွံၪအီၪဝ့ၫလၧအ ၥၭကျၩတၭ, ဆၧဂါလၩ့ဝ့ၫလၧလိးၥံၪလဲၫ့ၥံၪ အဖၫ့ ခိၪလီၫ.ဂါလၩ့ဝ့ၫလၧဂၪ့ခိၪအလီၩ့ ဘဲၫၥိၭအမိလၩ့",
			"8": "<sup>8</sup> ဘၧၩ့ဝ့ၫလၧဂၪ့ခိၪမုၬနီၪမွဲအ့ၬ.- ဘဲၫၥိၭဆၧအၥၭမိခဲၩ ထၪ့ဒဲမိမၩဆၧၫ့ဆၧအၧၩ့တၭ, ယအီၪက့ၪလၩ့ဆၧ အၥွံၪလၧအဂါလၩ့ဝ့ၫ လၧလဲၫ့ခိၪ ဘဲၫၥိၭအထီးလၩ့",
			"9": "<sup>9</sup> ဘၧၩ့လဂ့ၩ.- မၩအၥၭဘဲၫနီၪတၭ,ကဆါယဟိဝၩ စံၭဘဲၫယီၩ, ဒိၩ့အီၪလၧဆၧၥွံၪနီၪဘၪအၡၪ့လီၫ. ယ",
			"10": "<sup>10</sup> မၩဆၧပိၩ့လၧမ့ၪအဂး ဖၭဒိၪလပိၩ့လီၫ.- ဖျႃၭလၩ့ ၥံၪ့မုအၪ,မၩခဲၩထၪ့မ့ၪ, အၪ့ဎွံမံၫ့ဆၧယၪ, ဒုၭနုၬဆၧ",
			"11": "<sup>11</sup> ဂဲၪတၭ,ဆူၭထၪ့ခွံၬဆၧဎွံၪဆံၭ.- ထီးနီၪလဖၧၫ့အီၪ က့ၩဖၧၩ့အီၪခီၫဝ့ၫနီၪလၧမ့ၪအၧၩ့ဖၭအဖၫ့ခိၪ, ဘဲၫၥိၭ အထီးဘၩ့မိခိထၪ့တၭ, မိဆူၭထၪ့ခွံၬအဆၧဘၪၥၭ လိၪမိဖံၪထၪ့ဝ့ၫလၧအဖၧၩ့, ဒဲအအ့ၪမိလူၬဝ့ၫနီၪဆံၭ.",
			"12": "<sup>12</sup> အဝ့ၫနီၪမၩပွံၭယၥၭ လၧဆၧမၩလါနၫ့တၭ, အအ့ၪ အၪနီၪစဲၪ့ထၪ့လၧအဖၧၩ့အ့ၬ. အအ့ၪအီၪဒၪဆၧလၧ",
			"13": "<sup>13</sup> မ့ၪကျၩလီၫ.- ဆၧလဲးဆၧဘျၪအီၪဝ့ၫလၧနဆၧလဆံၫ့ ဘၪအဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ထီးယမၩဆံၫ့နၧၩ တၭ,နဆံၫ့ထၪ့အ့ၬ. ဆၧလၥူၫဝၭလၧၩ့ဘၪဆၧစံၪစၪ လၧနလီၩ့ထီးယမၪလူၬယၥၭခဲၩထၪ့အီၪဒၪဆၧလၧန",
			"14": "<sup>14</sup> လီၩ့လီၫ.- ယၧၩ,ယဟိဝၩယီၩ,ယချဲၩ့ယူၭဆၧယူၭ, ဆၧမိမၩအၥၭတၭ,ယမိမၩယဝ့ၫလီၫ. ယကၠၪခွံၬယ ၥၭအ့ၬး တၭယလီၫ့ကီၩ့အ့ၬး ယနီၫ့ယါလၩ့ထဲၩ့ယ ၥၭအ့ၬ,ဘဲၫနဖၧၩ့ၥၭအၥိၭနီၪ, ဒဲဘဲၫနမၩဆၧအၥိၭ နီၪ,ပမိစ့ၩရၫ့နၧၩ,ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"15": "<sup>15</sup> ယဟိဝၩအလူလၩ့ဘၪဆ့ယၧၩတၭ, စံၭဝ့ၫဒၪ,",
			"16": "<sup>16</sup> ၦၡၩအဖိၪခွၫဧ့,ယိခွါ, ယမၩန့ထၪ့ခွံၬဆၧလၧအဘၪ နမ့ၬၥၪၥံၪလၧဆၧထးလဘျၩ့လီၫ. မွဲလါနၫ့တၭ,နဂၪ့",
			"17": "<sup>17</sup> နယၧၩ့ဘၪအ့ၬ. ဒဲနမ့ၬထံၫမိလၩ့ယွၩဘၪဆ့အ့ၬ.- ဂၪ့ အုၩဂၪ့ထိၬလဂ့ၩ. ဂၪ့လၧၦၥံၫအကၠီၩ့လဂ့ၩ.ဖုၪ့ထၪ့ နခိၪဖုၪ့လၧနခိၪဎွံၪ, ဖျၪ့ထၪ့နခၪ့ဖံၭလၧနခၪ့တၭ, ကၭ",
			"18": "<sup>18</sup> ဘံၭနနိၭလဂ့ၩ. အၪ့ၦၡၩအဆၧအၪ့လဂ့ၩ.- ယချဲၩ့ ယူၭဆၧလၧၦခမျၧးလၧမုဂီၩတၭ, လၧမုဂၪလၩ့နီၪယ မၫၥံၫဝ့ၫလီၫ. တၭမုဆဲၪ့ထၪ့နီၪယမၩဆၧဘဲၫဆၧမၪ လူၬယၧၩအၥိၭနီၪလီၫ.",
			"19": "<sup>19</sup> တၭၦခမျၧးစံၭယၧၩ, ဆၧလဖၪလၧနမၩဘၪဆဲၫ့",
			"20": "<sup>20</sup> လၧပၧၩဘဲၫၥ့ၪလဲၪနီၪ,မွဲနလီၩဘၪပၧၩအ့ၬဧၪ.- ယ စံၭအဝ့ၫၥံၪ, ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,စံၭဝ့ၫ",
			"21": "<sup>21</sup> ဒၪ,- စံၭအံၫစရ့လၭအၡၩဂံၪ့ဖိၪ, ကဆါယဟိဝၩစံၭ ဘဲၫယီၩ,ယိခွါ, ယမိမၩဘၪၥၭလိၪ ယလးဆံၫ့ဎံၪ, နၥံၪဒိၭနဲၩ့နၥံၪအၥၭအလး လၧနၥံၪအီၪက့ၪဖိၫလိၫ နၥံၪအၥၭလၧအကၠီၩ့, ဆၧလၧအဘၪနၥံၪအမ့ၬၥၪၥံၪ ဒဲဆၧလၧနၥံၪလီၫ့ကီၩ့ဝ့ၫလီၫ. နၥံၪအဖိၪခွၫၥံၪ,ဒဲနၥံၪ အဖိၪမုၪၥံၪလၧအအီၪလၩ့ထး လၧနၥံၪအၥိၭနီၪမိလၩ့",
			"22": "<sup>22</sup> ထံၩဖါလၧနၭၥံၪဖၩ့ၥံၪလီၫ.- နၥံၪမၩဆၧဘဲၫယမၩ အၥိၭနီၪလီၫ. နၥံၪကၭဘံၭနၥံၪအနိၭအ့ၬ, ဒဲအၪ့ၦၡၩ",
			"23": "<sup>23</sup> အဆၧအၪ့အ့ၬ.- နၥံၪအခိၪဖုၪ့မိအီၪလၧနၥံၪအခိၪဎွံၪ တၭ,နၥံၪအခၪ့ဖံၭမိအီၪလၧနၥံၪအခၪ့လီၩ့လီၫ. နၥံၪ မိဂၪ့မိယၧၩ့အ့ၬ, နၥံၪမိဎွ့လၩ့ခွံၬ လၧနၥံၪအဆၧဒဲၩ ဘၭအဖၧၩ့တၭ, နၥံၪမိဂၪ့အုၩဂၪ့ထိၬလဂၩ ဒဲလဂၩ",
			"24": "<sup>24</sup> လီၫ.- တၭစအဇံၫခအ့လၭ မိကဲၪထၪ့ဆၧမၩနဲၪ့လ မံၩ့လၧနၥံၪအဂးလီၫ. ဘဲၫအဝ့ၫဒၪမၩယူၭဆၧထီးအ လူၬအၥိၭနီၪ, နၥံၪမိမၩဒီၭနၥံၪဝ့ၫလီၫ. ထီးဆၧနီၪမၩ အၥၭတၭ,နၥံၪမိၥ့ၪယၫလၧယမွဲကဆါယဟိဝၩလီၫ.",
			"25": "<sup>25</sup> နဝ့ၫဒၪယီၩၦၡၩအဖိၪခွၫဧ့, မုလနံၩလၧယမၩန့ထၪ့ ထဲၩ့အဂဲးအဘၭ,အလၩအဖၩ့, အၥုၪ့ဎွံၫၥၭယီၫ ဆၧ လၧအဘၪအမ့ၬၥၪၥံၪ, ဒဲဆၧလၧအလီၫ့ကီၩ့ဝ့ၫအဖိၪ",
			"26": "<sup>26</sup> ခွၫၥံၪ,ဒဲအဖိၪမုၪၥံၪနီၪတၭ,- ဆၧလၧမုလနံၩနီၪ, ၦ လၧအဖီၩ့ဖျ့ၭလဂၩ မိဂဲၫလၧနအီၪ ဘဲၫၥိၭအမိဒုၭနါ",
			"27": "<sup>27</sup> ဂၧၫ့နၧၩလၧဆၧလၧနနါဖၧၩ့လီၫ.- ဆၧလၧမုလနံၩနီၪ နနိၭမိအၩ့ထၪ့အၥၭ လၧၦလၧအဖီၩ့ဖျ့ၭဆၧအဂး,န မိချဲၩ့ဆၧတၭ,အီၪအုၭအၭလၧၩ့အ့ၬ. နမိကဲၪထၪ့ဆၧ မၩနဲၪ့လမံၩ့လၧအဝ့ၫၥံၪအဂးတၭ, အဝ့ၫၥံၪမိၥ့ၪယၫ လၧယမွဲယဟိဝၩလီၫ."
		},
		"25": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၩ့ဘၪဒီၭယၧၩတၭ, စံၭဝ့ၫဒၪ.",
			"2": "<sup>2</sup> ၦၡၩအဖိၪခွၫဧ့,အီၪက့ၪနမ့ၬထၫ့ဒၩၦအၫမၧၫ့ဖိၪလ",
			"3": "<sup>3</sup> ဖၪတၭ,ချဲၩ့ဆၧလၧမီၪအချိၬထၫ့ဒၩအဝ့ၫၥံၪ,- တၭစံၭ ၦအၫမၧၫ့ဖိၪ ခိၭနၪကဆါယဟိဝၩအလူဆံၭ. ကဆါ ယဟိဝၩစံၭဘဲၫယီၩ, လၧယလးဆံၫ့ဎံၪဘၪယူၭဆၧ မၩဘၪၥၭလိၪဝ့ၫနီၪ, ဒဲအံၫစရ့လၭအခးအီၪယူဝ့ၫ,ဒဲ ယုဒၫအၡၩဂံၪ့ဖိၪလ့ၩကဲၪယူၭလၧဎီးတၭ, မွဲနၥံၪစံၭ,",
			"4": "<sup>4</sup> အၩဟါၬ ထၫ့ဒၩအဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယိခွါ,ယမိဖ့ၪလၫ့နၧၩ လၧၦမုထၪ့ဖိၪလၧအန့ၥၫဆၧ အလး,ဒဲအဝ့ၫၥံၪမိမၩထၪ့အနီးလဖၪ လၧနဖၧၩ့မိအၪ့",
			"5": "<sup>5</sup> ဘၪနဆၧၥၪ, ဒဲမိအီၩဘၪနဆၧနူထံၫလီၫ.- ယမိအီၪ က့ၪရၭဘၫလၧကလအူၭ အတၩ့ခူၬအဂး ဒဲအၫမၧၫ့ ဖိၪအခးလၧၥိၪ ဒဲဘ့ၪလဖၪခိၬလၩ့အလးတၭ, နၥံၪမိ",
			"6": "<sup>6</sup> ၥ့ၪယၫလၧယမွဲယဟိဝၩလီၫ.- အဂဲးဘဲၫယီၩကဆါ ယဟိဝၩစံၭဘဲၫယီၩ, မွဲနဒဲၩနစူၪ,ဒဲနဆ့ၪနခၪ့တၭ, နၥၭထိၬလၧနၥၭအဆၧမၩကြၩ့ထမး ထီးအလူၬထၫ့",
			"7": "<sup>7</sup> ဒၩခးအံၫစရ့လၭတၭ,- ယိခွါ,မၩအၥၭဘဲၫနီၪတၭ, ယမိယၩ့ထၪ့ယစူၪ လၧနလီၩ့တၭ, အီၪက့ၪနၧၩလၧ ဆၧအၪ့ဂူၬဆီၪ့ လၧၦဆၨၩလဖၪအဂးတၭ, ယမိဒၪ့ ထ့ၬခွံၬနၧၩလၧၦခမျၧးအကျၩတၭ, ယမိမၩလၩ့မါ နၧၩလၧထံၫၥံၪခးၥံၪအဖၧၩ့တၭ, ယမိမၩဂၭဂီၩ့နၧၩ တၭ,နမိၥ့ၪယၫလၧယမွဲယဟိဝၩလီၫ.",
			"8": "<sup>8</sup> ကဆါယဟိဝၩစံၭဘဲၫယီၩ, လၧမိအၭဒဲစံအၫနီၪ စံၭ,ယိခွါ,ယုဒၫအၡၩဂံၪ့ဖိၪ မၩအၥၭဘဲၫၦဆၨၩထီး",
			"9": "<sup>9</sup> အလူၬအၥိၭနီၪအကၠီၩ့တၭ,- မၩအၥၭဘဲၫနီၪတၭ, ယိခွါ,ယမိဝဲထၪ့မိအၭ အကဖၩလၧအဒိၩ့လဖၪအီၪ ဝ့ၫလၧအနဲၩ့ထံၭ, ထံၫၥံၪခးၥံၪအလၩအဖၩ့ဘ့ၭၥယ့ၭ",
			"10": "<sup>10</sup> စမီၭ,ဘၫအလၭမံအိၫ့ဒဲကံၫရၥ့အံၫ့,- ဒဲၦအၫမၧၫ့ဖိၪ, ယမိဖ့ၪလၫ့အဝ့ၫၥံၪလၧဆၧန့ၥၫ လၧၦမုထၪ့ဖိၪအအီၪ, ဘဲၫၥိၭဆၧထီးနၪ့ထၪ့ထဲၩ့ လၧၩ့ၦအၫမၧၫ့ဖိၪ လၧၦ",
			"11": "<sup>11</sup> ဆၨၩလဖၪအကျၩလဂ့ၩလီၫ.- ယမိမၩဆၧစ့ၩရၫ့လၧ မိအၭအလီၩ့တၭ, အဝ့ၫၥံၪမိၥ့ၪယၫဝ့ၫလၧယမွဲယဟိ ဝၩလီၫ.",
			"12": "<sup>12</sup> ကဆါယဟိဝၩစံၭဘဲၫယီၩ လၧအံဒၧၫ့ မၩဆၧၫ့ ဆၧအၧၩ့ထၫ့ဒၩယုဒၫအၡၩဂံၪ့ဖိၪတၭ, မၩဆၧဒဲၩဘၭ",
			"13": "<sup>13</sup> အဒိၪအယိၬ,ဒဲမၩဆၧၫ့ဆၧအၧၩ့အကၠီၩ့တၭ,- ကဆါ ယဟိဝၩစံၭဘဲၫယီၩ, ယမိယၩ့ထၪ့ယစူၪ လၧအံဒၧၫ့ အဖၫ့ခိၪတၭ, ယမိဖ့ၬခွံၬၦၡၩ ဒဲဆၧဖိၪဆၧဎါလၧအ ဖၧၩ့တၭ,ယမိမၩယူအဝ့ၫလၧတံမၧၫ့,ဒဲၦဒံဒၫ့ဖိၪမိလၩ့",
			"14": "<sup>14</sup> ထံၩဖါလၧနၭၥံၪဖၩ့ၥံၪလီၫ.- ယမိမၩဆၧၫ့ဆၧအၧၩ့ လၧအံဒၧၫ့အလီၩ့ လၧယၡၩခမျၧးအံၫစရ့လၭ အစူၪ တၭ,မိမၩဘၪအံဒၧၫ့ဘဲၫယၥၭထၪ့ ဒဲဘဲၫယၥၭခဲၩထၪ့ အၥိၭတၭ,အဝ့ၫၥံၪမိၥ့ၪယၫဝ့ၫ လၧယမၩဆၧၫ့ဆၧ အၧၩ့နီၪ,ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"15": "<sup>15</sup> ကဆါယဟိဝၩစံၭဘဲၫယီၩ မွဲၦဖလံၡၫဖိၪမၩဆၧ လၧဆၧမၩဆၧၫ့ဆၧအၧၩ့ ဒဲမၩဆၧၫ့ဆၧအၧၩ့လၧအ ၥၭမၩကြၩ့ထမးဘဲၫၥိၭ အမိမၩဂၭဂီၩ့ဆၧလၧဆၧၥၭ",
			"16": "<sup>16</sup> ဂဲၫ့လၧဖျိၩ့အကၠီၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ကဆါယ ဟိဝၩစံၭဘဲၫယီၩ,ယိခွါ, ယမိယၩ့ထၪ့ယစူၪလၧၦဖလံ ၡၫဖိၪအဖၫ့ခိၪတၭ, ယမိဒၪ့ထ့ၬခွံၬၦကရံၥၭဖိၪ,ဒဲမၩ",
			"17": "<sup>17</sup> ဂၭဂီၩ့ဆၧအီၪလၩ့ထးလၧမၫဆမံၭနဲၩ့လီၫ.- ယမိမၩ ဆၧၫ့ဆၧအၧၩ့နၭနၭလ့ၬလၧအလီၩ့, အီၪလၧဆၧအၪ့ ၥီၪ့အီၪလၧဆၧၥၭခဲၩထၪ့, ထီးယမၩဆၧၫ့ဆၧအၧၩ့ လၧအလီၩ့တၭ,အဝ့ၫၥံၪမိၥ့ၪယၫဝ့ၫ လၧယမွဲယဟိဝၩ လီၫ."
		},
		"26": {
			"1": "<sup>1</sup> လၧနံၪ့လဆံၫလနံၪ့လၩထၪ့လနံၩနီၪ ဆၧမၩအၥၭ",
			"2": "<sup>2</sup> လၧယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,စံၭဝ့ၫဒၪ,- ၦၡၩ အဖိၪခွၫဧ့, လၧတဲအၫချဲၩ့ထၫ့ဒၩ ယရုစလံၫ့အကၠီၩ့, ဒဲစံၭ, အၩလါၬ ၦလၧအမွဲၦဆၨၩလဖၪအတရၫ့နီၪခါ ခွံၬယူၭးဆၧမိကၠၪအၥၭလၧယအီၪတၭ,ယမိလၧၫ့ထၪ့",
			"3": "<sup>3</sup> ဎွ့ၩထၪ့ယဝ့ၫ,အဝ့ၫဒၪအီၪယူယူၭ,- မၩအၥၭဘဲၫနီၪ တၭ,ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ယိခွါ,ယထၫ့ဒၩနၧၩ, တဲအၫဧ့,တၭယမိအၪ့မၧၫ့ၦအၪဆၨၩ ဂဲၫထၫ့ဒၩနၧၩ, ဘဲၫမၫဆမံၭဒုၭဂဲၫထၪ့အလပီၩလဖၪ အၥိၭနီၪလီၫ.",
			"4": "<sup>4</sup> ဆၧမိမၩဂၭဂီၩ့တဲအၫအခိၪဒၧၩ့, ဒဲမၩလၩ့ဎီးအထိၬ ထီၫလဖၪတၭ, ယမိကွၭခွံၬ အဂၪ့ခိၪအမုၬလၧအဖၫ့ ခိၪတၭ,အီၪက့ၪဝ့ၫဘဲၫလဲၫ့လဖျိၪ့ အဒၩ့ခိၪအၥိၭနီၪ",
			"5": "<sup>5</sup> လီၫ.- မိကဲၪထၪ့ဆၧအလးလၧမၫဆမံၭဖၧၩ့ထီးၦအၪ့ လိၫလၩ့အၡၬလဖၪ လၧအဖၫ့ခိၪလီၫ. အဂဲးဘဲၫယီၩ ယချဲၩ့ယူၭဆၧယူၭ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ, တၭ အဝ့ၫမိကဲၪထၪ့ဆၧအၪ့ဂူၬဆီၪ့ လၧၦဆၨၩလဖၪအဂး",
			"6": "<sup>6</sup> လီၫ.- အဖိၪမုၪလဖၪအီၪဝ့ၫလၧမံၩ့လၬကျၩနီၪ,မိဘၪ ဆၧမၩၥံၫဝ့ၫလၧဖၩ့ၥံၪနၭၥံၪတၭး မိၥ့ၪယၫဝ့ၫလၧယ မွဲယဟိဝၩလီၫ.",
			"7": "<sup>7</sup> အဂဲးဘဲၫယီၩကဆါယဟိဝၩစံၭဘဲၫယီၩ, ယိခွါ, ယမိဒုၭဂဲၫဘၪတဲအၫ လၧဘၭဘလၧၫ့အစဎွၩ န့ၭဘူၫ ခၭန့ဇၫအစဎွၩလဖၪအစဎွၩ လၧမုဖၩလခီၫ,အီၪဝ့ၫ လၧကၥ့ၪလဖၪ ဒဲလဲၪ့ၥုၭလဖၪ,ဒဲၦထူၬကၥ့ၪ,ၦအဒီၪ့",
			"8": "<sup>8</sup> လဖၪ,ဒဲၦခမျၧးအၪအၪလ့ၬလီၫ.- အဝ့ၫဒၪမိမၩၥံၫ နဖိၪမုၪလဖၪ လၧဂၪ့ခိၪအဝၩ့အကျၩလၧနၭၥံၪဖၩ့ၥံၪ တၭ,မိမၩခိၪဒၧၩ့ထၫ့ဒၩနၧၩ, ဒဲမၩထိၬၥံၪထၭၥံၪထၫ့",
			"9": "<sup>9</sup> ဒၩနၧၩတၭ, မိဆိၬထၪ့ထၩ့ဖံၭထၫ့ဒၩနၧၩလီၫ.- မိအီၪ က့ၪလၩ့စဲၭဘုၪ့ဖိးဆၧဆဲၫဎၩ့လၧနခိၪဒၧၩ့တၭ, မိမၩ",
			"10": "<sup>10</sup> လၩ့ဎီးနထိၬၥံၪလၧအကွၩလဖၪလီၫ.- မွဲအကၥ့ၪအီၪ အၪဒုၩအကၠီၩ့တၭ, ဆၧအမုၬမိမၩဘံၭနၧၩလီၫ. ထီး အဂဲၫနုၬလၧနတရၫ့ ဘဲၫၦၡၩဂဲၫနုၬဒိၩ့လၧဆၧဘုၪ့ဖိး အၥိၭနီၪတၭ, နခိၪဒၧၩ့မိဝၭဝ့ၫလၧၦထူၬကၥ့ၪ,ဒဲလဲၪ့",
			"11": "<sup>11</sup> ပၪ,ဒဲလဲၪ့ၥုၭအၥီၫအကၠီၩ့လီၫ.- မိယဲးလၩ့နဖၧၩ့ၥၭ ထီးအလူၬလၧအကၥ့ၪအခၪ့မံၪလီၫ. မိမၩၥံၫနၡၩခမျၧး လၧနၭၥံၪဖၩ့ၥံၪတၭ, နဂဲးနဘၭအဆၧဂၩ့ဆၧဖၪ့မိလၩ့",
			"12": "<sup>12</sup> ဒၩလၧဂၪ့ခိၪအဖၫ့ခိၪလီၫ.- အဝ့ၫၥံၪမိအၪ့ဂူၬန့ဆီၪ့ နဆၧထူၭဆၧလၧၫ့ဒဲမိမၩန့ဆီၪ့ဆၧ လၧနမၩဖနံၬနီၪ တၭ,အဝ့ၫၥံၪမိမၩလၩ့ဎီးခွံၬ နခိၪဒၧၩ့နီၪတၭ,မိမၩ ဂၭဂီၩ့ခွံၬနဂံၪ့အဎံၫအလၩတၭ, မိခွံၬၡိၭခွံၬနလိး, ဒဲ",
			"13": "<sup>13</sup> နၥံၪ့ဒဲဂၪ့ခိၪအမုၬ လၧထံၫကျၩလီၫ.- ယမိမၩထုၬ နဆၧၥံၫကျံၩအၥီၫတၭ, နနါဒံၩ့အၥီၫမိဂၧၫ့ထၪ့လၧၩ့",
			"14": "<sup>14</sup> အ့ၬ.- ယမိဒုၭကဲၪထၪ့နၧၩ ဘဲၫလဲၫ့ဒၩ့ခိၪအၥိၭလီၫ. နမိကဲၪထၪ့ဆၧအလး ထီးၦအၪ့လိၫလၩ့ၡၬၥံၪလၧအ ဖၫ့ခိၪလီၫ.ၦမၩကဲၪထၪ့ထဲၩ့လၧၩ့နၧၩအ့ၬ. အဂဲးဘဲၫ ယီၩဆၧလၧယၧၩယဟိဝၩယီၩ, ယချဲၩ့ယူၭဆၧယူၭ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"15": "<sup>15</sup> ကဆါယဟိဝၩစံၭတဲအၫဘဲၫယီၩ, ကျိၩ့လဖၪဝၭ ၡိၩ့ၡိၬဝ့ၫလၧနလၩ့ဎီးလဖၪအကၠီၩ့, လၧၦဘၪဆၧဆ့ၭ ဝ့ၫလဖၪ ဂၪ့အုၩဂၪ့ထိၬအကၠီၩ့, ဒဲလၧဆၧမၩၥံၫဆၧ",
			"16": "<sup>16</sup> လၧအမၩအၥၭလၧနစူၪဖၧၩ့အကၠီၩ့လီၫ.- ထီးနီၪလ ဖၧၫ့မၫဆမံၭအၦဒိၪဖၭဒိၪ ထီးအလူၬမိဂဲၫလၩ့လၧအ လးဆီၩ့ဆီတၭ,အီၪက့ၪခွံၬအဆဲၫ့ဖၭထီၫ, ဘဲၪ့လၩ့ခွံၬ အကီၩ့အၥိၭဆၭကံၪလီၫ. မိကီၩ့ၥိၭထၪ့ဆၧဝၭထိၬ တၭ,ဆၧၫ့နၩ့လၧဂၪ့ခိၪအဖၫ့ခိၪတၭ, ဝၭထိၬဝၭတ့ၭ",
			"17": "<sup>17</sup> ဒဲထီၫမံၫထီၫမၪလၧနကၠီၩ့လီၫ.- အဝ့ၫၥံၪမိဂၪ့ဆၧယၧၩ့ ဆၧလၧနကၠီၩ့တၭ, စံၭနၧၩ,ဆၧလၧအအီၪလၧၦမၫ ဆမံၭဖိၪလၧအဖၧၩ့, ဒိၩ့လၧအမံၩ့ဂၧၫ့ထၪ့ၥၩလၩ့လၧ အအီၪခၧၫ့လၧမၫဆမံၭအဖၧၩ့ဧ့, နဘၪဆၧဂၭဂီၩ့ဘဲၫၥ့ၪ လဲၪးနဝ့ၫဒၪ,ဒဲၦဒိၩ့ဖိၪလၧအမၩၥၭမဲၪ ကယဲၦလၧ",
			"18": "<sup>18</sup> အအီၪဝ့ၫလၧအနဲၩ့ထံၭလီၫ.- ဘိၩ့နဲၪ့ယီၩ ကျိၩ့လဖၪ ဝၭၡိၩ့ၡိၬဝ့ၫ လၧနလၩ့ဎီး အမုနံၩအဖၧၩ့လီၫ. မွဲမၬ, ကျိၩ့လဖၪအီၪဝ့ၫ လၧမၫဆမံၭဖၧၩ့ဝၭၡိၩ့ၡိၬလၧနစဲၪ့",
			"19": "<sup>19</sup> ထၪ့ခွံၬအကၠီၩ့လီၫ.- အဂဲးဘဲၫယီၩကဆါယဟိဝၩစံၭ ဘဲၫယီၩ,ထီးယအ့ၪအီၪက့ၪနၧၩ လၧဒိၩ့အီၪယူဝ့ၫ, ဘဲၫဒိၩ့လဖၪလၧၦဒိၩ့ဖိၪလအီၪဘၪ လၧအဖၧၩ့အၥိၭ နီၪ,ထီးယအ့ၪ ဒုၭဂဲၫထၪ့ထံၫယိၬဖၧၩ့ လၧနဖၫ့ခိၪ",
			"20": "<sup>20</sup> တၭ,ထံၫဖၭဒိၪမိလုၬဘံၭနၧၩတၭ,- ယမိဆၪ့လၩ့နၧၩ ဖိးလၧၦလၧအလ့ၩလၩ့လၧဆၧဖၧၩ့, လၧၦခမျၧးလၧ အအီၪလၧဖျိၩ့အၥိၭတၭ, ယမိဒုၭအီၪနၧၩလၧဂၪ့ခိၪ လၬလၧအလးအီၪယူလၧဖျိၩ့, အီၪလၧၦလၧအလ့ၩ လၩ့လၧဆၧဖၧၩ့အၥိၭ, ဘဲၫၥိၭၦမိအီၪလၧနဖၧၩ့လဂ့ၩ တၭ,ယမိအီၪက့ၪဆၧလၩဖၩ့ လၧဆၧမၧၫ့အခးဖၧၩ့",
			"21": "<sup>21</sup> လီၫ.- ယမိအီၪက့ၪဎွ့ၩနၧၩလၧဆၧၥၭမဲၪအလးတၭ, နအီၪလၧၩ့အ့ၬ. ၦအ့ၪအၪ့ဎၬနၧၩ လါနၫ့နီၪ, မိဒၪန့ လၧၩ့နၧၩနးဆိၭအ့ၬ.ကဆါယဟိဝၩစံၭဝ့ၫဒၪ."
		},
		"27": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၩ့ဘၪဒီၭယၧၩတၭ,စံၭဝ့ၫဒၪ, ၦ ၡၩအဖိၪခွၫဧ့,ဒုၭအီၪထၪ့ဂၪ့ဆၧယၧၩ့ဆၧ လၧတဲအၫ",
			"3": "<sup>3</sup> အကၠီၩ့,- တၭစံၭ, တဲအၫ, ဒိၩ့လၧအအီၪလၧဆၧလ့ၩ နုၬလၧမၫဆမံၭဖၧၩ့,ၦဆၨၩလဖၪအၡၩဖနံၬဖိၪလၧခး လၧမၫဆမံၭနဲၩ့အၪဘံၪ့အဂး, လဖျိၪ့ဧ့,ကဆါယဟိ ဝၩစံၭဘဲၫယီၩ,တဲအၫဧ့,နစံၭ, ယဎံၫယလၩလၧၫ့ထၪ့",
			"4": "<sup>4</sup> ဎွ့ၩထၪ့လီၫ.- နနဲၩ့ထံၭၥံၪအီၪလၧမၫဆမံၭဖၧၩ့, နၡၩ မၩထၪ့ဆၧၥံၪ မၩလၧၫ့ထၪ့ဎွ့ၩထၪ့နဎံၫနလၩလီၫ.",
			"5": "<sup>5</sup> အဝ့ၫၥံၪမၩနၥံၪ့ပၪထီးအလူၬ လၧၥံၪ့ၡိၫလၧစံနၧၫ,ဒဲ မၩန့ၥံၪ့ၡိၫအ့ရ့ၭ လၧလ့ၭဘနၧၫ့တၭ, မၩယါထုၪ့လ",
			"6": "<sup>6</sup> ဖၪလၧနဂးလီၫ.- လၧဘၫၡၫ့အၥံၪ့ထိၭဖၫနီၪ, အဝ့ၫၥံၪ မၩတငၨၭလဖၪလၧနဂးတၭ, ၦအၭၡၧၫဖိၪၥံၪလဒီၪ့ မၩထၪ့နလးဆၧၫ့နၩ့လဖၪလၧကဆၫ့မဲၪနီၪ, လၧအဂဲၫ",
			"7": "<sup>7</sup> ဆိၬထၪ့ခွံၬလၧကျိၩ့ဆံၭတံၫ့လဖၪအဖၧၩ့လီၫ.- ဆၧ ဘွၩဖျ့ၫလံၬကံၭ ဒဲဆၧဆၭကံၪဂဲၫလၧခးအံဇံၭနီၪ, မွဲ ဆၧလၧနပၠၪထၪ့ လၧနယါလၪအဂးလီၫ. ဆၧလၫ,ဒဲ ဆၧလုၭဖုၭလၧအဂဲၫလၧအံၫလဲၡၫအကျိၩ့ၥံၪနီၪ မွဲဆၧ",
			"8": "<sup>8</sup> မၩဘံၭနၧၩလီၫ.- ၦအီၪဝ့ၫလၧဇဲဒၧၫ့,ဒဲအၫဝၭမွဲနက ဘၩ့ဖိၪလီၫ. နၡၩကိၪ့ဆၧၥ့ၪလၧအအီၪဝ့ၫ လၧနဖၧၩ့",
			"9": "<sup>9</sup> နီၪ,မွဲနၡၩရိၬၥန့ၫဖိၪ,တဲအၫဧ့ၬ- ဂံလဘၭအၡၩၥုၪ့ က့ၭၥၭၡါ,ဒဲၦမၩဆၧၥ့ၪလၧအဖၧၩ့နီၪ, မွဲနၡၩၥံၪထ့ၫ ကဘၩ့လီၫ. မၫဆမံၭအကဘၩ့ထီးအလူၬ, ဒဲအက ဘၩ့ဖိၪအီၪဝ့ၫလၧနဖၧၩ့, ဘဲၫၥိၭအမိမၩန့ နဆၧဖနံၬ",
			"10": "<sup>10</sup> လီၫ.- ၦပၧၡၫဖိၪ,ဒဲၦလုဒံၫဖိၪ, ဒဲၦဖုၫတၫဖိၪအီၪဝ့ၫ လၧနၥုၭမုအကျၩ, နၡၩဒုၭၥုၭလီၫ. တၭအဝ့ၫၥံၪဘျၭ ထၪ့ဆၧပဒၩ့ဒဲခိၪလူၬၥုၭလၧနဖၧၩ့, မၩလၩမၩဖၩ့နၧၩ",
			"11": "<sup>11</sup> လီၫ.- ၦအၫဝၭဖိၪဒဲနၥုၭမုထီးအလူၬအီၪဝ့ၫလၧနခိၪ ဒၧၩ့ဝၬဖီၩ့ဝ့ၫ, ဒဲၦၥုၭဖိၪဆီၪ့အီၪဝ့ၫ လၧနတၨၭထီၫအ ဖၧၩ့လီၫ.အဝ့ၫၥံၪဘျၭထၪ့အဆၧပဒၩ့ လၧနခိၪဒၧၩ့ အလီၩ့ဝၬဖီၩ့ဝ့ၫး မၩလၧၫ့ထၪ့ဎွ့ၩထၪ့နဎံၫနလၩလီၫ.",
			"12": "<sup>12</sup> တၫၡံၭမွဲနၡၩဖနံၬဖိၪ လၧဆၧဖိၪဆၧလံၩ ကိၭမံၩ့ဒ့ၭ အီၪဝ့ၫအၪအၪလ့ၬအကၠီၩ့လီၫ. အဝ့ၫၥံၪအၪ့ဆၫခွံၬ",
			"13": "<sup>13</sup> စ့ၩ,ဒဲထၭ, ဒဲၡၬ, ဒဲၡၬၥၧၫ့နီၪလၧနဖၠၫဖၧၩ့လီၫ.- ယၫ ဝၫ့,တုဘလၭ,ဒဲမ့ၫၡ့ၭနီၪမွဲနၡၩဖနံၬဖိၪလီၫ. အဝ့ၫၥံၪ အၪ့ဆၫခွံၬၦၡၩၥံၪ, ဒဲထွ့ၫထီးဘၩ့လၧဖၠၫဖၧၩ့လီၫ.",
			"14": "<sup>14</sup> တိၫဂၫမၫအၡၩဂံၪ့ဖိၪအၪ့ဆၫခွံၬကၥ့ၪ, ဒဲၦထူၬကၥ့ၪ",
			"15": "<sup>15</sup> ဒဲကၥ့ၪလၫလၧနဖၠၫဖၧၩ့လီၫ.- ၦဒံဒၫ့ဖိၪမွဲနၡၩဖနံၬဖိၪ လီၫ.ခးအၪဘံၪ့လၧမၫဆမံၭနဲၩ့ မၩဖနံၬလၧနစူၪဖၧၩ့ လီၫ.အဝ့ၫၥံၪဂဲၫဆိၬအၪ့လဲၩဆၧနိၩ့လဖၪ, ဒဲကဆၫ့",
			"16": "<sup>16</sup> မဲၪ,ဒဲၥံၪ့အယၪၥၧၫ့လီၫ.- စံရအၫမွဲနၡၩဖနံၬဖိၪလၧ နတဲၩ့ဆၧအၪမံၩ့အကၠီၩ့လီၫ. အဝ့ၫၥံၪအၪ့ဆၫခွံၬထၫ့ မျါဝီၩ,ဒဲဆၧလုၭဖုၭ,ဒဲဆၧဆၭကံၪ, ဒဲဆၧဘွၩဖျ့ၫလံၬ",
			"17": "<sup>17</sup> ကံၭ,ဒဲလိးနိၩ့,ဒဲထၫ့မျါဝီၩလုၭ,လၧနဖၠၫဖၧၩ့လီၫ.- ယု ဒၫဒဲအံၫစရ့လၭအၡၩခးဖိၪ,မွဲနၡၩဖနံၬဖိၪလီၫ. အဝ့ၫ ၥံၪအၪ့ဆၫခွံၬမံၫ့နံၭအဘုၪကၠိၩ့ ဒဲကိၪဆၧၫ့, ဒဲန့ၫစၩ့,",
			"18": "<sup>18</sup> ဒဲၥိၪ,ဒဲၥံၪ့စရံအထူၭလၧနဖၠၫဖၧၩ့လီၫ.- ဒမၭစကၧၭ မွဲနၡၩဖနံၬဖိၪလၧနတဲၩ့ဆၧအၪမံၩ့အကၠီၩ့, လၧနဆၧ ဖိၪဆၧလံၩကိၭမံၩ့ဒ့ၭ အီၪအၪအၪလ့ၬ အကၠီၩ့လီၫ. အဝ့ၫၥံၪအၪ့ဆၫခွံၬ ဟ့ၭလဘိၭအစဘံၭထံၫ,ဒဲၥိၪအ",
			"19": "<sup>19</sup> ဆီၪ့ဘွၩလီၫ.- ဒၫ့ဒဲယၫဝၫ့ဂဲၫဆိၬလူၪလဖၪ,လၧနဖၠၫ ဖၧၩ့လီၫ.ယၭၥဒဲၩ့ယုၩ့ယဲ,ဒဲကဒါရၫအဖံၭ,ဒဲလၫ့ယ့ၫ",
			"20": "<sup>20</sup> အီၪဝ့ၫလၧနဖၠၫဖၧၩ့လီၫ.- ဒံဒၫ့မွဲနၡၩဖနံၬဖိၪတၭ, ဂဲၫ ဆိၬဆၧကီၩ့ဆၧၥိၭ လၧအလူဒိၪဎွ့ၩဒိၪလၧလဲၪ့ၥုၭအ",
			"21": "<sup>21</sup> ဂးလီၫ.- အရ့ဘၠၫ,ဒဲက့ဒၫအၦဒိၪဖၭဒိၪထီးအလူၬနီၪ, မွဲနၡၩဖနံၬမၩလၧနၥိၭတၭး အဝ့ၫၥံၪမၩဖနံၬလၧၥိၪဖိၪ,",
			"22": "<sup>22</sup> ဒဲၥိၪဖၫလၧဘ့ၪဒဲနၧၩလီၫ.- ၡံဘၫ,ဒဲရၫမၫနီၪမွဲနၡၩ ဖနံၬဖိၪလီၫ. တၭအဝ့ၫၥံၪအၪ့ဆၫဆၧနၧၫ့မၧၫ့အၪမံၩ့, ဒဲထၫ့မျါအၪမံၩ့,ဒဲထီၫ့ၥံၪလွ့ၫၥံၪ, လၧနဖၠၫဖၧၩ့လီၫ.",
			"23": "<sup>23</sup> ဟၫရၫ့ဒဲခၫ့နံၫ,ဒဲအံဒံၫ့ဒဲၡံဘၫ, ဒဲအၭၡၧၫ,ဒဲခံလမၭ",
			"24": "<sup>24</sup> အၡၩမၩဖနံၬနီၪ,မွဲနၡၩမၩဖနံၬဖိၪလီၫ.- အဝ့ၫၥံၪအၪ့ ဆၫဆၧကီၩ့ဆၧၥိၭအလၧၫ့အဎွ့ၩ, ဒဲဖၬဘဲၩ့အလၫ, ဒဲဆၧဆၭကံၪ, ဒဲတလၫၥံၪ့ၡိၫအ့ရ့ၭအတလၫၥံၪ့စၧၩ့ ထၬအၥၭလၧဖျံၩ, အီၪလၧဆၧကီၩ့ဆၧၥိၭ အဂ့ၩအ",
			"25": "<sup>25</sup> ဘွၩနီၪ,လၧနဖၠၫဖၧၩ့လီၫ.- တၫၡံၭအကဘၩ့နီၪမွဲဆၧ လၧအဆိၬနဖနံၬလဖၪလီၫ. နလၧၫ့ထၪ့ဎွ့ၩထၪ့တၭ, အီၪဝ့ၫလၧဆၧအလၩအဖၩ့ဒိၪမၬ လၧမၫဆမံၭဖၧၩ့ လီၫ.",
			"26": "<sup>26</sup> နၡၩခုးတငၨၭလဖၪ ၥိၫ့ယူၭနၧၩ လၧထံၫဖၭဒိၪအ ဖၧၩ့,လံၩမုထၪ့နီၪမၩခါခွံၬနၧၩ လၧမၫဆမံၭအၥၭခံ",
			"27": "<sup>27</sup> ဖၧၩ့လီၫ.- နဆၧထူၭဆၧလၧၫ့,ဒဲနဖၠၫလဖၪ,ဒဲနဆၧဖ နံၬၥံၪ,ဒဲနၡၩကဘၩ့ဖိၪ, ဒဲနၡၩရိၬၥန့ၫ, ဒဲနၡၩၥံၪထ့ၫ ကဘၩ့,ဒဲၦအၪ့ခၩဆၧလၧနဖနံၬလဖၪ, ဒဲနၡၩၥုၭဖိၪ ထီးအလူၬအီၪဝ့ၫလၧနဖၧၩ့, ဒဲကယဲနၡၩၥုၭဖိၪၥံၪလၧ အအီၪလၧနကျၩမိလၩ့ထ့ၬ လၧမၫဆမံၭဖၧၩ့, လၧန",
			"28": "<sup>28</sup> ထီၩ့လၧဆၧဂၭဂီၩ့အမုလနံၩအဖၧၩ့နီၪလီၫ.- ဆၧအ လးအီၪလၧခီၫ့ဝၬဖီၩ့နၧၩလဖၪမိဝၭၡိၩ့ၡိၬ လၧနၡၩ ရိၬၥန့ၫအကိၭၡၭထၪ့အကၠီၩ့လီၫ.",
			"29": "<sup>29</sup> ကယဲၦလၧအခုးတငၨၭထီးအလူၬ, ဒဲၦကဘၩ့ဖိၪ ၥံၪ,ဒဲမၫဆမံၭအၡၩရိၬၥန့ၫထီးအလူၬ, မိစဲၪ့လၩ့ခွံၬ",
			"30": "<sup>30</sup> လၧအကဘၩ့ဖၧၩ့တၭ,မိဆၧၫ့ထုၪ့လၧခီၫ့,- မိဒုၭနါ ဂၧၫ့အလူထၫ့ဒၩနၧၩ, မိဂၪ့နၭနၭလ့ၬ, မိဎွံၪထၪ့ဂၪ့ခိၪ မုၬလၧအခိၪဎွံၪအဖၫ့ခိၪတၭ, မိလွၫလၩ့အၥၭလၧဖံၫ့",
			"31": "<sup>31</sup> ချၪအဖၧၩ့လီၫ.- အဝ့ၫၥံၪမိလိၩ့အခိၪဆံၫ့ဆၫ့ပျၩ့လၧ နကၠီၩ့တၭ, မိခဲးထူၬအၥၭလၧရၧၬအဆၧယၬတၭ,မိ ဂၪ့လၧနကၠီၩ့လၧအၥၭဆၫတၭ, ဂၪ့နၭနၭလ့ၬလီၫ.",
			"32": "<sup>32</sup> ဂၪ့ဆၧယၧၩ့ဆၧအဘိၩ့ဘၭတၭ, မိမၩဆၧဂၪ့အုၩဂၪ့ ထိၬနီၪ,ဂၪ့ဆၧလၧနကၠီၩ့တၭ,စံၭ, ဒိၩ့မၩအၥၭဘဲၫတဲ အၫအၥိၭ လၧအဘၪဆၧဂၭဂီၩ့ဝ့ၫ လၧမၫဆမံၭအၥၭ",
			"33": "<sup>33</sup> ကျၩနီၪ,မွဲဒိၩ့ပလၫနီၪလဲၪ.- ထီးနဆၧဖနံၬစဲၪ့ထၪ့လၧ မၫဆမံၭဖၧၩ့နီၪ, နဒုၭမံၫ့ၥုၪ့မံၫ့ၥၭၦအၪဆၨၩ, နဒုၭ ထူၭထၪ့လၧၫ့ထၪ့ဂၪ့ခိၪ, အစဎွၩလဖၪ လၧနဆၧထူၭ",
			"34": "<sup>34</sup> ဆၧလၧၫ့အအၪအဒိၪ, ဒဲနဆၧဖနံၬလဖၪလီၫ.- ထီး နအ့ၪဂၭဂီၩ့ခွံၬ လၧမၫဆမံၭဖၧၩ့လၧထံၫယိၬအဖၧၩ့ နီၪတၭ,ဆၧဖနံၬလဖၪ ဒဲနဆၧအီၪလၧနဖၧၩ့ထီးအ",
			"35": "<sup>35</sup> လူၬနီၪမိဂၭဂီၩ့ဝ့ၫလီၫ.- ၦခးဖိၪလၧကျိၩ့လဖၪအလီၩ့ နီၪမိထီၫမံၫထီၫမၪလၧနကၠီၩ့ထီးအလူၬ, ဒဲအဝ့ၫၥံၪအ စဎွၩလဖၪမိၥၭမဲၪဆၧနၭလ့ၬတၭ,အဆီၪ့ဎး, အမ့ၬ",
			"36": "<sup>36</sup> လၩ့ၡါဝ့ၫလီၫ.- ၦဖနံၬဖိၪလၧၦဆၨၩလဖၪအကျၩမိ ဒုၪဒွ့ၪနၧၩ,နမိကဲၪထၪ့ဆၧၥၭမဲၪဖၭဒိၪအလးတၭ, န လအီၪလၧၩ့ဘၪလၩ့ဆိၩလၩ့ကၠၠၪလီၫ."
		},
		"28": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၩ့ဘၪဒီၭယၧၩတၭ, စံၭဝ့ၫဒၪ,",
			"2": "<sup>2</sup> ၦၡၩအဖိၪခွၫဧ့, စံၭလၧတဲအၫအၦဒိၪဖၭဒိၪနီၪ,ကဆါ ယဟိဝၩစံၭဘဲၫယီၩ, မွဲနၥၭအီၪထၪ့ထီၫတၭ, နစံၭ ယူၭ,ယမွဲယွၩလဂၩ, ယဆၧၫ့နၩ့လၧယွၩအလးဆၧၫ့ နၩ့လၧမၫဆမံၭအၥၭကျၩနီၪတၭ, နအီၪက့ၪနၥၭဘဲၫ ယွၩလဂၩအၥၭလါနၫ့တၭး နမွဲၦၡၩလဂၩတၭ,မွဲယွၩ",
			"3": "<sup>3</sup> လဂၩအ့ၬ.- ယိခွါ,နအီၪက့ၪနၥၭကိၪ့ၥ့ၪနဲၪ့ဒံၭစဒၫ့န အ့လၭတၭ,ဆၧအီၪၥူၪအီၪကဒုၩလၧနၧၩနးမံၩ့အ့ၬ.",
			"4": "<sup>4</sup> လၧနထူၭထၪ့လၧၫ့ထၪ့လၧနဆၧကိၪ့ၥ့ၪကိၪ့ဘၪဒဲနၥုၪ့ ဆၭၥၭဆၭအကၠီၩ့တၭ, နအီၪလၧထီၫ့ဒဲစ့ၩလၧနအီၪ",
			"5": "<sup>5</sup> က့ၪကီၪ့ဆၧအလးဖၧၩ့လီၫ.- နမၩအၪထၪ့နဆၧထူၭ ဆၧလၧၫ့ လၧဆၧကိၪ့ၥ့ၪကိၪ့ဘၪဖၭဒိၪ လၧနမၩဖနံၬ ဆၧလီၫ. နမၩထၪ့ထီၫနၥၭလၧနဆၧထူၭဆၧလၧၫ့အ",
			"6": "<sup>6</sup> ကၠီၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ကဆါယဟိဝၩစံၭ ဘဲၫယီၩ,မွဲနအီၪက့ၪနၥၭ ဘဲၫယွၩလဂၩအၥၭ အၥိၭ",
			"7": "<sup>7</sup> တၭ.- ယိခွါ,ယမိဒုၭဂဲၫဘၪနၧၩလၧၦလခီၫဘၩ့မုးဖိၪ, ၦမၩၥၭမဲၪဆၧလၧၦဆၨၩလဖၪအကျၩ, ဒဲမိထုၭထၪ့ခွံၬ အနၭထၫ့ဒၩ နဆၧကိၪ့ၥ့ၪကိၪ့ဘၪ အဎံၫအလၩတၭ,",
			"8": "<sup>8</sup> မိမၩဘၪၥၭလိၪ နဆၧယုၩ့ယဲလီၫ.- တၭအဝ့ၫၥံၪမိ ဆၪ့လၩ့နၧၩလၧဆၧဖၧၩ့တၭ, နမိၥံၫဘဲၫၦလၧအဘၪ ဆၧမၩၥံၫဝ့ၫ လၧမၫဆမံၭအၥၭကျၩ အၥိၭနီၪလီၫ.",
			"9": "<sup>9</sup> လၧၦလၧအမၩၥံၫနၧၩ အမ့ၬယၫနီၪ နမိစံၭလၧယမွဲ ယွၩလဂၩနီၪဆ့ဧၪ, အ့ၪမွဲနမွဲယွၩအ့ၬ, မွဲၦၡၩလဂၩ",
			"10": "<sup>10</sup> လၧၦလၧအမၩၥံၫနၧၩအစူၪဖၧၩ့လီၫ.- နမိဘၪၥံၫဘဲၫ ၦလၧအလဒိၭဘၪဆၧကူၭတရံၭၥံၫဝ့ၫအၥိၭ, လၧၦလ ခီၫဘၩ့မုးဖိၪအစူၪဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ယဝ့ၫဒၪ ယီၩ, ယချဲၩ့ယူၭဆၧယူၭ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"11": "<sup>11</sup> လၧနီၪအမ့ၬယၫယဟိဝၩအလူလၩ့ဘၪယၧၩ, စံၭ",
			"12": "<sup>12</sup> ဝ့ၫဒၪ,- ၦၡၩအဖိၪခွၫဧ့,ဒုၭအီၪထၪ့ဂၪ့ဆၧယၧၩ့ဆၧ လၧတဲအၫ အစဎွၩအကၠီၩ့တၭ,စံၭအဝ့ၫဒၪ, ကဆါ ယဟိဝၩစံၭဘဲၫယီၩ, ဆၧလၧအလၧၫ့ဎွ့ၩလၧဆၧကိၪ့ ၥ့ၪကိၪ့ဘၪတၭ, လၧၫ့ထၪ့ဎွ့ၩထၪ့ လၧဆၧအဎံၫအ",
			"13": "<sup>13</sup> လၩနစဲၩနဲၪ့ထၬဝ့ၫဒၪလီၫ.- နအီၪယူၭလၧအံဒံၫ့ယွၩ အကျိၭအဖၧၩ့း ထၫ့မျါကိၭမံၩ့ဒ့ၭ, မွဲဆၧချႃၬဘံၭနၧၩ, ထၫ့မျါဆၫ့ၥွံၪ, ထၫ့မျါဘၩ့အုၭၥဖၬယၩ, ထၫ့မျါမဟူ ယၩထီၩ့အၥၭ, ထၫ့မျါဘၩ့ယ့ၫ,ထၫ့မျါနကၥွဲၭ,ထၫ့ မျါနံၩလၩ,ထၫ့မျါဝီၩ, ထၫ့မျါတ့မၠၭ,ဒဲထီၫ့လီၫ. ဆၧအ မ့ၬအဖၧၩ့တဲၩ့အၥၭလၧနထၫ့မျါအဂးနီၪ အၪဝ့ၫလၧ",
			"14": "<sup>14</sup> နၧၩ,မုလနံၩ လၧနအီၪဖျဲၪနီၪတဲၩ့ဝဲၩအၥၭလီၫ.- နမွဲ ခ့ၫရူၬဒိၭဂုၪအၥၭလဒုၩ လၧအကၭဘံၭထၬအၥၭ, ယအီၪက့ၪနၧၩ လၧယွၩအခိၪလီၩ့ဆံၫ့ဎံၪအလီၩ့လီၫ.",
			"15": "<sup>15</sup> နစဲၪ့ဝံၩ့ဝၩ့ဆၧလၧလိးမ့ၪအကျၩလီၫ.- နဘီၪထၪ့ယီၫ ထၪ့လၧနဖၧၩ့ၥၭခီၫလၧနမုလနံၩ လၧနအီၪဖျဲၪထီးဆၧ",
			"16": "<sup>16</sup> ဒၪန့ဆၧဒဲၩဘၭလၧနဖၧၩ့လီၫ.- နဎွ့ၩလၧဆၧမၩဆီၪ့ လ့ၬလၧနဆၧဖနံၬလဖၪအၪလ့ၬအကၠီၩ့တၭ, နမၩယူၭ ဆၧဒဲၩဘၭယူၭ, မၩအၥၭဘဲၫနီၪတၭ, ယမိခွံၬၡိၬခွံၬ နၧၩလၧယွၩအခိၪလီၩ့အလီၩ့, ဘဲၫဆၧဘၪၥၭလိၪအ ၥိၭနီၪခ့ၫရူၬ လၧအမၩဘံၭဆၧလဂၩဧ့, ယမိမၩဂၭ",
			"17": "<sup>17</sup> ဂီၩ့နၧၩလၧလိးမ့ၪအကျၩလီၫ.- နအီၪက့ၪထၪ့ထီၫန ၥၭလၧနဎံၫနလၩအကၠီၩ့, နမၩဘၪၥၭလိၪနဆၧကိၪ့ ၥ့ၪကိၪ့ဘၪလၧနဆၧယုၩ့ယဲအကၠီၩ့လီၫ. ယမိခွံၬလၩ့ ခွံၬနၧၩလၧဂၪ့ခိၪအဖၫ့ခိၪ, ယမိအီၪက့ၪနၧၩလၧစဎွၩ",
			"18": "<sup>18</sup> လဖၪအမ့ၬယၫဘဲၫၥိၭအမိယိဖၧၩ့နၧၩလီၫ.- နမၩဘၪ ၥၭလိၪနလးဆံၫ့ဎံၪလဖၪ လၧနဆၧဒဲၩဘၭအၪမံၩ့အ ကၠီၩ့,လၧနမၩဖနံၬ ဆၧလတီၩလလီၩ့ဘၪအကၠီၩ့လီၫ. တၭယမိဒုၭဂဲၫထၪ့မ့ၪ လၧနၥၭကျၩလၧအမိအၪ့ခွံၬ နၧၩ,ဒဲယမိဒုၭကဲၪထၪ့နၧၩ, လၧဖံၫ့ချၪလၧဂၪ့ခိၪချိၫ့, လၧၦလၧအယိနၧၩလဖၪ အမ့ၬယၫ ထီးအလူၬလီၫ.",
			"19": "<sup>19</sup> ကယဲၦလၧအၥ့ၪယၫနၧၩ လၧၦၡၩခမျၧးထီးအလူၬအ ကျၩနီၪမိထီၫမံၫထီၫမၪလၧနကၠီၩ့လီၫ. နကဲၪထၪ့ဆၧ ၥၭမဲၪဖၭဒိၪအလးတၭ, နလအီၪလၧၩ့ဘၪလၩ့ဆိၩ လၩ့ကၠၪလီၫ.",
			"20": "<sup>20</sup> ယဟိဝၩအလူလၩ့ဘၪဒီၭယၧၩတၭ,စံၭဝ့ၫဒၪ,",
			"21": "<sup>21</sup> ၦၡၩအဖိၪခွၫဧ့, အီၪက့ၪနမ့ၬ ထၫ့ဒုၪဒၩ ဇဲဒၧၫ့တၭ,",
			"22": "<sup>22</sup> ချဲၩ့ဆၧလၧမီၪအချိၬထၫ့ဒၩဝ့ၫတၭ,- စံၭ,ကဆါယ ဟိဝၩစံၭဘဲၫယီၩ, ယိခွါ,ဇဲဒၧၫ့ဧ့,ယထၫ့ဒၩနၧၩတၭ, ယမိဒိၭဆၧလၩဆၧဖၩ့လၧနၥၭကျၩတၭ, ထီးယအ့ၪ မၩဆၧစ့ၩရၫ့လၧအဖၧၩ့တၭ, ဆၧမိအီၪက့ၪဆံၫ့ဎံၪ ယၧၩလၧအဖၧၩ့နီၪ, ၦလဖၪမိၥ့ၪယၫဝ့ၫလၧယမွဲယ",
			"23": "<sup>23</sup> ဟိဝၩလီၫ.- ယမိအၪ့မၧၫ့လၩ့ဆၧၥံၫချဲၫ့လၧအအီၪ, ဆၧၥွံၪလၧအဖၧၩ့ၥၭဖၧၩ့ ဒဲၦဘၪဆ့ၭမိလၩ့ထံၩဖါ လၧအကျၩ လၧနၭၥံၪဖၩ့ၥံၪ လၧအအီၪဝၬဖီၩ့ထၫ့ဒၩ အဝ့ၫတၭ, အဝ့ၫၥံၪမိၥ့ၪယၫလၧယမွဲယဟိဝၩလီၫ.",
			"24": "<sup>24</sup> ဆၧဆူၪလၧအဘၪဆ့ၭဆၧမွဲဂ့ၩ, ဒဲဆၧဆူၪဆၧမဲၪ လၧအမၩဆၫဆၧမွဲဂ့ၩ, အီၪလၧၩ့လၧအံၫစရ့လၭအ ၡၩဂံၪ့ဖိၪ, ဒဲလၧၦလၧအဝၬဖီၩ့ဝ့ၫ ထီးအလူၬအကျၩ လၧအမၩကြၩ့ထမးအဝ့ၫၥံၪအ့ၬ. တၭအဝ့ၫၥံၪမိၥ့ၪ",
			"25": "<sup>25</sup> ယၫဝ့ၫလၧယမွဲကဆါယဟိဝၩလီၫ.- ကဆါယဟိဝၩ စံၭဘဲၫယီၩ, ထီးယအ့ၪအၪ့ထုၫ့ကီၪ့ အံၫစရ့လၭအ ၡၩဂံၪ့ဖိၪလၧၦဆၨၩလဖၪအကျၩ ထီးအလးလၧအ အီၪပြံၩပၩလၧအကျၩတၭ, ဆၧမိအီၪက့ၪဆံၫ့ဎံၪ ယၧၩလၧအကၠီၩ့ လၧၦဆၨၩလဖၪအမ့ၬယၫတၭ, မိ အီၪဝ့ၫလၧခးလဘံၪ့အဖၧၩ့ လၧယဖ့ၪလၫ့ယူၭယခ့ၫ",
			"26": "<sup>26</sup> ယၡၩစယၫကူၭနီၪလီၫ.- အဝ့ၫၥံၪမိအီၪထီးနီၪအီၪဂုး ခၧၫ့တၭ,မိမၩဂံၪ့ၥံၪဎၫ့ၥံၪ, ဒဲၥုၪ့စဘံၭမုအလးတၭ, ထီးယမၩဆၧစ့ၩရၫ့လၧၦလၧအမၩကြၩ့ထမးဘၪအ ဝ့ၫဝၬဖီၩ့ဝ့ၫထီးအလူၬအလီၩ့တၭ,မွဲမၬ,မိအီၪဝ့ၫဂုး ခၧၫ့တၭ,မိၥ့ၪယၫဝ့ၫလၧယမွဲယဟိဝၩ အဝ့ၫၥံၪအယွၩ လီၫ."
		},
		"29": {
			"1": "<sup>1</sup> လၧနံၪ့ဆံၫနံၪ့လနံၪ့ လၩဆံၫဘံၪ့လဘံၪ့လၩထၪ့လ ဆံၫနံၫနံၩလနံၩနီၪ, ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,",
			"2": "<sup>2</sup> စံၭဝ့ၫဒၪ,- ၦၡၩအဖိၪဧ့, အီၪက့ၪနမ့ၬထၫ့ဒၩခးအံ ဇံၭအစဎွၩဖၫရိၫတၭ, ချဲၩ့ဆၧလၧမီၪအချိၬထၫ့ဒၩအ",
			"3": "<sup>3</sup> ဝ့ၫ,ဒဲထၫ့ဒၩခးအံဇံၭထၧၫ့ဘံၪ့ယၫတၭ,- ချဲၩ့ဆၧတၭ, စံၭ,ကဆါယဟိဝၩစံၭဘဲၫယီၩ,ယိခွါ,ယထၫ့ဒၩနၧၩ, ဖၫရိၫအံဇံၭအစဎွၩ, မၪဖၭဒိၪလၧအမံၫနၩ့ လၧထံၫ မိၡါအဖၧၩ့တၭ,စံၭ, ယထံၫမိၡါမွဲယဆၧ, ယတဲၩ့ဝ့ၫ",
			"4": "<sup>4</sup> လၧယဂးဒၪယဝ့ၫလဂၩဧ့,- ယမိပုၭနခၪလၬလၧနိၪ ပုၭတၭ,ယမိဒုၭဘုၭထၬ ဒ့ၪၥံၪယၪၥံၪ လၧနဘံၪ့ၥံၪ တၭ,ယမိမီၩ့ကၠူၭထၪ့ခွံၬနၧၩ လၧထံၫမိၡါအကျၩ, ဒဲကယဲဒ့ၪၥံၪယၪၥံၪလၧနထံၫမိၡါအဖၧၩ့ လၧအဘုၭ",
			"5": "<sup>5</sup> ထၬလၧနဘံၪ့ၥံၪနီၪဆ့လီၫ.- ယမိခွံၬၡိၭခွံၬနၧၩလၧၡါ မုနၧၫ့ဖၫ, နဝ့ၫဒၪဒဲဒ့ၪၥံၪယၪၥံၪ လၧထံၫမိၡါအဖၧၩ့ ထီးအလူၬ, နမိလၩ့ထ့ၬလၧဆၧပျၩ့ဖၧၩ့တၭ, ဆၧလ အီၪက့ၪကီၪ့ဘၪနၧၩ, ဒဲအၪ့ထုၫ့ကီၪ့ဘၪနၧၩဆ့အ့ၬ. ယဖ့ၪလၫ့ယူၭနၧၩလၧဆၧဖိၪဆၧဎါ လၧမံၩ့လၬကျၩ, ဒဲလၧထိၪၥံၪလံၪၥံၪ လၧမူၭဖိၭဖၫ့ လၧဆၧအၪ့အဂး",
			"6": "<sup>6</sup> လီၫ.- လၧအကဲၪထၪ့နိၪထိၭလဘီၩ့ လၧအံၫစရ့လၭ အၡၩဂံၪ့ဖိၪအဂးတၭ, ၦအံဇံၭဖိၪထီးအလူၬမိၥ့ၪယၫ",
			"7": "<sup>7</sup> ဝ့ၫလၧယမွဲယဟိဝၩလီၫ.- ထီးအဝ့ၫၥံၪမၩန့နၧၩလၧ နစူၪတၭ,နမၩခါခွံၬ, ဒဲအဝ့ၫၥံၪအခိၬထံၭခိၪဘၪလၩ့ ဘျူၭခွံၬထၧၫ့ဘံၪ့ယၫလီၫ. ထီးအဒိၭနဲၩ့အၥၭလၧ နၧၩနီၪ,နမၩခါခွံၬတၭ, ဒုၭဝၭထိၬအယံးဒံၩ့ ထီးအ",
			"8": "<sup>8</sup> လူၬလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ကဆါယဟိဝၩစံၭ ဘဲၫယီၩ,ယိခွါ, ယမိဒုၭဘၪနၧၩလၧနၭလဘံၪ့နီၪ,ဒဲ",
			"9": "<sup>9</sup> ဒၪ့ထ့ၬခွံၬၦၡၩ ဒဲဆၧဖိၪဆၧဎါ လၧနဖၧၩ့လီၫ.- ခး အံဇံၭမိအီၪယူဝ့ၫတၭ, မိၥ့ၪယၫဝ့ၫလၧယမွဲယဟိဝၩ လီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫဒၪစံၭဝ့ၫ, ထံၫမိၡါမွဲယဆၧ",
			"10": "<sup>10</sup> တၭး ယတဲၩ့အဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယိခွါ, ယထၫ့ဒၩနၧၩ, ယထၫ့ဒၩနထံၫမိၡါလဖၪတၭ,ယမိမၩ ဂၭဂီၩ့ခးအံဇံၭတၭ, မိအီၪယူဝ့ၫလူၬထူၬဆံၫ့ဘၩ့လၧ မံကဒီၫလၭ,ဖိးလၧစဲၫအံနံၫ, ထီၩ့လၧကုၡၫအခးနဲၩ့",
			"11": "<sup>11</sup> ထံၭလီၫ.- ၦၡၩအခၪ့လမိခၫ့ဂၬဘၪဝ့ၫ, ဒဲဆၧဖိၪဆၧ ဎါအခၪ့လမိခၫ့ဂၬဘၪဝ့ၫတၭ, ၦလမိအီၪဘၪလၧအ",
			"12": "<sup>12</sup> ဖၧၩ့အနံၪ့လံဆံၫလီၫ.- ယမိမၩအီၪယူခးအံဇံၭလၧ ခးလဖၪလၧအအီၪယူဝ့ၫအကျၩ, အဒိၩ့လဖၪလၧဆၧ မၩလူၬထူၬဝ့ၫ အကျၩနီၪမိအီၪယူအနံၪ့ လံဆံၫလီၫ. တၭယမိမၩလၩ့ပြံၩလၩ့ပၩ ၦအံဇံၭဖိၪလၧၦဆၨၩ လဖၪအကျၩတၭ,ယမိမၩလၩ့မုလၩ့ဖၭဝ့ၫလၧခးလ ဖၪအကျၩလီၫ.",
			"13": "<sup>13</sup> ကဆါယဟိဝၩစံၭဘဲၫယီၩ, အနံၪ့လံဆံၫအထုၬနီၪ ယမိအၪ့ထုၫ့ကီၪ့ထဲၩ့ၦအံဇံၭဖိၪ လၧၦဆၨၩလဖၪအ",
			"14": "<sup>14</sup> ကျၩထီးအအီၪပြံၩပၩနီၪ,- ယမိဒုၭဂဲၫထဲၩ့ထဲၩ့အံ ဇံၭအၡၩလ့ၩကဲၪဎီးတၭ, ယမိဒုၭဂဲၫထဲၩ့ကဒၩထဲၩ့အ ဝ့ၫၥံၪထီၩ့လၧခးပၫၥြီၭအဖၧၩ့, လၧခးထီးအအီၪဖျဲၪ လၧအဖၧၩ့တၭ,အဝ့ၫၥံၪမိကဲၪထၪ့ဘၩ့မုးလၧအလၩ",
			"15": "<sup>15</sup> အဖၩ့လအီၪဘၪလဘၩ့မုးထီးနီၪလီၫ.- အလၩအဖၩ့ မိဆံၭနဲၪ့ဒံၭ ဘၩ့မုးထီးအလူၬ အလၩအဖၩ့လီၫ. မိ အီၪက့ၪထၪ့ထီၫလၧၩ့အၥၭ လၧၦဆၨၩလဖၪအဖၫ့ခိၪ အ့ၬ.ယမိမၩၡၩလၩ့အဝ့ၫ ဘဲၫၥိၭအထီးပၧၩ့လၧၩ့",
			"16": "<sup>16</sup> ၦဆၨၩလဖၪလဂ့ၩလီၫ.- ကဲၪထၪ့လၧၩ့အံၫစရ့လၭ အၡၩဂံၪ့ဖိၪ အဆၧဒိၭနဲၩ့အၥၭ အလးအ့ၬ. ထီးအ ကၠၪဖိၬအဝ့ၫၥံၪအၥၭအခဲၫ့တၭ, ဒုၭနၪ့ထၪ့ထဲၩ့ယၧၩ လၧဆၧဒဲၩဘၭလီၫ. အ့ၪမွဲအဝ့ၫၥံၪမိၥ့ၪယၫဝ့ၫလၧယ မွဲကဆါယဟိဝၩလီၫ.",
			"17": "<sup>17</sup> တၭဆၧမၩအၥၭလၧနံၪ့နံၫဆံၫနွ့ၫနံၪ့ လနံၪ့လၩခၪ့ ထံၭလၩထၪ့လနံၩနီၪ, ယဟိဝၩအလူလၩ့ဘၪယၧၩ",
			"18": "<sup>18</sup> တၭစံၭဝ့ၫဒၪ,- ၦၡၩအဖိၪခွၫဧ့, ဘၭဘလၧၫ့အစဎွၩ န့ၭဘူၫခၭန့ဇၫဒုၭမၩအၥုၭမု လၧအဆၧမၩဖၭဒိၪထၫ့ ဒၩတဲအၫလီၫ. ကယဲၦအခိၪဎွံၪဆၧဒုၭကဲၪၦအခိၪချၩ, ဒဲကယဲၦအခိၬထံၭခိၪနီၪ အဖံၭလၩ့ဘျူၭခွံၬဝ့ၫလီၫ. မွဲလါနၫ့တၭ,အဝ့ၫဒၪမွဲဂ့ၩ, အၥုၭမုမွဲဂ့ၩ,န့ဘၪအလံၩ့ အလဲၫလၧတဲအၫအစူၪဖၧၩ့ လၧဆၧမၩလၧအမၩထၫ့",
			"19": "<sup>19</sup> ဒၩဝ့ၫအဂးအ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, ကဆါယဟိ ဝၩစံၭဘဲၫယီၩ,ယိခွါ, ယမိဖ့ၪလၫ့ခးအံဇံၭလၧဘၭ ဘလၧၫ့အစဎွၩ န့ၭဘူၭခၭန့ဇၫအစူၪဖၧၩ့တၭ, အဝ့ၫ ဒၪမိမၩန့အၡၩခမျၧးတၭ, မိအၪ့ဂူၬန့ဆီၪ့အဆၧတၭ, မိအၪ့ဂူၬန့အဆၧဖိၪဆၧလံၩတၭ, ဆၧမိကဲၪထၪ့အ",
			"20": "<sup>20</sup> လံၩ့အလဲၫ, လၧအၥုၭမုခမျၧးအဂးလီၫ.- ယဖ့ၪလၫ့ ယူၭအဝ့ၫလၧခးအံဇံၭလၧအမၩဆၧ လၧအမၩထၫ့ ဒၩဝ့ၫအကၠီၩ့ အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪမၩဆၧလၧယဂး",
			"21": "<sup>21</sup> ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.- ဆၧလၧမုလနံၩနီၪယမိဒုၭ ထၪ့အံၫစရ့လၭအၡၩဂံၪ့ဖိၪအနိၩ့လဘီၩ့တၭ, ယမိ ဖ့ၪလၫ့နအၩ့ထၪ့နနိၭ လၧအကျၩတၭ,အဝ့ၫၥံၪမိၥ့ၪ ယၫလၧယမွဲယဟိဝၩလီၫ."
		},
		"30": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၩ့ဘၪဒီၭယၧၩတၭ, စံၭဝ့ၫဒၪ, ၦ ၡၩအဖိၪခွၫဧ့, ချဲၩ့ဆၧလၧမီၪအချိၬတၭ, စံၭ, ကဆါ ယဟိဝၩစံၭဘဲၫယီၩ,အိၩ့ယိၩ့ထၪ့နၥံၪဝ့ၫဆံၭ,မုနံၩ",
			"3": "<sup>3</sup> လနံၩနီၪဘၪအၡၪ့ဖီၩၬ- အဂဲးဘဲၫယီၩမုလနံၩနီၪအီၪ ဘူၭထၪ့ယူၭ,ယဟိဝၩအမုလနံၩ အီၪဘူၭထၪ့ယူၭ,မု လနံၩအီၪလၧဆၧအုၪ့း ၦဆၨၩလဖၪအဆၧၫ့အထီဘၪ",
			"4": "<sup>4</sup> ယူၭ.- နၭၥံၪဖၩ့ၥံၪမိဘၪ လၧခးအံဇံၭအလီၩ့တၭ,ထီး ၦဘၪဆၧမၩၥံၫဝ့ၫလဖၪ အ့ၪလၩ့ထံၩဖါလၧခးအံဇံၭ အဖၧၩ့တၭ, ဆၧၥၭမဲၪၥၭဖျဲၩ့မိအီၪဝ့ၫလၧကုၡၫအဖၧၩ့ တၭ,ဆၧမိမၩန့ထၪ့ခွံၬအၡၩခမျၧး, ဒဲအခၪ့ထံၭလဖၪ",
			"5": "<sup>5</sup> မိလၩ့ဎီးခွံၬဝ့ၫလီၫ.- ကုၡၫ,လံဘၠၫ ဒဲလုဒံၫအၫၦကျီၪ မွံၩအၥၭထီးအလူၬ, ဒဲခၠူၭ, ဒဲကယဲၦခးဖိၪလၧအအုၩ့ လၩ့ဆၧလၧအဝ့ၫအၥိၭ ထီးအလူၬနီၪ,မိလၩ့ထံၩဖါ",
			"6": "<sup>6</sup> လၧအၥိၭလၧနၭၥံၪဖၩ့ၥံၪလီၫ.- ယဟိဝၩစံၭဘဲၫယီၩ, ၦၡၩလၧအမၩဆၧၩ့အံၭဇံၭလဖၪ မိလၩ့ထံၩဖါဝ့ၫတၭ, အစီၩ့အမၩ့အဆၧအီၪက့ၪထၪ့ထီၫအၥၭနီၪ, ဆၧမိဆၪ့ လၩ့ဝ့ၫလီၫ. လၧမံကဒီၫလၭဖိးလၧစဲၫအံနံၫနီၪ မိလၩ့ ထံၩဖါလၧနၭၥံၪဖၩ့ၥံၪလၧအဖၧၩ့း ကဆါယဟိဝၩ",
			"7": "<sup>7</sup> စံၭဝ့ၫဒၪ,- မိအီၪယူဝ့ၫ လၧခးလၧအအီၪယူဝ့ၫလဖၪ အကျၩတၭ, အဒိၩ့လဖၪမိအီၪဝ့ၫလၧဒိၩ့လၧဆၧမၩ",
			"8": "<sup>8</sup> လူၬထူၬဝ့ၫလဖၪအကျၩလီၫ.- ထီးယအ့ၪဆူၭခဲၩထၪ့ မ့ၪလၧခးအံဇံၭအဖၧၩ့တၭ, ၦမၩဆၧၩ့ဝ့ၫမိထီၩ့လၧ ဆၧဂၭဂီၩ့တၭးအဝ့ၫၥံၪမိၥ့ၪယၫဝ့ၫ လၧယမွဲယဟိဝၩ",
			"9": "<sup>9</sup> လီၫ.- ဆၧလၧမုနံၩလဖၪနီၪအၥီၫ့လဖၪမိစဲၪ့ထၪ့လၧယ အီၪလၧကဘၩ့ဖၧၩ့ ဘဲၫၥိၭအမိမၩၥၭမဲၪၦကုၡၫဖိၪလၧ အလထီးလၩ့ဘၪအၥၭတၭ, မိဘၪဆၧၥၭမဲၪၥၭဖျဲၩ့ ဘဲၫလၧအံဇံၭအမုလနံၩအၥိၭနီၪလီၫ. အဂဲးဘဲၫယီၩ",
			"10": "<sup>10</sup> ယိခွါ,ဆၧဂဲၫဝ့ၫလီၫ.- ကဆါယဟိဝၩ စံၭဘဲၫယီၩ, ယမိဒုၭထုၭခွံၬ အံဇံၭအၡၩခမျၧး လၧဘၭဘလၧၫ့",
			"11": "<sup>11</sup> အစဎွၩန့ၭဘူၫခၭန့ဇၫ အစူၪဖၧၩ့လီၫ.- အဝ့ၫဒၪဒဲ အၡၩခမျၧးအီၪဝ့ၫလၧအၥိၭ, ဆၧမၩၥၭမဲၪဆၧလၧ ၦဆၨၩလဖၪအကျၩနီၪ, မိဂဲၫမၩဂၭဂီၩ့ခးလဘံၪ့နီၪ တၭ,မိထုၭထၪ့ခွံၬအနၭထၫ့ဒၩခးအံဇံၭတၭ, မၩဎွ့ၩ",
			"12": "<sup>12</sup> ခးလဘံၪ့နီၪလၧၦဘၪဆၧမၩၥံၫဝ့ၫလီၫ.- ယမိဒုၭလၩ့ ၥံၭခွံၬထံၫမိၡါအထံၫတၭ, ယမိအၪ့ဆၫခွံၬခးနီၪလၧ ၦလတီၩလလီၩ့ဘၪအစူၪဖၧၩ့တၭ, ယမိမၩယူခးဒဲက ယဲဆၧလၧအအီၪဝ့ၫလၧအဖၧၩ့ လၧၦလခီၫဘၩ့မုးအ စူၪဖၧၩ့လီၫ. ယၧၩ,ယဟိဝၩယီၩ, ယချဲၩ့ယူၭဆၧ ယူၭ.",
			"13": "<sup>13</sup> ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ယမိမၩဂၭဂီၩ့ဆၧဂၩ့ ဆၧဖၪ့လဖၪယမိမၩလၩ့မါခွံၬ ဆၧဂၩ့ဆၧဖၪ့လၧနီဖၭ အဖၧၩ့တၭ,ၦဒိၪဖၭဒိၪလဂၩ အီၪလၧၩ့လၧခးအံဇံၭ အဖၧၩ့နးဂၩအ့ၬ. တၭယမိဒုၭဘၪခးအံဇံၭလၧအဆၧ",
			"14": "<sup>14</sup> ၥၭမဲၪၥၭဖျဲၩ့လီၫ.- ယမၩယူပၫၥြီၭတၭ, ယမိဆူၭခဲၩ ထၪ့မ့ၪလၧဇိအၫ့အဖၧၩ့တၭ,ယမိမၩဆၧစ့ၩရၫ့လၧ",
			"15": "<sup>15</sup> နိၫအဖၧၩ့လီၫ.- ယမိဂါလၩ့ယၥၭခဲၩထၪ့လၧဇံၫ့, အံဇံၭအဂဲးအဘၭအဖၫ့ခိၪတၭ,ယမိဒၪ့ထ့ၬခွံၬနိၫအၡၩ",
			"16": "<sup>16</sup> ခမျၧးလီၫ.- ယမိဆူၭခဲၩထၪ့မ့ၪလၧခးအံဇံၭအဖၧၩ့ တၭ,ဇံၫ့နီၪမိဝၭၡိၩ့ၡိၬတၭ,နိၫနီၪမိထ့ဖၭတၭ, နီဖၭ",
			"17": "<sup>17</sup> မိဘၪဆၧမၩဆီၪ့ဝ့ၫၥံၫ့ၥံၫ့နံၩလီၫ.- အၫဝံၫ့,ဒဲဖံၫဘဲစ့ၭ, အၡၩၥၭဘၪ့နီၪ,မိလၩ့ထံၩဖါလၧနၭတၭ ၦမုၪလဖၪ",
			"18": "<sup>18</sup> နီၪမိလ့ၩကဲၪဎီးလီၫ.-လၧတၫဖၫ့ဟ့ၭဆ့မုနံၩမိခံၭလၩ့ တၭ,ထီးယအ့ၪမၩခါခွံၬအံဇံၭအနိၪထိၭဘီၩ့လၧအ ဖၧၩ့,ဒဲအဂဲးအဘၭအၥၭထၪ့ထီၫမိထုၬဝ့ၫလၧအဖၧၩ့ လီၫ. ဆၧအုၪ့မိမၩဘံၭအဝ့ၫတၭ, အဖိၪမုၪလဖၪမိ",
			"19": "<sup>19</sup> လ့ၩကဲၪဎီးလီၫ.- ယမိမၩဆၧစ့ၩရၫ့လၧခးအံဇံၭအ ဖၧၩ့တၭ အဝ့ၫၥံၪမိၥ့ၪယၫဝ့ၫလၧယမွဲယဟိဝၩလီၫ.",
			"20": "<sup>20</sup> လၧနံၪ့လဆံၫလနံၪ့လၩခၪ့ထံၭ, လၩထၪ့နွ့ၫနံၩလ နံၩနီၪဆၧမၩအၥၭလၧယဟိဝၩ အလူလၩ့ဘၪယၧၩ",
			"21": "<sup>21</sup> တၭစံၭဝ့ၫဒၪ.- ၦၡၩအဖိၪခွၫဧ့, ယမၩခါယူၭ အံဇံၭ အစဎွၩဖၫရိၫအစူၪဒူၪယူၭ. တၭ,ယိခွါ,ဆၧဘီၪ့ဘံၭ ထၬဝ့ၫ, ဘဲၫၥိၭအမိအီၪက့ၪ ၥံၪ ဎၥံၪ့ဎွံၭ လၧအလီၩ့ အ့ၬး ဆၧဘီၪ့ဘံၭထၬ အဝ့ၫဘဲၫၥိၭအမိဒုၭဆီၪ့ထၪ့ဝ့ၫ",
			"22": "<sup>22</sup> လၧအမိမၩန့နၭအဂးဆ့အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, ကဆါယဟိဝၩစံၭဘဲၫယီၩ,ယိခွါ, ယထၫ့ဒၩအံဇံၭ အစဎွၩဖၫရိၫတၭ, ယမိမၩခါအစူၪဒူၪနံၫခီၫ, အဆီၪ့ လခီၫ,ဒဲအဆါလခီၫတၭ, ယမိဒုၭလၩ့ထ့ၬခွံၬနၭလၧ",
			"23": "<sup>23</sup> အစူၪဖၧၩ့လီၫ.- ယမိမၩလၩ့ပြံၩလၩ့ပၩၦအံဇံၭဖိၪ လၧၦဆၨၩလဖၪအကျၩတၭ, ယမိမၩလၩ့မုလၩ့ဖၭ",
			"24": "<sup>24</sup> ဝ့ၫလၧခးလဖၪအကျၩလီၫ.- အ့ၪမွဲယမိဒုၭဆီၪ့ထၪ့ ဘၭဘလၧၫ့အစူၪဒူၪတၭ, ယမိဒုၭနုၬယနၭလၧအစူၪ ဖၧၩ့လီၫ. ယမိမၩခါခွံၬဖၫရိၫအစူၪဒူၪတၭ, အဝ့ၫမိဂၪ့ အုၩဂၪ့ထိၬ လၧအမ့ၬယၫဘဲၫၦလၧအဘၪဆ့ၭၥံၫအ",
			"25": "<sup>25</sup> ဆၧဂၪ့အုၩဂၪ့ထိၬအၥိၭနီၪလီၫ.- မွဲမၬယမိဒုၭဆီၪ့ ထၪ့ဘၭဘလၧၫ့အစဎွၩအစူၪဒူၪတၭ, ဖၫရိၫအစူၪဒူၪ မိလၩ့ဆါဝ့ၫလီၫ. ထီးယအ့ၪဒုၭနုၬယနၭလၧဘၭဘ လၧၫ့အစဎွၩအစူၪဖၧၩ့တၭ, အဝ့ၫဒၪမိယၩ့ထၪ့ဝ့ၫလၧ ခးအံဇံၭအဖၫ့ခိၪတၭ, အဝ့ၫၥံၪမိၥ့ၪယၫဝ့ၫလၧယမွဲ",
			"26": "<sup>26</sup> ယဟိဝၩလီၫ.- ယမိမၩလၩ့ပြံၩလၩ့ပၩၦအံဇံၭဖိၪ လၧၦဆၨၩလဖၪအကျၩတၭ, မၩလၩ့မုလၩ့ဖၭဝ့ၫလၧ ခးလဖၪအကျၩတၭ,အဝ့ၫၥံၪမိၥ့ၪယၫဝ့ၫလၧယမွဲယ ဟိဝၩလီၫ."
		},
		"31": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭလၧနံၪ့လဆံၫလနံၪ့ လၩၥၧၫ့ဘံၪ့လဘံၪ့ လၩထၪ့လနံၩနီၪ ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,",
			"2": "<sup>2</sup> စံၭဝ့ၫဒၪ,- ၦၡၩအဖိၪခွၫဧ့, စံၭအံဇံၭအစဎွၩဖၫရိၫ ဒဲအၡၩခမျၧးလဖၪဆံၭ. လၧနဆၧဒိၪဆၧထီၫအဖၧၩ့ နီၪမွဲဆၧမၩနၥၭဘဲၫပလၫလဂၩလဲၪ.",
			"3": "<sup>3</sup> ယိခွါ,ၦအစံရအၫဖိၪမွဲယူၭၥံၪ့ၡိၫအ့ရ့ၭ လၧလ့ၭ ဘနၧၫ့အလီၩ့ အီၪလၧအထဲၩ့လဖၪ အဎံၫအလၩလ ထံၭ,မွဲၥံၪ့လၩဒုၩဒဲအထံၭထီၫတၭ, အခံၫအီၪဝ့ၫလၧ",
			"4": "<sup>4</sup> အထဲၩ့အၪထဲၩ့အကျၩနီၪလီၫ.- ထံၫဒုၭဒိၪထၪ့ဝ့ၫ, ထံၫယိၬဒုၭထီၫထၪ့ဝ့ၫတၭ, အထံၫချိၬလဖၪယွၩလၩ့ ဝၬဖီၩ့အဆၧၥုၪ့လၩ့အၥၭအလးတၭ, ထဲၩ့ဖၫ့ထၪ့အ ထံၫချိၬဖိၪဘၪကယဲၥံၪ့ၥံၪ အီၪလၧဂၪ့ခိၪအဝၩ့ဖၧၩ့နီၪ",
			"5": "<sup>5</sup> ထီးအလူၬလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,အထံၭထီၫနဲၪ့ ဒံၭကယဲၥံၪ့လၧမံၩ့လၬကျၩ, ဒဲအထဲၩ့အၪထၪ့တၭ,အ",
			"6": "<sup>6</sup> ထဲၩ့ထီၫထၪ့,မွဲထံၫအၪတၭ,ဒိၪထၪ့ဝ့ၫလီၫ.- ထိၪၥံၪ လံၪၥံၪလၧမူၭဖိၭဖၫ့ထီးအလူၬနီၪ မၩအၥွံၫလၧအခံၫ တၭ,ဆၧဖိၪဆၧဎါလၧမံၩ့လၬကျၩ ထီးအလူၬဖိၪဆါ န့အဖိၪလၧအလၩဒုၩအဖၫ့လၬတၭ, ၦဆၨၩဖၭဒိၪ",
			"7": "<sup>7</sup> ထီးအလူၬအီၪဝ့ၫလၧအလၩဒုၩကျၩလီၫ.- အီၪဝ့ၫလၧ အဎံၫအလၩလၧအဆၧဒိၪဆၧထီၫအကၠီၩ့ လၧအထဲၩ့ ထီၫအကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩအဝံအၪဝ့ၫ လၧထံၫ",
			"8": "<sup>8</sup> အၪအနဲၩ့လီၫ.- ၥံၪ့ၡိၫအ့ရ့ၭလၧယွၩအကျိၭအလး ဖၧၩ့လဖၪနီၪ အီၪကဒုၩအဝ့ၫၥ့ၪအ့ၬ, ၥံၪ့ၡိၫၥံၪလန့ၫ ဎီၩ့ဘၪလၧအထဲၩ့တၭ, ၥံၪ့ဧၫမိၫၥံၪလန့ၫၥိၭဘၪလၧ အထဲၩ့အဖၫ့တၭ, ၥံၪ့န့ၫဎီၩ့လၧအဝ့ၫအီၪလၧအဎံၫအ",
			"9": "<sup>9</sup> လၩအီၪလၧယွၩအကျိၭဖၧၩ့အ့ၬ.- ယအီၪက့ၪအဎံၫ အလၩလၧအလီၩ့ အီၪလၧအလၩဒုၩအလီၩ့လီၫ.က ယဲအံဒံၫ့အၥံၪ့ လၧယွၩအကျိၭဖၧၩ့ထီးအလူၬနီၪၥၭ",
			"10": "<sup>10</sup> ခ့ၬဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ကဆါယဟိဝၩစံၭ ဘဲၫယီၩ,မွဲနအီၪက့ၪထၪ့ထီၫနၥၭ, ဒဲအဝ့ၫယူၬထၪ့အ ခံၫလၧအထဲၩ့အၪထဲၩ့အကျၩတၭ, အီၪက့ၪထၪ့ထီၫ",
			"11": "<sup>11</sup> အၥၭလၧအထီၫအကၠီၩ့တၭ,- ယဖ့ၪလၫ့ခွံၬအဝ့ၫလၧ ၦအဆီၪ့လၧၦဆၨၩလဖၪအကျၩ လဂၩအစူၪဖၧၩ့လၧ အမိမၩဆီၪ့တၡါအဝ့ၫလီၫ. ယနၫ့ထၪ့ခွံၬအဝ့ၫလၧ",
			"12": "<sup>12</sup> အဆၧဒဲၩဘၭအကၠီၩ့လီၫ.- ၦလခီၫဘၩ့မုးဖိၪဆၧမၩ ၥၭမဲၪဆၧလၧၦဆၨၩလဖၪအကျၩ, ခူၬလၩ့ခွံၬအဝ့ၫ နီၪ,စဲၪ့ဒၪဝ့ၫတၭး လၧအထဲၩ့လၩ့ဒၩ လၧခိၪလီၩ့အ လီၩ့,ဒဲလၧခိၪလီၩ့ဆူၭ ထီးအလူၬအဖၧၩ့တၭ, ၦကိၭ ဆၨၩဒ့ၭလၧဂၪ့ခိၪချိၫ့မိစဲၪ့ထၪ့ခွံၬ လၧအလၩဒုၩအ",
			"13": "<sup>13</sup> ဖၫ့လၬတၭ,စဲၪ့ဒၪအဝ့ၫလီၫ.- လၧအဆၧဂၭဂီၩ့အဖၫ့ ခိၪနီၪမူၭဖိၭဖၫ့အထိၪၥံၪလံၪၥံၪမိအီၪထး, ဒဲဆၧဖိၪ ဆၧဎါအီၪဝ့ၫလၧအထဲၩ့လဖၪ အဖၫ့ခိၪထီးအလူၬ",
			"14": "<sup>14</sup> လီၫ.- ဘဲၫၥိၭၥံၪ့ၥံၪလၧထံၫနဲၩ့ ထီးအီၪက့ၪထၪ့ထီၫ အၥၭလၧအထီၫဝ့ၫအကၠီၩ့နးဆံၭလဂ့ၩ, ဒဲအထီးယူၬ ထၪ့အခံၫလၧအလၩဒုၩအကျၩလဂ့ၩ, ဘဲၫၥိၭၥံၪ့လၧ အအီၩထံၫထီးအလူၬ, မွဲအထီးဆၧၫ့ထုၪ့လၧအထီၫ ဝ့ၫအကၠီၩ့နီၪနးထံၭလဂ့ၩလီၫ. အဂဲးဘဲၫယီၩဆၧဖ့ၪ လၫ့ခွံၬအဝ့ၫၥံၪလၧဆၧၥံၫလၧဂၪ့ခိၪလၬ လၧၦၡၩအ ကျၩ,လၧၦလၧအလ့ၩလၩ့ လၧဆၧဖၧၩ့အၥိၭလီၫ.",
			"15": "<sup>15</sup> ကဆါယဟိဝၩစံၭဘဲၫယီၩ, မုလနံၩလၧအလ့ၩလၩ့ လၧဖျႃဖၧၩ့နီၪ, ယမိဒုၭဂၪ့ဆၧလၧအကၠီၩ့း ယကၭ ဘံၭထၬဆၧယိၬနီၪ လၧအကၠီၩ့, ဒဲယပဒၩ့အထံၫချိၬ လဖၪလၧအကၠီၩ့,ဒဲအထံၫဖၭဒိၪလဖၪ အီၪထီဝ့ၫလီၫ. ယဒုၭဂၪ့လ့ၭဘနၧၫ့ လၧအကၠီၩ့တၭ, ၥံၪ့ၥံၪလၧမံၩ့ လၬကျၩထီးအလူၬ အၥၭမိလၩ့ဘဲၩလၧအကၠီၩ့လီၫ.",
			"16": "<sup>16</sup> ထီးယခွံၬလၩ့ခွံၬယူၭအဝ့ၫလၧဖျႃဖၧၩ့ ဒဲၦလၧအလ့ၩ ဆၧလၧဆၧဖၧၩ့အအီၪတၭ, ယဒုၭဝၭထိၬၦဆၨၩလ ဖၪလၧအလၩ့ထံၩဖါအၥီၫအကၠီၩ့လီၫ. အံဒံၫ့ အၥံၪ့ ထီးအလူၬ, ဒဲဆၧဘၪရွံန့ဝ့ၫ,ဒဲဆၧဂ့ၩလၧလ့ၭဘနၧၫ့ အလီၩ့,ကယဲဆၧလၧအအီၩထံၫထီးအလူၬနီၪ,မိမုၬ",
			"17": "<sup>17</sup> ထၪ့ထဲၩ့လၧဂၪ့ခိၪလၬလီၫ.- အဝ့ၫၥံၪနီၪလၩ့ဆ့လၧဖျႃ ဖၧၩ့လၧအၥိၭ, လၧၦလၧအဘၪဆၧမၩၥံၫဝ့ၫ လၧနၭ ၥံၪဖၩ့ၥံၪအအီၪ, ဒဲၦလၧအမွဲအစူၪဒူၪ လၧအအီၪလၧ အလၩဒုၩဖၫ့လၬ လၧၦဆၨၩလဖၪအကျၩလီၫ.",
			"18": "<sup>18</sup> နလၩနဖၩ့ဒဲနဆၧဒိၪဆၧထီၫနီၪ လၩ့ဂၬလၧၥံၪ့လၧ အံဒံၫ့အၥံၪ့ကျၩနီၪထုၪ့ထုၪ့လဲၪ.မွဲမၬ,နမိဘၪဆၧဆၪ့ လၩ့နၧၩလၧအံဒံၫ့အၥံၪ့လဖၪအၥိၭ လၧဂၪ့ခိၪလၬလီၫ. နမိမံၫနၩ့လၧၦလဒိၭဘၪဆၧကူၭတရံၭဖိၪ, ဒဲၦဘၪ ဆၧမၩၥံၫဝ့ၫလၧနၭၥံၪဖၩ့ၥံၪအကျၩလီၫ. အဝ့ၫနီၪမွဲ ဖၫရိၫဒဲအၡၩခမျၧးထီးအလူၬ, ကဆါယဟိဝၩ စံၭဝ့ၫဒၪ."
		},
		"32": {
			"1": "<sup>1</sup> လၧလဆံၫနံၫနံၪ့လနံၪ့နီၪ, လၩလဆံၫနံၫဘံၪ့လ ဘံၪ့,လၩထၪ့လနံၩနီၪ, ဆၧမၩအၥၭလၧယဟိဝၩအ",
			"2": "<sup>2</sup> လူလၩ့ဘၪယၧၩတၭ,စံၭဝ့ၫဒၪ,- ၦၡၩအဖိၪခွၫဧ့,မၩ ထၪ့ဂၪ့ဆၧယၧၩ့ဆၧ လၧအံဇံၭအစဎွၩဖၫရိၫအကၠီၩ့ တၭ,စံၭအဝ့ၫနမၩနၥၭဘဲၫဆၬလၥၧၫ့ဖိၪ လၧၦဆၨၩ လဖၪအကျၩအၥိၭ, နမၩနၥၭဘဲၫမၪလၧမၫဆမံၭဖၧၩ့ အၥိၭလီၫ. နဂဲၫလၧထံၫမိၡါလဖၪအဖၧၩ့တၭ, နမၩ ဒုၪထၪ့ထံၫလၧနခၪ့တၭ, မၩထံၫမိၡါအထံၫလဆံၫ့ဘၪ",
			"3": "<sup>3</sup> လီၫ.- ကဆါယဟိဝၩစံၭဘဲၫယီၩ,ယမိခွံၬယၡၬလၧ နဖၫ့ခိၪလၧၦဆၨၩခမျၧးအကျၩတၭ, အဝ့ၫၥံၪမိမီၩ့",
			"4": "<sup>4</sup> ကၠူၭထၪ့နၧၩလၧယၡၬဖၧၩ့လီၫ.- ထီးနီၪလဖၧၫ့ယမိ အီၪက့ၪလၩ့ထးနၧၩလၧခီၫ့တၭ, ယမိခွံၬၡိၭခွံၬနၧၩ လၧဆၧပျၩ့ဖၧၩ့တၭ, ယမိဒုၭဆီးလၩ့မူၭဖိၭဖၫ့အထိၪ ၥံၪလံၪၥံၪလၧနဖၫ့ခိၪထီးအလူၬတၭ, ယမိဒုၭအၪ့ဘျဲၩ အၪ့ဂၪ့ခိၪထၧၫ့ဘံၪ့ယၫ အဆၧဖိၪဆၧဎါလၧနၧၩလီၫ.",
			"5": "<sup>5</sup> ယမိအီၪက့ၪလၩ့နယၪ လၧခိၪလီၩ့အလီၩ့တၭ, ယမိ",
			"6": "<sup>6</sup> မၩဎွ့ၩခိၪလီၩ့ဆူၭ လၧနဆၧထၪ့ထီၫလီၫ.- ယမိမၩ ဘၪစီၫဆ့ခးလဘံၪ့လၧနၥွံၪထီၩ့ လၧခိၪလီၩ့ထိၩ့ချိၬ,",
			"7": "<sup>7</sup> ဒဲထံၫချိၬလဖၪလီၫ.- ထီးယအ့ၪမၩလၩ့ဖံၭခွံၬနၧၩ တၭ,ယမိချႃၬဘံၭမူၭခိၪဒဲဒုၭခံၭလၩ့ၡၪလဖၪ, ယမိ",
			"8": "<sup>8</sup> ချႃၬဘံၭမုလၧဆၧအုၪ့တၭ,လၩမိဖၩ့ထၪ့အ့ၬ.- ကယဲ ဆၧဖၩ့ယုၩ့ယဲ လၧနဖၫ့ခိၪလၧမူၭခိၪနီၪ, ယမိမၩခံၭ လၩ့ဒဲဒုၭခံၭန့နခးထၧၫ့ဘံၪ့ယၫ, ကဆါယဟိဝၩစံၭ",
			"9": "<sup>9</sup> ဝ့ၫဒၪ.- ထီးယအ့ၪမၩဂၭဂီၩ့နၧၩလၧၦဆၨၩလဖၪအ ကျၩလၧခးလဖၪအဖၧၩ့လၧနလၥ့ၪယၫဘၪဝ့ၫနီၪ,ယ",
			"10": "<sup>10</sup> မိမၩခိမၩဝီၩၦအၪဆၨၩအၥၭလီၫ.- မွဲမၬ,ထီးယအ့ၪ ၥွၫ့ဆၧလၧယနၭလၧအဝ့ၫၥံၪအမ့ၬယၫတၭ, ယမိဒုၭ ထီၫမံၫထီၫမၪၦခမျၧးအၪစီၪ့လၧနကၠီၩ့, ဒဲအစဎွၩမိၥၭ မဲၪဆၧဆီၪ့လၧနကၠီၩ့လီၫ, မိဝၭထိၬဆိၫဆိလဂၩလါ လါလၧအၥၭမၧၫ့ဒၪဝ့ၫအဖၧၩ့ဆုၬဆုၬ ထီးမုလနံၩ",
			"11": "<sup>11</sup> လၧနလၩ့ထံၩဖါလီၫ.- အဂဲးဘဲၫယီၩ,ကဆါယဟိဝၩ စံၭဘဲၫယီၩ, ဘၭဘလၧၫ့အစဎွၩအနၭမိဘၪနၧၩလီၫ.",
			"12": "<sup>12</sup> ယမိဒုၭလၩ့ထံၩဖါနၡၩခမျၧး လၧၦအဆီၪ့အနၭလဖၪ, ၦထီးအလူၬနီၪ,မွဲၦမၩၥၭမဲၪဆၧလၧ ၦဆၨၩလဖၪအ ကျၩတၭ, မိမၩဂၭဂီၩ့အံဇံၭအၥၭထၪ့ထီၫတၭ, အၡၩ",
			"13": "<sup>13</sup> ခမျၧးမိထီၩ့လၧဆၧဂၭဂီၩ့ထီးအလူၬလီၫ.- ယမိမၩ ဂၭဂီၩ့ဆ့အဆၧဖိၪဆၧဎါအဒိၩ့ထီးအလူၬ လၧထံၫဖၭ ဒိၪအနဲၩ့ထံၭတၭ, ၦၡၩအခၪ့ မိမၩဒုၪထၪ့လၧၩ့ဝ့ၫ အ့ၬ.တၭဆၧဖိၪဆၧဎါအဒိၩ့ အခၪ့ယဲးလၩ့လၧၩ့ဆၧ",
			"14": "<sup>14</sup> လၧထံၫဖၭဒိၪအကျၩဆ့အ့ၬ.- ထီးနီၪလဖၧၫ့ယမိဒုၭ ဎံၪထၪ့အထံၫလဖၪတၭ, ဒုၭလၩ့ယွၩအထံၫဘဲၫၥိၪအ",
			"15": "<sup>15</sup> ၥိၭနီၪ,ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.- ထီးအထီလၧယမၩ ယူခးအံဇံၭ ဒဲခးပျီၩပျီၩလၧကယဲဆၧအလၧၫ့အဎွ့ၩ ယူၭလၧအဖၧၩ့,ထီးအထီ လၧယမိကျီၪ့ခွံၬကယဲၦ လၧအအီၪဝ့ၫလၧအဖၧၩ့တၭး ထီးနီၪလဖၧၫ့အဝ့ၫၥံၪ",
			"16": "<sup>16</sup> မိၥ့ၪယၫလၧယမွဲယဟိဝၩလီၫ.- အနီၪမွဲဂၪ့ဆၧယၧၩ့ ဆၧလၧအဝ့ၫၥံၪမၩဝ့ၫလၧအကၠီၩ့လီၫ. ၦဆၨၩလဖၪ အဖိၪမုၪနီၪမိမၩဆၧယၧၩ့ဘၪလၧအကၠီၩ့လီၫ. မိမၩ ဆၧယၧၩ့ဘၪလၧခးအံဇံၭအကၠီၩ့ ဒဲလၧအၡၩခမျၧး အကၠီၩ့,ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"17": "<sup>17</sup> လၧလဆံၫနံၫနံၪ့လနံၪ့ လၩထၪ့လဆံၫယဲနံၩလနံၩ နီၪ,ဆၧမၩအၥၭလၧယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,",
			"18": "<sup>18</sup> စံၭဝ့ၫဒၪ,- ၦၡၩအဖိၪခွၫဧ့, ဂၪ့အုၩဂၪ့ထိၬလၧအံဇံၭ အၡၩခမျၧးအကၠီၩ့တၭ, ခွံၬလၩ့ခွံၬအဝ့ၫၥံၪ,အဝ့ၫဒၪ ဒဲၦဆၨၩလဖၪ လၧအမံၩ့ဂၧၫ့ထၪ့ၥၩလၩ့ အဖိၪမုၪလ ဖၪလၧဂၪ့ခိၪလၬ လၧၦလၧအလ့ၩလၩ့လၧဆၧဖၧၩ့နီၪ",
			"19": "<sup>19</sup> ဆံၭ.- နဎံၫနဲၪ့နလၩနဲၪ့ဒံၭပလၫလဂၩလဲၪ. လ့ၩလၩ့ ဘီၪ.မံၫနၩ့လၧၦလၧအလဒိၭဘၪ ဆၧကူၭတရံၭလဖၪ",
			"20": "<sup>20</sup> အၥိၭဆံၭ.- အဝ့ၫၥံၪမိလၩ့ထံၩဖါဝ့ၫလၧၦလၧအဘၪ ဆၧမၩၥံၫဝ့ၫလၧနၭလဖၪအကျၩလီၫ. ဆၧဖ့ၪလၫ့ယူၭ အဝ့ၫဒၪလၧနၭၥံၪဖၩ့ၥံၪလီၫ. မီၩ့ထၪ့ခွံၬအဝ့ၫ,ဒဲအၡၩ",
			"21": "<sup>21</sup> ခမျၧးထီးအလူၬနီၪဆံၭ.- ၦအဆီၪ့ထုၬလၧၦအဆီၪ့ အကျၩနီၪ လၧဖျႃအၥၭခံဖၧၩ့ မိချဲၩ့ဆၧလၧအဝ့ၫ,ဒဲၦ လၧအမၩဆၧၩ့အဝ့ၫလီၫ. အဂဲးဘဲၫယီၩလ့ၩလၩ့ယူၭ ဝ့ၫယူၭ,မံၫနၩ့တၭဘၪဆၧကူၭတရံၭအ့ၬ. ဘၪဆၧမၩ",
			"22": "<sup>22</sup> ၥံၫဝ့ၫလၧနၭလီၫ.- အၭၡၧၫဒဲအဆၧအီၪကီၪ့ထီးအလူၬ အီၪဝ့ၫထီးနီၪလီၫ. အဆၧၥွၪခိၪၥံၪအီၪဝၬဖီၩ့ဝ့ၫနီၪ, ၦဘၪဆၧမၩၥံၫဝ့ၫထီးအလူၬ, လၩ့ထံၩဖါဝ့ၫလၧနၭ",
			"23": "<sup>23</sup> ၥံၪဖၩ့ၥံၪလီၫ.- အဆၧၥွၪခိၪအီၪဝ့ၫလၧဆၧဖၧၩ့အခဲၫ့ ဒၭတၭ,အဆၧအီၪကီၪ့အီၪဖီၩ့ လၧအဆၧၥွၪခိၪလီၫ. ဘၪဆၧမၩၥံၫဝ့ၫထီးအလူၬ, လၩ့ထံၩဖါဝ့ၫလၧနၭၥံၪ ဖၩ့ၥံၪ,ၦလၧအမၩၥၭမဲၪဆၧ လၧခးမၧၫ့အဖၧၩ့လီၫ.",
			"24": "<sup>24</sup> အံလၫ့ဒဲအၡၩခမျၧးထီးအလူၬ အီၪဝၬဖီၩ့ဝ့ၫလၧအ ဆၧၥွၪခိၪနီၪ, ဘၪဆၧမၩၥံၫဝ့ၫထီးအလူၬ လၩ့ထံၩဖါ ဝ့ၫလၧနၭၥံၪဖၩ့ၥံၪ လဒိၭဘၪဆၧကူၭတရံၭတၭ, လ့ၩ လၩ့ဝ့ၫလၧဂၪ့ခိၪလၬ, ၦလၧအမၩၥၭမဲၪဆၧလၧခးမၧၫ့ အဖၧၩ့လီၫ. မွဲလါနၫ့ဘိၩအီၪဒၪအဆၧဒဲအဆၧမ့ၬမဲ,",
			"25": "<sup>25</sup> ဒဲၦလၧအလ့ၩလၩ့လၧဆၧဖၧၩ့နီၪအၥိၭလီၫ.- ၦအီၪ က့ၪလၩ့န့အဝ့ၫအီၪလၧအလးမံၫအီၪ လၧအၡၩခမျၧး ထီးအလူၬလၧၦဘၪဆၧမၩၥံၫ ဝ့ၫလၧအကျၩ, အဆၧ ၥွၪခိၪလဖၪ အီၪဝၬဖီၩ့အဝ့ၫလီၫ. လဒိၭဘၪဆၧကူၭ တရံၭနးဂၩတၭ, ဘၪဆၧမၩၥံၫဝ့ၫလၧနၭၥံၪဖၩ့ၥံၪလီၫ. မၩၥၭမဲၪဆၧလၧခးမၧၫ့အဖၧၩ့လါနၫ့တၭ, အီၪဒၪအ ဆၧလၧအမ့ၬမဲ ဘဲၫၦလၧအလ့ၩလၩ့ယူၭလၧဆၧဖၧၩ့ အၥိၭလီၫ. ဆၧအီၪက့ၪလၩ့အဝ့ၫလၧၦလၧအဘၪဆၧ",
			"26": "<sup>26</sup> မၩၥံၫဝ့ၫလဖၪနီၪအကျၩလီၫ.- မံၡ့ၭ,ဒဲတုဘလၭ,ဒဲအ ၡၩခမျၧးထီးအလူၬအီၪဝ့ၫထီးနီၪ အဆၧၥွၪခိၪလဖၪ အီၪဝၬဖီၩ့ဝ့ၫ, ထီးအလူၬလဒိၭဘၪဆၧကူၭတရံၭနီၪ, အဝ့ၫၥံၪမၩၥၭမဲၪဆၧလၧခးမၧၫ့အဖၧၩ့လါနၫ့တၭ, ဘၪ",
			"27": "<sup>27</sup> ဆၧမၩၥံၫဝ့ၫလၧနၭၥံၪဖၩ့ၥံၪလီၫ.- မၩၥၭမဲၪၦအဆီၪ့ လၧခးမၧၫ့အဖၧၩ့လါနၫ့တၭ, မိမံၫနၩ့လၧၦအဆီၪ့လၧ အလဒိၭဘၪဆၧကူၭတရံၭလဖၪ လၧအလၩ့ထံၩဖါဝ့ၫ လၧအကျၩလၧအလ့ၩလၩ့လၧ ဖျႃဖၧၩ့အီၪလၧအဒုၭ ဆၧအစူၪဝဲၩ,ဆၧအီၪက့ၪအနၭၥံၪဖၩ့ၥံၪ လၧအခိၪဎွံၪ အဖၫ့လၬတၭ, အဆၧအၧၩ့ဆၧၥၫ့အီၪဝ့ၫလၧအဎွံၪအ",
			"28": "<sup>28</sup> နၧၩ့အဖၫ့ခိၪနီၪမွဲအ့ၬဧၪ.- မွဲမၬ,နဝ့ၫဒၪနမိဘၪဆၧမၩ ခါလၩ့ခွံၬ လၧၦလဒိၭဘၪဆၧကူၭတရံၭအကျၩတၭ, မိမံၫနၩ့လၧၦလၧအဘၪဆၧမၩၥံၫဝ့ၫ လၧနၭၥံၪဖၩ့ၥံၪ",
			"29": "<sup>29</sup> အၥိၭလီၫ.- အံဒၧၫ့ဒဲအစဎွၩလဖၪ,ဒဲအၦဒိၪဖၭဒိၪလ ဖၪအီၪဝ့ၫ လၧအဂဲးဆီၪ့ဘၭဆီၪ့ထီးအလူၬနီၪ,မံၫနၩ့ လၧၦလၧအဘၪဆၧမၩၥံၫဝ့ၫ လၧနၭၥံၪဖၩ့ၥံၪအၥိၭနီၪ အီၪထီးနီၪလီၫ. အဝ့ၫၥံၪမိမံၫနၩ့ဝ့ၫလၧၦလဒိၭဘၪဆၧ ကူၭတရံၭလဖၪ, ဒဲၦလၧအလ့ၩလၩ့ယူၭလၧဆၧယိၬ",
			"30": "<sup>30</sup> အဖၧၩ့အၥိၭလီၫ.- မုဖၩအၦဒိၪဖၭဒိၪအီၪထီးနီၪ, အဝ့ၫၥံၪထီးအလူၬ, ဒဲၦစဲဒၧၫ့ဖိၪထီးအလူၬလၧအလ့ၩ လၩ့လၧၦဘၪဆၧမၩၥံၫဝ့ၫလီၫ. လၧအဆၧမၩၥၭမဲၪ ဆၧလၧအစီၩ့အမၩ့အဘိၩ့ဘၭတၭ, ဆၧအီၪက့ၪမဲအ မ့ၬလီၫ. လဒိၭဘၪဆၧကူၭတရံၭတၭ,မံၫနၩ့ဝ့ၫအီၪလၧ ၦလၧအဘၪဆၧမၩၥံၫဝ့ၫ လၧနၭၥံၪဖၩ့ၥံၪအၥိၭတၭ, အီၪဒၪအဆၧလၧအမ့ၬမဲ, ဒဲၦလၧအလ့ၩလၩ့လၧဆၧ",
			"31": "<sup>31</sup> ယိၬအဖၧၩ့အၥိၭလီၫ.- ဖၫရိၫမိဒၪဘၪအဝ့ၫၥံၪတၭ, မိမၩမုၬထၪ့ထဲၩ့အၥၭ လၧအၡၩခမျၧးထီးအလူၬအ ကၠီၩ့,ဖၫရိၫဒဲအၡၩၥုၭမု လၧအဘၪဆၧမၩၥံၫဝ့ၫလၧနၭ",
			"32": "<sup>32</sup> ၥံၪဖၩ့ၥံၪထီးအလူၬ,ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.- အဂဲး ဘဲၫယီၩ,ယဖ့ၪလၫ့ယဆၧမၩၥၭမဲၪ လၧၦမၧၫ့အခး ဖၧၩ့လါနၫ့တၭ, ဆၧအီၪက့ၪလၩ့အဝ့ၫလၧၦလဒိၭဘၪ ဆၧကူၭတရံၭအကျၩ, အီၪလၧၦလၧအဘၪဆၧမၩၥံၫ ဝ့ၫလၧနၭၥံၪဖၩ့ၥံၪ, ဖၫရိၫဒၪလ့ၬ, ဒဲအၡၩခမျၧးထီး အလူၬအၥိၭ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ."
		},
		"33": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၩ့ဘၪဒီၭယၧၩတၭ, စံၭဝ့ၫဒၪ, ၦ ၡၩအဖိၪခွၫဧ့, ချဲၩ့ဆၧလၧနၡၩခမျၧးအဖိၪၥံၪတၭ, စံၭအဝ့ၫၥံၪထီးယဒုၭဘၪ ခးလၧနၭၥံၪတၭ, ၦခးဖိၪ အ့ၪမၩန့ၦလဂၩလၧအခးနဲၩ့ထံၭတၭ, အီၪက့ၪဝ့ၫလၧ",
			"3": "<sup>3</sup> ၦခိၭဆၧတၭ,- ထီးအဝ့ၫနီၪ အ့ၪဒၪဘၪ နၭၥံၪဖၩ့ၥံၪ ဂဲၫဘၪခးနီၪတၭ, အ့ၪအူၪထၪ့ခွ့ၩတၭ,ဒုၭထီးလၩ့ၦ",
			"4": "<sup>4</sup> ခမျၧးအၥၭတၭ,- ထီးဒၪၦလၧအနါဂၧၫ့ခွ့ၩအၥီၫလဂၩ ဂၩတၭးအ့ၪလထီးလၩ့ဘၪအၥၭနီၪ, နၭၥံၪဖၩ့ၥံၪအ့ၪ ဂဲၫဖ့ၬၥံၫခွံၬအဝ့ၫၥံၪတၭ, အၥွံၪမိအီၪလၧအခိၪဎွံၪဒၪ",
			"5": "<sup>5</sup> ဝ့ၫအလီၩ့လီၫ.- နါဂၧၫ့ခွ့ၩအၥီၫလါနၫ့တၭ, ထီးလၩ့ အၥၭအ့ၬ. အၥွံၪမိအီၪလၧအလီၩ့ဒၪဝ့ၫလီၫ. အ့ၪမွဲၦ",
			"6": "<sup>6</sup> လၧအထီးလၩ့အၥၭနီၪမိမၩဖီၩ့ဖျ့ၭအၥၭလီၫ.- လါ နၫ့ၦခိၭဆၧအ့ၪဒၪဘၪ နၭၥံၪဖၩ့ၥံၪဂဲၫဝ့ၫတၭ, လအူၪ ထၪ့ဘၪခွ့ၩနီၪ, လဒုၭထီးလၩ့ဘၪ ၦခမျၧးအၥၭတၭ, နၭၥံၪဖၩ့ၥံၪအ့ၪဂဲၫဖ့ၬၥံၫခွံၬၦလဂၩဂၩ လၧအကျၩနီၪ, ဆၧဆိၬထၪ့ခွံၬဝ့ၫလၧအဆၧဒဲၩဘၭအကၠီၩ့လီၫ. လါ နၫ့တၭ,ယမိအၪ့ဎၬအၥွံၪလၧ ၦခိၭဆၧအစူၪဖၧၩ့လီၫ.",
			"7": "<sup>7</sup> နဝ့ၫဒၪၦၡၩအဖိၪခွၫဧ့, ယအီၪက့ၪယူၭနၧၩလၧၦခိၭ ဆၧလၧအံၫစရ့လၭအၡၩဂံၪ့ဖိၪအဂးတၭ, နမိဘၪခိၭ နၪဆၧချဲၩ့လၧယနိၭ, ဒဲဒုၭထီးလၩ့အဝ့ၫၥံၪအၥၭလၧ",
			"8": "<sup>8</sup> ယၧၩလီၫ.- ထီးယစံၭလၧၦလတီၩလလီၩ့ဘၪ,ၦလ တီၩလလီၩ့ဘၪလဂၩဧ့,နမိၥံၫတၡါတၭး နအ့ၪလချဲၩ့ ဘၪဘဲၫၥိၭနမိဒုၭထီးလၩ့ ၦလတီၩလလီၩ့ဘၪအၥၭ ဘဲၫၥိၭအမိကၠၪခွံၬ လၧအဖၧၩ့ၥၭတၭ, ဆၧလၧၦလ တီၩလလီၩ့ဘၪလဂၩနီၪ မိၥံၫဝ့ၫလၧအဆၧဒဲၩဘၭအ ကၠီၩ့လီၫ. မွဲလါနၫ့ဘိၩ, ယမိအၪ့ဎၬအၥွံၪလၧနစူၪဖၧၩ့",
			"9": "<sup>9</sup> လီၫ.- မွဲလါနၫ့ဘဲၫနီၪနအ့ၪဒုၭထီးလၩ့ၦလတီၩလလီၩ့ ဘၪအၥၭနီၪ လၧအမိကၠၪခွံၬဝ့ၫလၧအဖၧၩ့ၥၭတၭ,အ့ၪ လကၠၪခွံၬဘၪလၧအဖၧၩ့ၥၭနီၪ, မိၥံၫဝ့ၫလၧအဆၧဒဲၩ ဘၭအကၠီၩ့း မွဲလါနၫ့နမၩဖီၩ့မၩဖျ့ၭယူၭနၥၭဒၪနဝ့ၫ ယူၭ.",
			"10": "<sup>10</sup> နဝ့ၫဒၪၦၡၩအဖိၪခွၫဧ့, စံၭအံၫစရ့လၭအၡၩဂံၪ့ ဖိၪ,နၥံၪချဲၩ့ဆၧယီၩ,နၥံၪစံၭ, ပဆၧမၪဒဲပဆၧဒဲၩဘၭ နီၪအီၪဝ့ၫလၧပလီၩ့တၭ, ပမိဎွ့လၩ့ခွံၬလၧအကၠီၩ့တၭ,",
			"11": "<sup>11</sup> ထီးနီၪလဖၧၫ့ပမိမၧၫ့ဒံၭဘဲၫၥ့ၪလဲၪ.- တၭစံၭအဝ့ၫၥံၪ, ယမၧၫ့ယဝ့ၫကဆါယဟိဝၩစံၭဝ့ၫဒၪ, ၦလတီၩလလီၩ့ ဘၪမိၥံၫနီၪ, ဘၪယၥၭအ့ၬး မွဲအဘၪယၥၭ လၧၦလ တီၩလလီၩ့ဘၪကၠၪခွံၬအၥၭလၧအဖၧၩ့ၥၭတၭ, မၧၫ့ ဝ့ၫလီၫ.ကၠၪခွံၬနၥံၪဝ့ၫ, ကၠၪခွံၬနၥံၪဝ့ၫ, လၧနၥံၪအ ဖၧၩ့ၥၭအၧၩ့ဆံၭ. အဂဲးဘဲၫယီၩအံၫစရ့လၭ အၡၩဂံၪ့",
			"12": "<sup>12</sup> ဖိၪၥံၪဧ့,နၥံၪမိၥံၫမွဲဘၪလဲၪ.- မၩအၥၭဘဲၫနီၪတၭ,နဝ့ၫ ဒၪယီၩၦၡၩအဖိၪခွၫဧ့, စံၭနခ့ၫနၡၩခမျၧးဖိၪ,ၦအတီၩ အလီၩ့လဂၩ အဆၧတီၩဆၧလီၩ့နီၪ မၩဖီၩ့ဖျ့ၭအဝ့ၫ လၧအမၩမၪဆၧ အမုနံၩအဖၧၩ့ၥ့ၪအ့ၬ. ၦလတီၩလ လီၩ့ဘၪလဂၩနီၪလၧမုလနံၩအဖၧၩ့ လၧအကၠၪခွံၬအ ၥၭလၧအဆၧလတီၩလလီၩ့ဘၪနီၪ, မိလၩ့ထံၩဖါလၧ အဆၧလတီၩလလီၩ့ဘၪအကၠီၩ့နီၪအ့ၬး ၦအတီၩအ လီၩ့နီၪလၧမုလနံၩအဖၧၩ့ လၧအမၩဆၧဒဲၩဘၭနီၪမိ မၧၫ့ဝ့ၫလၧအဆၧတီၩဆၧလီၩ့အကၠီၩ့နီၪ ၥ့ၪဆ့အ့ၬ.",
			"13": "<sup>13</sup> ထီးယအ့ၪစံၭလၧၦအတီၩအလီၩ့အဂဲးနီၪ, မိမၧၫ့တၡါ ဝ့ၫတၭးအ့ၪဒိၭနဲၩ့အၥၭလၧအဆၧတီၩဆၧလီၩ့ဒၪဝ့ၫ, ဒဲမၩဆၧဒဲၩဘၭတၭ, ဆၧနၪ့ထၪ့ထဲၩ့အဆၧတီၩဆၧ လီၩ့နးမံၩ့အ့ၬ. အ့ၪမွဲအမိၥံၫဝ့ၫလၧအဆၧဒဲၩဘၭလၧ",
			"14": "<sup>14</sup> အမၩဝ့ၫအကၠီၩ့နီၪလီၫ.- ထီးယအ့ၪစံၭလၧၦလတီၩ လလီၩ့ဘၪအဂဲး,နမိၥံၫတၡါနီၪး အ့ၪကၠၪခွံၬအၥၭလၧ အဆၧဒဲၩဘၭနီၪတၭ, မၩဆၧစ့ၩရၫ့ဒဲဆၧတီၩဆၧလီၩ့",
			"15": "<sup>15</sup> တၭ,- ၦလတီၩဘၪအ့ၪဖ့ၪထဲၩ့ဆၧပီၩ့လၩ့ အ့ၪဖ့ၪ ထဲၩ့ဆၧလၧအအၪ့ဂူၬဆီၪ့န့ဝ့ၫ, လမၩဘၪဆၧဒဲၩဘၭ တၭ,အ့ၪလ့ၩဆၧလၧဆၧမၧၫ့အဆၧၥီၪ့ဆၧၥၫ့ အဖၧၩ့",
			"16": "<sup>16</sup> တၭ,မိမၧၫ့ဝ့ၫနီၪ,ၥံၫဘၪအ့ၬ.- ဆၧနၪ့ထၪ့ထဲၩ့လၧၩ့ အဆၧဒဲၩဘၭလၧအမၩဝ့ၫအဂးနီၪနးမံၩ့အ့ၬ. မၩယူၭ ဝ့ၫလၧဆၧစ့ၩရၫ့ဒဲဆၧတီၩဆၧလီၩ့လီၫ. မိမၧၫ့တၡါ",
			"17": "<sup>17</sup> တၭ,မိၥံၫဘၪအ့ၬ.- လါနၫ့တၭ,နၡၩခမျၧးဖိၪၥံၪစံၭ, ယဟိဝၩအဖၧၩ့ၥၭမွဲဆၧလတီၩလလီၩ့ဘၪလီၫ. အ့ၪ",
			"18": "<sup>18</sup> မွဲအဝ့ၫၥံၪအဖၧၩ့ၥၭတီၩအ့ၬဘၪအ့ၬ.- ထီးၦတီၩၦ လီၩ့အ့ၪကၠၪခွံၬအၥၭလၧအဆၧတီၩဆၧလီၩ့တၭ, မၩ",
			"19": "<sup>19</sup> ဆၧဒဲၩဘၭနီၪမိၥံၫဝ့ၫလၧအကၠီၩ့လီၫ.- ထီးၦလတီၩ လလီၩ့ဘၪအ့ၪကၠၪခွံၬအၥၭ လၧအဆၧလတီၩလလီၩ့ ဘၪတၭ,မၩဆၧစ့ၩရၫ့နီၪ,ဒဲအဆၧတီၩဆၧလီၩ့တၭ,မိ",
			"20": "<sup>20</sup> မၧၫ့ဝ့ၫလၧအကၠီၩ့လီၫ.- လါနၫ့တၭ,နၥံၪစံၭ,ယဟိဝၩ အဖၧၩ့ၥၭ, မွဲဆၧလတီၩဘၪနီၪလီၫ. ၦအံၫစရ့လၭအ ၡၩဂံၪ့ဖိၪၥံၪဧ့, ယမိစ့ၩရၫ့နၥံၪလဂၩလါလါ လၧဆၧ စ့ၩရၫ့ဘဲၫအဖၧၩ့ၥၭဒၪဝ့ၫအၥိၭနီၪး လဂၩဘဲၫအဖၧၩ့ ၥၭဒၪဝ့ၫအၥိၭနီၪဆုၬဆုၬလီၫ.",
			"21": "<sup>21</sup> တၭလၧပကဲၪဎီးအနံၪ့လဆံၫနံၫနံၪ့လနံၪ့ လၩဆံၫ ဘံၪ့လဘံၪ့လၩထၪ့ယဲနံၩလနံၩနီၪ, ဆၧမၩအၥၭလၧ ၦလၧအဖီၩ့ဖျ့ၭလၧယရုစလံၫ့လဂၩ, ဂဲၫဝ့ၫလၧယအီၪ",
			"22": "<sup>22</sup> တၭ,စံၭဝ့ၫဒၪ, ဆၧမၩလူၬထူၬယူၭဒိၩ့နီၪယူၭ,- တၭ ယဟိဝၩအစူၪအီၪယူၭဝ့ၫ လၧယလီၩ့လၧမုဂၪလၩ့ လၧၦလၧအဖီၩ့ဖျ့ၭ ဆၧလဂၩ လချႃၭဂဲၫဒံၭဘၪနီၪ လီၫ.ဒုၭအၩ့ထၪ့ယနိၭ ထီးအဝ့ၫဂဲၫလၧယအီၪ လၧ မုဂီၩလီၫ.",
			"23": "<sup>23</sup> ဒုၭအၩ့ထၪ့ယနိၭတၭ, ယအီၪအုၭအၭလၧၩ့အ့ၬ.ထီး နီၪလဖၧၫ့ ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ, စံၭဝ့ၫ",
			"24": "<sup>24</sup> ဒၪ,- ၦၡၩအဖိၪခွၫဧ့,ၦလၧအအီၪဝ့ၫ လၧအံၫစရ့လၭ အလးအီၪယူလဖၪနီၪ, ချဲၩ့ဆၧတၭ, စံၭဝ့ၫဒၪ, စအၫ ဘြဟၫ့မွဲၦလဂၩဎးတၭ, န့ၥၫထံၫၥံၪခးၥံၪနီၪလီၫ. အ့ၪ မွဲပဝ့ၫဒၪယီၩ ပမွဲၦအၪဂၩတၭး ဆၧဖ့ၪလၫ့ပၧၩလၧ",
			"25": "<sup>25</sup> ထံၫၥံၪခးၥံၪ လၧၦန့ၥၫဆၧအဂးလီၫ.- မၩအၥၭဘဲၫ နီၪတၭ,စံၭအဝ့ၫၥံၪ, ကဆါယဟိဝၩစံၭဘဲၫယီၩ, နၥံၪအၪ့ဆၧ လၧဆၧၥွံၪတၭ, နၥံၪစၪ့ထၪ့နၥံၪအမ့ၬ လၧနၥံၪအဆၧဂၩ့ဆၧဖၪ့ အအီၪတၭ, နၥံၪဂါလၩ့",
			"26": "<sup>26</sup> ဆၧၥွံၪလီၫ.မွဲနၥံၪ မိန့ဘၪထံၫၥံၪခးၥံၪ ဆ့ဧၪ.- နၥံၪဒိၭ နဲၩ့နၥံၪအၥၭ လၧနၥံၪအနၭတၭး နၥံၪမၩဆၧဘၪ ၥၭလိၪတၭ,နၥံၪမၩဘၪၥၭလိၪ ၦလၧအနဲၩ့ထံၭ အမၫ,လဂၩၦလၧအနဲၩ့ထံၭ အမၫဆုၬဆုၬလီၫ. မွဲန",
			"27": "<sup>27</sup> ၥံၪမိန့ဘၪထံၫၥံၪခးၥံၪဆ့ဧၪ.- စံၭအဝ့ၫၥံၪဘဲၫယီၩ, ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ယမၧၫ့ယဝ့ၫ, မွဲမၬ,ၦအီၪ ဝ့ၫလၧဆၧအီၪယူအဖၧၩ့လဖၪနီၪ မိလၩ့ထံၩဖါလၧနၭ ၥံၪဖၩ့ၥံၪတၭ, ၦလၧအအီၪဝ့ၫလၧမံၩ့လၬကျၩနီၪယ မိဖ့ၪလၫ့ခွံၬဝ့ၫ လၧဆၧဖိၪဆၧဎါဘဲၫၥိၭ အမိအၪ့ခွံၬ အဝ့ၫ,ဒဲၦအီၪဝ့ၫလၧထိၬလဖၪအဖၧၩ့ ဒဲလၧဆၧအိၩ",
			"28": "<sup>28</sup> ဖၧၩ့နီၪမိၥံၫဝ့ၫလၧဆၧၥံၫချဲၫ့လီၫ.- အဂဲးဘဲၫယီၩယ မိမၩအီၪယူလူၬထူၬထံၫၥံၪခးၥံၪတၭ, အဆၧအဂဲးအ ဘၭအၥၭထၪ့ထီၫနီၪမိထုၬတၭ, အံၫစရ့လၭအခိၪ လီၩ့ထိၩ့ချိၬ မိအီၪယူထီးၦခၫ့ဂၬဘၪဝ့ၫ နးဂၩအ့ၬ.",
			"29": "<sup>29</sup> ထီးယအ့ၪမၩအီၪယူ ထံၫၥံၪခးၥံၪနီၪ လၧအဆၧၥၭ လိၪလၧအမၩဝ့ၫအကၠီၩ့တၭ, အဝ့ၫၥံၪမိၥ့ၪယၫလၧယ မွဲယဟိဝၩလီၫ.",
			"30": "<sup>30</sup> နဝ့ၫဒၪယီၩၦၡၩအဖိၪခွၫဧ့,း နၡၩခမျၧးဖိၪၥံၪလၧ အချဲၩ့ဆၧလၧနဂဲးလၧဆၧအဒီၪ့အနဲၩ့ထံၭ, ဒဲလၧဂံၪ့ အတရၫ့ထံၭတၭ, ချဲၩ့ဆၧလဂၩဒဲလဂၩ, လဂၩလၧအ ထၧၫ့ဖုဝဲတၭ,စံၭ,ဂဲၫဘီၪ, ဆၧချဲၩ့လၧအဂဲၫလၧယဟိ ဝၩအအီၪနီၪ,မွဲဘဲၫၥ့ၪလဲၪ, ဘဲၫၥ့ၪလဲၪနီၪ, ခိၭနၪဆံၭ.",
			"31": "<sup>31</sup> မွဲမၬ,အဝ့ၫၥံၪဂဲၫလၧနအီၪ ဘဲၫၦခမျၧးအီၪကိၩ့အီၪ ကီၪ့အၥိၭနီၪတၭ, ဆၧၫ့နၩ့ လၧနမ့ၬယၫ ဘဲၫယၡၩ ခမျၧးအၥိၭနီၪတၭ, နါဂၧၫ့နဆၧချဲၩ့လါနၫ့တၭ,မၩဝ့ၫ အ့ၬ.အဂဲးဘဲၫယီၩ အဲၪဆၧအၪလၧအနိၭ, အ့ၪမွဲအ",
			"32": "<sup>32</sup> ၥၭလ့ၩဖိၬအဆၧၥၭကွံၩအခဲၫ့လီၫ.- ယိခွါ,နအီၪလၧ အဂးမၩအၥၭဘဲၫၦလၧအလူမုၬ လၧအၥံၫကျံၩဆၧ ဂ့ၩဂ့ၩၥ့ၪလဂၩတၭ, ဒဲၦလၧအဒံၩ့နါဒံၩ့မုၬမုၬ အၥိၭ နီၪလီၫ.အဂဲးဘဲၫယီၩနါဂၧၫ့နဆၧချဲၩ့လါနၫ့တၭ, မၩ",
			"33": "<sup>33</sup> ဝ့ၫအ့ၬ.- ထီးဆၧမၩအၥၭတၭ,ယိခွါ, မိမၩအၥၭနီၪ, ထီးနီၪလဖၧၫ့ အဝ့ၫၥံၪမိၥ့ၪယၫဝ့ၫ လၧမီၪလဂၩအီၪ ယူၭလၧအကျၩလီၫ."
		},
		"34": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ, စံၭဝ့ၫဒၪ, ၦၡၩ အဖိၪခွၫဧ့, ချဲၩ့ဆၧလၧမီၪအချိၬထၫ့ဒၩ အံၫစရ့လၭအ ၡၩယိၥိၪလဖၪနီၪး ချဲၩ့ဆၧလၧမီၪအချိၬတၭ,စံၭအ ဝ့ၫၥံၪကဆါယဟိဝၩစံၭၦယိၥိၪလဖၪဘဲၫယီၩ,အံၫစ ရ့လၭအၡၩယိၥိၪ လၧအယိအၥၭဒၪဝ့ၫလဖၪနီၪ,ဘၪ အၡၪ့လီၫ. ၦယိၥိၪမိဒုၭအၪ့ဘၪအၥိၪလဒီၪ့အဆၪမွဲ",
			"3": "<sup>3</sup> အ့ၬဧၪ.- နၥံၪအၪ့ဆၧအဘီၪ့,ဒဲနၥံၪကီၩ့ၥိၭလၧၥိၪအ ဆီၪ့,နၥံၪမၩၥံၫဆၧအဘီၪ့လီၫ. အ့ၪမွဲၥိၪလဒီၪ့အဆၪ",
			"4": "<sup>4</sup> နီၪနၥံၪဒုၭအၪ့ဘၪအ့ၬ.- ဆၧလၧအဂဲးဆါအဘၭဆါ နီၪ,နၥံၪဒုၭဆီၪ့ထၪ့ဝ့ၫအ့ၬ. ဆၧလၧအဆၫထၪ့ဝ့ၫနီၪ နၥံၪမၩဘျၪအ့ၬ. ဆၧလၧအဘၪထူၭနီၪ နၥံၪဘီၪ့ဘံၭ ထၬအ့ၬ. ဆၧလၧအဘၪဆၧနၫ့ထၪ့ခွံၬဝ့ၫနီၪ, နၥံၪဂဲၫ ထဲၩ့ဆိၬထဲၩ့ဝ့ၫအ့ၬ. ဆၧလၧအဂၭဖျိၭဖၧၩ့ၥၭနီၪ, နၥံၪအၪ့ဎၬဝ့ၫအ့ၬ. အ့ၪမွဲနၥံၪပၧၩ့အဝ့ၫ လၧဆၧမၩ",
			"5": "<sup>5</sup> ဆီၪ့,ဒဲဆၧအစူၪဆီၪ့အခၪ့ဆီၪ့လီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,မွဲၦယိၥိၪလအီၪဘၪနးဂၩတၭ, ၥိၪနီၪအီၪပြံၩပၩ ဝ့ၫတၭ,လၧအအီၪပြံၩပၩဝ့ၫအဘိၩ့ဘၭနီၪ, ကဲၪထၪ့ ဆၧအၪ့လၧကယဲဆၧဖိၪဆၧဎါ လၧမံၩ့လၬကျၩအဂး",
			"6": "<sup>6</sup> လီၫ.- ယၥိၪဂၭဖျိၭလၧခိၪလီၩ့ ထီးအလူၬအလီၩ့,ဒဲ လၧဆၧစီၩ့ခိၪထီၫကိၭဖျီၪ့ဒ့ၭအလီၩ့လီၫ. မွဲမၬ, ယၥိၪ လဒီၪ့လၩ့ပြံၩလၩ့ပၩဝ့ၫ လၧခးထၧၫ့ဘံၪ့ယၫအဖၧၩ့ တၭ,ၦအၪ့ဎူၫအၪ့ဎၬဝ့ၫအီၪအ့ၬ.",
			"7": "<sup>7</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦယိၥိၪၥံၪဧ့, ခိၭနၪယဟိဝၩ",
			"8": "<sup>8</sup> အလူဆံၭ.- ယမၧၫ့ယဝ့ၫ,ကဆါယဟိဝၩစံၭဝ့ၫဒၪ, မွဲမၬ,မွဲယၥိၪလဒီၪ့ကဲၪထၪ့ဆၧအၪ့ဂူၬန့, ဒဲယၥိၪလ ဒီၪ့ကဲၪထၪ့ဆၧအၪ့ လၧကယဲဆၧဖိၪဆၧဎါ လၧမံၩ့ လၬကျၩထီးအလူၬအဂး, မွဲၦယိၥိၪလအီၪဘၪတၭ,မွဲ ယၡၩယိၥိၪလအၪ့ဎၬဘၪယၥိၪလဒီၪ့တၭ, ယိဒၪအ",
			"9": "<sup>9</sup> နၫ့ဆါအၥၭတၭ,ဒုၭအၪ့ယၥိၪလဒီၪ့အဆၪအ့ၬ.- ၦယိ",
			"10": "<sup>10</sup> ၥိၪၥံၪဧ့, ခိၭနၪယဟိဝၩအလူဆံၭ.- ကဆါယဟိဝၩ စံၭဘဲၫယီၩ,ယိခွါ, ယထၫ့ဒၩၦယိၥိၪတၭ,ယအၪ့ဎၬ ယၥိၪလဒီၪ့လၧအစူၪဖၧၩ့ ဒဲဒုၭထုၬအယိဆၧလဒီၪ့နီၪ တၭ,ၦယိၥိၪနီၪ, မိယိဘၪလၧၩ့အနၫ့ဆါဒၪဝ့ၫဆ့အ့ၬ. ယမိမၩဖီၩ့မၩဖျ့ၭ ယၥိၪလဒီၪ့ လၧအနိၭ ဘဲၫၥိၭအ ထီးကဲၪထၪ့ဆၧအၪ့လၧအဝ့ၫၥံၪအဂးလဂ့ၩလီၫ.",
			"11": "<sup>11</sup> အဂဲးဘဲၫယီၩ,ကဆါယဟိဝၩစံၭဘဲၫယီၩ,ယိခွါ, ယဝ့ၫဒၪယီၩ,ယၧၩဒၪလ့ၬ, ယမိအၪ့ဎၬယၥိၪလဒီၪ့",
			"12": "<sup>12</sup> တၭယမိအၪ့ဎၬဝ့ၫ,- ဘဲၫၦယိၥိၪလဒီၪ့အၪ့ဎၬအၥိၪလ ဒီၪ့,လၧမုလနံၩလၧအအီၪလၧအၥိၪ လၧအအီၪပြံၩ ပၩအကျၩအၥိၭနီၪ, ယမိအၪ့ဎၬယၥိၪလဒီၪ့ ဘဲၫနီၪ ၥိၭ,ဒဲမၩဖီၩ့မၩဖျ့ၭဝ့ၫလၧကယဲဆၧအလးလၧအလၩ့ ပြံၩလၩ့ပၩလၧအဖၧၩ့ လၧမုလနံၩ လၧအအီၪလၧ",
			"13": "<sup>13</sup> ဆၧအုၪ့ဒဲဆၧခံၭနီၪလီၫ.- ယမိဒုၭဂဲၫထၪ့ခွံၬအဝ့ၫၥံၪ, လၧၦဆၨၩလဖၪအကျၩ, ဒဲအၪ့ထုၫ့ကီၪ့အဝ့ၫၥံၪ လၧ ခးထီးအလူၬအဖၧၩ့တၭ, ယမိဒုၭဂဲၫထဲၩ့အဝ့ၫၥံၪလၧ အခးဒၪဝ့ၫအဖၧၩ့, ဒဲဒုၭအၪ့ဆၧလၧအံၫစရ့လၭအခိၪ လီၩ့ထိၩ့ချိၬအလီၩ့, လၧထံၫကၠီၪ့လဖၪအနဲၩ့,ဒဲလၧ ၦအီၪဝ့ၫလၧအလးဖၧၩ့ ထီးအလူၬလၧထံၫၥံၪခးၥံၪအ",
			"14": "<sup>14</sup> ဖၧၩ့လီၫ.- ယမိဒုၭအၪ့အဆၪလၧဆၧအၪ့အဆၪအ လးအဂ့ၩအဖၧၩ့, ဒဲလၧအံၫစရ့လၭအခိၪလီၩ့ထီၫအ လီၩ့နီၪ,အဖီၩ့မိအီၪဝ့ၫတၭ, မိခိၬလၩ့ထီးနီၪလၧအဖီၩ့ ဂ့ၩလဖျိၪ့အဖၧၩ့တၭ, မိအၪ့အဆၪအွံၪ လၧအံၫစရ့",
			"15": "<sup>15</sup> လၭအခိၪလီၩ့ထိၩ့ချိၬအလီၩ့လီၫ.- ယမိဒုၭအၪ့ယၥိၪ လဒီၪ့အဆၪတၭ, ယမိဒုၭခိၬလၩ့ဝ့ၫ, ကဆါယဟိဝၩ",
			"16": "<sup>16</sup> စံၭဝ့ၫဒၪ,- ယမိအၪ့ဎၬဆၧလၧအလၩ့မါ, ဒဲဒုၭဂဲၫထဲၩ့ ဆၧလၧအဘၪဆၧနၫ့ထၪ့ခွံၬအဝ့ၫတၭ, ယမိဘီၪ့ထၪ့ ဆၧလၧအခါတၭ, ယမိဒုၭဆီၪ့ထၪ့ဆၧလၧအဆၫထၪ့ လီၫ.အ့ၪမွဲဆၧလၧအဘီၪ့ဝ့ၫဒဲဆီၪ့ဝ့ၫနီၪ, ယမိမၩဂၭ ဂီၩ့ဝ့ၫ,ယမိဒုၭအၪ့အဝ့ၫၥံၪလၧဆၧစ့ၩရၫ့လီၫ.",
			"17": "<sup>17</sup> ဆၧလၧနၥံၪယီၩ,ယၥိၪဒဲဘ့ၪလဒီၪ့ဧ့, ကဆါယဟိ ဝၩစံၭဘဲၫယီၩ,ယိခွါ, ယစ့ၩရၫ့ဆၧလၧၥိၪလဒုၩဒဲလ ဒုၩအဘိၩ့ဆၧၩ့, ဒဲလၧၥိၪဖၫလဒုၩ, ဒဲဘ့ၪဖၫလဒုၩ",
			"18": "<sup>18</sup> အဘိၩ့ဆၧၩ့လီၫ.- နၥံၪအၪ့ခွံၬ ဆၧအၪ့အဆၪအလး အဂ့ၩ,နၥံၪယဲးထဲးလၩ့ နၥံၪအခၪ့ လၧနၥံၪအၪ့ဆၪ အလးလၧအဆၧအီၪလၩ့ထးနီၪ, မွဲဆၧအဆံၭဆ့ဧၪ. နၥံၪအီၩထံၫအယိၬတၭ, နၥံၪမၩဒုၪထၪ့ထံၫအီၪလၩ့",
			"19": "<sup>19</sup> ထးလဖၪလၧနၥံၪအခၪ့နီၪ, မွဲဆၧအဆံၭဆ့ဧၪ.- ဆၧ လၧယၥိၪ ဒဲယဘ့ၪအၪ့ဆၧလၧနၥံၪယဲးထဲးလၩ့လၧန ၥံၪအခၪ့, ဒဲအီၩဆၧလၧနၥံၪမၩဒုၪထၪ့လၧနၥံၪအခၪ့",
			"20": "<sup>20</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ကဆါယဟိဝၩစံၭဘဲၫ ယီၩ,ယိခွါ,ယဝ့ၫဒၪယီၩ, ယၧၩဒၪလ့ၬ, ယမိစ့ၩရၫ့ဆၧ",
			"21": "<sup>21</sup> လၧၥိၪဘီၪ့ဒဲၥိၪဎွ့လၩ့အဘိၩ့ဆၧၩ့လီၫ.- မွဲလၧနၥံၪ ဆၪ့ထဲးဆၧလၧနၥံၪအကဖၩ ဒဲလၧနၥံၪအခိၬထံၭခိၪ, ဒဲဘျႃၪ့ကယဲဆၧလၧအဆၫဝ့ၫလၧနၥံၪအနိၩ့ ထီးနၥံၪ",
			"22": "<sup>22</sup> မၩလၩ့ပြံၩပၩဝ့ၫအကၠီၩ့တၭ,- ယမိထိးထဲၩ့တၩ့ထဲၩ့ ယၥိၪလဒီၪ့တၭ, လကဲၪထၪ့လၧၩ့ဘၪ ဆၧအၪ့ဂူၬန့ အလးတၭ,ယမိစ့ၩရၫ့ဆၧလၧၥိၪ ဒဲၥိၪလဒုၩဒဲလဒုၩ",
			"23": "<sup>23</sup> အဘိၩ့ဆၧၩ့လီၫ.- ယမိအီၪက့ၪၦယိၥိၪလဂၩလၧအ ဖၫ့ခိၪတၭ, အဝ့ၫဒၪယခ့ၫယၡၩ စဒၫဝံၭဒၪလ့ၬ မိယိ ဝ့ၫလီၫ.မိယိဝ့ၫတၭ, မိကဲၪထၪ့အဝ့ၫၥံၪအၡၩယိၥိၪ",
			"24": "<sup>24</sup> လီၫ.- ယၧၩယဟိဝၩယီၩ, ယမိကဲၪထၪ့အဝ့ၫၥံၪအ ယွၩတၭ, ယခ့ၫယၡၩစဒၫဝံၭမိကဲၪထၪ့ ၦဒိၪဖၭဒိၪလ ဂၩလၧအကျၩလီၫ. ယၧၩယဟိဝၩယီၩ, ယချဲၩ့ယူၭ",
			"25": "<sup>25</sup> ဆၧယူၭ.- ယမိအုၩ့လၩ့ဆၧဘၪလိၬအိၭလိၬအဆၧ အုၩ့လၩ့လၧအဝ့ၫၥံၪ, ယမိမၩထုၬခွံၬဆၧဖိၪဆၧဎါ အဒဲၩ့လၧထံၫၥံၪခးၥံၪ အဖၧၩ့တၭ, အဝ့ၫၥံၪမိအီၪ ဝ့ၫခၧၫ့မၬ,လၧၡါမုနၧၫ့ဖၫအဖၧၩ့, ဒဲမံၫဝ့ၫလၧၥံၪ့ကျၩ",
			"26": "<sup>26</sup> လီၫ.- ယမိအီၪက့ၪအဝ့ၫၥံၪဒဲဆၧဝၬဖီၩ့ယဆၧစီၩ့ခိၪ လၧဆၧဆိၪဂ့ၩအလးတၭ, ယမိဒုၭဂဲၫဆၧဆၧၩ့ လၧ အထီဒၪဝ့ၫအဖၧၩ့လီၫ. ဆၧဆိၪဂ့ၩအဆၧဂဲၫဆၧၩ့နီၪ",
			"27": "<sup>27</sup> မိအီၪဝ့ၫလီၫ.- ၥံၪ့လၧဂၪ့ခိၪအဝၩ့ဖၧၩ့နီၪမိၥၪထၪ့တၭ, ဂၪ့ခိၪမိဒုၭအၪထၪ့ဆၧတၭ, အဝ့ၫၥံၪမိအီၪခၧၫ့လၧအ ခးဖၧၩ့တၭ, ထီးယမၩထ့ၬခွံၬ အနိၪယိၭဘီၩ့ အဖျံၩ တၭ,မၩဖီၩ့ဖျ့ၭဝ့ၫ လၧၦလၧအအၪ့မၧၫ့ဎီးအဝ့ၫၥံၪ",
			"28": "<sup>28</sup> တၭ,မိၥ့ၪယၫဝ့ၫလၧယမွဲယဟိဝၩလီၫ.- တၭအဝ့ၫၥံၪ မိကဲၪထၪ့လၧၩ့ဆၧအၪ့ဂူၬန့အလး လၧၦဆၨၩလဖၪ အဂးအ့ၬ. ထံၫၥံၪခးၥံၪအဆၧဖိၪဆၧဎါ မိအၪ့ခွံၬအ ဝ့ၫၥံၪဆ့အ့ၬ. အ့ၪမွဲမိအီၪခၧၫ့တၭ,ဆၧမၩၥၭမဲၪအဝ့ၫ",
			"29": "<sup>29</sup> ၥံၪအီၪနးမံၩ့အ့ၬ.- ယမိဒုၭမဲၪထၪ့ဆၧၥုၪ့လၩ့အၥၭ အလးလၧယမံၩ့အကၠီၩ့တၭ, အဝ့ၫၥံၪမိလူၬခွံၬလၧၩ့ လၧဆၧၥၭဝံလၩ့ဒိၩ လၧခးဖၧၩ့အကၠီၩ့အ့ၬး ဒဲမိဘၪ",
			"30": "<sup>30</sup> လၧၩ့ဆၧမ့ၬမဲဘၪဆဲၫ့ လၧၦဆၨၩလဖၪဆ့အ့ၬ.- ထီး နီၪလဖၧၫ့အဝ့ၫၥံၪ မိၥ့ၪယၫဝ့ၫလၧယၧၩ, ယဟိဝၩ ယီၩအဝ့ၫၥံၪအယွၩနီၪ, အီၪဝ့ၫလၧအဝ့ၫၥံၪအၥိၭတၭ, အဝ့ၫၥံၪ အံၫစရ့လၭ အၡၩဂံၪ့ဖိၪနီၪ, မွဲယၡၩခမျၧး,",
			"31": "<sup>31</sup> ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.- နၥံၪဝ့ၫဒၪ ယၥိၪလဒီၪ့, ယဆၧအၪ့အဆၪအလးအၥိၪလဒီၪ့နီၪ, မွဲၦၡၩတၭ, ယဝ့ၫဒၪယီၩ ယမွဲနၥံၪအယွၩ ကဆါယဟိဝၩစံၭ ဝ့ၫဒၪ."
		},
		"35": {
			"1": "<sup>1</sup> လၧနီၪအမ့ၬယၫ ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,",
			"2": "<sup>2</sup> စံၭဝ့ၫဒၪ,- ၦၡၩအဖိၪခွၫဧ့, အီၪက့ၪနမ့ၬထၫ့ဒၩခိၪလီၩ့",
			"3": "<sup>3</sup> စံအၫတၭ, ချဲၩ့ဆၧလၧမီၪအချိၬ ထၫ့ဒၩအဝ့ၫ,- တၭ, စံၭ,ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ခိၪလီၩ့စံအၫဧ့, ယိ ခွါ,ယထၫ့ဒၩနၧၩတၭ, ယမိယၩ့ထၪ့ယစူၪလၧနဖၫ့",
			"4": "<sup>4</sup> ခိၪတၭ,ယမိမၩအီၪယူနၧၩလီၫ.- ယမိမၩလူၬထူၬ ခွံၬနဒိၩ့လဖၪတၭ, နမိအီၪယူဝ့ၫတၭ, နမိၥ့ၪယၫလၧ",
			"5": "<sup>5</sup> ယမွဲယဟိဝၩလီၫ.- အဂဲးဘဲၫယီၩနၥၭဂဲၫ့ဆၧလထံၪ ဎးဘီၩ့ဎးတၭ, နဖ့ၪလၫ့ခွံၬၦအံၫစရ့လၭဖိၪ လၧနၭအ နါလၧအဘၪၡၪ့အထးဖၧၩ့ ထီးအထီလၧဆၧဒဲၩဘၭ",
			"6": "<sup>6</sup> မၩလူၬဆၧလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယမၧၫ့ယဝ့ၫ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ, ယမိတဲၩ့ဝဲၩနၧၩလၧဆၧၥွံၪ အဂး,ဒဲဆၧၥွံၪမိလီၩ့ဆီးနၧၩလီၫ. မွဲနလၥၭဂဲၫ့ဘၪ",
			"7": "<sup>7</sup> ဆၧၥွံၪအကၠီၩ့တၭ, ဆၧၥွံၪမိလီၩ့ဆီးနၧၩလီၫ.- ထီး ယမၩအီၪယူခိၪလီၩ့ စံအၫတၭ, ယမိဒၪ့ထ့ၬၦလၧအ",
			"8": "<sup>8</sup> စဲၪ့ထၪ့ဒဲၦလၧအထဲၩ့ထဲၩ့နီၪလီၫ.- ယမိမၩဎွ့ၩအခိၪ လီၩ့ထိၩ့ချိၬအလီၩ့ လၧၦဘၪဆၧမၩၥံၫဝ့ၫနီၪလီၫ. လၧ နဆၧစီၩ့ခိၪအလီၩ့ဒဲလၧနဆၧပျၩ့ဖၧၩ့, ဒဲလၧနခိၪလီၩ့ ဆူၭဖၧၩ့ထီးအလူၬနီၪ, ၦလၧအဘၪဆၧမၩၥံၫဝ့ၫလၧ",
			"9": "<sup>9</sup> နၭမိလၩ့ထံၩဖါဝ့ၫလီၫ.- ယမိမၩအီၪယူနၧၩ လၩ့ ဆိၩလၩ့ကၠၪဒဲၦလအီၪဘၪ လၧနဒိၩ့ဖၧၩ့နီၪတၭ,နၥံၪမိ",
			"10": "<sup>10</sup> ၥ့ၪယၫလၧယမွဲယဟိဝၩလီၫ.- မွဲနစံၭ,ၦနံၫဆၨၩယီၩ, ဒဲခးနံၫဘံၪ့ယီၩ မိကဲၪထၪ့ပဆၧတၭ, ပမိမၩန့ဝ့ၫအ",
			"11": "<sup>11</sup> ကၠီၩ့တၭ,လါနၫ့ယဟိဝၩအီၪဝ့ၫထီးနီၪး- မၩအၥၭဘဲၫ နီၪတၭ,ယမၧၫ့ယဝ့ၫ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ, ယမိ မၩယဝ့ၫ ဘဲၫနမၩလၧနၥၭထၪ့ ဒဲနၥၭခ့ၬ လၧနၥၭဂဲၫ့ အဝ့ၫၥံၪအၥိၭနီၪတၭ, ထီးယအ့ၪစ့ၩရၫ့နၧၩဂီၩ့တၭ,",
			"12": "<sup>12</sup> ယမိနဲၪဖျီၪထၪ့ယၥၭလၧအဝ့ၫၥံၪအမ့ၬယၫလီၫ.- နၥံၪ မိၥ့ၪယၫ လၧယမွဲယဟိဝၩ ဒဲလၧယနါဂၧၫ့နၥံၪဒုၪဒွ့ၪ ဆၧလၧနၥံၪချဲၩ့ဆၧ လၧအံၫစရ့လၭအခိၪလီၩ့ထိၩ့ချိၬ အလီၩ့တၭ,နစံၭ, အဝ့ၫၥံၪအီၪယူဝ့ၫ,ဆၧဖ့ၪလၫ့အဝ့ၫ",
			"13": "<sup>13</sup> ၥံၪ,လၧပၧၩလၧၦမိမၩလူၬခွံၬဝ့ၫအဂဲးလီၫ.- နၥံၪအီၪ က့ၪဖိၫလိၫနၥံၪအၥၭ လၧနၥံၪအနိၭထၫ့ဒၩယၧၩ, ဒဲမၩ အၪထၪ့နၥံၪအဆၧချဲၩ့ ထၫ့ဒၩယၧၩလီၫ. ယနါဂၧၫ့",
			"14": "<sup>14</sup> ယူၭ.- ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ထီးခးထၧၫ့ဘံၪ့ ယၫအ့ၪၥၭထိၬဝ့ၫတၭ, ယမိတဲၩ့ဝဲၩဆၧအီၪယူလၧ",
			"15": "<sup>15</sup> နဂးလီၫ.- ဘဲၫနၥၭထိၬလၧအံၫစရ့လၭအဂံၪ့, ယဆၧ န့ၥၫအဖၫ့ခိၪ လၧအအီၪယူဝ့ၫအကၠီၩ့အၥိၭနီၪ,ယမိ မၩနၧၩဘဲၫနီၪၥိၭလီၫ. ခိၪလီၩ့စံအၫဧ့, ဒဲအံဒၧၫ့ထၧၫ့ ဘံၪ့ယၫဆ့မိအီၪယူဝ့ၫတၭ, မိၥ့ၪယၫဝ့ၫလၧယမွဲယဟိ ဝၩလီၫ."
		},
		"36": {
			"1": "<sup>1</sup> နဝ့ၫဒၪယီၩၦၡၩအဖိၪခွၫဧ့, ချဲၩ့ဆၧလၧမီၪအချိၬလၧ အံၫစရ့လၭအခိၪလီၩ့အဂဲးတၭ, စံၭ,အံၫစရ့လၭအ",
			"2": "<sup>2</sup> ခိၪလီၩ့ၥံၪဧ့,ခိၭနၪယဟိဝၩအလူဆံၭ,- ကဆါယဟိ ဝၩစံၭဘဲၫယီၩ လၧဆၧအဒုၪအဒၩချဲၩ့ဆၧထၫ့ဒၩနၥံၪ အကၠီၩ့နီၪ,စံၭ,အၩဟါၬ ဆၧအလးထၪ့ထီၫအဆိၩ",
			"3": "<sup>3</sup> အကၠၪကဲၪထၪ့ပဆၧန့ၥၫအလးတၭ,- အခိးမွဲချဲၩ့ဆၧ လၧမီၪအချိၬတၭ,စံၭ, ကဆါယဟိဝၩစံၭဘဲၫယီၩးမွဲ မၬ,ၦမၩယူနၥံၪ, ဒဲယုလၩ့ခွံၬနၥံၪကိၭခီၫဒ့ၭ,ဘဲၫၥိၭ နၥံၪမိကဲၪထၪ့ဆၧန့ၥၫ လၧၦဆၨၩဂူၫဂၩလဖၪလၧအ အီၪလၩ့ထးအဂး, ဒဲဆၧချဲၩ့ဆၧအလး လၧၦချဲၩ့ဒၪ ဆၧအဂး,ဒဲဆၧဒုၪဒွ့ၪအလး လၧၦခမျၧးအဂးလီၫ.",
			"4": "<sup>4</sup> မၩအၥၭဘဲၫနီၪတၭ, အံၫစရ့လၭအခိၪလီၩ့ၥံၪဧ့, ခိၭ နၪကဆါယဟိဝၩအလူဆံၭ. ကဆါယဟိဝၩစံၭခိၪ လီၩ့ထိၩ့ချိၬ,ဒဲဆၧစီၩ့ခိၪ,ဒဲထံၫချိၬလဖၪ, ဒဲခိၪလီၩ့ ဆူၭ,ဒဲဆၧပျၩ့လၧအလးအီၪယူဝ့ၫ, ဒဲဒိၩ့လဖၪလၧၦစဲၪ့ ဒၪဝ့ၫ,လၧအကဲၪထၪ့ယူၭဆၧအၪ့ဂူၬန့, ဒဲဆၧမၩကြၩ့ ထမးအလး လၧၦဆၨၩလၧအအီၪလၩ့ထးလဖၪအဂး",
			"5": "<sup>5</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ကဆါယဟိဝၩစံၭဘဲၫ ယီၩ,မွဲမၬ,ယချဲၩ့ယူၭလၧယၥၭကဲၪ့ အမ့ၪထၫ့ဒၩ ၦ ဆၨၩၥံၪလၧအအီၪလၩ့ထး, ဒဲထၫ့ဒၩၦအံဒၧၫ့ဖိၪထီး အလူၬ,လၧအမၩန့ဝဲၩ ယခးလၧအဂးဒၪဝ့ၫလၧအၥၭ ထိၬဝ့ၫလၧအၥၭထၧၫ့ဖျိၪ့ယၫတၭ, အီၪက့ၪဖိၫလိၫအ ၥၭဘဲၫၥိၭအမိအီၪက့ၪဝ့ၫလၧဆၧအၪ့ဂူၬန့အလးလၧ",
			"6": "<sup>6</sup> အၥၭလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ချဲၩ့ဆၧလၧမီၪအချိၬ လၧခးအံၫစရ့လၭအဂဲးတၭ, စံၭခိၪလီၩ့ထိၩ့ချိၬ, ဒဲ ထံၫမိၡါၥံၪ,ဒဲဆၧစီၩ့ခိၪၥံၪ,ဒဲခိၪလီၩ့ဆူၭၥံၪ, ကဆါ ယဟိဝၩစံၭဘဲၫယီၩ, ယချဲၩ့ယူၭဆၧလၧယၥၭကဲၪ့,ဒဲ ယၥၭခဲၩထၪ့လီၫ. အဂဲးဘဲၫယီၩနၥံၪဘၪယူၭၦဆၨၩ",
			"7": "<sup>7</sup> လဖၪအဆၧဒုၪဒွ့ၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ကဆါ ယဟိဝၩစံၭဘဲၫယီၩ, ယယၩ့ထၪ့ယစူၪ, မွဲမၬ,ၦဆၨၩ လဖၪလၧအအီၪဝၬဖီၩ့နၥံၪ, အဝ့ၫၥံၪမိဘၪထိးအဆၧ",
			"8": "<sup>8</sup> ဒုၪဒွ့ၪလီၫ.- အ့ၪမွဲနၥံၪဝ့ၫဒၪအံၫစရ့လၭအခိၪလီၩ့ၥံၪ ဧ့,နၥံၪမိယူၬထၪ့နၥံၪ အၥံၪ့ထဲၩ့တၭ,ၥၪထၪ့ဆၧလၧ ယၡၩခမျၧး အံၫစရ့လၭ အဂးလီၫ. အဂဲးဘဲၫယီၩ",
			"9": "<sup>9</sup> ဘူၭလၧအမိဂဲၫလီၫ.- အဂဲးဘဲၫယီၩ,ယိခွါ,ယအီၪလၧ နၥံၪအဂးတၭ,ယမိကၠၪယၥၭလၧနၥံၪအအီၪတၭ, ၦ",
			"10": "<sup>10</sup> မိထဲၫနၥံၪ ဒဲဎွံၪဆၧလၧနၥံၪအလီၩ့လီၫ.- ယမိမၩအၪ ထၪ့ၦၡၩလၧနၥံၪအဖၫ့ခိၪ, ကယဲအံၫစရ့လၭအၡၩဂံၪ့ ဖိၪထီးအလူၬဒၪလ့ၬတၭ, ၦမိအီၪလၧဒိၩ့လဖၪအဖၧၩ့ တၭ,ၦမိမၩထၪ့ထဲၩ့ ဆၧအလးလဖၪအီၪယူဝ့ၫလီၫ.",
			"11": "<sup>11</sup> ယမိမၩအီၪထၪ့ၦၡၩ ဒဲဆၧဖိၪဆၧဎါ လၧနၥံၪအဖၫ့ ခိၪတၭ,အဝ့ၫၥံၪမိအၪထၪ့ဝ့ၫ,ဒဲၥၪထၪ့တၭ, ဆၧမိအီၪ လၧနၥံၪအလီၩ့, ဘဲၫလၧဖျိၩ့အၥိၭနီၪတၭ, ယမိမၩန ၥံၪဂ့ၩနဲၪ့လၧအခၪ့ထံၭဒံၭတၭ, နၥံၪမိၥ့ၪယၫလၧယ",
			"12": "<sup>12</sup> မွဲယဟိဝၩလီၫ.- မွဲမၬ,ယမိဒုၭလ့ၩၦၡၩလၧနၥံၪအ ဖၫ့ခိၪ,ယၡၩခမျၧးအံၫစရ့လၭဒၪလ့ၬတၭ, အဝ့ၫၥံၪမိ န့ၥၫနၧၩတၭ, နမိကဲၪထၪ့အဆၧန့ၥၫတၭ, စူၩယၫလခီၫ",
			"13": "<sup>13</sup> နဒုၭဘၪၡၪ့ဘၪနၭလၧၩ့အ့ၬ.- ကဆါယဟိဝၩစံၭဘဲၫ ယီၩ,မွဲအဝ့ၫၥံၪစံၭ,နၥံၪအၪ့ခွံၬၦၡၩ, နမၩၡၪ့မၩနၭ",
			"14": "<sup>14</sup> ၦဆၨၩလဖၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, နအၪ့လၧၩ့ ၦၡၩအ့ၬ. နမၩၡၪ့မၩနၭလၧၩ့ၦဆၨၩလဖၪအ့ၬ. က",
			"15": "<sup>15</sup> ဆါယဟိဝၩစံၭဝ့ၫဒၪ,- ယမိဒုၭနါဂၧၫ့လၧၩ့ၦဆၨၩလ ဖၪအဆၧဒုၪဒွ့ၪနၧၩအ့ၬ. နမိဘၪလၧၩ့ၦခမျၧးအဆၧ မၩကြၩ့ထမးနီၪဆ့အ့ၬ. နမိဒုၭဘၪလၧၩ့ နၡၩဆၨၩ လဖၪလၧဆၧၡၪ့ဆၧနၭအ့ၬ. ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"16": "<sup>16</sup> ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ, စံၭဝ့ၫဒၪ, ၦ ၡၩအဖိၪခွၫဧ့, လၧၦအံၫစရ့လၭဖိၪအီၪဝ့ၫ လၧအခး ဒၪဝ့ၫအဖၧၩ့နီၪ, မၩဘၪၥၭလိၪဝ့ၫလၧအဖၧၩ့ၥၭဒၪဝ့ၫ အကၠီၩ့,ဒဲလၧအမၩဆၧအကၠီၩ့လီၫ. အဖၧၩ့ၥၭလၧ ယမ့ၬယၫ မၩအၥၭဘဲၫၦမုၪ လၧအအၪ့ဆူၫဝၭအၥၭ",
			"18": "<sup>18</sup> အဆၧလဆံၫ့ဘၪအၥိၭနီၪလီၫ.- အခိးမွဲယဂါလၩ့ယ ၥၭခဲၩထၪ့လၧအဖၫ့ခိၪလၧဆၧၥွံၪ လၧအဝ့ၫၥံၪဂါလၩ့ ဝ့ၫလၧထံၫၥံၪခးၥံၪအဖၧၩ့အကၠီၩ့, ဒဲလၧအမၩဘၪၥၭ",
			"19": "<sup>19</sup> လိၪဝ့ၫလၧအဆၧဂၩ့ဆၧဖၪ့အကၠီၩ့လီၫ.- ယမၩလၩ့ ပြံၩလၩ့ပၩယူၭ အဝ့ၫၥံၪ လၧၦဆၨၩလဖၪ အကျၩ, ဒဲမၩလၩ့မုလၩ့ဖၭအဝ့ၫၥံၪ လၧခးလဖၪအကျၩလီၫ. ယစ့ၩရၫ့အဝ့ၫၥံၪဘဲၫအဖၧၩ့ၥၭအၥိၭ, ဒဲဘဲၫအဆၧမၩ",
			"20": "<sup>20</sup> အၥိၭနီၪလီၫ.- ထီးအဝ့ၫၥံၪ အ့ၪလ့ၩထီၩ့ဝ့ၫ လၧၦ ဆၨၩလဖၪအကျၩ, ထီးဒၪအလ့ၩဆၧအလးနီၪတၭ, မၩဘၪၥၭလိၪယမံၩ့ဆံၫ့ဎံၪလီၫ. ၦစံၭလၧအဂဲးနီၪ, အဝ့ၫၥံၪမွဲယဟိဝၩအၡၩခမျၧးတၭ, စဲၪ့ထၪ့ခွံၬလၧအ ခးဖၧၩ့လီၫ.",
			"21": "<sup>21</sup> ယလီၫ့ကီၩ့ယမံၩ့ဆံၫ့ဎံၪ လၧၦအံၫစရ့လၭဖိၪမၩ ဘၪၥၭလိၪဝ့ၫလၧၦဆၨၩလဖၪအကျၩ ထီးဒၪအလ့ၩ",
			"22": "<sup>22</sup> ဆၧအလးနီၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, စံၭအံၫစရ့ လၭအၡၩဂံၪ့ဖိၪ, ကဆါယဟိဝၩစံၭဘဲၫယီၩ,အံၫစရ့ လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့, ယမၩဆၧယီၩလၧနၥံၪအကၠီၩ့ မွဲအ့ၬးမွဲလၧယမံၩ့ဆံၫ့ဎံၪ လၧနၥံၪမၩဘၪၥၭလိၪဝ့ၫ လၧၦဆၨလဖၪအကျၩ ထီးဒၪနၥံၪလ့ၩဆၧအလး",
			"23": "<sup>23</sup> နီၪအကၠီၩ့လီၫ.- ယမိအီၪက့ၪဆံၫ့ဎံၪယမံၩ့ဖၭဒိၪလၧ အဘၪၥၭလိၪယူၭ လၧၦဆၨၩလဖၪအကျၩ လၧနၥံၪ မၩဘၪၥၭလိၪဝ့ၫ လၧအကျၩး ထီးဆၧအ့ၪအီၪက့ၪ ဆံၫ့ဎံၪယၧၩလၧနၥံၪအကၠီၩ့ လၧအဝ့ၫၥံၪအမ့ၬယၫ တၭ,ၦဆၨၩလဖၪမိၥ့ၪယၫဝ့ၫ လၧယမွဲယဟိဝၩ,က",
			"24": "<sup>24</sup> ဆါယဟိဝၩစံၭဝ့ၫဒၪ.- အဂဲးဘဲၫယီၩ ယမိမၩန့ထၪ့ ခွံၬနၥံၪ လၧၦဆၨၩလဖၪအကျၩတၭ, ယမိအၪ့ထုၫ့ ကီၪ့ထဲၩ့ နၥံၪလၧကယဲခးထီးအလူၬအကျၩတၭ, ယမိဒုၭဂဲၫထဲၩ့နၥံၪ လၧနၥံၪအခးဒၪနၥံၪဝ့ၫ အဖၧၩ့လီၫ.",
			"25": "<sup>25</sup> ထီးနီၪလဖၧၫ့ ယမိဎွံၪထံၫဆံၫ့ လၧနၥံၪအလီၩ့တၭ, နၥံၪမိဆံၫ့ထၪ့လီၫ. ယမိၥူၫဝၭဆံၫ့နၥံၪ အဆၧဘၪၥၭ လိၪလၧနၥံၪအလီၩ့ထီးအလူၬ, ဒဲနၥံၪအဆၧဂၩ့အဆၧ",
			"26": "<sup>26</sup> ဘၪၥၭလိၪလၧနၥံၪအလီၩ့ထီးအလူၬလီၫ.- ယမိဖ့ၪ လၫ့နၥံၪအၥၭၥၫ့, ဒဲနၥံၪအၥၭဆီၫ့မီၪ့ဆၧအၥၫ့, ယမိ အီၪက့ၪလၧနၥံၪအဖၧၩ့တၭ, ယမိမၩန့ထၪ့ခွံၬနၥံၪအ ၥၭလိးလၧနၥံၪအနၫ့ဆါအဖၧၩ့တၭ, ယမိဖ့ၪလၫ့နၥံၪ",
			"27": "<sup>27</sup> အၥၭယၪလီၫ.- ယမိအီၪက့ၪယၥၭ လၧနၥံၪအဖၧၩ့ တၭ,ဒုၭလ့ၩနၥံၪလၧယဆၧၥီၪ့ဆၧၥၫ့အဖၧၩ့တၭ, န",
			"28": "<sup>28</sup> ၥံၪမိထီးန့ယဆၧစ့ၩရၫ့ ဒဲမၩဝ့ၫဆ့လီၫ.- နၥံၪမိအီၪ လၧခးဖၧၩ့လၧယဖ့ၪလၫ့ယူၭနၥံၪ အဖါလဖၪ, နၥံၪ မိကဲၪထၪ့ယၡၩခမျၧးတၭ, ယမိကဲၪထၪ့နၥံၪအယွၩ",
			"29": "<sup>29</sup> လီၫ.- ယမိထိးထဲၩ့တၩ့ထဲၩ့နၥံၪ လၧနၥံၪအဆၧလ ဆံၫ့ဘၪအဖၧၩ့တၭ,ယမိကိၭထၪ့န့ နၥံၪအဘုၪၥံၪဂူၫ ၥံၪ,ဒဲမၩအၪထၪ့ဝ့ၫတၭ, ဒုၭဘၪလၧၩ့နၥံၪလၧဆၧၥၭ",
			"30": "<sup>30</sup> ဝံလၩ့ဒိၩနးမံၩ့အ့ၬ.- ယမိမၩအၪထၪ့ၥံၪ့အၥၪ,ဒဲဆၧ အၪထၪ့လၧဆံၬဖၧၩ့ ဘဲၫၥိၭနၥံၪထီးဘၪလၧၩ့ဆၧၥၭ ဝံလၩ့ဒိၩအဆၧဒုၪဒွ့ၪ လၧၦဆၨၩလဖၪအကျၩလဂ့ၩ",
			"31": "<sup>31</sup> လီၫ.- ထီးနီၪလဖၧၫ့နၥံၪမိနၪ့ထၪ့ထဲၩ့နၥံၪအဖၧၩ့ၥၭ အၧၩ့ဒၪနၥံၪဝ့ၫ, ဒဲနၥံၪမၩဆၧလၧအလဂ့ၩဘၪတၭ, န ၥံၪမိၥၭဂဲၫ့လၩ့နၥံၪအၥၭ လၧနၥံၪအမ့ၬယၫဒၪနၥံၪဝ့ၫ, လၧနၥံၪအဆၧဒဲၩဘၭအကၠီၩ့, ဒဲနၥံၪအဆၧၥၭလိၪအ",
			"32": "<sup>32</sup> ကၠီၩ့လီၫ.- ယမၩဆၧယီၩလၧနၥံၪအကၠီၩ့ဒၪနၥံၪဝ့ၫ မွဲအ့ၬးကဆါယဟိဝၩစံၭဝ့ၫဒၪ, ၥ့ၪယၫနၥံၪဝ့ၫဆံၭ. အီၪက့ၪမဲနၥံၪအမ့ၬတၭ,ဒဲၥၭဘံၪဘူၪလၧနၥံၪအဖၧၩ့",
			"33": "<sup>33</sup> ၥၭအကၠီၩ့ဆံၭ, အံၫစရ့လၭအၡၩဂံၪ့ဖိၪၥံၪဧ့.- ကဆါ ယဟိဝၩစံၭဘဲၫယီၩ, မုလနံၩလၧယၥူၫဝၭဆံၫ့နၥံၪအ ဆၧဒဲၩဘၭလၧနၥံၪအလီၩ့ထီးအလူၬနီၪ,ယမိဒုၭအီၪ ဆၧလၧဒိၩ့လဖၪအဖၧၩ့တၭ, ၦမိမၩထၪ့ထဲၩ့ဆၧအ",
			"34": "<sup>34</sup> လးလဖၪအီၪယူဝ့ၫလီၫ.- ၦမိထဲၫဂၪ့ခိၪလၧအအီၪယူ ဝ့ၫလီၫ. မွဲလါနၫ့အီၪလၩ့ထးအီၪယူဝ့ၫလၧကယဲၦလၧ",
			"35": "<sup>35</sup> အလဲးလီၩ့ဝ့ၫလဖၪအမ့ၬယၫထီးအလူၬလီၫ.- ထီးနီၪ လဖၧၫ့ၦၡၩၥံၪမိစံၭဝ့ၫ, ဂၪ့ခိၪယီၩလၧအအီၪလၩ့ထး အီၪယူဝ့ၫနီၪ,ကဲၪထၪ့ဝ့ၫ ဘဲၫအံဒံၫ့အကျိၭအၥိၭနီၪ,ဒဲ ဒိၩ့လဖၪလၧဆၧမၩလူၬထူၬဝ့ၫ, ဒဲအီၪယူဝ့ၫဒဲလၩ့ဎီး လဖၪနီၪ, အီၪလၧအခိၪဒၧၩ့တၭ,ၦအီၪဝ့ၫလၧအဖၧၩ့",
			"36": "<sup>36</sup> လီၫ.- ၦဆၨၩလဖၪလၧအအီၪလၩ့ထးဝၬဖီၩ့နၥံၪနီၪ, မိၥ့ၪယၫလၧယၧၩ, ယဟိဝၩယီၩ,ယမၩထၪ့ထဲၩ့ဆၧ လၧအလၩ့ဎီးယူၭ,ဒဲယၥုၪ့လၩ့ဖျၭလၩ့ဆၧလၧအအီၪ ယူဝ့ၫအဖၧၩ့လီၫ. ယၧၩ,ယဟိဝၩယချဲၩ့ယူၭတၭ, ယမိ",
			"37": "<sup>37</sup> မၩဆၧနီၪလီၫ.-ကဆါယဟိဝၩစံၭဘဲၫယီၩ,လါ နၫ့တၭ,ယမိဒိၭဆၧအၪ့ဎူၫအၪ့ဎၬအၪ့စိၭအၪ့စၪ့လၧ အံၫစရ့လၭအၡၩဂံၪ့ဖိၪ, ဘဲၫၥိၭယမိမၩဆၧနီၪလၧအ ဂးလီၫ. ယမိမၩအၪထၪ့အဝ့ၫၥံၪအၡၩ ဘဲၫၥိၪလဒီၪ့",
			"38": "<sup>38</sup> အၥိၭနီၪလီၫ. ဘဲၫၥိၪလဒီၪ့ဆံၫ့ဎံၪအၥိၭ,ဘဲၫယရုစ လံၫ့အၥိၪလဒီၪ့လၧအမၩ ဘိၪ့ဆၧအဆၧၫ့အထီအၥိၭ နီၪ, ဒိၩ့လဖၪအီၪယူဝ့ၫနီၪ မိဎွ့ၩလၧၦၡၩအဒီၪ့လဖၪ ဘဲၫနီၪၥိၭတၭ,မိၥ့ၪယၫဝ့ၫလၧယမွဲယဟိဝၩလီၫ."
		},
		"37": {
			"1": "<sup>1</sup> ယဟိဝၩအစူၪအီၪဝ့ၫ လၧယလီၩ့တၭ,ဆိၬထၪ့ယၧၩ လၧယဟိဝၩ အၥၭတၭ, အီၪက့ၪလၩ့ယၧၩ လၧခိၪ လီၩ့ဆူၭဖၧၩ့ လၧအဎွ့ၩဝ့ၫ လၧဆၧဎွံၪဆၧနၧၩ့လီၫ.",
			"2": "<sup>2</sup> တၭဒုၭလ့ၩဝံၩ့ဝၩ့ယၧၩတၭ, ယိခွါ, အီၪဝ့ၫအၪမၬလၧ ခိၪလီၩ့ဆူၭဖၧၩ့တၭ, ယိခွါ,ဎဲၫ့ထၬဝ့ၫနၭမၬလီၫ.",
			"3": "<sup>3</sup> တၭဆၧစံၭယၧၩ,ၦၡၩအဖိၪခွၫဧ့, ဆၧဎွံၪဆၧနၧၩ့ ယီၩမၧၫ့ထၪ့ဝ့ၫဘၪမိၥ့ၪဧၪ. တၭယစံၭ, ကဆါယဟိ",
			"4": "<sup>4</sup> ဝၩဧ့,နၥ့ၪယၫနဝ့ၫလီၫ.- တၭအဝ့ၫဒၪစံၭဒီၭယၧၩ, ချဲၩ့ဆၧလၧမီၪအချိၬ လၧဆၧဎွံၪဆၧနၧၩ့ယီၩအဖၫ့ခိၪ တၭစံၭအဝ့ၫၥံၪ, ဆၧဎွံၪဎဲၫ့ထၬၥံၪဧ့, ခိၭနၪယဟိဝၩ",
			"5": "<sup>5</sup> အလူဆံၭ.- ကဆါယဟိဝၩစံၭ, ဆၧဎွံၪဆၧနၧၩ့ယီၩ, ယိခွါ,ယမိဒုၭနုၬနၥံၪအၥၪလၧနၥံၪအဖၧၩ့တၭ, နၥံၪ",
			"6": "<sup>6</sup> မိမၧၫ့ထၪ့လီၫ.- ယမိအီၪက့ၪဆၧအထီၪ့လဖၪလၧန ၥံၪအလီၩ့တၭ, ယမိဒုၭထၪ့နၥံၪအလီၩ့ လၧဆၧယၪ တၭ,ယမိချႃၬဘံၭနၥံၪလၧဆၧဖံၭတၭ, ယမိဒုၭနုၬန ၥံၪအၥၪလၧနၥံၪအဖၧၩ့တၭ, နၥံၪမိမၧၫ့ထၪ့တၭ,နၥံၪ",
			"7": "<sup>7</sup> မိၥ့ၪယၫလၧယမွဲယဟိဝၩလီၫ.- ယချဲၩ့ဆၧလၧမီၪအ ချိၬဘဲၫဆၧမၪလူၬယၧၩအၥိၭနီၪတၭ, လၧယချဲၩ့ဆၧ လၧမီၪအချိၬအဘိၩ့ဘၭနီၪဆၧၥီၫထၪ့တၭ, ယိခွါ,ဆၧ ဝၭၡိၩ့ၡိၬအီၪဝ့ၫတၭ, ဆၧဎွံၪလဖၪနီၪၥုၭကီၪ့အၥၭလ",
			"8": "<sup>8</sup> ဘီၩ့ဒဲလဘီၩ့လီၫ.- ယယိဆၧတၭ,ယိခွါ,ထီးယယိနီၪ ဆၧအထီၪ့လဖၪအီၪဝ့ၫလၧအလီၩ့လီၫ. တၭဆၧယၪ ထၪ့လၧအလီၩ့တၭ, ချႃၬဘံၭဝ့ၫလၧအဖၫ့ခိၪလီၫ. မွဲ",
			"9": "<sup>9</sup> လါနၫ့အၥၪအီၪလၧအဖၧၩ့အ့ၬ.- ထီးနီၪလဖၧၫ့ယဟိ ဝၩစံၭယၧၩ, ချဲၩ့ဆၧလၧမီၪအချိၬ လၧဆၧအၥၪနီၪ, ချဲၩ့ဆၧလၧမီၪအချိၬဆံၭး ၦၡၩအဖိၪခွၫဧ့, စံၭဆၧအ ၥၪနီၪ,ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ဆၧအၥၪဧ့,ဂဲၫလၧ လံၩလံခီၫတၭ,ၥၪထၪ့လၧၦအဘၪ ဆၧမၩၥံၫဝ့ၫလဖၪ",
			"10": "<sup>10</sup> ယီၩအလီၩ့, ဘဲၫၥိၭအမိမၧၫ့ထၪ့ထဲၩ့နီၪဆံၭ.- ယချဲၩ့ ဆၧလၧမီၪအချိၬဘဲၫအမၪလူၬယၧၩအၥိၭတၭ, အၥၪ ဂဲၫနုၬလၧအဖၧၩ့တၭ, မၧၫ့ထၪ့ထဲၩ့ဝ့ၫတၭ,ဆၧၫ့ထုၪ့ဝ့ၫ လၧအခၪ့လၧၦခမျၧးဖၭဒိၪလီၫ.",
			"11": "<sup>11</sup> ထီးနီၪလဖၧၫ့အဝ့ၫဒၪစံၭယၧၩ, ၦၡၩအဖိၪခွၫဧ့, ဆၧအဎွံၪလဖၪယီၩ မွဲအံၫစရ့လၭအၡၩဂံၪ့ဖိၪထီးအ လူၬလီၫ. ယိခွါ,အဝ့ၫၥံၪစံၭဝ့ၫ,ပဎွံၪပနၧၩ့ဎဲၫ့ထၬခွံၬ ယူၭတၭ,ဆၧလၧၦယိလါအဖၧၩ့ၥၭနီၪ လၩ့မါယူၭ,",
			"12": "<sup>12</sup> ဆၧဒၪ့ထ့ၬယူၭပၧၩလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ချဲၩ့ ဆၧလၧမီၪအချိၬတၭ, စံၭအဝ့ၫၥံၪ, ကဆါယဟိဝၩ စံၭဘဲၫယီၩ,ယိခွါ,ယၡၩခမျၧးၥံၪဧ့, ယမိဝဲထၪ့နၥံၪအ ၥွၪခိၪဖၧၩ့တၭ, ဒုၭဂဲၫထၪ့နၥံၪလၧဆၧၥွၪခိၪဖၧၩ့, ဒဲ",
			"13": "<sup>13</sup> ဒုၭဂဲၫထဲၩ့နၥံၪလၧခးအံၫစရ့လၭအဖၧၩ့လီၫ.- ယၡၩ ခမျၧးၥံၪဧ့, ထီးယအ့ၪဝဲထၪ့နၥံၪအၥွၪခိၪဖၧၩ့, ဒဲဒုၭ ဂဲၫထၪ့နၥံၪ လၧနၥံၪအၥွၪခိၪဖၧၩ့တၭ, နၥံၪမိၥ့ၪယၫ",
			"14": "<sup>14</sup> လၧယမွဲယဟိဝၩလီၫ.- ထီးယအ့ၪဒုၭနုၬယၥၭလၧန ၥံၪအဖၧၩ့နီၪ, နၥံၪမိမၧၫ့ထၪ့တၭ, ယမိအီၪက့ၪနၥံၪ လၧနၥံၪအခးဒၪနၥံၪဝ့ၫအဖၧၩ့တၭ, ထီးနီၪလဖၧၫ့နၥံၪ မိၥ့ၪယၫလၧယၧၩ,ယဟိဝၩယီၩ, ယချဲၩ့ယူၭဆၧတၭ, မၩယူၭဆၧယူၭ,ယဟိဝၩစံၭဝ့ၫဒၪ.",
			"15": "<sup>15</sup> ယဟိဝၩအလူလၩ့ဘၪဒီၭယၧၩတၭ, စံၭဝ့ၫဒၪ,",
			"16": "<sup>16</sup> လၧနီၪအမ့ၬယၫနဝ့ၫဒၪယီၩ, ၦၡၩအဖိၪခွၫဧ့, မၩန့နိၪ ကဲၩ့လဘီၩ့တၭ, ကွ့ၭဆၧလၧအလီၩ့လၧယုဒၫအဂး ဒဲလၧအထံၩအၥိၭၥံၪ အံၫစရ့လၭဖိၪအဂးဆံၭ. ထီး နီၪလဖၧၫ့မၩန့နိၪကဲၩ့လဘီၩ့ဒၪတၭ, ကွ့ၭဆၧလၧအ လီၩ့လၧစယိၥၭအဂး, အံဖြံၫ့အနိၪကဲၩ့လဘီၩ့,ဒဲလၧ အထံၩအၥိၭအံၫစရ့လၭ အၡၩဂံၪ့ဖိၪထီးအလူၬအဂး",
			"17": "<sup>17</sup> ဆံၭ.- မၩဘုၭထၬလိၬအၥၭအထိၭနၫ လၧနိၪကဲၩ့လ ဘီၩ့ဎးဆံၭ. မိကဲၪထၪ့ဝ့ၫလဘီၩ့ဎးလၧနစူၪဖၧၩ့လီၫ.",
			"18": "<sup>18</sup> ထီးနၡၩခမျၧးအဖိၪၥံၪ အ့ၪချဲၩ့ဆၧလၧနၧၩတၭ, စံၭ,ဆၧနီၪလဖၪမွဲဘဲၫၥ့ၪလဲၪ, ဘဲၫၥ့ၪလဲၪနီၪ,နမိဒုၭနဲၪ",
			"19": "<sup>19</sup> ပၧၩအ့ၬဧၪ.- စံၭအဝ့ၫၥံၪ,ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ယိခွါ,ယမိမၩန့စယိၥၭ, ဒဲအထံၩအၥိၭ အံၫစရ့လၭ အဒီၪ့လဖၪအနိၪကဲၩ့လဘီၩ့ လၧအအီၪဝ့ၫလၧအံဖြံၫ့ အစူၪဖၧၩ့တၭ, ယမိမၩဘုၭထၬဝ့ၫလၧအဝ့ၫဒၪဒဲယုဒၫ အနိၪကဲၩ့လဘီၩ့တၭ, ယမိဒုၭဘုၭထၬဝ့ၫလၧနိၪကဲၩ့ လဘီၩ့ဎးတၭ, မိကဲၪထၪ့လဘီၩ့ဎး လၧယစူၪဖၧၩ့ လီၫ.",
			"20": "<sup>20</sup> နိၪကဲၩ့အဘီၩ့လဖၪ လၧနကွ့ၭဆၧလၧအလီၩ့နီၪ, မိဘၪအီၪဝ့ၫလၧနစူၪဖၧၩ့, လၧအဝ့ၫၥံၪအမ့ၬယၫလီၫ.",
			"21": "<sup>21</sup> စံၭအဝ့ၫၥံၪ,ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ယိခွါ,ယမိ မၩန့ၦအံၫစရ့လၭဖိၪၥံၪ လၧၦဆၨၩလဖၪအကျၩထီး ဒၪအလ့ၩဆၧလစီၪ့စီၪ့နီၪ, ယမိအၪ့ထုၫ့ကီၪ့ထဲၩ့အဝ့ၫ ၥံၪလၧအအီၪဝၬဖီၩ့ဝ့ၫ, ဒဲဒုၭဂဲၫထဲၩ့ဝ့ၫလၧအခးဒၪဝ့ၫ",
			"22": "<sup>22</sup> အဖၧၩ့လီၫ.- ယမိအီၪက့ၪအဝ့ၫၥံၪလၧၦလဆၨၩဎး, လၧထံၫၥံၪခးၥံၪအဖၧၩ့ လၧအံၫစရ့လၭအခိၪလီၩ့ထိၩ့ ချိၬအလီၩ့တၭ, စဎွၩလဂၩဎးမိကဲၪထၪ့အဝ့ၫၥံၪထီး အလူၬအစဎွၩတၭ,ကဲၪလၧၩ့ၦနံၫဆၨၩအ့ၬ. ဒဲမၩလၩ့ ဖၭလၧၩ့အဝ့ၫၥံၪ လၧဆၧအဘၩ့အမုးနံၫစီၪ့ဆ့အ့ၬ.",
			"23": "<sup>23</sup> အဝ့ၫၥံၪမိမၩဘၪၥၭလိၪလၧၩ့အၥၭ လၧအဆၧဂၩ့ဆၧ ဖၪ့ဒဲအဆၧဘၪၥၭလိၪ ဒဲအဆၧၥူၭဆၧမၪ နးမံၩ့အ့ၬ. အ့ၪမွဲယမိထိးထဲၩ့တၩ့ထဲၩ့အဝ့ၫၥံၪ လၧကယဲအအီၪ ဝ့ၫအလးဖၧၩ့လၧအမၩမၪဆၧနီၪတၭ, ယမိၥူၫဝၭဆံၫ့ ခွံၬအဝ့ၫၥံၪတၭ, အဝ့ၫၥံၪမိကဲၪထၪ့ယၡၩခမျၧးတၭ,",
			"24": "<sup>24</sup> ယမိကဲၪထၪ့အဝ့ၫၥံၪအယွၩလီၫ.- ယဎီးယၡၩစဒၫ ဝံၭမိကဲၪထၪ့စဎွၩလၧအဖၫ့ခိၪတၭ, အဝ့ၫၥံၪမိအီၪလၧ ၦၡၩယိၥိၪလဂၩဎးတၭ, မိလ့ၩဆၧလၧယဆၧစ့ၩရၫ့",
			"25": "<sup>25</sup> အဖၧၩ့,ဒဲထီးန့ယဆၧၥီၪ့ဆၧၥၫ့ဒဲမၩဝ့ၫလီၫ.- တၭအ ဝ့ၫၥံၪမိအီၪလၧထံၫၥံၪခးၥံၪအဖၧၩ့ လၧယဖ့ၪလၫ့ယ ဎီးယၡၩစယၫကူၭလၧနၥံၪအဖါအီၪဝ့ၫတၭ, မိအီၪဝ့ၫ လၧအဖၧၩ့, အဝ့ၫၥံၪဒဲအဖိၪခွၫလဖၪ, ဒဲအဖိၪခွၫအဖိၪ ခွၫလဖၪလၩ့ဆိၩလၩ့ကၠၪလီၫ. တၭယဎီးယၡၩစဒၫ",
			"26": "<sup>26</sup> ဝံၭမိကဲၪထၪ့အခိၪလၩ့ဆိၩလၩ့ကၠၪလီၫ- လၧနီၪအမ့ၬ ယၫယမိအုၩ့လၩ့ဆၧဘၪလိၬအိၭလိၬ အဆၧအုၩ့လၩ့ လၧအဝ့ၫၥံၪတၭ, မိကဲၪထၪ့ဆၧအုၩ့လၩ့အဆိၩအကၠၪ လၧအဝ့ၫၥံၪတၭ, ယမိၥိၫ့အဝ့ၫၥံၪဒဲမၩအၪထၪ့အဝ့ၫ ၥံၪ,ဒဲအီၪက့ၪယလးဆံၫ့ဎံၪ လၧအကျၩလၩ့ဆိၩလၩ့",
			"27": "<sup>27</sup> ကၠၪလီၫ- ယတဲၩဆံၫ့ဎံၪမိအီၪလၧအဝ့ၫၥံၪအၥိၭတၭ, ယမိကဲၪထဲၩ့အဝ့ၫၥံၪအယွၩ ဒဲအဝ့ၫၥံၪနီၪမိကဲၪထဲၩ့",
			"28": "<sup>28</sup> ယၡၩခမျၧးလီၫ.- ထီးယလးဆံၫ့ဎံၪအ့ၪအီၪဝ့ၫလၧ အကျၩလၩ့ဆိၩလၩ့ကၠၪတၭ, ၦဆၨၩလဖၪမိၥ့ၪယၫ ဝ့ၫလၧယၧၩ, ယဟိဝၩမၩဆံၫ့ထၪ့ ၦအံၫစရ့လၭဖိၪ လီၫ."
		},
		"38": {
			"1": "<sup>1</sup> ယဟိဝၩအလူလၩ့ဘၪယၧၩတၭ,စံၭဝ့ၫဒၪ,- ၦၡၩ အဖိၪခွၫဧ့,ဒိၭနမ့ၬထၫ့ဒၩဂီၭ, လၧခးမ့ဂီၭအဖၧၩ့, ရိ ၡၫ,မ့ၡ့ၭ,ဒဲတုဘလၭအၦဒိၪဖၭဒိၪ, ဒဲချဲၩ့ဆၧလၧမီၪ",
			"3": "<sup>3</sup> အချိၬထၫ့ဒၩအဝ့ၫဆံၭ.- စံၭ,ကဆါယဟိဝၩစံၭဘဲၫ ယီၩ,ယိခွါ,ယထၫ့ဒၩနၧၩ, ရိၡၫ, မ့ၡ့ၭ, ဒဲတုဘလၭ",
			"4": "<sup>4</sup> အၦဒိၪဖၭဒိၪဂီၭဧ့,- ယမိဘိၭကၠၪကဒၩထဲၩ့နၧၩတၭ, ယမိပုၭနိၪပုၭ လၧနခၪလၬဎွံၪဖၧၩ့တၭ, ယမိမီၩ့ထၪ့ နၧၩဒဲနၥုၭမုထီးအလူၬ, ကၥ့ၪဒဲၦထူၬကၥ့ၪလဖၪလီၫ. အဝ့ၫၥံၪကီၩ့ၥိၭဝ့ၫလၧ ဆၧအကီၩ့အၥိၭအဎံၫအလၩ ထီးအလူၬလီၫ. မွဲဆၧလဒီၪ့ဖၭဒိၪအီၪလၧထၩ့ဖံၭဖိၪ, ဒဲဆၧပဒၩ့ဖၭဒိၪ, အဝ့ၫၥံၪဖီၪ့ထၬနၭၥံၪဖၩ့ၥံၪထီးအ",
			"5": "<sup>5</sup> လူၬလီၫ.- ၦပၧၡၫဖိၪ, ကုၡၫ,ဒဲလံၭဘၠၫ အီၪဝ့ၫလၧ အၥိၭ,အဝ့ၫၥံၪထီးအလူၬအီၪဝ့ၫ လၧထၩ့ဖံၭဒဲခိၪလူၬ",
			"6": "<sup>6</sup> လီၫ.- ဂိမၧၫဒဲအၡၩၥုၭမုထီးအလူၬ, တိၫဂၫမၫ အၡၩဂံၪ့ဖိၪလၧမုဖၩလခီၫ, ဒဲအၥုၭမုခမျၧးထီးအလူၬ,",
			"7": "<sup>7</sup> ၦအၪဆၨၩအီၪဝ့ၫလၧအၥိၭလီၫ.- အီၪတဲၩ့ဝဲၩဆၧ လၧနဂးဒၪနဝ့ၫ,နဝ့ၫဒၪဒဲနၡၩလဒီၪ့ လၧအအီၪကိၩ့အီၪ ကီၪ့လၧနအီၪတၭ, ကဲၪထၪ့နဝ့ၫလၧအခိၪနီၪဆံၭ.",
			"8": "<sup>8</sup> လၧအၪနံၩအၪၥၫ့ ဖီၩ့ခွံၬတၭ, ဆၧမိအီၪက့ၪနၧၩ လၧအဖၫ့ခိၪလီၫ. လၧတဘျႃၭနံၪ့အလးခဲၫ့နီၪ, နမိဂဲၫ နုၬလၧခးလၧဆၧမၩန့ထဲၩ့ လၧနၭအစူၪဖၧၩ့, လၧဆၧ အၪ့ထုၫ့ကီၪ့လၧၦအၪဆၨၩအကျၩ လၧအံၫစရ့လၭ အခိၪလီၩ့ လၧအအီၪယူယူၭလထံၪဎးလီၫ. မွဲလါနၫ့ တၭ,ဆၧဒုၭဂဲၫထၪ့အဝ့ၫၥံၪ လၧၦဆၨၩလဖၪအကျၩ",
			"9": "<sup>9</sup> တၭ,မိအီၪဂုးခၧၫ့ထီးအလူၬလီၫ.- နမိထၪ့ဘဲၫလံၩလ ဖုၬအၥိၭတၭ, နမိဂဲၫထၪ့လုၬဘံၭထံၫၥံၪခးၥံၪ ဘဲၫဆၧ အုၪ့အၥိၭ, နဝ့ၫဒၪဒဲနၡၩၥုၭမုခမျၧး ထီးအလူၬတၭ,",
			"10": "<sup>10</sup> ၦအၪဆၨၩအီၪဝ့ၫလၧနၥိၭလီၫ.- ကဆါယဟိဝၩစံၭ ဘဲၫယီၩ,ဆၧမိမၩအၥၭလၧမုလနံၩ လၧဆၧမိဂဲၫထၪ့",
			"11": "<sup>11</sup> လၧနၥၭခံဖၧၩ့တၭ,နမိကိၪ့ထၪ့ဆၧကိၪ့အၧၩ့,- နမိစံၭ, ယမိလ့ၩထၪ့လၧတဝၫ့ လၧအခိၪဒၧၩ့လအီၪဘၪအခး လဘံၪ့, ယမိလ့ၩလၧၦလၧအအီၪဒၪဆၧဘဲၫနီၪတၭ, လၧအအီၪအလးလၧအလၥၭမဲၪဘၪဆၧ, ၦထီးအလူၬ လၧအအီၪလၧခိၪဒၧၩ့လအီၪဘၪ, နိၪဘီၩ့မွဲဂ့ၩ,တရၫ့",
			"12": "<sup>12</sup> မွဲဂ့ၩအီၪဆ့အ့ၬ.- ဘဲၫၥိၭယမိအၪ့ဂူၬန့ဆီၪ့ဆၧ, ဒဲ အၪ့ဂူၬန့ဆၧး ဘဲၫၥိၭနမိအီၪက့ၪနစူၪလၧဆၧအီၪယူဝ့ၫ အလးအဖၫ့ခိၪလၧၦအီၪဝ့ၫလၧအဖၧၩ့, ဒဲလၧၦခမျၧး အလီၩ့ လၧဆၧအၪ့ထုၫ့ကီၪ့အဝ့ၫၥံၪ လၧၦဆၨၩအ ကျၩလၧအအီၪဝ့ၫလၧဆၧဖိၪဆၧဎါအဒိၩ့, ဒဲဆၧဖိၪ",
			"13": "<sup>13</sup> ဆၧလံၩလၧအအီၪလၧဂၪ့ခိၪအၥၭကျၩလီၫ.- ၡံဘၫ, ဒဲဒံဒၫ့,ဒဲတၫၡ့ၭအၡၩဖနံၬဖိၪ, ဒဲဆၬလၥၧၫ့အၥၭဘၪ့ ထီးအလူၬနီၪ,မိစံၭနၧၩ, မွဲနဂဲၫအၪ့ဂူၬန့ဆီၪ့ဆၧနီၪဆ့ ဧၪ.မွဲနဒုၭအီၪကီၪ့နၡၩလဒီၪ့ ဘဲၫၥိၭနမိအၪ့ဂူၬန့ဆၧ ဆ့ဧၪ.ဘဲၫၥိၭနမိဆိၬထၪ့ခွံၬ အကျိၪၥံၪစ့ၩၥံၪဒဲ ဒဲထီၫ့ ၥံၪလွ့ၫၥံၪ,ဘဲၫၥိၭနမိမၩန့ထၪ့ခွံၬ ဆၧဖိၪဆၧဎါအဒိၩ့ ဒဲဆၧဖိၪဆၧလံၩ ဘဲၫၥိၭနမိအၪ့ဂူၬန့ဆီၪ့ဆၧဖၭဒိၪဆ့ ဧၪ.",
			"14": "<sup>14</sup> မၩအၥၭဘဲၫနီၪတၭ,ၦၡၩအဖိၪခွၫဧ့, ချဲၩ့ဆၧလၧ မီၪအချိၬတၭ,စံၭလၧဂီၭနီၪး ကဆါယဟိဝၩစံၭဘဲၫ ယီၩ,မုလနံၩလၧယၡၩခမျၧးအီၪခၧၫ့နီၪ, မွဲနမိၥ့ၪယၫ",
			"15": "<sup>15</sup> အ့ၬဧၪ.- နမိဂဲၫလၩ့လၧနလးလၧမုဖၩလခီၫ, နဝ့ၫဒၪ, ဒဲၦအၪဆၨၩအီၪလၧနၥိၭ, အဝ့ၫၥံၪထီးအလူၬထူၬက",
			"16": "<sup>16</sup> ၥ့ၪ,ဒဲၦလဒီၪ့ဖၭဒိၪ, ဒဲၦၥုၭမုခမျၧးဖၭဒိၪဆ့လီၫ.- နမိ လ့ၩထၫ့ဒၩယၡၩခမျၧးအံၫစရ့လၭ ဘဲၫၥိၭနမိလုၬဘံၭ ထံၫၥံၪခးၥံၪဘဲၫဆၧအုၪ့အၥိၭနီၪလီၫ. ဆၧမိမၩအၥၭ လၧမုနံၩလၧအထုၬလဖၪနီၪ, ယမိဒုၭဂဲၫထၪ့နၧၩထၫ့ ဒၩယထံၫယခး ဘဲၫၥိၭထီးဆၧအီၪက့ၪဆံၫ့ဎံၪယၧၩ လၧနကၠီၩ့ လၧအဝ့ၫၥံၪအမ့ၬယၫတၭ, ၦဆၨၩလဖၪ",
			"17": "<sup>17</sup> မိၥ့ၪယၫယၧၩလီၫး ဂီၭဧ့,- ကဆါယဟိဝၩ စံၭဘဲၫ ယီၩ,နမွဲၦလဂၩလၧယချဲၩ့ဆၧ လၧအဂဲးလၧယဎီးယ ၡၩအံၫစရ့လၭ အမီၪလဖၪအစူၪဖၧၩ့ လၧအချဲၩ့ဆၧ လၧမီၪအချိၬလၧနံၪ့လဖၪ အမုနံၩလဖၪအကျၩလၧယ မိဒုၭဂဲၫနၧၩထၫ့ဒၩအဝ့ၫၥံၪလီၫ.",
			"18": "<sup>18</sup> လၧမုလနံၩဎးလၧဂီၭမိဂဲၫထၫ့ဒၩ ခးအံၫစရ့လၭနီၪ, ဆၧမိမၩအၥၭ လၧယၥၭခဲၩထၪ့မိထၪ့ဝ့ၫ, ကဆါယ",
			"19": "<sup>19</sup> ဟိဝၩစံၭဝ့ၫဒၪ.- အဂဲးဘဲၫယီၩယချဲၩ့ယူၭဆၧလၧယ ၥၭကဲၪ့,ဒဲယၥၭခဲၩထၪ့အမ့ၪနီၪလီၫ. မွဲမၬလၧမုလနံၩ နီၪ,ဆၧဝၭၡိၩ့ၡိၬဖၭဒိၪမိအီၪဝ့ၫ လၧခးအံၫစရ့လၭအ",
			"20": "<sup>20</sup> ဖၧၩ့လီၫ.- ဒ့ၪၥံၪယၪၥံၪလၧမၫဆမံၭဖၧၩ့, ဒဲထိၪၥံၪလံၪ ၥံၪလၧဆၧဖိၭဖၫ့, ဒဲဆၧဖိၪဆၧဎါလၧမံၩ့လၬကျၩ, ဒဲ ဆၧစွၩလၧအစွၩလၧဂၪ့ခိၪချိၫ့ကိၭမံၩ့ဒ့ၭ, ဒဲကယဲၦၡၩ လၧအအီၪဝ့ၫလၧဂၪ့ခိၪချိၫ့ထီးအလူၬနီၪ, မိဝၭထိၬ လၧယမ့ၬယၫတၭ, ဆၧမိခွံၬလၩ့ခွံၬခိၪလီၩ့ထိၩ့ချိၬ ဒဲ ဆၧလၩ့ဘျဲၩ့မိလၩ့ဎီး, ဒဲဆၧအဒီၪ့ထီးအလူၬ မိလၩ့",
			"21": "<sup>21</sup> ဎီးလၧဂၪ့ခိၪအဖၫ့ခိၪလီၫ.- ယမိကိၭန့နၭလဘံၪ့ထၫ့ ဒၩအဝ့ၫလၧယခိၪလီၩ့ ထီးအလူၬအကျၩ,ကဆါယ ဟိဝၩစံၭဝ့ၫဒၪး ၦလဂၩဘၪလဂၩ အနၭမိအီၪလၧအ",
			"22": "<sup>22</sup> ထၧၫ့ဖုဝဲအလီၩ့ဆုၬဆုၬလီၫ.- ယမိစ့ၩရၫ့ထၫ့ဒုၪဒၩ အဝ့ၫလၧဆၧၥံၫချဲၫ့,ဒဲဆၧၥွံၪး ယမိဒုၭဂဲၫဆၧၩ့လၩ့ဆၧ လၧအလီၩ့လၧမုၥၪဖၭဒိၪ, ဒဲမ့ၪ,ဒဲကး, ဒဲလၧအၡၩ ခမျၧးအလီၩ့, ဒဲလၧၦအၪဆၨၩလၧအအီၪလၧအၥိၭ",
			"23": "<sup>23</sup> အလီၩ့လီၫ.- ယမိအီၪက့ၪဒိၪယၥၭ ဒဲအီၪက့ၪဆံၫ့ ဎံၪယၥၭ,ယမိဘၪဆၧၥ့ၪယၫယၧၩ လၧၦအၪဆၨၩအ မ့ၬယၫတၭ, အဝ့ၫၥံၪမိၥ့ၪယၫဝ့ၫ လၧယမွဲယဟိဝၩ လီၫ."
		},
		"39": {
			"1": "<sup>1</sup> မၩအၥၭဘဲၫနီၪတၭ, နဝ့ၫဒၪၦၡၩအဖိၪခွၫဧ့, ချဲၩ့ ဆၧလၧမီၪအချိၬထၫ့ဒၩဂီၭနီၪတၭ,စံၭ, ကဆါယဟိဝၩ စံၭဘဲၫယီၩ, ယိခွါ, ယထၫ့ဒၩနၧၩ,ဂီၭဧ့း ရိၡၫ, မ့ၡ့ၭ,",
			"2": "<sup>2</sup> ဒဲတုဘလၭအၦဒိၪဖၭဒိၪဧ့,- ယမိမီၩ့ထဲၩ့နၧၩတၭ, ယမိၥိၫ့ဝံၩ့ဝၩ့နၧၩတၭ, ယမိဒုၭဂဲၫထၪ့နၧၩ လၧမုဖၩ လခီၫတၭ,ယမိဒုၭထၪ့နၧၩ လၧအံၫစရ့လၭအခိၪလီၩ့",
			"3": "<sup>3</sup> ထိၩ့ချိၬလီၫ.- ယမိကျီၪ့ခွံၬနချံၪလၧနစူၪစ့ၪဖၧၩ့တၭ,",
			"4": "<sup>4</sup> ယမိဒုၭလၩ့ထ့ၬဖျါၥံၪလၧနစူၪထွ့ၪလီၫ.- နမိလၩ့ထံၩ ဖါလၧအံၫစရ့လၭအခိၪလီၩ့, နဝ့ၫဒၪဒဲနၡၩၥုၭမုခမျၧး လဖၪ,ဒဲၦဆၨၩလဖၪ လၧအအီၪလၧနၥိၭတၭ,ယမိ ဖ့ၪလၫ့ခွံၬနၧၩ လၧထိၪၥံၪအၪ့ဂူၬအၪ့ဆီၪ့ ဆၧလမံၩ့ လါလါဒဲလၧဆၧဖိၪဆၧဎါ လၧဆၧပျၩ့ဖၧၩ့ဘဲၫၥိၭအမိ",
			"5": "<sup>5</sup> အၪ့ခွံၬနၧၩလီၫ.- နမိလၩ့ထံၩဖါလၧဆၧပျၩ့ဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩယချဲၩ့ယူၭဆၧယူၭ, ကဆါယဟိဝၩစံၭ",
			"6": "<sup>6</sup> ဝ့ၫဒၪ.- ယမိအၪ့မၧၫ့လၩ့မ့ၪလၧမ့ဂီၭအဖၧၩ့, ဒဲလၧၦ အီၪလၧအလးလထီးလၩ့ဘၪအၥၭ လၧကျိၩ့လဖၪအ ဖၧၩ့တၭ,အဝ့ၫၥံၪမိၥ့ၪယၫဝ့ၫ လၧယမွဲယဟိဝၩလီၫ.",
			"7": "<sup>7</sup> ယမိဒုၭၥ့ၪယၫဆၧလၧယမံၩ့ဆံၫ့ဎံၪ လၧယၡၩခမျၧး အံၫစရ့လၭအကျၩတၭ, ယလဒုၭမၩအၧၩ့လၧၩ့ဘၪ ယမံၩ့ဆံၫ့ဎံၪတၭ, ၦဆၨၩလဖၪမိၥ့ၪယၫဝ့ၫလၧယမွဲ ယဟိဝၩဆၧဆံၫ့ဎံၪလဂၩ လၧအံၫစရ့လၭအ ကျၩလီၫ.",
			"8": "<sup>8</sup> ယိခွါ,ဆၧဂဲၫဝ့ၫတၭ, မၩယူၭအၥၭယူၭ, ကဆါယ ဟိဝၩစံၭဝ့ၫဒၪ, အယီၩမွဲမုလနံၩ လၧယချဲၩ့ဆၧလၧ",
			"9": "<sup>9</sup> အဂဲးနီၪလီၫ.- ထီးနီၪလဖၧၫ့ၦလၧအအီၪလၧအံၫစရ့ လၭအဒိၩ့လဖၪအဖၧၩ့နီၪ,မိစဲၪ့ထၪ့တၭ,မိဆူၭခဲၩထၪ့ မ့ၪတၭ,မိဆူၭခဲၩထၪ့ခွံၬအစူၪဝဲၩၥံၪ, ဆၧထၩ့ဖံၭလ ဖၪဒဲဆၧပဒၩ့ဖိၪလဖၪ, ဒဲချံၪဒဲဖျါ, ဒဲစူၪအနိၪထိၭဘီၩ့ ဒဲဖၩ့လဖၪတၭ, မိဆူၭထၪ့ခွံၬဝ့ၫ လၧမ့ၪနွ့ၫနံၪ့လီၫ.",
			"10": "<sup>10</sup> တၭအဝ့ၫၥံၪမၩန့ၥံၪ့မုလၧမံၩ့လၬကျၩအ့ၬ. ဒဲခူၬလၩ့ ခွံၬဆၧလၧၥံၪ့လဖၪအကျၩနးမံၩ့အ့ၬ. အဂဲးဘဲၫယီၩ မိဆူၭထၪ့ခွံၬဆၧအစူၪဝဲၩလၧမ့ၪတၭ, မိမၩန့ဆီၪ့ၦလၧ အမၩန့ဆီၪ့အဝ့ၫၥံၪ, ဒဲမိအၪ့ဂူၬန့ဆီၪ့ၦအဆၧလၧအ အၪ့ဂူၬန့ဆီၪ့အဝ့ၫၥံၪအဆၧ ဒဲမိအၪ့ဂူၬန့ၦအဆၧလၧ အအၪ့ဂူၬန့ဆၧ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"11": "<sup>11</sup> ဆၧမိမၩအၥၭလၧမုလနံၩနီၪ လၧယဖ့ၪလၫ့ဂီၭလၧ အၥွၪခိၪအလးထီးနီၪ, လၧအံၫစရ့လၭအဖၧၩ့လၧခိၪ လီၩ့ဆူၭ,ၦခၫ့ဂၬဆၧလၧမၫဆမံၭ လၧမုထၪ့လခီၫ တၭ,မိမၩဘံၭၦခၫ့ဂၬ ဆၧအဖၧၩ့ၥၭလီၫ. မိခုၪ့လၩ့ ဘၧၩ့ခွံၬဂီၭဒဲအၡၩခမျၧး ထီးအလူၬ ထီးနီၪတၭ, မိ",
			"12": "<sup>12</sup> ကိၭအမံၩ့လၧခိၪလီၩ့ဆူၭဂီၭအၡၩခမျၧးလီၫ.- ၦအံၫ စရ့လၭအၡၩဂံၪ့ဖိၪ မိခုၪ့လၩ့ဘၧၩ့ခွံၬအဝ့ၫၥံၪလၩနွ့ၫ ဘံၪ့အထးဖၧၩ့ ဘဲၫၥိၭအမိမၩဆံၫ့ ထံၫၥံၪခးၥံၪနီၪ",
			"13": "<sup>13</sup> လီၫ.- တၭၦခးဖိၪထီးအလူၬ မိခုၪ့လၩ့ဘၧၩ့ခွံၬအဝ့ၫ ၥံၪတၭ,မိကဲၪထၪ့ဆၧအမံၩ့လၧအဂး, လၧမုလနံၩလၧ ဆၧမိအီၪက့ၪလၩဖၩ့ယၧၩ ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"14": "<sup>14</sup> အဝ့ၫၥံၪမိရွံန့ၦၡၩလဖၪ လၧအမၩဆၧမၩနီၪလထံၪ ဎးတၭ,အဝ့ၫၥံၪနီၪ ဒဲၦလၧအလ့ၩဖီၩ့ခွံၬလဖၪ မိခုၪ့ လၩ့ဘၧၩ့ခွံၬၦလၧအအီၪလၩ့ထးလၧဂၪ့ခိၪချိၫ့ ဘဲၫၥိၭ အမိမၩဆံၫ့ခွံၬဝ့ၫလီၫ. လၩနွ့ၫဘံၪ့အလးခဲၫ့နီၪ ဆၧ",
			"15": "<sup>15</sup> မိအၪ့ဎၬဆၧလီၫ.- ၦလ့ၩဆၧလဖၪထီးအခၫ့ဂၬထံၫ ၥံၪခးၥံၪနီၪတၭ, အ့ၪဒၪဘၪၦၡၩအဎွံၪတၭ, မိဘၪမၩ နဲၪ့ဆၧလၧအနဲၩ့ထံၭ, ထီးၦခုၪ့လၩ့ဘၧၩ့ခွံၬ ဆၧၥံၪ မိခုၪ့လၩ့ခွံၬဝ့ၫလၧခိၪလီၩ့ဆူၭဂီၭ အၡၩခမျၧးအဖၧၩ့",
			"16": "<sup>16</sup> လီၫ.- ဒိၩ့အမံၩ့မိမွဲဆ့ဟၫမိနၫတၭ,အဝ့ၫၥံၪမိမၩဆံၫ့ ထံၫၥံၪခးၥံၪလီၫ.",
			"17": "<sup>17</sup> နဝ့ၫဒၪၦၡၩအဖိၪခွၫဧ့, ကဆါယဟိဝၩစံၭဘဲၫယီၩ, စံၭကယဲထိၪၥံၪလံၪၥံၪလမံၩ့လါလါ, ဒဲကယဲဆၧဖိၪ ဆၧဎါလၧမံၩ့လၬကျၩလမံၩ့လါလါနီၪ, အီၪကိၩ့အီၪ ကီၪ့,ဒဲဂဲၫအီၪကိၩ့အီၪကီၪ့ကိၭခီၫဒ့ၭ လၧယဆၧလုအ အီၪလၧယလုထၪ့ဆၧလၧနၥံၪအဂး, ဆၧလုဖၭဒိၪလၧ အံၫစရ့လၭအခိၪလီၩ့အလီၩ့ဆံၭ. နၥံၪမိအၪ့ဆၧယၪ",
			"18": "<sup>18</sup> ဒဲအီၩဆၧၥွံၪလီၫ.- နၥံၪမိအၪ့ၦအဆီၪ့အယၪ, ဒဲနၥံၪ မိအီၩဂၪ့ခိၪအၦဒိၪဖၭဒိၪအၥွံၪ, ၥိၪဖၫ, ၥိၪဖိၪ, ဒဲဘ့ၪ,",
			"19": "<sup>19</sup> ချီၥံၪအၥွံၪ,ဘၫၡၫ့အဆၧဘီၪ့ထီးအလူၬလီၫ.- နၥံၪမိ အၪ့ဆၧၥိၪထီးနၥံၪအၪ့ကုၭအီၩဎွ့ၩ ဒဲအီၩဆၧၥွံၪထီး နၥံၪအီၩမၧၩ့နၥံၪအၥၭ, မွဲအဘၪဆဲၫ့လၧယဆၧလုလၧ",
			"20": "<sup>20</sup> ယလုထၪ့လၧနၥံၪအဂးလီၫ.- နၥံၪမိအၪ့ဘျဲၩအၪ့လၧ ယစပွဲခိၪဒဲကၥ့ၪ,ဒဲၦထူၬကၥ့ၪ,ဒဲၦအဆီၪ့, ဒဲၦၥုၭဖိၪ ထီးအလူၬ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"21": "<sup>21</sup> ယမိအီၪက့ၪ လၩ့ယလၩယဖၩ့လၧၦဆၨၩလဖၪ အကျၩတၭ, ၦကိၭဆၨၩဒ့ၭမိဒၪဘၪယဆၧစ့ၩရၫ့ လၧယမၩအဝ့ၫၥံၪလၧ ယစူၪလၧယအီၪက့ၪ လၧအ",
			"22": "<sup>22</sup> ဖၫ့ခိၪလီၫ.- တၭလၧမုလနံၩနီၪစူၩယၫလခီၫ ၦအံၫ စရ့လၭအၡၩဂံၪ့ဖိၪမိၥ့ၪယၫ လၧယမွဲယဟိဝၩနၥံၪ အယွၩလီၫ.",
			"23": "<sup>23</sup> ၦဆၨၩလဖၪမိၥ့ၪယၫ လၧအံၫစရ့လၭအၡၩဂံၪ့ဖိၪ လ့ၩကဲၪဎီးလၧအဆၧဒဲၩဘၭအကၠီၩ့လီၫ. အဂဲးဘဲၫ ယီၩအဝ့ၫၥံၪမၩမၪဘၪယၧၩတၭ, ယအီၪက့ၪၥူၪခွံၬ ယမ့ၬလၧအဝ့ၫၥံၪတၭ, ယဖ့ၪလၫ့ခွံၬယူၭအဝ့ၫၥံၪလၧ အဒုၪအဒၩအစူၪဖၧၩ့တၭ, လၩ့ထံၩဖါဝ့ၫလၧနၭၥံၪဖၩ့",
			"24": "<sup>24</sup> ၥံၪလီၫ.- ဘဲၫအဆၧလဆံၫ့ဘၪအၥိၭ,ဒဲဘဲၫအဆၧမၪ လဖၪအၥိၭနီၪ, ယမၩအဝ့ၫၥံၪ,ဒဲအီၪက့ၪၥူၪခွံၬယမ့ၬ",
			"25": "<sup>25</sup> လၧအဝ့ၫၥံၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ကဆါယဟိ ဝၩစံၭဘဲၫယီၩ,ယမိဒုၭဂဲၫထဲၩ့ စယၫကူၭအၡၩလ့ၩ ကဲၪဎီးတၭ,ယမိယၫ့ၥၭအံၫစရ့လၭအၡၩဂံၪ့ဖိၪ ထီး အလူၬတၭ, ယမိၥၭကဲၪ့ဆၧလၧယမံၩ့ဆံၫ့ဎံၪအဂး",
			"26": "<sup>26</sup> လီၫ.- ထီးအဝ့ၫၥံၪအ့ၪထိးဘၪယူၭဆၧမ့ၬမဲ ,ဒဲအ ဆၧမၪလဖၪလၧအမၩမၪဘၪယၧၩတၭ, ထီးအအီၪ ခၧၫ့လၧအခးဖၧၩ့နီၪ,ဆၧလမၩၥၭမဲၪဘၪ အဝ့ၫၥံၪ",
			"27": "<sup>27</sup> လီၫ.- ထီးယအ့ၪဒုၭဂဲၫထဲၩ့အဝ့ၫၥံၪ လၧၦဆၨၩလဖၪ အကျၩ,ဒဲအၪ့ထုၫ့ကီၪ့ထဲၩ့အဝ့ၫၥံၪ လၧအဒုၪအဒၩ အခးဖၧၩ့တၭ, ဒဲယဘၪဆၧအီၪက့ၪဆံၫ့ဎံၪယၧၩလၧ",
			"28": "<sup>28</sup> အကၠီၩ့လၧၦအၪဆၨၩအမ့ၬယၫတၭ,- ထီးနီၪလဖၧၫ့ အဝ့ၫၥံၪမိၥ့ၪယၫဝ့ၫ လၧယမွဲယဟိဝၩအဝ့ၫၥံၪအယွၩ လၧဆၧအၪ့မၧၫ့ဎီးအဝ့ၫၥံၪ လၧၦဆၨၩလဖၪအကျၩ, အ့ၪမွဲယအၪ့ထုၫ့ကီၪ့ထဲၩ့အဝ့ၫၥံၪ လၧအခးဒၪဝ့ၫအ",
			"29": "<sup>29</sup> ဖၧၩ့တၭ,ယစဲၪ့ဒၪလၧၩ့အဝ့ၫၥံၪနးဆိၭအ့ၬ.- ယမိအီၪ က့ၪၥူၪလၧၩ့ယမ့ၬ လၧအဝ့ၫၥံၪအ့ၬ. အဂဲးဘဲၫယီၩ, ယဂါလၩ့ယူၭယၥၭ လၧအံၫစရ့လၭအၡၩဂံၪ့ဖိၪအ လီၩ့ယူၭ. ကဆါယဟိဝၩစံၭဝ့ၫဒၪ."
		},
		"40": {
			"1": "<sup>1</sup> ပကဲၪဎီးအနံၪ့နံၫဆံၫယဲနံၪ့လနံၪ့ လၩခၪ့ထံၭ, လၩ ထၪ့ဆံၫနံၩလနံၩ လၧဒိၩ့ဘၪဆၧမၩဂၭဂီၩ့လူၬထူၬဝ့ၫ အလးခဲၫ့လဆံၫလံနံၪ့လနံၪ့ လၧမုလနံၩနီၪ,ယဟိဝၩ အစူၪအီၪဝ့ၫလၧယလီၩ့တၭ, ဆိၬထၪ့ခွံၬယၧၩလၧနီၪ",
			"2": "<sup>2</sup> လီၫ.-လၧဆၧဒၪဆၧလၧယၫလခီၫ ဘၪဆဲၫ့လၧယဟိ ဝၩနီၪ, ဆၧဆိၬထၪ့ယၧၩ လၧခးအံၫစရ့လၭအဖၧၩ့ တၭ,အီၪက့ၪယၧၩလၧခိၪလီၩ့ ထီၫလ့ၬလဖျိၪ့အလီၩ့ တၭ,ဆၧမၩအၥၭဘဲၫဒိၩ့အခံးအဂၩ့ လၧမုခံၫ့လခီၫ",
			"3": "<sup>3</sup> လီၫ.- ထီးအဆိၬထၪ့ယၧၩလၧနီၪတၭ, ယိခွါ,ၦၡၩ အီၪဖျီၪဘဲၫထီးဘၩ့အၥိၭ အီၪဝ့ၫလၧဖျံၩၥီၪကဘၩ့ လဘီၩ့လၧအစူၪဖၧၩ့, ဒဲအီၪဝ့ၫလၧနိၪထိၪဖီးဘီၩ့တၭ,",
			"4": "<sup>4</sup> ဆၧၫ့ထုၪ့လၧတရၫ့အဖၧၩ့လီၫ.- ၦၡၩလဂၩနီၪ စံၭ ယၧၩ,ၦၡၩအဖိၪခွၫဧ့, ယိဆၧလၧနမ့ၬၥၪလဖၪ,ဒဲခိၭ နၪဆၧလၧနနါ, ဒဲထီးန့လၧနၥၭလၧကယဲဆၧလၧယမိ ဒုၭနဲၪနၧၩနီၪဆံၭ. အဂဲးဘဲၫယီၩ ဆၧဂဲၫဆိၬနၧၩ ထီး ယီၩဘဲၫၥိၭယမိဒုၭနဲၪဆၧလဖၪနီၪလၧနၧၩလီၫ. ကယဲ ဆၧလၧနဒၪဘၪနီၪဒုၭနဲၪ အံၫစရ့လၭအၡၩဂံၪ့ဖိၪနီၪ ထီးအလူၬဆံၭ.",
			"5": "<sup>5</sup> ယိခွါ, ဆၧအဒီၪ့အီၪဝၬဖီၩ့ဂံၪ့လၧခီၫ့, ဒဲလၧၦ လဂၩနီၪအစူၪဖၧၩ့, နိၪထိၪဖီးဘီၩ့လၧအထီၫဎူၫဖျါ (လဖျါနီၪမွဲလဖျါဒဲလထၫ) အီၪဝ့ၫလီၫ. အဝ့ၫဒၪထိၪဂံၪ့ အဒၪ့ဎၩ့လဆိၩ ဒဲအဆီၩ့ဆီထၪ့လဆိၩလီၫ.",
			"6": "<sup>6</sup> ထီးနီၪလဖၧၫ့ ဂဲၫဝ့ၫလၧတရၫ့ လၧအဖိးလၧမုထၪ့ လခီၫတၭ, ထိၪဝ့ၫအဎၫ့, ဒဲထိၪအတရၫ့အခၧၪ့, လၧ အဒၪ့ဎၩ့မွဲလဆိၩ,ဒဲတရၫ့အခၧၪ့လၧအဂူၫဂၩမွဲလဆိၩ",
			"7": "<sup>7</sup> လီၫ.- ကယဲဒူၭဖိၪလစီၪ့လါလါနီၪ အထီၫမွဲလဆိၩ, ဒဲအဒၪ့ဎၩ့မွဲလဆိၩတၭ, လၧဒူၭဖိၪလဖၪအဘိၩ့ဆၧၩ့ နီၪမွဲယဲဖျါတၭ, တရၫ့အခၧၪ့လၧတရၫ့အထိၬချိၫ့လၧ",
			"8": "<sup>8</sup> ယၫလဆိၩလီၫ.- ထိၪတရၫ့အထိၬချိၫ့လၧယၫလဆိၩ",
			"9": "<sup>9</sup> လီၫ.- ထိၪတရၫ့လၧအထိၬချိၫ့ဎိၭဖျါ, ဒဲဆၧအဒီၪ့အ ထုၪ့လဖၪနံၫဖျါ, ဒဲတရၫ့အထိၬချိၫ့ လၧအဖၧၩ့လခီၫ",
			"10": "<sup>10</sup> လီၫ.-ဒူၭဖိၪဘၪဆဲၫ့လၧတရၫ့ လၧမုထၪ့လခီၫနီၪမွဲၥၧၫ့ ဒူၭလၧအယီၩလခီၫ, ဒဲၥၧၫ့ဒူၭလၧအနီၪလခီၫလီၫ. အ ဝ့ၫၥၧၫ့ဒူၭနီၪထီၫဎီၩ့လိၬအၥၭ, ဆၧအဒီၪ့အထုၪ့လဖၪ လၧအယီၩလခီၫ, ဒဲလၧအနီၪလခီၫ ထီၫဎီၩ့လိၬအၥၭလီၫ.-",
			"11": "<sup>11</sup> ထိၪဆၧလ့ၩနုၬလၧတရၫ့အဒၪ့ဎၩ့အဖျါလဆံၫး ဒဲလၧအဖၭထီၫလခီၫမွဲလဆံၫၥၧၫ့ဖျါလီၫ.-",
			"12": "<sup>12</sup> ဆၧအဘိၩ့ ဆၧၩ့လၧဒူၭဖိၪအမ့ၬယၫနီၪမွဲလဖျါ ဒဲဆၧအနဲၩ့ထံၭ လၧအဝ့ၫလခီၫနီၪမွဲလဖျါဒဲဒူၭဖိၪနီၪ, မွဲဎူၫဖျါလၧအယီၩလခီၫ, ဒဲဎူၫဖျါလၧအနီၪလခီၫလီၫ.-",
			"13": "<sup>13</sup> ထိၪတရၫ့ လၧဒူၭဖိၪအခိၪလဒူၭဖိးလၧ အခိၪလဒူၭဒၪလီၫ. အဒၪ့ ဎၩ့ မွဲနံၫဆံၫယဲဖျါတၭ, တရၫ့ၥံၪဎၩ့လိၬအၥၭလီၫ.",
			"14": "<sup>14</sup> မၩအထုၪ့လဖၪလၧအဖျါဎူၫဆံၫဖိးလၧဆၧအဝၩ့အီၪ ဝၬဖီၩ့တရၫ့နီၪအထုၪ့လီၫ.",
			"15": "<sup>15</sup> လၧဆၧလ့ၩနုၬ အတရၫ့ အမ့ၬယၫဖိးလၧတရၫ့လၧအဖၧၩ့လခီၫအထိၬချိၫ့လၧအမ့ၬယၫအီၪဝ့ၫအဖျါယဲဆံၫလီၫ.-",
			"16": "<sup>16</sup> တရၫ့လံၩအအံၪ့ အီၪဝ့ၫလၧဒူၭဖိၪအဖၧၩ့, ဒဲလၧဆၧအဒီၪ့အထုၪ့လၧ အဖၧၩ့လခီၫထီးတရၫ့ဝၬဖီၩ့ဝ့ၫ, ဒဲထိၬချိၫ့ၥံၪဆ့လီၫ. တရၫ့လံၩအအံၪ့အီၪဝ့ၫ လၧအဖၧၩ့လခီၫဝၬဖီၩ့ဝ့ၫ, ဒဲ ၥံၪ့စီၩ့မလီၫ့အီၪဝ့ၫလၧဆၧအဒီၪ့အထုၪ့အလီၩ့လီၫ.",
			"17": "<sup>17</sup> တၭဆၧဂဲၫဆိၬယၧၩ လၧဆၧအဒူၭ လၧခီၫ့လခီၫတၭ, ယိခွါ,ဆၧအဒူၭဖိၪလဖၪ, ဖုဒၩလိးမၩအၥၭလၧဆၧ ဝၩ့အဂးဝၬဖီၩ့ဝ့ၫလီၫ. လၧအဒူၭဖိၪအီၪဝ့ၫၥၧၫ့ဆံၫလၧ",
			"18": "<sup>18</sup> ဖုဒၩလိးအဖၫ့ခိၪလီၫ.- ဖုဒၩလိးလၧတရၫ့အနဲၩ့ထံၭ ဎၩ့လိၬအၥၭ လၧ တရၫ့အထီၫနီၪ, မွဲဖုဒၩလိးလၧလၬ",
			"19": "<sup>19</sup> လခီၫ လဆၫ့လီၫ.- ထီးနီၪလဖၧၫ့ ထိၪအဒၪ့ဎၩ့ လၧ တရၫ့လၧလၬ လခီၫအမ့ၬယၫဖိးလၧအဝၩ့လၧအဖၧၩ့ လခီၫအမ့ၬယၫလၧခီၫ့တၭ, အဖျါအီၪဝ့ၫလယၩလၧ မုထၪ့လခီၫ, ဒဲလၧမုဖၩလခီၫဆ့လီၫ.",
			"20": "<sup>20</sup> ဆၧအဝၩ့လၧခီၫ့လခီၫအတရၫ့ လၧအဖိးထၪ့ဝ့ၫလၧ",
			"21": "<sup>21</sup> မုဖၩနီၪထိၪဝ့ၫအထီၫဒဲအဒၪ့ဎၩ့လီၫ.- ဒူၭဖိၪၥၧၫ့ဒူၭ လၧအယီၩလခီၫ, ဒဲၥၧၫ့ဒူၭလၧအနီၪလခီၫ, ဒဲဆၧအ ဒီၪ့အထုၪ့လဖၪ, ဒဲထိၬချိၫ့လဖၪန့ၫဎီၩ့, ဒဲတရၫ့လၧအ ခၪ့ထံၭလဖၧၩ့လီၫ. အထီၫမွဲအဖျါယဲဆံၫ,ဒဲအဒၪ့ဎၩ့",
			"22": "<sup>22</sup> အဖျါနံၫဆံၫယဲဖျါလီၫ.- အတရၫ့လံၩလဖၪ,ဒဲအထိၬ ချိၫ့လဖၪဒဲအၥံၪ့စီၩ့မလီၫ့လဖၪနီၪ မွဲဘဲၫဆၧထိၪတရၫ့ လၧအမ့ၬယၫအၥိၭနီၪ, လၧအဖိးထၪ့လၧမုထၪ့လ ခီၫ,ဒဲၦထၪ့ဘၭဝ့ၫလၧအၥွၫနွ့ၫၥွၫတၭ, အထိၬချိၫ့ၥံၪ",
			"23": "<sup>23</sup> အီၪဝ့ၫလၧအမ့ၬယၫလီၫ.- ဆၧအဝၩ့လၧယၫလခီၫ အတရၫ့အီၪဆဲၫဎၩ့ဒဲလၧတရၫ့လၧမုဖၩလခီၫး ဒဲလၧ မုထၪ့လခီၫတၭ,ထိၪဆၧလၧတရၫ့လစီၪ့ဖိးလၧတရၫ့ လစီၪ့ဒၪနီၪအဖျါလယၩလီၫ.",
			"24": "<sup>24</sup> ဆၧဆိၬထၪ့ယၧၩလၧမုခံၫ့လခီၫတၭ, ယိခွါ,တရၫ့ အီၪဝ့ၫလၧမုခံၫ့လခီၫလီၫ. ထိၪဆၧအဒီၪ့အထုၪ့လဖၪ,",
			"25": "<sup>25</sup> ဒဲထိၬချိၫ့လဖၪ, န့ၫဎီၩ့လၧအဆၧထိၪဝ့ၫနီၪလီၫ.- တ ရၫ့လံၩလဖၪအီၪဝ့ၫလၧအဖၧၩ့, ဒဲလၧထိၬချိၫ့လဖၪဝၬ ဖီၩ့ဝ့ၫဘဲၫတရၫ့လံၩအၥိၭနီၪလီၫ. အထီၫမွဲအဖျါယဲ",
			"26": "<sup>26</sup> ဆံၫ,ဒဲအဒၪ့ဎၩ့နံၫဆံၫယဲဖျါလီၫ.- လၧၦထၪ့ဝ့ၫအဂး နီၪ, ဎၫ့ၥွၫနွ့ၫၥွၫအီၪဝ့ၫတၭ, ထိၬချိၫ့အီၪဝ့ၫလၧအမ့ၬ ယၫလီၫ. တၭအီၪဝ့ၫလၧၥံၪ့စီၩ့မလီၫ့ အထုၪ့လၧဆၧ ဒီၪ့အထုၪ့အလီၩ့ လၧအယီၩလခီၫ ဒဲလၧအနီၪလခီၫ",
			"27": "<sup>27</sup> လီၫ.- လၧဝၩ့လၧအဖၧၩ့လခီၫလစီၪ့နီၪတရၫ့လဖၧၩ့ အီၪဝ့ၫလၧမုခံၫ့နီၪတၭ, ထိၪဆၧလၧတရၫ့လစီၪ့ဖိးလၧ တရၫ့လစီၪ့ဒၪလၧမုခံၫ့လခီၫအဖျါလယၩလီၫ.",
			"28": "<sup>28</sup> ဆၧဂဲၫဆိၬနုၬယၧၩ လၧဝၩ့လၧအဖၧၩ့လခီၫလစီၪ့ လၧတရၫ့လၧမုခံၫ့နီၪ ထိၪတရၫ့လၧမုခံၫ့န့ၫဎီၩ့လၧအ",
			"29": "<sup>29</sup> ဆၧထိၪဝ့ၫလီၫ.- တၭအဒူၭဖိၪလဖၪဒဲဆၧအဒီၪ့အထုၪ့ လဖၪ,ဒဲထိၬချိၫ့လဖၪန့ၫဎီၩ့ လၧအဆၧထိၪဝ့ၫနီၪလီၫ. တၭတရၫ့လံၩအီၪဝ့ၫလၧအဖၧၩ့ ဒဲလၧထိၬချိၫ့ဝၬဖီၩ့ဝ့ၫ လီၫ.အဖၭထီၫမွဲအဖျါယဲဆံၫ, ဒဲအဒၪ့ဎၩ့နံၫဆံၫယဲ",
			"30": "<sup>30</sup> ဖျါလီၫ.- လၧထိၬချိၫ့ဝၬဝၬနီၪအထီၫမွဲနံၫဆံၫယဲဖျါဒဲ",
			"31": "<sup>31</sup> အဒၪ့ဎၩ့မွဲယဲဖျါလီၫ.- ထိၬချိၫ့လဖၪနီၪအီၪဝ့ၫလၧဆၧ အဝၩ့လၧခီၫ့လစီၪ့, ဒဲၥံၪ့စီၩ့မလီၫ့အီၪဝ့ၫလၧဆၧအဒီၪ့ အထုၪ့လီၩ့တၭ, ဆၧလၧအလ့ၩထၪ့ဘၭနီၪ အီၪဝ့ၫ လၧဎၫ့ၥွၫဎိၭၥွၫလီၫ.",
			"32": "<sup>32</sup> ဆၧဆိၬထၪ့ယၧၩ လၧဆၧအဝၩ့လၧအဖၧၩ့လစီၪ့ လၧမုထၪ့လခီၫတၭ, ထိၪတရၫ့န့ၫဎီၩ့ လၧအဆၧထိၪ",
			"33": "<sup>33</sup> ဝ့ၫနီၪလီၫ.- အဒူၭဖိၪလဖၪ ဒဲဆၧအဒီၪ့အထုၪ့လဖၪ, ဒဲအထိၬချိၫ့လဖၪန့ၫဎီၩ့လၧအဆၧထိၪဝ့ၫနီၪလီၫ. တၭ တရၫ့လံၩအီၪဝ့ၫလၧအဖၧၩ့, ဒဲလၧထိၬချိၫ့လဖၪဝၬဖီၩ့ ဝ့ၫလီၫ. အဖၭထီၫမွဲအဖျါယဲဆံၫ, ဒဲအဒၪ့ဎၩ့နံၫဆံၫ",
			"34": "<sup>34</sup> ယဲဖျါလီၫ.- ထိၬချိၫ့လဖၪနီၪအီၪဝ့ၫလၧအဝၩ့လၧခီၫ့လ စီၪ့,ဒဲၥံၪ့စီၩ့မလီၫ့အီၪဝ့ၫ လၧဆၧအဒီၪ့အထုၪ့လီၩ့လၧ အယီၩလခီၫဒဲလၧအနီၪလခီၫတၭ, အဆၧထၪ့ဘၭအ ဝ့ၫနီၪအီၪဝ့ၫလၧအၥွၫဎိၭၥွၫလီၫ.",
			"35": "<sup>35</sup> ဆၧဆိၬထၪ့ယၧၩလၧတရၫ့မုဖၩလခီၫတၭ, ထိၪဝ့ၫ",
			"36": "<sup>36</sup> န့ၫဎီၩ့လၧအဆၧထိၪဝ့ၫလဖၪနီၪလီၫ.- အဒူၭဖိၪလဖၪ, ဆၧအဒီၪ့အထုၪ့လဖၪ, ဒဲအထိၬချိၫ့လဖၪ,ဒဲတရၫ့လံၩ အီၪဝၬဖီၩ့ဝ့ၫနီၪလီၫ. အဖၭထီၫမွဲအဖျါယဲဆံၫ,ဒဲအ",
			"37": "<sup>37</sup> ဒၪ့ဎၩ့နံၫဆံၫယဲဖျါလီၫ.- အထုၪ့လဖၪအီၪလၧအဝၩ့ လၧခီၫ့လစီၪ့,ဒဲၥံၪ့စီၩ့မလီၫ့အီၪဝ့ၫ လၧဆၧဒီၪ့အထုၪ့ လဖၪအလီၩ့လၧအယီၩလခီၫ, ဒဲလၧအနီၪလခီၫတၭ, အဆၧထၪ့အလးနီၪအၥွၫဎိၭၥွၫအီၪဝ့ၫလီၫ.",
			"38": "<sup>38</sup> ဒူၭဖိၪလဖၪဒဲအတရၫ့နီၪ အီၪဝ့ၫလၧတရၫ့ထုၪ့အ နဲၩ့ထံၭ,အလးလၧၦၥူၫဝၭခွံၬဆၧလုမ့ၪလီၫ.",
			"39": "<sup>39</sup> လၧတရၫ့အထိၬချိၫ့နီၪ, စပွဲနံၫဖျိၪ့အီၪလၧအယီၩ လခီၫ,ဒဲစပွဲနံၫဖျိၪ့အီၪလၧအနီၪလခီၫ, ဘဲၫၥိၭၦမိမၩ ၥံၫဆၧလုမ့ၪ, ဒဲဆၧလုဆၧဒဲၩဘၭ, ဒဲဆၧလုမၪဘၪ",
			"40": "<sup>40</sup> ဆၧလီၫ.- လၧအနဲၩ့ထံၭလၧခီၫ့နီၪလၧၦလ့ၩနုၬလၧ တရၫ့လၧမုဖၩနီၪ,စပွဲအီၪဝ့ၫနံၫဖျိၪ့, ဒဲလၧအလခီၫ ဒၪလၧတရၫ့လခီၫလၧထိၬချိၫ့နီၪ, စပွဲအီၪဝ့ၫနံၫဖျိၪ့ဆ့",
			"41": "<sup>41</sup> လီၫ.- စပွဲလံဖျိၪ့အီၪဝ့ၫလၧအယီၩလခီၫ, ဒဲစပွဲလံဖျိၪ့ အီၪဝ့ၫလၧအနီၪလခီၫ, လၧတရၫ့အနဲၩ့ထံၭလခီၫနီၪး စပွဲလၧအမၩၥံၫဆၧလုလဖၪ လၧအလီၩ့နီၪ,အီၪဝ့ၫ",
			"42": "<sup>42</sup> ဎိၭဖျိၪ့လီၫ.- စပွဲလံဖျိၪ့နီၪဆၧတဲၩ့ဝ့ၫလၧလိးစိၭဖျၩ အၥၭလၧဆၧလုမ့ၪအဂးလီၫ. အဖၭထီၫမွဲလဖျါဒဲလ ထၫ, ဒဲအဒၪ့ဎၩ့လဖျါဒဲလထၫ, အဆီၩ့ဆီထၪ့နီၪမွဲလ ဖျါလီၫ. အီၪက့ၪလၩ့အစူၪဝဲၩ လၧဆၧမၩၥံၫဆၧလု",
			"43": "<sup>43</sup> မ့ၪ,ဒဲဆၧလုလဖၪလၧအဖၫ့ခိၪလီၫ.- အခိၪဒၧၩ့တဲၩ့ အၥၭလၧၥံၪ့ပၪအဒၪ့ဎၩ့ မွဲလထၫနီၪတဲၩ့ဝဲၩအၥၭလၧ ယၫလခီၫဝၬဖီၩ့ဝ့ၫလီၫ. ဆၧလုအဆၧယၪအီၪဝ့ၫလၧ စပွဲအဖၫ့ခိၪလီၫ.",
			"44": "<sup>44</sup> လၧတရၫ့လၧအဖၧၩ့လခီၫ လၧခီၫ့နီၪ,မွဲၦၥံၫကျံၩ ဆၧအဒူၭလဖၪလၧဆၧအဝၩ့လၧအဖၧၩ့လခီၫလစီၪ့ နီၪအီၪဝ့ၫလီၫ. အီၪဝ့ၫလၧအတရၫ့ လၧမုဖၩအနဲၩ့ ထံၭ,အဝ့ၫလခီၫနီၪဒိၭအၥၭ လၧမုခံၫ့လခီၫလီၫ. ဒူၭ လၧတရၫ့မုထၪ့လခီၫအနဲၩ့ထံၭ လၧအဒိၭအၥၭလၧ",
			"45": "<sup>45</sup> မုဖၩလခီၫအီၪဝ့ၫလဒူၭလီၫ.- တၭအဝ့ၫစံၭယၧၩဆၧ အဒူၭလဒူၭယီၩ လၧအဒိၭအၥၭလၧမုခံၫ့နီၪ, မွဲလၧ",
			"46": "<sup>46</sup> ၦလုဆၧလဖၪ လၧအခိၭဂံၪ့နီၪအဂးလီၫ.- ဆၧအဒူၭ လဒူၭလၧအဒိၭအၥၭ လၧမုဖၩနီၪမွဲလၧၦလုဆၧလဖၪ လၧအယိဆၧယိဘၪဆဲၫ့ လၧဆၧလုလးအဂးလီၫ.အ ဝ့ၫၥံၪနီၪမွဲစဇၫဒီၭအဖိၪခွၫ လၧၦလံဝဲဖိၪအဖိၪခွၫအ ကျၩလၧအၥုၭဘူၭအၥၭလၧယဟိဝၩအအီၪ ဘဲၫၥိၭ အမိမၩအဆၧလီၫ.",
			"47": "<sup>47</sup> ထိၪဆၧအဝၩ့အဖၭထီၫနီၪမွဲအဖျါလယၩ, ဒဲအဒၪ့ ဎၩ့အဖျါလယၩ မွဲဆၧလံနိၪ့တၭ,ဆၧလုလးအီၪဝ့ၫ",
			"48": "<sup>48</sup> လၧဂံၪ့အမ့ၬယၫလီၫ.- အဝ့ၫဆိၬယၧၩလၧဂံၪ့အထိၬ ချိၫ့တၭ, ထိၪဆၧထိၬချိၫ့နီၪ, အတရၫ့နဲၩ့ထံၭအထုၪ့ လၧအယီၩလခီၫယဲဖျါ, ဒဲလၧအနီၪလခီၫယဲဖျါလီၫ. တရၫ့အဒၪ့ဎၩ့နီၪ မွဲၥၧၫ့ဖျါလၧအယီၩလခီၫ,ဒဲၥၧၫ့ဖျါ",
			"49": "<sup>49</sup> လၧအနီၪလခီၫလီၫ.- ထိၬချိၫ့နီၪအဖၭထီၫမွဲအဖျါ နံၫဆံၫ,ဒဲအဒၪ့ဎၩ့လဆံၫလဖျါလီၫ. တၭၦထၪ့ဝ့ၫ လၧအဎၫ့လီၫ. ဆၧအထုၪ့လဖၪအီၪဝ့ၫ လၧထိၬချိၫ့ နီၪ,လၧအယီၩလခီၫလထုၪ့, ဒဲလၧအနီၪလခီၫလ ထုၪ့လီၫ."
		},
		"41": {
			"1": "<sup>1</sup> လၧခဲၫ့ထဲၩ့အဆၧဆိၬထၪ့ယၧၩ လၧနီးဖၧၩ့တၭ, ထိၪဆၧအထုၪ့လီၫ. အဒၪ့ဎၩ့မွဲဎူၫဖျါ လၧအယီၩလ ခီၫ,ဒဲအဒၪ့ဎၩ့ဎူၫဖျါလၧအနီၪလခီၫလီၫ. အဝ့ၫနီၪမွဲ",
			"2": "<sup>2</sup> ဂံၪ့အဒၪ့ဎၩ့လီၫ.- တရၫ့နီၪ, အဒၪ့ဎၩ့မွဲဆံၫဖျါတၭ, တရၫ့အနဲၩ့ထံၭ,မွဲယဲဖျါလၧအယီၩလခီၫ,ဒဲယဲဖျါလၧ အနီၪလခီၫလီၫ. တၭမွဲအထိၪအဖၭထီၫအဖျါလံဆံၫ",
			"3": "<sup>3</sup> ဒဲအဒၪ့ဎၩ့အဖျါနံၫဆံၫလီၫ.- ထီးနီၪလဖၧၫ့လ့ၩနုၬ လၧယၫတၭ,ထိၪတရၫ့ထုၪ့လဖၪနံၫဖျါ, ဒဲတရၫ့နီၪဎူၫ",
			"4": "<sup>4</sup> ဖျါ,ဒဲတရၫ့အဒၪ့ဎၩ့နွ့ၫဖျါလီၫ.- တၭထိၪဆၧအလး လၧအဖၭထီၫအဖျါနံၫဆံၫ, ဒဲအဒၪ့ဎၩ့အဖျါနံၫဆံၫ လၧနီးနီၪအမ့ၬယၫတၭ,စံၭယၧၩ, အယီၩမွဲဆၧအလး ဆံၫ့ဎံၪထုၬလီၫ.",
			"5": "<sup>5</sup> ထီးနီၪလဖၧၫ့ထိၪဂံၪ့အဒီၪ့လၧဎူၫဖျါ, ဒဲဒူၭဖိၪလၧ အနဲၩ့ဖၩလဒူၭလဒူၭနီၪလံဖျါဆုၬဆုၬ ဝၬဖီၩ့ဂံၪ့လခီၫ",
			"6": "<sup>6</sup> ဘၪလခီၫလီၫ.- ဒူၭဖိၪၥံၪလၧအနဲၩ့ဖၩအဖၧၩ့နီၪအီၪဝ့ၫ လဒူၭဒဲလဒူၭၥၧၫ့ဆံၫဆီၩ့ဆီ ထၪ့ၥၧၫ့ဆၫ့လဆၫ့ဘၪလ ဆၫ့လီၫ.တၭနုၬဝ့ၫလၧဆၧဒီၪ့ဘၪဆဲၫ့ လၧဒူၭဖိၪလဖၪ လၧဆၧအနဲၩ့ဖၩဝၬဖီၩ့ဝ့ၫအဖၧၩ့ ဘၪဆဲၫ့လၧအဝ့ၫ",
			"7": "<sup>7</sup> ၥံၪလီၫ. လါနၫ့တၭနုၬဘၪလၧဂံၪ့အဒီၪ့အ့ၬ.- ဒူၭဖိၪ လဖၪလၧဆၧအနဲၩ့ဖၩဖၧၩ့နီၪလဲထၪ့တၭ, ဝံၬအၥၭ ထၪ့ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩဂံၪ့အဆၧဝံၬဝ့ၫနီၪ ထၪ့ဝၬ ဖီၩ့ဂံၪ့လီၫ. မၩအၥၭဘဲၫနီၪတၭ, ဂံၪ့လဲလၧထၭလခီၫ တၭ,ၦထၪ့ဝ့ၫလၧဒူၭ လၧလၬလခီၫလဆၫ့ဖိးလၧဒူၭ လၧထၭလခီၫလဆၫ့ လၧဒူၭအဘိၩ့ဆၧၩ့လဆၫ့အၥၭ",
			"8": "<sup>8</sup> ခံဖၧၩ့လီၫ.- ယဒၪဘၪဆ့ဂံၪ့အဆီၩ့ဆီထၪ့ဝၬဖီၩ့ဝ့ၫ လီၫ.ဒူၭလဖၪ လၧအနဲၩ့ဖၩဖၧၩ့အခၪ့ထံၭနီၪ မွဲနိၪထိၪ",
			"9": "<sup>9</sup> လဆိၩထၧၫ့ဘီၩ့ယၫဎူၫဖျါလီၫ.- ဒူၭလၧဆၧအနဲၩ့ဖၩ ဖၧၩ့အဒီၪ့လဒီၪ့လၧခီၫ့လခီၫ မွဲယဲဖျါ,အလးအီၪလၩ့ ထးနီၪမွဲဒူၭဖိၪလဖၪ လၧဂံၪ့အနဲၩ့ဖၩဖၧၩ့အလးလီၫ.",
			"10": "<sup>10</sup> လၧဒူၭအဘိၩ့ဆၧၩ့အဖျါနံၫဆံၫ အီၪဝၬဖီၩ့ဂံၪ့ကိၭခီၫ",
			"11": "<sup>11</sup> ဒ့ၭလီၫ.- ဒူၭဖိၪၥံၪလၧဆၧအနဲၩ့ဖၩဖၧၩ့ အတရၫ့ဖိး ထၪ့ဝ့ၫလၧဆၧအလးလၧအအီၪ လၩ့ထးတရၫ့လဖၧၩ့ နီၪဖိးဝ့ၫလၧမုဖၩလခီၫ, ဒဲတရၫ့လဖၧၩ့ဒၪဖိးဝ့ၫလၧမု ခံၫ့လခီၫလီၫ. တၭဆၧအလးအီၪလၩ့ထးနီၪ လဲဝ့ၫ ယဲဖျါဝၬဖီၩ့ဝ့ၫလီၫ.",
			"12": "<sup>12</sup> တၭဂံၪ့လၧဆၧလၩ့ဖၭအလးအမ့ၬယၫအနဲၩ့ထံၭ, လၧမုနုၬလခီၫနီၪ, အဒၪ့ဎၩ့မွဲအဖျါနွ့ၫဆံၫး ဒဲဂံၪ့အ ဒီၪ့နီၪအတၪ့ မွဲယဲဖျါဝၬဖီၩ့ဝ့ၫဒဲအဖၭထီၫမွဲအဖျါခွံၫ ဆံၫလီၫ.",
			"13": "<sup>13</sup> အဆၧထိၪဂံၪ့အဖၭထီၫ အဖျါလယၩ, ဒဲဆၧ အလးလၩ့ဖၭလစီၪ့တၭ, ဒူၭနီၪဒဲအဒီၪ့လဖၪအဖၭ",
			"14": "<sup>14</sup> ထီၫမွဲအဖျါလယၩလီၫ.- ဂံၪ့အမ့ၬယၫအဒၪ့ဎၩ့နီၪ, ဒဲဆၧအလးလၩ့ဖၭလစီၪ့ လၧမုထၪ့လခီၫနီၪ မွဲအ",
			"15": "<sup>15</sup> ဖျါလယၩ လီၫ.- အဆၧထိၪဒူၭလဒူၭနီၪအဖၭထီၫ လၧ ဆၧအလးလၩ့ဖၭလစီၪ့အမ့ၬယၫ,ဒဲလၧအချိၫ့နီၪ, ဒဲ ဆၧအလးထၪ့ထီၫလဖၪ လၧအယီၩလခီၫ,ဒဲလၧအနီၪ လခီၫ,မွဲအဖျါလယၩ,ဒဲနီးလၧအဖၧၩ့လခီၫလဖျိၪ့, ဒဲဆၧအဝၩ့အဆၧထိၬချိၫ့လဖၪ,",
			"16": "<sup>16</sup> တရၫ့အထုၪ့လဖၪ ဒဲတရၫ့လံၩအအံၪ့, ဒဲ ဆၧအလးထၪ့ထီၫလဖၪ ဝၬဖီၩ့ဝ့ၫၥၧၫ့ဆၫ့အီၪဆဲၫဎၩ့ လၧတရၫ့တၭ, ဒီၪ့ထၬဝ့ၫလၧၥံၪ့ဝၬဖီၩ့ဝ့ၫ လၧဂၪ့ခိၪ ထၪ့ဘၭလၧတရၫ့လံၩတၭ, တရၫ့လံၩ အီၪဘံၭဝ့ၫ",
			"17": "<sup>17</sup> လီၫ.- အီၪဝ့ၫလၧဆၧအလးလၧတရၫ့အဖၫ့ခိၪဒဲလၧ ဂံၪ့လၧအဖၧၩ့လခီၫလဖျိၪ့ ဒဲလၧခီၫ့ဒဲလၧဆၧဒီၪ့အနဲၩ့ ထံၭဝၬဖီၩ့ဝ့ၫလၧအဖၧၩ့လခီၫလဖျိၪ့, ဒဲလၧခီၫ့ဘဲၫဆၧ",
			"18": "<sup>18</sup> ထိၪဝ့ၫအၥိၭနီၪလီၫ.- ဆၧတဲၩ့ခ့ၫရူၬၥံၪလၧၥံၪ့စီၩ့မလီၫ့ အကျၩနီၪ,ၥံၪ့စီၩ့မလီၫ့အထုၪ့အီၪဝ့ၫလၧခ့ၫရူၬနံၫဒုၩ",
			"19": "<sup>19</sup> အဘိၩ့ဆၧၩ့,- ခ့ၫရူၬလဒုၩအီၪလၧ အမ့ၬနံၫခီၫတၭ, ၦၡၩအမ့ၬ အီၪတီၩ လၧၥံၪ့စီၩ့မလီၫ့လခီၫတၭ, ဆၬ လၥၧၫ့အမ့ၬအီၪတီၩ လၧၥံၪ့စီၩ့မလီၫ့အလခီၫဒၪလီၫ. ဆၧမၩအၥၭ လၧဂံၪ့ထၧၫ့ဖျိၪ့ယၫဝၬဖီၩ့ဝ့ၫ ဘဲၫနီၪၥိၭ",
			"20": "<sup>20</sup> လီၫ.- လၧဂၪ့ခိၪဖိးလၧတရၫ့အဖၫ့ခိၪနီၪ ခ့ၫရူၬလဖၪ, ဒဲၥံၪ့စီၩ့မလီၫ့လဖၪ တဲၩ့အၥၭဒဲလၧနီးအဒီၪ့အလီၩ့ဆ့ လီၫ.",
			"21": "<sup>21</sup> နီးနီၪအတရၫ့အထုၪ့လဖၪအီၪ လၧအနိၪ့လံနိၪ့ တၭ,အီၪဝ့ၫလၧလးဆံၫ့ဎံၪအမ့ၬယၫလီၫ. အလထုၪ့",
			"22": "<sup>22</sup> နီၪဖျီၪဝ့ၫဘဲၫအလထုၪ့ဒၪအၥိၭနီၪလီၫ.- ဆၧလုအလး ၥံၪ့နီၪ အဆီၩ့ဆီထၪ့မွဲၥၧၫ့ဖျါ, ဒဲအဖၭထီၫနံၫဖျါတၭ, အနိၫ့လဖၪ ဒဲအဖၭထီၫနီၪ ဒဲအဒီၪ့လဖၪနီၪမွဲၥံၪ့လီၫ. တၭအဝ့ၫဒၪစံၭယၧၩ,အယီၩမွဲစပွဲလၧ အအီၪဝ့ၫလၧ ယဟိဝၩအမ့ၬယၫလီၫ.",
			"23": "<sup>23</sup> နီးနီၪဒဲဆၧအလးဆံၫ့ဎံၪအီၪဝ့ၫ လၧတရၫ့နံၫဘံၪ့",
			"24": "<sup>24</sup> လီၫ.- တရၫ့လဘံၪ့အီၪလၧအလၪ နံၫဘံၪ့း အလၪ နံၫဘံၪ့လၧအကၠၪအၥၭလီၫ. တရၫ့လဘံၪ့အီၪလၧအ လၪနံၫဘံၪ့, အတရၫ့အဂူၫဂၩလဘံၪ့အီၪလၧအလၪ",
			"25": "<sup>25</sup> နံၫဘံၪ့လီၫ.- ခ့ၫရူၬလဖၪဒဲၥံၪ့စီၩ့မလီၫ့လဖၪဘၪဆၧ တဲၩ့ဝ့ၫလၧအလီၩ့ လၧနီးအတရၫ့အလီၩ့ဒၪလ့ၬ,ဘဲၫ ဆၧလၧအအီၪ လၧဆၧဒီၪ့အလီၩ့ အၥိၭနီၪလီၫ. တၭ ၥံၪ့ပၪတၪ့ဝ့ၫနီၪအီၪလၧထိၬချိၫ့အမ့ၬယၫ လၧခီၫ့လီၫ.",
			"26": "<sup>26</sup> ၥံၪ့စီၩ့မလီၫ့ဒဲတရၫ့လံၩအအံၪ့ အီၪဝ့ၫလၧအယီၩ လခီၫဒဲလၧအနီၪလခီၫ, အီၪလၧထိၬချိၫ့အနဲၩ့ဖၩအ လီၩ့,ဒဲလၧဂံၪ့အဒူၭဖိၪလၧအနဲၩ့ဖၩအလီၩ့, ဒဲလၧၥံၪ့ပၪ တၪ့လဖၪအလီၩ့နီၪလီၫ."
		},
		"42": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့အဝ့ၫဒၪဆိၬထၪ့ယၧၩ လၧဆၧအဝၩ့ လၧခီၫ့လစီၪ့လၧဖၧၩ့ၥၭလ့ၩလၧမုဖၩလခီၫတၭ, ဆိၬ ယၧၩလၧဒူၭဖိၪလဖၪ လၧအအီၪဝ့ၫ လၧဆၧအလး",
			"2": "<sup>2</sup> လၩ့ဖၭလၧဂံၪ့နီၪအမ့ၬယၫလၧမုဖၩလခီၫလီၫ.- လၧ တရၫ့လၧမုဖၩလခီၫအမ့ၬယၫနီၪ, အဖၭထီၫမွဲအဖျါ",
			"3": "<sup>3</sup> လယၩဒဲအဒၪ့ဎၩ့အဖျါယဲဆံၫလီၫ.- တၭဆဲၫဎၩ့လၧ အလးလစီၪ့ အဖျါနံၫဆံၫဘၪဆဲၫ့လၧဝၩ့ လၧအဖၧၩ့ လခီၫနီၪ,ဒဲဆဲၫဎၩ့လၧဖုဒၩလိးလစီၪ့ဘၪဆဲၫ့လၧဝၩ့ အီၪလၧခီၫ့လခီၫနီၪ,အလးထၪ့ထီၫလဖၪဆီၩ့ဆီထၪ့",
			"4": "<sup>4</sup> ၥၧၫ့ဆၫ့လီၫ.- ဆၧဂၭဝံၩ့ဝၩ့အလး အဒၪ့ဎၩ့ဆံၫဖျါ လၧအဖၧၩ့လခီၫဖၧၩ့ၥၭလဖျါအီၪဝ့ၫ လၧဒူၭဖိၪလဖၪ အမ့ၬယၫနီၪး ဒဲအတရၫ့ၥံၪဖိးထၪ့ဝ့ၫလၧမုဖၩလခီၫ",
			"5": "<sup>5</sup> လီၫ.- ဒူၭဖိၪၥံၪလၧထၭလခီၫနီၪ အံၪ့နဲၪ့ဒံၭဒူၭၥံၪအီၪ ဝ့ၫလၧဆၧဘိၩ့ဆၧၩ့လဆၫ့လီၫ. အဂဲးဘဲၫယီၩအလး",
			"6": "<sup>6</sup> ထၪ့ထီၫလဖၪနီၪမၩန့အလးလီၫ.- အဂဲးဘဲၫယီၩဆီၩ့ ဆီထၪ့ၥၧၫ့ဆၫ့လီၫ. လါနၫ့ထုၪ့လဖၪဘဲၫထုၪ့လၧဆၧ ဝၩ့ဖၧၩ့အၥိၭနီၪအီၪအ့ၬ. မၩအၥၭဘဲၫနီၪတၭ, အံၪ့ နဲၪ့ဒံၭဆၧလၧလၬလခီၫလဆၫ့, ဒဲဆၧလၧအဘိၩ့ဆၧၩ့",
			"7": "<sup>7</sup> လဆၫ့လီၫ.- ဆၧအဒီၪ့လၧခီၫ့အီၪဎၩ့လိၬလၧဒူၭဖိၪ လဖၪလၧဆၧအဝၩ့လၧခီၫ့လစီၪ့ လၧဒူၭဖိၪလဖၪအမ့ၬ",
			"8": "<sup>8</sup> ယၫနီၪအဖၭထီၫမွဲအဖျါယဲဆံၫလီၫ.- အဂဲးဘဲၫယီၩ ဒူၭဖိၪလဖၪလၧဆၧအဝၩ့လၧခီၫ့လစီၪ့နီၪအဖၭထီၫမွဲ အဖျါယဲဆံၫလီၫ. အ့ၪမွဲလၧနီးအမ့ၬယၫနီၪမွဲအဖျါလ",
			"9": "<sup>9</sup> ယၩလီၫ.- လၧဒူၭဖိၪလဖၪအဖၫ့လၬနီၪ, ဖၧၩ့ၥၭလ့ၩ နုၬလၧမုထၪ့လခီၫအီၪ ထီးၦလ့ၩနုၬလၧအဖၧၩ့ လၧ",
			"10": "<sup>10</sup> ဆၧအဝၩ့လၧခီၫ့လီၫ.- လၧဆၧအဝၩ့ အဒီၪ့အတၪ့ လၧမုထၪ့လခီၫ, လၧဆၧအလးလၩ့ဖၭအမ့ၬယၫ, ဒဲ လၧဒူၭလဖျိၪ့အမ့ၬယၫနီၪ ဒူၭဖိၪလဖၪအီၪဝ့ၫလီၫ.",
			"11": "<sup>11</sup> ဖၧၩ့ၥၭအီၪဝ့ၫလၧအမ့ၬယၫ မၩအၥၭဘဲၫဆၧလၧဒူၭ ဖိၪလဖၪလၧအအီၪဝ့ၫ လၧမုဖၩလခီၫအၥိၭနီၪလီၫ. အဖၭထီၫန့ၫဎီၩ့, ဒဲအဒၪ့ဎၩ့န့ၫဎီၩ့, အဆၧစဲၪ့ထၪ့အ လးထီးအလူၬ, အခံးအဂၩ့,ဒဲအတရၫ့နီၪမွဲမီၪ့ဎီၩ့လီၫ.",
			"12": "<sup>12</sup> ဒူၭဖိၪလဖၪအီၪဝ့ၫ လၧတရၫ့ဖိးထၪ့ဝ့ၫလၧမုခံၫ့လခီၫ နီၪ,ဘဲၫနီၪၥိၭဆ့, ဖၧၩ့ၥၭခၪ့ထံၭအီၪဝ့ၫလၧတရၫ့လ ဖၧၩ့လၧဖၧၩ့ၥၭလဘီၩ့အီၪဝ့ၫ လၧဆၧဒီၪ့တီၩလၧမုထၪ့ လခီၫအမ့ၬယၫထီးၦလ့ၩနုၬလၧအဖၧၩ့လီၫ.",
			"13": "<sup>13</sup> ထီးနီၪလဖၧၫ့အဝ့ၫဒၪစံၭယၧၩ, ဒူၭဖိၪလဖၪလၧမုဖၩ လခီၫ,ဒဲဒူၭဖိၪလဖၪလၧမုခံၫ့လခီၫ, လၧအအီၪလၧဆၧ အလးလၩ့ဖၭအမ့ၬယၫနီၪ, မွဲဒူၭဖိၪဆံၫ့ဎံၪ, ၦလုဆၧ လဖၪၥုၭဘူၭအၥၭလၧယဟိဝၩအအီၪနီၪတၭ, မိဘၪ အီၪက့ၪဆၧဆံၫ့ဎံၪထုၬလီၫ. မိဘၪအီၪက့ၪဆၧဆံၫ့ဎံၪ ထုၬလဖၪ, ဒဲဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲဆၧလုဆၧဒဲၩဘၭ, ဒဲဆၧလုမၪဘၪဆၧထီးနီၪလီၫ. အဂဲးဘဲၫယီၩဆၧအ",
			"14": "<sup>14</sup> လးနီၪဆံၫ့ဎံၪဝ့ၫလီၫ.- ထီးၦလုဆၧလဖၪလ့ၩနုၬတၭ, စဲၪ့ထၪ့ဘၪလၧဆၧအဝၩ့ လၧခီၫ့အဖၧၩ့အ့ၬ. မွဲအဘၪ အီၪက့ၪထးအကီၩ့အၥိၭ လၧအမၩဆၧအခ့ၫအၡၩ အဆၧလၧအဖၧၩ့ထီးနီၪလီၫ. အဂဲးဘဲၫယီၩမွဲဆၧဆံၫ့ ဎံၪလီၫ.တၭမိဘၪကီၩ့ၥိၭထၪ့ဆၧအကီၩ့အၥိၭအဂူၫ ဂၩ,ဒဲၥုၭဘူၭအၥၭ လၧဆၧအလးလၧအအီၪဝ့ၫလၧ ၦခမျၧးအဂးလီၫ.",
			"15": "<sup>15</sup> အဆၧထိၪဂံၪ့လၧအဖၧၩ့လခီၫလဖျိၪ့ဂီၩ့တၭ, ဆိၬ ထၪ့ယၧၩလၧတရၫ့လၧအဒိၭအၥၭ လၧမုထၪ့လခီၫ",
			"16": "<sup>16</sup> တၭ,ထိၪဝ့ၫဝၬဖီၩ့ဝ့ၫလီၫ.- အဆၧထိၪအနဲၩ့ထံၭလၧ မုထၪ့လခီၫ လၧနိၪထိၪဖီးဘီၩ့တၭ, အီၪဝ့ၫအဆိၩယဲ",
			"17": "<sup>17</sup> ယၩဝၬဝၬလီၫ.- အဆၧထိၪဝ့ၫအနဲၩ့ထံၭလၧမုဖၩ လၧ ဆၧထိၪဖီးဘီၩ့တၭ, အီၪဝ့ၫအဆိၩယဲယၩဝၬဝၬလီၫ.",
			"18": "<sup>18</sup> အဆၧထိၪအနဲၩ့ထံၭ လၧမုခံၫ့လခီၫလၧနိၪထိၪဖီးဘီၩ့",
			"19": "<sup>19</sup> တၭ,အီၪဝ့ၫအဆိၩယဲယၩဝၬဖီၩ့ဝ့ၫလီၫ.- ကၠၪအၥၭ လၧမုနုၬလခီၫတၭ, ထိၪဝ့ၫအဆိၩယဲယၩလၧနိၪထိၪ",
			"20": "<sup>20</sup> ဖီးဘီၩ့လီၫ.- အဆၧထိၪအဒီၪ့လၧအနဲၩ့ဖၩလံခီၫဝၬ ဖီၩ့ဝ့ၫလီၫ. အထီၫမွဲယဲယၩ, ဒဲအဒၪ့ဎၩ့ယဲယၩ,ဘဲၫ ၥိၭအမိအၪ့နၩ့ဖၭဆၧဆံၫ့ဎံၪ, ဒဲဆၧလဆံၫ့ဘၪအလး အဆၧၫ့နီၪလီၫ."
		},
		"43": {
			"1": "<sup>1</sup> လၧခဲၫ့ထဲၩ့အဝ့ၫဒၪဂဲၫဆိၬယၧၩ လၧတရၫ့နီၪ,တရၫ့",
			"2": "<sup>2</sup> လၧအဖိးလၧမုထၪ့လခီၫ,- တၭယိခွါ,အံၫစရ့လၭအ ယွၩအလၩအဖၩ့ဂဲၫဝ့ၫလၧမုထၪ့အဖၧၩ့ၥၭတၭ, အၥီၫ မၩအၥၭ ဘဲၫထံၫအၪအၥီၫ အၥိၭနီၪတၭ, ဂၪ့ခိၪဖၩ့",
			"3": "<sup>3</sup> ထၪ့ဝ့ၫလၧအလၩအဖၩ့လီၫ.- ဆၧဖျီၪထၪ့ဝ့ၫမၩအၥၭ ဘဲၫဆၧလၧယဒၪဘၪလၧယၫလခီၫအၥိၭ, ဘဲၫဆၧဒၪ လၧယၫလခီၫလၧယဒၪဘၪ ထီးအထီလၧအဂဲၫမၩဂၭ ဂီၩ့ဒိၩ့အၥိၭနီၪ, ဒဲဆၧဒၪလၧယၫလခီၫနီၪ, မၩအၥၭ ဘဲၫဆၧလၧယဒၪဘၪ လၧခံဘၫအထံၫနဲၩ့ အၥိၭနီၪး",
			"4": "<sup>4</sup> တၭယထိၪလၩ့ထံၩဖါချႃၬလၩ့ယၥၭလီၫ.- ယဟိဝၩ အလၩအဖၩ့ဂဲၫနုၬလၧဂံၪ့ဖၧၩ့ လၧဖၧၩ့ၥၭအတရၫ့",
			"5": "<sup>5</sup> အဖၧၩ့လၧအဒိၭအၥၭ လၧမုထၪ့လခီၫလီၫ.- ၥၭနီၪ မၩန့ထၪ့ယၧၩတၭ, ဆိၬထၪ့ယၧၩလၧဝၩ့လၧအဖၧၩ့ လခီၫလစီၪ့တၭ, ယိခွါ,ယဟိဝၩအလၩအဖၩ့မၩဎွ့ၩ",
			"6": "<sup>6</sup> ဂံၪ့လီၫ.- ယနါဂၧၫ့အဝ့ၫချဲၩ့ဆၧလၧယၧၩလၧဂံၪ့ဖၧၩ့ တၭ,ၦၡၩလဂၩဆၧၫ့ထုၪ့လၧယနဲၩ့ထံၭလီၫ.",
			"7": "<sup>7</sup> အဝ့ၫစံၭယၧၩ,ၦၡၩအဖိၪခွၫဧ့, ယလးဆီၩ့ဆီအ လး,ဒဲယခၪ့ယၫၥၭအလး, ထီးယမိအီၪလၧအံၫစရ့ လၭဖိၪအကျၩ လၩ့ဆိၩလၩ့ကၠၪ မွဲထီးယီၩလီၫ. တၭ ၦအံၫစရ့လၭဖိၪ မိမၩဘၪၥၭလိၪလၧၩ့ ယမံၩ့ဆံၫ့ဎံၪ အ့ၬ.- အဝ့ၫၥံၪမွဲဂ့ၩ, အစဎွၩလဖၪမွဲဂ့ၩ, မၩဘၪၥၭ လိၪဝ့ၫလၧအမၩ ဆၧလဲးဆၧဘျၪအကၠီၩ့, လၧစဎွၩ",
			"8": "<sup>8</sup> အစွၪလၧအၥွၪခိၪဖၧၩ့အကၠီၩ့အ့ၬ.- မွဲအအီၪက့ၪအ တရၫ့အခၧၪ့ လၧယတရၫ့အခၧၪ့အနဲၩ့ထံၭ, ဒဲအထုၪ့ လၧယထုၪ့အနဲၩ့ထံၭတၭ, အီၪန့ၫဆၧဒီၪ့လဒီၪ့လၧ ယၧၩဒဲအဝ့ၫၥံၪ အဘိၩ့ဆၧၩ့တၭ, မၩဘၪၥၭလိၪယူၭ ယမံၩ့ဆံၫ့ဎံၪ လၧအဆၧဘၪၥၭလိၪလၧအမၩဝ့ၫလီၫ. တၭယမၩလူၬခွံၬယူၭ အဝ့ၫၥံၪလၧယၥၭထၪ့နီၪလီၫ.",
			"9": "<sup>9</sup> ဘိၩ့နဲၪ့ယီၩ မွဲအဝ့ၫၥံၪအီၪက့ၪခွံၬ အမၩဆၧလဲးဆၧ ဘျၪယဲၩ့လၧယၧၩ, ဒဲစဎွၩအစွၪလဖၪ ယဲၩ့လၧယၧၩ ဆံၭ. တၭယမိအီၪလၧအကျၩ လၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"10": "<sup>10</sup> နဝ့ၫဒၪၦၡၩအဖိၪခွၫဧ့, ဒုၭနဲၪၦအံၫစရ့လၭအၡၩ ဂံၪ့ဖိၪလဂံၪ့လဖျိၪ့ယီၩ, ဘဲၫၥိၭအမ့ၬမိမဲ လၧအဆၧ ဒဲၩဘၭလကၠီၩ့, ဒဲဘဲၫၥိၭအမိထိၪန့ ဆၧအဒီၩ့အထ့ၬ",
			"11": "<sup>11</sup> နီၪဆံၭ.- အမ့ၬအ့ၪမဲလၧကယဲဆၧလၧ အမၩဝ့ၫအကၠီၩ့ တၭ, ဒုၭၥ့ၪယၫအဝ့ၫၥံၪလၧဂံၪ့ အဒီၩ့အထ့ၬ, ဒဲအခံး အဂၩ့, ဒဲဖၧၩ့ၥၭဂဲၫနုၬဒဲလ့ၩထၪ့လဖၪ, ဒဲအဂၩ့လဖၪ ထီးအလူၬဒဲအဆၧမၪလူၬထီးအလူၬ, ဒဲအဒီၩ့အထ့ၬ ထီးအလူၬ, ဒဲအဆၧၥီၪ့ဆၧၥၫ့လဖၪ ထီးအလူၬနီၪ တၭ, ကွ့ၭဆၧနီၪလၧအမ့ၬယၫဆံၭး မွဲဘဲၫၥိၭအဝ့ၫ ၥံၪမိထီးန့ ဆၧအဒီၩ့အထ့ၬထၧၫ့ဖျိၪ့ယၫ, ဒဲအဆၧမၪ",
			"12": "<sup>12</sup> လူၬၥံၪထီးအလူၬ, ဒဲမၩဝ့ၫဆ့လီၫ.- အယီၩမွဲဂံၪ့အဆၧ ၥီၪ့ဆၧၥၫ့ လၧခိၪလီၩ့ဒၩ့ခိၪနီၪ, ဆၧအီၪဝ့ၫလၧအနဲၩ့ ထံၭဝၬဖီၩ့ဝ့ၫ ထၧၫ့ဖျိၪ့ယၫ မိမွဲဝ့ၫဆၧဆံၫ့ဎံၪထုၬလီၫ. ယိခွါ,အနီၪမွဲဂံၪ့အဆၧၥီၪ့ဆၧၥၫ့လီၫ.",
			"13": "<sup>13</sup> ဆၧထိၪဆၧလုလး အဖျါလဖၪဘဲၫယီၩ, (လဖျါနီၪ မွဲလဖျါဒဲလထၫလီၫ.) ဆၧလၧလၬလခီၫနီၪအဆီၩ့ဆီ ထၪ့မွဲလဖျါ, အဒၪ့ဎၩ့လဖျါ,ဒဲအခိၪဒၧၩ့လၧအနဲၩ့ထံၭ ဝၬဝၬနီၪမွဲလထၫလီၫ. တၭအနီၪမွဲဆၧလုလးအလး",
			"14": "<sup>14</sup> လၧအချိၫ့လီၫ.- လၧလၬလခီၫ လၧဂၪ့ခိၪအဖၫ့ခိၪဖိး လၧအနဲၩ့ထံၭ, လၧလၬလခီၫနီၪမွဲနံၫဖျါ, ဒဲအဒၪ့ဎၩ့ လဖျါ, ဒဲအနဲၩ့ထံၭအအံၪ့ဖိးလၧအနဲၩ့ထံၭအလဲနီၪ",
			"15": "<sup>15</sup> မွဲလံဖျါဒဲအဒၪ့ဎၩ့မွဲလဖျါလီၫ.- ဆၧလုအလးမွဲလံဖျါ တၭ,လၧဆၧလုအလးလၧထၭလခီၫနီၪ, အနိၩ့လံနိၩ့",
			"16": "<sup>16</sup> မိအီၪဝ့ၫလီၫ.- ဆၧလုအလးအဖၭထီၫမိမွဲလဆံၫနံၫ ဖျါ,အဒၪ့ဎၩ့လဆံၫနံၫဖျါ, ဆၧလံနိၪ့အနဲၩ့ဖၩန့ၫဎီၩ့လီၫ.",
			"17": "<sup>17</sup> အနဲၩ့ထံၭအဖၭထီၫမွဲလဆံၫလံဖျါ, ဒဲအဒၪ့ဎၩ့လဆံၫ လံဖျါလၧဆၧလံဖၩလီၫ. တၭအခိၪဒၧၩ့လၧအနဲၩ့ထံၭ မိမွဲလထၫတၭ, အခၪ့ထံၭနီၪမိမွဲလဖျါဝၬဝၬတၭ,အ ဎၩ့နီၪမိဆဲၫဎၩ့ဝ့ၫလၧမုထၪ့လခီၫလီၫ.",
			"18": "<sup>18</sup> အဝ့ၫဒၪစံၭယၧၩ, ၦၡၩအဖိၪခွၫဧ့,ကဆါယဟိဝၩ စံၭဘဲၫယီၩ, အယီၩလဖၪမွဲဆၧၥီၪ့ဆၧၥၫ့ဘၪဆဲၫ့လၧ ဆၧလုအလးလၧမုလနံၩ လၧၦမိတဲၩ့ဝ့ၫဘဲၫၥိၭအမိ လုထၪ့ဆၧလုမ့ၪလၧအဖၫ့ခိၪ, ဒဲဎွံၪဆၧၥွံၪလၧအလီၩ့",
			"19": "<sup>19</sup> နီၪလီၫ.- နဘၪဖ့ၪလၫ့ၦလုဆၧလဖၪ,ၦလံဝဲၫဖိၪစဇၫဒီၭ အချံၫအၥၪလၧအၥုၭဘူၭအၥၭ လၧယအီၪဘဲၫၥိၭအ မိမၩယဆၧနီၪလၧချီဖၫဖိၪလဒုၩ လၧဆၧလုဆၧဒဲၩဘၭ",
			"20": "<sup>20</sup> အဂးကဆါယဟိဝၩစံၭဝ့ၫဒၪ.- နဘၪမၩန့အၥွံၪတၭ, အီၪက့ၪလၧဆၧအနိၩ့လံနိၩ့, ဒဲအနဲၩ့ထံၭအနိၪ့လံနိၪ့ အလီၩ့, ဒဲလၧအခိၪဒၧၩ့ဝၬဖီၩ့ဝ့ၫအလီၩ့လီၫ. နမိဘၪ",
			"21": "<sup>21</sup> မၩဆၧဖီၩ့ဖျ့ၭလၧအဂးနီၪလီၫ.- နမိဘၪမၩန့ဆၧလု ဆၧဒဲၩဘၭအချီဖၫလဒုၩတၭ, ၦမိဘၪဆူၭထၪ့ခွံၬအ ဝ့ၫလၧဆၧမၪလူၬဝဲၩအလး လၧဂံၪ့ဖၧၩ့လၧဆၧအလး",
			"22": "<sup>22</sup> ဆံၫ့ဎံၪလၧခီၫ့လီၫ.- မုနံၫနံၩလနံၩနီၪနမိဘၪလုထၪ့ ဘ့ၪဖိၪလၧအလၧၫ့အဎွ့ၩလဒုၩ လၧဆၧလုဆၧဒဲၩဘၭ အဂးတၭ,ၦမိမၩဆံၫ့ဆၧလုအလး ဘဲၫအမၩဆံၫ့ဝ့ၫ",
			"23": "<sup>23</sup> လၧချီဖၫလဒုၩအၥိၭနီၪလီၫ.- ထီးနမၩဆံၫ့ဂီၩ့တၭ,န မိဘၪလုထၪ့ချီဖၫအလၧၫ့အဎွ့ၩလဒုၩ, ဒဲဆၧအဖၫလၧ",
			"24": "<sup>24</sup> ၥိၪဒဲဘ့ၪအကျၩလၧအလၧၫ့အဎွ့ၩလဒုၩလီၫ.- နမိဘၪ လုထၪ့ဝ့ၫလၧယဟိဝၩအမ့ၬယၫ, ဒဲၦလုဆၧလဖၪမိ ဘၪဖၧၫ့လၩ့ထံၫလၪလၧအဖၫ့ခိၪတၭ, လုထၪ့ဝ့ၫလၧ",
			"25": "<sup>25</sup> ဆၧလုမ့ၪလၧယဟိဝၩအဂးလီၫ.- နွ့ၫနံၩအထးဖၧၩ့ နီၪနမိဘၪလုထၪ့ဘ့ၪလဒုၩ လၧဆၧလုဆၧဒဲၩဘၭအဂး လနံၩလဒုၩလနံၩလဒုၩ ကိၭနံၩဒ့ၭလီၫ. တၭၦမိဘၪ လုထၪ့ချီဖၫဖိၪလဒုၩ, ဒဲဆၧအဖၫအလၧၫ့အဎွ့ၩလဒုၩ",
			"26": "<sup>26</sup> လၧၥိၪဒဲဘ့ၪအကျၩလီၫ.- နွ့ၫနံၩအထးဖၧၩ့နီၪ ၦမိ ဘၪမၩဆံၫ့ထၪ့, ဒဲမၩဆၧဖီၩ့ဖျ့ၭလၧဆၧလုလးအဂး",
			"27": "<sup>27</sup> ဒဲအဝ့ၫၥံၪဘၪမၩဆံၫ့ဎံၪအနၫ့ဆါဒၪဝ့ၫဆ့လီၫ.- ဆၧ လၧမုနံၩလဖၪနီၪဖီၩ့ခွံၬတၭ, ဆၧမိမၩအၥၭလၧမုဎိၭ နံၩလနံၩဒဲစူၩယၫလခီၫနီၪ, ၦလုဆၧလဖၪမိဘၪလုထၪ့ နၥံၪအဆၧလုမ့ၪ, ဒဲနၥံၪအဆၧလုမၩဘၪလိၬအိၭလိၬ လၧနၥံၪအဆၧလုလးအဖၫ့ခိၪတၭ, နၥံၪမိဘၪယၥၭ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ."
		},
		"44": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့အဆၧဆိၬကဒၩထဲၩ့ယၧၩလၧဖၧၩ့ၥၭ လၧဆၧအလးဆံၫ့ဎံၪအတရၫ့လၧခီၫ့, လၧအဖိးဝ့ၫလၧ",
			"2": "<sup>2</sup> မုထၪ့လခီၫ,ဒဲကၭဘံၭထၬယူၭအၥၭလီၫ.- ထီးနီၪလ ဖၧၫ့ယဟိဝၩစံၭယၧၩ, တရၫ့ယီၩမိဘၪကၭဘံၭထၬ အၥၭတၭ,ဆၧဝဲထၪ့ဘၪအ့ၬ. တၭၦလ့ၩနုၬဘၪလၧ အဖၧၩ့နးဂၩအ့ၬ. အဂဲးဘဲၫယီၩယဟိဝၩအံၫစရ့လၭ အယွၩလ့ၩနုၬယူၭလၧအဖၧၩ့နီၪ, မၩအၥၭဘဲၫနီၪတၭ,",
			"3": "<sup>3</sup> မိဘၪကၭဘံၭထၬအၥၭလီၫ.- မွဲလၧၦဒိၪဖၭဒိၪအဂး, ၦဒိၪဖၭဒိၪမိဆၧၫ့နၩ့ဝ့ၫလၧအဖၧၩ့ ဘဲၫၥိၭအမိအၪ့ ဆၧအၪ့လၧယဟိဝၩအမ့ၬယၫ, မိလ့ၩနုၬဝ့ၫလၧတရၫ့ အထိၬချိၫ့တၭ, မိစဲၪ့ထၪ့ဝ့ၫလၧအဖၧၩ့ၥၭလဘီၩ့ဎးနီၪ လီၫ.",
			"4": "<sup>4</sup> ထီးနီၪလဖၧၫ့အဝ့ၫဒၪဆိၬထၪ့ယၧၩ လၧတရၫ့လၧ မုဖၩလခီၫလၧဂံၪ့အမ့ၬယၫတၭ, ယယိထၪ့တၭ,ယိ ခွါ,ယဟိဝၩအလၩအဖၩ့ မၩဎွ့ၩယဟိဝၩအဂံၪ့တၭ,",
			"5": "<sup>5</sup> ယထိၪလၩ့ထံၩဖါချႃၬလၩ့ယၥၭလီၫ.- တၭယဟိဝၩ စံၭယၧၩ, ၦၡၩအဖိၪခွၫဧ့, ထီးန့လၧနၥၭ, ဒဲယိလၧ နမ့ၬ,ဒိၭနနါလၧကယဲဆၧလၧယစံၭနၧၩ လၧယဟိဝၩ အဂံၪ့အဆၧမၪလူၬအဂဲး,ဒဲအဆၧၥီၪ့ဆၧၥၫ့, ဒဲထီးနဲၪ့ လၧနၥၭလၧဆၧလ့ၩနုၬလၧဂံၪ့ဖၧၩ့, ဒဲကယဲဆၧစဲၪ့ထၪ့ လၧဆၧအလးဆံၫ့ဎံၪအဖၧၩ့ၥၭ လဘီၩ့လါလါနီၪဆံၭ.",
			"6": "<sup>6</sup> နဘၪစံၭ, ၦအံၫစရ့လၭအၡၩဂံၪ့ဖိၪ လၧအပိၩ့ထၪ့ဒၪ ဆၧ,ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ၦအံၫစရ့လၭအၡၩ",
			"7": "<sup>7</sup> ဂံၪ့ဖိၪၥံၪဧ့,- လၧကယဲနၥံၪအဆၧမၩဘၪၥၭလိၪလဖၪ အဖၫ့ခိၪနီၪ, မွဲနၥံၪဒုၭဂဲၫနုၬၦလခီၫဘၩ့မုးဖိၪ, ၦလဒိၭ ဘၪဆၧကူၭတရံၭလၧၥၭ, ဒဲလဒိၭဘၪဆၧကူၭတရံၭ လၧယၪလၧယလးဆံၫ့ဎံၪအဖၧၩ့အကၠီၩ့တၭ, နၥံၪမၩ ဘၪၥၭလိၪယဂံၪ့, ထီးအထီလၧနၥံၪမၩယဆၧအၪ့,ဆၧ ၥိၪဒဲဆၧၥွံၪတၭ,မၩဂၭဂီၩ့ယဆၧအုၩ့လၩ့ လၧနၥံၪၥၭ လိၪခွံၬဝ့ၫအကၠီၩ့တၭ, မွဲနၥံၪမံၫ့ၥုၪ့မံၫ့ၥၭ လၧနၥံၪအ",
			"8": "<sup>8</sup> ဆၧၥၭလိၪအဂဲးဆံၭ.- ဆၧပၧၩ့ယလးဆံၫ့ဎံၪနီၪနၥံၪ ယိဘၪအ့ၬ. အ့ၪမွဲနၥံၪအီၪက့ၪ ၦယိဆၧပၧၩ့အလး ဆံၫ့ဎံၪလၧနၥံၪအဂးဒၪနၥံၪဝ့ၫလီၫ.",
			"9": "<sup>9</sup> ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ၦလခီၫဘၩ့မုးဖိၪလဒိၭ ဘၪဆၧကူၭတရံၭလၧၥၭ, ဒဲလဒိၭဘၪဆၧကူၭတရံၭ လၧယၪလၧၦလခီၫဘၩ့မုးဖိၪအီၪ လၧၦအံၫစရ့လၭဖိၪ အကျၩနီၪ လ့ၩနုၬဘၪလၧယလးဆံၫ့ဎံၪအဖၧၩ့နးဂၩ",
			"10": "<sup>10</sup> အ့ၬ.- အ့ၪမွဲၦလံဝဲၫဖိၪဒၪလ့ၬ လၧအဂၭဖျိၭဖၧၩ့ၥၭ ထီးအထီလၧအံၫစရ့လၭဂၭဖျိၭဖၧၩ့ၥၭ လၧအစဲၪ့ဒၪ ယၧၩတၭ, လ့ၩဖိၬအဆၧဂၩ့ဆၧဖၪ့အခဲၫ့နီၪး အဝ့ၫၥံၪ",
			"11": "<sup>11</sup> မိဘၪထိးအဆၧဒဲၩဘၭလီၫ.- လါနၫ့တၭမိမၩယခ့ၫ ယၡၩအဆၧလၧယလးဆံၫ့ဎံၪအဖၧၩ့, မိပၧၩ့ဆၧထီး ဂံၪ့အတရၫ့တၭ, မိမၩဂံၪ့အခ့ၫအၡၩအဆၧမၩလီၫ. မိမၩၥံၫဆၧလုမ့ၪ, ဒဲဆၧလုလၧၦခမျၧးအဂးတၭ,မိ ဆၧၫ့ထုၪ့လၧအမ့ၬယၫဘဲၫၥိၭအမိမၩ ၦခမျၧးအခ့ၫအ",
			"12": "<sup>12</sup> ၡၩအဆၧလီၫ.- မွဲအမၩဆၧအခ့ၫအၡၩအဆၧလၧအ ဆၧဂၩ့ဆၧဖၪ့အမ့ၬယၫ ဒဲဒုၭလၩ့မၪဘၪအံၫစရ့လၭ အၡၩဂံၪ့ဖိၪတၭ, ယယၩ့ထၪ့ယူၭယစူၪ ထၫ့ဒၩအဝ့ၫ ၥံၪတၭ,အဝ့ၫၥံၪမိဘၪထိးအဆၧဒဲၩဘၭ, ကဆါယဟိ",
			"13": "<sup>13</sup> ဝၩစံၭဝ့ၫဒၪ.- အဝ့ၫၥံၪၥုၭဘူၭဘၪအၥၭ လၧယအီၪ ဘဲၫၥိၭအမိမၩၦလုဆၧအဆၧလၧယဂးတၭ, ၥုၭဘူၭ ဘၪအၥၭဘဲၫၥိၭအမိမၩယဆၧဆံၫ့ဎံၪလမံၩ့လါလါ လၧဆၧအလးဆံၫ့ဎံၪထုၬနီၪနးမံၩ့အ့ၬ. အ့ၪမွဲမိဘၪ ထိးအဆၧမ့ၬမဲဒဲအဆၧၥၭလိၪ လၧအမၩယူၭဆၧလီၫ.",
			"14": "<sup>14</sup> လါနၫ့တၭ,ယမိအီၪက့ၪအဝ့ၫၥံၪ လၧၦယိဆၧပၧၩ့ဂံၪ့ လၧအဆၧမၩထီးအလူၬအဂး,ဒဲလၧကယဲဆၧလၧၦမိ မၩဝ့ၫလၧအဖၧၩ့ထီးအလူၬအဂးလီၫ.",
			"15": "<sup>15</sup> အ့ၪမွဲၦလုဆၧလဖၪ, ၦလံဝဲၫဖိၪ စဇၫဒီၭအဖိၪခွၫၥံၪ လၧအယိဆၧပၧၩ့ ယလးဆံၫ့ဎံၪ ထီးအထီလၧၦအံၫစ ရ့လၭဖိၪ ဂၭဖျိၭလၧယအီၪနီၪး အဝ့ၫၥံၪမိၥုၭဘူၭအ ၥၭလၧယအီၪ ဘဲၫၥိၭအမိမၩယခ့ၫယၡၩအဆၧ, ဒဲမိ ဆၧၫ့ထုၪ့လၧယမ့ၬယၫ ဘဲၫၥိၭ အမိလုထၪ့ယၧၩလၧ",
			"16": "<sup>16</sup> ဆၧၥိၪ ဒဲဆၧၥွံၪနီၪ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.- အဝ့ၫ ၥံၪမိလ့ၩနုၬဝ့ၫလၧယလးဆံၫ့ဎံၪအဖၧၩ့, ဒဲမိၥုၭဘူၭ အၥၭလၧ ယစပွဲအအီၪ ဘဲၫၥိၭအမိမၩယခ့ၫယၡၩအ",
			"17": "<sup>17</sup> ဆၧ, ဒဲယိယဆၧပၧၩ့လီၫ.- ထီးအဝ့ၫၥံၪလ့ၩနုၬလၧ ဆၧအဝၩ့လၧအဖၧၩ့လစီၪ့အတရၫ့နီၪ ဆၧမိမၩအၥၭ လၧအမိၥိၭဆၧဘွၩ ဖျ့ၫလံၬကံၭတၭ, လၧအမၩဆၧ လၧဝၩ့လၧအဖၧၩ့လစီၪ့အတရၫ့, ဒဲလၧဂံၪ့လၧအဖၧၩ့",
			"18": "<sup>18</sup> လခီၫအဘိၩ့ဘၭနီၪၥိၭဘၪၥိၪအဆီၪ့အ့ၬ.- အဝ့ၫၥံၪမိ ဘၪအီၪလၧ အခိၪဖုၪ့ဆၧဘွၩဖျ့ၫလံၬကံၭ လၧအခိၪ ဎွံၪ, ဒဲဆၧဖျၪ့ခဲၫ့ဆၧဘွၩ ဖျ့ၫလံၬကံၭ လၧအယးဒံၩ့ တၭ, ခဲးထူၬဘၪအၥၭ လၧဆၧဒုၭထၪ့ခိၥွ့ၫနီၪ နးမံၩ့",
			"19": "<sup>19</sup> အ့ၬ.- ထီးအဝ့ၫၥံၪအ့ၪစဲၪ့ထၪ့နုၬလၧဆၧဝၩ့လၧခီၫ့လ စီၪ့လၧဆၧအဝၩ့လၧခီၫ့လၧၦမျၧး အအီၪတၭ, မိဘၪ ဘဲၪ့လၩ့ခွံၬ အကီၩ့အၥိၭ လၧအမၩဆၧ လၧအဖၧၩ့ တၭ,အီၪက့ၪဝ့ၫလၧဒူၭဖိၪဆံၫ့ဎံၪလဖၪအဖၧၩ့တၭ, မိဘၪကီၩ့ထၪ့ၥိၭထၪ့ ဆၧအကီၩ့အၥိၭအဂူၫဂၩ,ဘဲၫ ၥိၭအထီးမၩဆံၫ့ဎံၪ ၦခမျၧးလၧအကီၩ့အၥိၭလဂ့ၩ",
			"20": "<sup>20</sup> လီၫ. အဝ့ၫၥံၪမိလိၩ့ခွံၬအခိၪအ့ၬ, ဒဲဒုၭထီၫထၪ့အခိၪ",
			"21": "<sup>21</sup> ၥူၫထီၫထီၫလ့ၬဆ့အ့ၬး မိဘၪထံၬအခိၪၥူၫလီၫ.- ထီးၦ လုဆၧလဂၩဂၩ အ့ၪလ့ၬနုၬ လၧဆၧဝၩ့လၧအဖၧၩ့လ",
			"22": "<sup>22</sup> စီၪ့တၭ, မိအီၩဘၪစဘံၭထံၫနးဂၩအ့ၬ.- အဝ့ၫၥံၪန့ ဘၪအမၫ လၧၦမုၪမဲၫမွဲဂ့ၩ, ၦမုၪလၩ့ၡၪ လၧအဝၩမွဲ ဂ့ၩ, နးဂၩအ့ၬ. မိဘၪမၩန့ၦမုၪနၩ့လၧအံၫစရ့လၭအ ဂံၪ့ဖိၪ အချံၫအၥၪ အကျၩလီၫ. အ့ၪလမွဲဘၪဘဲၫနီၪ တၭ, ဘၪမၩန့ၦမုၪမဲၫ လၧအမွဲယူၭ ၦလုဆၧအမၫလၧ",
			"23": "<sup>23</sup> အခီၫနီၪလီၫ.- အဝ့ၫၥံၪမိၥီၪ့လိၪယၡၩခမျၧးလၧဆၧ ဆံၫ့ဎံၪ, ဒဲဆၧလဆံၫ့ဘၪအဆၧၫ့, ဒဲဒုၭအၪ့နၩ့ဖၭအ ဝ့ၫၥံၪလၧဆၧဆံၫ့ဎံၪ ဒဲဆၧလဆံၫ့ဘၪအဆၧၫ့လီၫ.",
			"24": "<sup>24</sup> လၧၦချဲၩ့ခွးနီၪ အဝ့ၫၥံၪမိဆၧၫ့ထုၪ့ဝ့ၫ ဘဲၫၥိၭအမိစ့ၩ ရၫ့ခွး မိဘၪစ့ၩရၫ့ဝ့ၫဘဲၫ ယဆၧစ့ၩရၫ့အၥိၭနီၪတၭ, မိဘၪထီးန့ ယဆၧၥီၪ့ဆၧၥၫ့ ဒဲယဆၧမၪလူၬ လၧယ မၩဘိၪ့အဆၧၫ့အထီထီးအလူၬအဖၧၩ့တၭ, မိဘၪအီၪ",
			"25": "<sup>25</sup> က့ၪဆံၫ့ဎံၪယမးၥံၫအနံၩလဖၪလီၫ.- ဂဲၫဘူၭဘၪလၧ ၦၥံၫယူၭ လၧအမိမၩစံၪစၪ အနၫ့ဆါဒၪဝ့ၫနးဂၩအ့ၬ. လါနၫ့တၭ, လၧဖါအဂးမွဲဂ့ၩ, လၧမိအဂးမွဲဂ့ၩ, လၧ ဖိၪခွၫအဂးမွဲဂ့ၩ, လၧဖိၪမုၪအဂးမွဲဂ့ၩ, လၧထၧၫ့ဖုဝဲ ခွၫအဂးမွဲဂ့ၩ, လၧထၧၫ့ဖုဝဲမုၪလၧအဝၩလအီၪဘၪအ",
			"26": "<sup>26</sup> ဂးမွဲဂ့ၩ, မိမၩဘၪၥၭလိၪအၥၭလီၫ.- တၭလၧဆၧၥူၫ ဝၭဆံၫ့ဝ့ၫ အလးခဲၫ့နီၪ ၦမိဘၪဝံထၪ့နၬထၪ့ လၧအဂး",
			"27": "<sup>27</sup> နွ့ၫနံၩလီၫ.- တၭမုလနံၩလၧအလ့ၩနုၬ လၧဆၧအလး ဆံၫ့ဎံၪအဖၧၩ့, လၧဆၧအဝၩ့လၧအဖၧၩ့လခီၫလစီၪ့, ဘဲၫၥိၭအမိမၩဆၧလၧ ဆၧအလးဆံၫ့ဎံၪအဖၧၩ့တၭ, မိဘၪလုထၪ့ အဆၧလုဆၧဒဲၩဘၭနီၪ, ကဆါယဟိဝၩ",
			"28": "<sup>28</sup> စံၭဝ့ၫဒၪ.- ဆၧနီၪမိကဲၪထၪ့အဆၧန့ၥၫလီၫ. ယဝ့ၫဒၪ ယီၩ ယမွဲအဆၧန့ၥၫလီၫ. နၥံၪမိဖ့ၪလၫ့အဝ့ၫၥံၪလၧ ဆၧန့ၥၫလၧအံၫစရ့လၭအကျၩ နးမံၩ့အ့ၬ. ယဝ့ၫဒၪ",
			"29": "<sup>29</sup> ယီၩယမွဲအဆၧန့ၥၫလီၫ.- အဝ့ၫၥံၪမိအၪ့ဘၪဆၧမၩ ဘိၪ့ကိၪမုၬ,ဒဲဆၧလုဆၧဒဲၩဘၭ, ဒဲဆၧလုမၪဘၪဆၧ, ဒဲကယဲဆၧမၩဘိၪ့ လၧအံၫစရ့လၭအကျၩ လမံၩ့လါ",
			"30": "<sup>30</sup> လါနီၪ မိကဲၪထၪ့အဝ့ၫၥံၪအဆၧလီၫ.- ဆၧၥၪဆိၫအ ခၪ့ထံၭလၧဆၧထီးအလူၬအကျၩ, ဒဲကယဲဆၧမၩဘိၪ့ ထၪ့လၧနၥံၪမၩဘိၪ့ထီးအလူၬအကျၩ, ကိၭမံၩ့ဒ့ၭနီၪ, မိကဲၪထၪ့ၦလုဆၧလဖၪအဆၧလီၫ. နၥံၪမိဘၪဖ့ၪလၫ့ ဆိၫၦလုဆၧလၧနၥံၪအကိၪၥံၫ့ဆ့ၬ ဘဲၫၥိၭအမိဒုၭအီၪ",
			"31": "<sup>31</sup> ဆၧဆိၪဂ့ၩလၧနၥံၪအဂံၪ့ဖၧၩ့လီၫ.- ထိၪၥံၪလံၪၥံၪမွဲ ဂ့ၩ,ဆၧဖိၪဆၧဎါမွဲဂ့ၩ, လၧအၥံၫဒၪအဆၧမွဲဂ့ၩ, လၧဆၧအဲၪ့ၡၫ့ခွံၬဝ့ၫနီၪမွဲဂ့ၩ, ၦလုဆၧအၪ့ဘၪဝ့ၫနးမံၩ့ အ့ၬ."
		},
		"45": {
			"1": "<sup>1</sup> ထီးနၥံၪ အ့ၪဖၭဆၧ ဘဲၫၥိၭမိအၪ့နၩ့ဖၭ ထံၫၥံၪခး ၥံၪလၧဆၧန့ၥၫ အဂးနီၪတၭ, နၥံၪမိဘၪမၩဘိၪ့လၧ ဆၧဆိၬဘိၪ့ဆိၬထၪ့ဆၧ လၧခးဆံၫ့ဎံၪလဝၩ့ လၧယ ဟိဝၩအဂးလီၫ. အထီၫမိမွဲအနိၪထိၪ ဖီးဘီၩ့အဆိၩ နံၫလၬယဲထီၫ့ဒဲအဒၪ့ဎၩ့မိမွဲအဆိၩလလၬလီၫ. အနီၪ မိဆံၫ့ဎံၪဝ့ၫလၧအနဲၩ့ထံၭဝၬဖီၩ့ဝ့ၫ ထီးအလူၬလီၫ.",
			"2": "<sup>2</sup> လၧအဝ့ၫနီၪအဖၧၩ့အထီၫအဆိၩယဲယၩ, ဒဲအဒၪ့ဎၩ့ အဆိၩယဲယၩ, မိအီၪဝ့ၫ လၧဆၧအလးဆံၫ့ဎံၪ အဂး ဆၧလံနိၪ့ဝၬဖီၩ့ဝ့ၫလီၫ. အလးမိအီၪလၧခီၫ့ ဝၬဖီၩ့ဝ့ၫ",
			"3": "<sup>3</sup> နီၪအဒၪ့ဎၩ့အဖျါယဲဆံၫလီၫ.-လၧဆၧထိၪယူၭဆၧအ ဖၧၩ့နီၪ, နမိဘၪထိၪအဖၭထီၫအဆိၩနံၫလၬယဲထီၫ့, ဒဲ အဒၪ့ဎၩ့အဆိၩလလၬတၭ, လၧအဖၧၩ့နီၪမိကဲၪထၪ့",
			"4": "<sup>4</sup> ဆၧအလးဆံၫ့ဎံၪ,အလးဆံၫ့ဎံၪထုၬလီၫ.-အနီၪမွဲဆၧ ဆံၫ့ဎံၪလၧခးဖၧၩ့အဂး မိအီၪဝ့ၫ လၧၦလုဆၧလဖၪ အဂး,ၦလၧအမၩဆၧအလးဆံၫ့ဎံၪ အခ့ၫအၡၩအ ဆၧလဖၪ, လၧအၥုၭဘူၭအၥၭဘဲၫၥိၭအမိမၩယဟိ ဝၩအခ့ၫအၡၩအဆၧလီၫ. တၭမိအီၪဝ့ၫလၧအဝ့ၫၥံၪ အဂံၪ့လဖၪအလး, ဒဲလၧဆၧအလးဆံၫ့ဎံၪလၧယဟိ",
			"5": "<sup>5</sup> ဝၩအလးဆံၫ့ဎံၪအဂးလီၫ- ဆၧလၧအဖၭထီၫမွဲအ ဆိၩနံၫလၬယဲထီၫ့, ဒဲအဒၪ့ဎၩ့အဆိၩလလၬနီၪမိအီၪ ဝ့ၫလၧၦလံဝဲၫဖိၪ, ၦလၧအမၩဂံၪ့အဆၧမၩလဖၪအ ဂးဒၪဝ့ၫ, လၧဆၧဖီၪ့ထၬအဂးဒဲဒူၭဖိၪအဒူၭနံၫဆံၫအ ဂးလီၫ.",
			"6": "<sup>6</sup> နၥံၪမိဘၪအီၪက့ၪဆၧအဒၪ့ဎၩ့အဆိၩယဲထီၫ့,ဒဲအ ဖၭထီၫနီၪအဆိၩနံၫလၬယဲထီၫ့, လၧဒိၩ့အဂးဆဲၫဎၩ့ လၧဆၧမၩဘိၪ့အလးဆံၫ့ဎံၪဝ့ၫနီၪလီၫ. မိအီၪဝ့ၫလၧ ၦအံၫစရ့လၭအၡၩဂံၪ့ဖိၪထီးအလူၬအဂးလီၫ.",
			"7": "<sup>7</sup> ဆၧအဂးလၧၦဒိၪဖၭဒိၪအဂးနီၪ မိအီၪဝ့ၫလၧဆၧ မၩဘိၪ့ဆံၫ့ဎံၪ,ဒဲလၧဒိၩ့အဆၧဖီၪ့ထၬလၧလခီၫဒဲလၧ အလခီၫဒၪ, ဒဲလၧဆၧမၩဘိၪ့ဆံၫ့ဎံၪ လၧဒိၩ့အဆၧ ဖီၪ့ထၬအမ့ၬယၫ လၧအနဲၩ့ထံၭလၧမုနုၬဖိးလၧမုနုၬ လခီၫ,ဒဲလၧအနဲၩ့ထံၭမုထၪ့ဖိးလၧမုထၪ့လခီၫတၭ, အဖၭထီၫနီၪအီၪဆဲၫဎၩ့လၧဆၧအဂးကိၭမံၩ့ဒ့ၭလၧ အနဲၩ့ထံၭလၧမုနုၬလခီၫဖိးလၧအနဲၩ့ထံၭလၧမုထၪ့",
			"8": "<sup>8</sup> လခီၫလီၫ.- ဆၧလၧဂၪ့ခိၪလစီၪ့နီၪမိကဲၪထၪ့အဆၧ ဖီၪ့ထၬ လၧအံၫစရ့လၭအကျၩ ဘဲၫၥိၭအၦဒိၪဖၭဒိၪ လဖၪလမၩအၧၩ့လၧၩ့ဘၪယၡၩခမျၧးလီၫ. အ့ၪမွဲဘဲၫ ၥိၭအမိဖ့ၪလၫ့ဂၪ့ခိၪလၧအအီၪလၩ့ထးနီၪလၧအံၫစရ့ လၭအၡၩဂံၪ့ဖိၪ ဘဲၫအဒီၪ့လဖၪအီၪဝ့ၫအၥိၭနီၪလီၫ.",
			"9": "<sup>9</sup> ကဆါယဟိဝၩစံၭဘဲၫယီၩ, မွဲဆၧနီၪလၧၫ့လၧနၥံၪ အဂးဆံၭ. အံၫစရ့လၭ အၦဒိၪဖၭဒိၪၥံၪဧ့, အီၪက့ၪ ခွံၬဆၧမၩန့ဆီၪ့, ဒဲဆၧအၪ့ဂူၬန့ဆီၪ့ လၧနၥံၪအအီၪ ဆံၭ.မၩဆၧစ့ၩရၫ့ဒဲဆၧတီၩဆၧလီၩ့ဆံၭး ၥုၭန့ခွံၬ နၥံၪအဆၧအၪ့မၧၫ့ဆီၪ့လၧယၡၩခမျၧးဆံၭ. ကဆါ",
			"10": "<sup>10</sup> ယဟိဝၩစံၭဝ့ၫဒၪ.- နၥံၪမိအီၪလၧခံၫ့အတီၩ,ဒဲအ့ဖၭ",
			"11": "<sup>11</sup> အတီၩ,ဒဲဘၫၥၭအတီၩလီၫ.- အ့ဖၭဒဲဘၫၥၭမိဘၪမွဲ ဆၧတိၪ့လမံၩ့ဎး, ဘဲၫၥိၭဟိမၧၫဆံၫပိၩ့လပိၩ့ မိဎွ့ၩ ၥိၭလၧဘၫၥၭတၭ, ဟိမၧၫဆံၫပိၩ့လပိၩ့ မိဎွ့ၩၥိၭလၧ လအ့ဖၭလီၫ. ဆၧတိၪ့နီၪမိမီၪ့ဎီၩ့ လၧဟိမၧၫ့အဆၧ",
			"12": "<sup>12</sup> တိၪ့အၥိၭနီၪလီၫ. ၡက့လၭမိန့ၫၥိၭဂံရၫနံၫဆံၫလီၫ. ၡက့လၭနံၫဆံၫ, နံၫဆံၫယဲၡက့လၭ, ဒဲလဆံၫယဲၡက့",
			"13": "<sup>13</sup> လၭနီၪမိကဲၪထၪ့လကံကၫ လၧနၥံၪအဂးလီၫ.- အ ယီၩမွဲဆၧမၩဘိၪ့ လၧနၥံၪဘၪမၩဘိၪ့ လၧဘုၪကၠိၩ့ လဟိမၧၫအဖၧၩ့နီၪ, အ့ဖၭဎူၫပိၩ့လပိၩ့, ဒဲလၧဘုၪမု",
			"14": "<sup>14</sup> ယီၩလဟိမၧၫအဖၧၩ့နီၪအ့ဖၭဎူၫပိၩ့လပိၩ့လီၫ.- ဆၧ မၪလူၬဘၪဆဲၫ့ လၧဆၧၥိၪနီၪ နၥံၪဘၪမၩဘိၪ့ဘၫၥၭ ဆံၫပိၩ့လပိၩ့လၧကီၫလကီၫအဖၧၩ့လီၫ. လကီၫနီၪမွဲ ဆံၫဘၫၥၭလီၫ. အဂဲးဘဲၫယီၩဆံၫဘၫၥၭမွဲလဟိမၧၫ",
			"15": "<sup>15</sup> လီၫ. နၥံၪဘၪမၩဘိၪ့လၧၥိၪဖိၪလဒုၩလၧၥိၪဒဲဘ့ၪနံၫ ယၩအကျၩ လၧအအီၪဝ့ၫလၧအံၫစရ့လၭအဆၧအၪ့ အဆၪအလးဘၪစီၪဂ့ၩဘၪစဲၪလဖၪအကျၩ လၧဆၧ မၩဘိၪ့ကိၪမုၬ, ဒဲလၧဆၧလုမ့ၪအဂး, ဒဲလၧဆၧလုမၩ ဘၪလိၬအိၭလိၬအဂး, ဘဲၫၥိၭအမိမၩ ဆၧဖီၩ့ဖျ့ၭလၧ",
			"16": "<sup>16</sup> အဂး,ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.-ၦခးဖိၪထီးအလူၬမိ ဘၪမၩဘိၪ့ဆၧမၩဘိၪ့ယီၩလၧအံၫစရ့လၭအၦဒိၪဖၭ",
			"17": "<sup>17</sup> ဒိၪအဂးလီၫ.-ၦဒိၪဖၭဒိၪနီၪဘၪဖ့ၪဆၧလုမ့ၪ,ဒဲဆၧလု မၩဘိၪ့ကိၪမုၬ, ဒဲဆၧလုအီၩလၧဆၧမၩဘိၪ့နံၩလဖၪ အဖၧၩ့,ဒဲလၧလၩၥံၫအနံၩလဖၪ,ဒဲလၧမးၥံၫအနံၩလ ဖၪ,လၧအံၫစရ့လၭအၡၩဂံၪ့ဖိၪ အဆၧအီၪကီၪ့အမု နံၩထီးအလူၬအဖၧၩ့လီၫ. မိဘၪမၩဘိၪ့ဆၧလုဆၧ ဒဲၩဘၭ,ဒဲဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲဆၧလုမ့ၪဒဲဆၧလုမၩ ဘၪလိၬအိၭလိၬဘဲၫၥိၭအမိမၩဆၧဖီၩ့ဖျ့ၭလၧအံၫစရ့ လၭအၡၩဂံၪ့ဖိၪအဂးလီၫ.",
			"18": "<sup>18</sup> ကဆါယဟိဝၩစံၭဘဲၫယီၩ, လၧလၩခၪ့ထံၭလၩ ထၪ့လနံၩနီၪနမိဘၪမၩန့ချီ ဖၫဖိၪလၧအလၧၫ့အဎွ့ၩ",
			"19": "<sup>19</sup> လဒုၩတၭ, မၩဆံၫ့ဆၧအလးဆံၫ့ဎံၪလီၫ.- ၦလုဆၧ ဘၪမၩန့ဆၧလုဆၧဒဲၩဘၭအၥွံၪလနၩ့တၭ, အီၪက့ၪ လၧဂံၪ့ထုၪ့လဖၪအလီၩ့, လၧဆၧလုအလးအနဲၩ့ ထံၭလၧလၬလခီၫလံနိၪ့အလီၩ့, ဒဲလၧဆၧအဝၩ့ လၧအဖၧၩ့ လခီၫလစီၪ့ အတရၫ့အထုၪ့လီၩ့လီၫ.",
			"20": "<sup>20</sup> ၦလၧအနဲၩမၪဆၧအကၠီၩ့မွဲဂ့ၩ, ၦလၧအလမၩ လိၪဘၪဆၧအကၠီၩ့မွဲဂ့ၩ, အ့ၪမၩမၪဆၧတၭ, လၩ ထၪ့နွ့ၫနံၩလနံၩနီၪ နမိဘၪမၩဘဲၫနီၪၥိၭလီၫ. တၭနၥံၪ",
			"21": "<sup>21</sup> မိဘၪမၩဆၧဖီၩ့ဖျ့ၭ လၧဂံၪ့အဂးလီၫ.- လၩခၪ့ ထံၭလၩထၪ့လဆံၫလံနံၩလနံၩနီၪနၥံၪဘၪမၩဘိၪ့ လ့ၩဖၬ,လၧဆၧဘိၪ့ နွ့ၫနံၩလီၫ. ၦမိဘၪအၪ့ကိၪလ",
			"22": "<sup>22</sup> အီၪဘၪလၧမံၪနီၪကိၭဂၩဒ့ၭလီၫ.- ဆၧလၧမုလနံၩနီၪ ၦဒိၪဖၭဒိၪ ဘၪလုထၪ့ချီဖၫလဒုၩ လၧဆၧလုဆၧဒဲၩ ဘၭအဂး, လၧအဂးဒၪဝ့ၫ,ဒဲလၧၦခမျၧးလၧထံၫၥံၪခး",
			"23": "<sup>23</sup> ၥံၪအဖၧၩ့ထီးအလူၬအဂးလီၫ.- လၧဆၧမၩဘိၪ့နွ့ၫ နံၩအထးဖၧၩ့နီၪမိဘၪလုထၪ့ယဟိဝၩလၧဆၧလုမ့ၪ, ချီဖၫနွ့ၫဒုၩ, ဒဲၥိၪဖၫနွ့ၫဒုၩ လၧအလၧၫ့အဎွ့ၩ ကိၭမု နံၩဒ့ၭ,လၧနွ့ၫနံၩအထးဖၧၩ့ ဒဲဘ့ၪဖၫလဒုၩလၧဆၧ",
			"24": "<sup>24</sup> လုဆၧဒဲၩဘၭအဂးကိၭမုနံၩဒ့ၭလီၫ.- အဝ့ၫဒၪမိဘၪ မၩဘိၪ့ဆၧမၩဘိၪ့ကိၪမုၬလအ့ဖၭ လၧချီဖၫလဒုၩအ ဂး, ဒဲလအ့ဖၭလၧၥိၪဖၫလဒုၩအဂး, ဒဲၥိၪလဟံၫ့လၧ",
			"25": "<sup>25</sup> လအ့ဖၭအဂးလီၫ.- လၧလၩနွ့ၫဘံၪ့လဘံၪ့ လၩထၪ့ လဆံၫယဲနံၩလနံၩနီၪ, မိဘၪမၩဘဲၫနီၪ, ဒဲလၧဆၧမၩ ဘိၪ့နွ့ၫနံၩအထးဖၧၩ့ ဘဲၫဆၧလုဆၧဒဲၩဘၭ, ဒဲဆၧ လုမ့ၪဒဲဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲဘဲၫၥိၪနီၪအၥိၭလီၫ."
		},
		"46": {
			"1": "<sup>1</sup> ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ဆၧဝၩ့လၧအဖၧၩ့လခီၫ အတရၫ့လၧအဖိးဝ့ၫလၧမုထၪ့လခီၫနီၪ, မိကၭဘံၭထၬ အၥၭလၧမုနံၩမၩဆၧဎူၫနံၩအထးဖၧၩ့နီၪလီၫ. အ့ၪမွဲ လၧမးၥံၫအနံၩနီၪဆၧမိဘၪဝဲထၪ့ဝ့ၫ, ဒဲလၧလၩၥံၫအ",
			"2": "<sup>2</sup> နံၩနီၪဆၧမိဘၪဝဲထၪ့ဝ့ၫဆ့လီၫ.- ၦဒိၪဖၭဒိၪနီၪမိလ့ၩ နုၬလၧထိၬချိၫ့အတရၫ့ လၧခီၫ့လခီၫအဖၧၩ့တၭ, မိ ဆၧၫ့ထုၪ့လၧတရၫ့အထုၪ့အနဲၩ့ထံၭတၭ, ၦလုဆၧ မိလုထၪ့အဆၧလုမ့ၪဒဲအဆၧလုမၩဘၪလိၬအိၭလိၬ လီၫ.မိဘၩဆၧလၧတရၫ့အခၪ့ထံၭတၭ, မိစဲၪ့ထၪ့ဝ့ၫ လီၫ.လါနၫ့တၭမုလချႃၭဂၪလၩ့ဒံၭဘၪနီၪ, ဆၧမိကၭ",
			"3": "<sup>3</sup> ဘံၭထၬတရၫ့နီၪဒံၭအ့ၬ.- ၦခးဖိၪနီၪမိဘၩဆၧလၧ တရၫ့ယီၩအခၪ့ထံၭ လၧယဟိဝၩအမ့ၬယၫလၧမးၥံၫ",
			"4": "<sup>4</sup> အနံၩလဖၪ, ဒဲလၧလၩၥံၫအနံၩလဖၪနီၪလီၫ.- ဆၧလု မ့ၪလၧၦဒိၪဖၭဒိၪ မိဘၪလုထၪ့ယဟိဝၩလၧမးၥံၫအ နံၩနီၪမွဲၥိၪဖိၪ အလၧၫ့အဎွ့ၩဎူၫဒုၩ, ဒဲၥိၪဖၫအလၧၫ့",
			"5": "<sup>5</sup> အဎွ့ၩလဒုၩလီၫ.- ဆၧမၩဘိၪ့ကိၪမုၬနီၪမိမွဲလအ့ဖၭ လၧၥိၪဖၫလဒုၩအဂးတၭ, ဆၧမၩဘိၪ့လၧၥိၪဖိၪလဒုၩ အဂးနီၪ, မိမွဲဆၧအီၪဝ့ၫလၧအစူၪဖၫ့လၬတၭ, ၥိၪလ",
			"6": "<sup>6</sup> ဟံၫ့မိအီၪဝ့ၫလၧလအ့ဖၭအဂးလီၫ.- တၭလၩၥံၫအ နံၩနီၪချီဖၫဖိၪအလၧၫ့အဎွ့ၩလဒုၩ မိအီၪလၧၥိၪဖိၪ ဎူၫဒုၩဒဲၥိၪဖၫဖိၪလဒုၩလီၫ. မိမွဲအလၧၫ့အဎွ့ၩလီၫ.",
			"7": "<sup>7</sup> မိဘၪမၩဘိၪ့ကိၪမုၬ လအ့ဖၭလၧချီဖၫလဒုၩအဂး,ဒဲ လအ့ဖၭလၧၥိၪဖၫလဒုၩအဂး ဒဲလၧၥိၪဖိၪလဖၪအဂး နီၪ,ဆၧအီၪဝ့ၫလၧအစူၪဖၫ့လၬ, ဒဲၥိၪလဟံၫ့လၧလအ့",
			"8": "<sup>8</sup> ဖၭအဂးလီၫ.- ထီးၦဒိၪဖၭဒိၪအ့ၪလ့ၩနုၬဝ့ၫတၭ, မိ ဘၪလ့ၩနုၬလၧထိၬချိၫ့အတရၫ့တၭ, မိဘၪစဲၪ့ထၪ့လၧ",
			"9": "<sup>9</sup> ဖၧၩ့ၥၭထီးနီၪလီၫ.- ထီးၦခးဖိၪဂဲၫနုၬ လၧယဟိဝၩ အမ့ၬယၫလၧမၩဘိၪ့နံၩလဖၪအဖၧၩ့တၭ, ၦလၧအ လ့ၩနုၬဘၩဆၧလၧတရၫ့ လၧမုဖၩလခီၫနီၪမိဘၪစဲၪ့ ထၪ့လၧတရၫ့လၧမုခံၫ့လခီၫအဖၧၩ့ၥၭလီၫ. တၭၦလၧ အဂဲၫနုၬလၧတရၫ့မုခံၫ့လခီၫနီၪ မိဘၪစဲၪ့ထၪ့လၧတရၫ့ လၧမုဖၩလခီၫ အဖၧၩ့ၥၭနီၪလီၫ. ထဲၩ့ထဲၩ့ဘၪလၧ တရၫ့ဖၧၩ့ၥၭထီးအလ့ၩနုၬဝ့ၫအ့ၬ. မွဲအဘၪစဲၪ့ထၪ့",
			"10": "<sup>10</sup> ဆဲၫဎၩ့လၧအဝ့ၫလီၫ.- ထီးအဝ့ၫၥံၪလ့ၩနုၬတၭ, ၦဒိၪ ဖၭဒိၪမိလ့ၩနုၬ လၧအကျၩလီၫ. ထီးအဝ့ၫၥံၪစဲၪ့ထၪ့",
			"11": "<sup>11</sup> တၭ,အဝ့ၫဒၪမိစဲၪ့ထၪ့ဆ့လီၫ.- ဒဲလၧဆၧမၩဘိၪ့နံၩ လဖၪအဖၧၩ့, ဒဲလၧဆၧအီၪကီၪ့လဖၪအဖၧၩ့နီၪ, ဆၧ မၩဘိၪ့ကိၪမုၬနီၪ မွဲလအ့ဖၭလၧချီဖၫလဒုၩအဂး, ဒဲ လအ့ဖၭ လၧၥိၪဖၫလဒုၩအဂး, ဒဲလၧၥိၪဖိၪၥံၪအဂး ဘဲၫအဖ့ၪလၫ့ဝ့ၫမိကဲၪအၥိၭ, ဒဲၥိၪလဟံၫ့လၧလအ့ဖၭ",
			"12": "<sup>12</sup> အဂးလီၫ.- ထီးၦဒိၪဖၭဒိၪအ့ၪမၩဘိၪ့ယဟိဝၩလၧ ဆၧမၩဘိၪ့ဒၪဝ့ၫ, ဆၧလုမ့ၪမွဲဂ့ၩ, ဆၧလုမၩဘၪလိၬ အိၭလိၬ လၧအမၩဒၪဝ့ၫ လၧယဟိဝၩအဂးမွဲဂ့ၩတၭ, ၦမိဘၪဝဲထၪ့န့အဝ့ၫ လၧတရၫ့လဖၧၩ့တီၩဝ့ၫလၧမုထၪ့ လခီၫတၭ,အဆၧလုမ့ၪမွဲဂ့ၩ, အဆၧလုမၩဘၪလိၬအိၭ လိၬမွဲဂ့ၩ, မိမၩဘိၪ့ဝ့ၫဘဲၫအမၩဝ့ၫ လၧမးၥံၫအနံၩ အၥိၭလီၫ. ထီးနီၪလဖၧၫ့မိစဲၪ့ထၪ့ဝ့ၫတၭ, လၧအစဲၪ့ ထၪ့အလးခဲၫ့နီၪ ၦမိကၭဘံၭထၬတရၫ့လီၫ.",
			"13": "<sup>13</sup> နမိဘၪလုထၪ့ ယဟိဝၩလၧၥိၪလနံၪ့ဖိၪ အလၧၫ့ အဎွ့ၩလဒုၩ, လၧဆၧလုမ့ၪအဂး, ကိၭမုနံၩဒ့ၭတၭ,",
			"14": "<sup>14</sup> နမိဘၪထၪ့ဝ့ၫ လၧမုဂီၩကိၭဂီၩဒ့ၭလီၫ.- နမိဘၪ တဲၩ့ဝဲၩဆၧမၩဘိၪ့ ကိၪမုၬလအ့ဖၭဎူၫပိၩ့လပိၩ့,ဒဲၥိၪ လဟံၫ့ၥၧၫ့ပိၩ့လပိၩ့ လၧအမိလဲၩဎုၬဘၪစီၪကိၪအမုၬ လၧဆၧမၩဘိၪ့ကိၪ မုၬလၧယဟိဝၩအဂးကိၭမုဂီၩ ဒ့ၭလထံၪဎးလဘီၩ့ဎးတၭး မွဲဆၧမၪလူၬအဆိၩ",
			"15": "<sup>15</sup> အကၠၪလီၫ.- အဝ့ၫၥံၪမိဘၪ တဲၩ့ဝဲၩၥိၪဖိၪလဒုၩ, ဒဲ ဆၧမၩဘိၪ့ကိၪမုၬ, ဒဲၥိၪလၧဆၧလုမ့ၪအဂးကိၭမုဂီၩ ဒ့ၭလထံၪဎးလဘီၩ့ဎးလီၫ.",
			"16": "<sup>16</sup> ကဆါယဟိဝၩစံၭဘဲၫယီၩ, ၦဒိၪဖၭဒိၪအ့ၪဖ့ၪဆၧ ဖ့ၪလၫ့လၧအဖိၪခွၫလဂၩဂၩတၭ, အဖိၪခွၫလဖၪမိန့ ၥၫဝ့ၫလီၫ. မိကဲၪထၪ့ဝ့ၫလၧအန့ၥၫဆၧဖီၪ့ထၬလီၫ.",
			"17": "<sup>17</sup> လါနၫ့တၭအ့ၪဖ့ၪဆၧဖ့ၪလၫ့ လၧအန့ၥၫဆၧအဖၧၩ့ လမံၩ့လၧအခ့ၫအၡၩလဂၩဂၩတၭ,မိကဲၪထၪ့အဆၧ ထီၩ့လၧဆၧဖီၩ့ဖျ့ၭ အနံၪ့လနံၪ့နီၪလီၫ. လၧအလးခဲၫ့ နီၪမိကဲၪထၪ့ထဲၩ့ၦဒိၪဖၭဒိၪအဆၧလီၫ. အ့ၪမွဲအဆၧ",
			"18": "<sup>18</sup> န့ၥၫဒၪဝ့ၫနီၪ မွဲလၧအဖိၪခွၫလဖၪအဂးလီၫ.- တၭၦဒိၪ ဖၭဒိၪမၩန့ဘၪဆၧ လၧၦခမျၧးအဆၧန့ၥၫအဖၧၩ့ဘဲၫ ၥိၭအမိနၫ့ထၪ့ခွံၬ အဝ့ၫၥံၪလၧအဆၧန့ၥၫအဖၧၩ့အ့ၬ. မိဘၪဖ့ၪၥၫအဖိၪခွၫလဖၪ အဆၧန့ၥၫလၧအဆၧဒၪဝ့ၫ အဖၧၩ့,ဘဲၫၥိၭယၡၩခမျၧး အထီးဘၪဆၧနၫ့ထၪ့ခွံၬ ဝ့ၫလၧအဆၧန့ၥၫအဖၧၩ့နးဂၩလဂ့ၩလီၫ.",
			"19": "<sup>19</sup> ထီးနီၪလဖၧၫ့ဆၧဆိၬထၪ့ယၧၩ လၧဆၧလ့ၩနုၬလၧ အအီၪဝ့ၫလၧတရၫ့အနဲၩ့ထံၭ လၧၦလုဆၧလဖၪအဒူၭ ဆံၫ့ဎံၪလဖၪအဖၧၩ့, လၧအဒိၭဝ့ၫလၧမုဖၩလခီၫတၭ,",
			"20": "<sup>20</sup> ယိခွါ,အလးအီၪဝ့ၫနံၫစီၪ့လၧမုနုၬလခီၫလီၫ.- ထီးနီၪ လဖၧၫ့အဝ့ၫဒၪစံၭယၧၩ, ဆၧထီးယီၩမွဲအလးထီးၦလု ဆၧလဖၪဘၪအၪ့ဎွံထၪ့ဆၧလုမၪဘၪဆၧ, ဒဲဆၧလုဆၧ ဒဲၩဘၭ, ဒဲထီးအမိဘၪဎူဆၧမၩဘိၪ့ကိၪမုၬဘဲၫၥိၭအ ထီးဆိၬထၪ့အဝ့ၫလၧဆၧဝၩ့လၧခီၫ့လစီၪ့ လၧအမိမၩ",
			"21": "<sup>21</sup> ဆံၫ့ဎံၪၦခမျၧးနီၪလဂ့ၩလီၫ.- ထီးနီၪလဖၧၫ့ဆၧဆိၬ ထၪ့ယၧၩလၧဆၧဝၩ့လၧခီၫ့လစီၪ့တၭ, ဒုၭလ့ၩဖီၩ့ခွံၬ ယၧၩလၧဆၧအဝၩ့လံနိၪ့တၭ, ယိခွါ,ဆၧအဝၩ့ဖိၪလ စီၪ့အီၪဝ့ၫ လၧဆၧအဝၩ့အနိၪ့ဖၧၩ့ကိၭစီၪ့ဒ့ၭဆုၬဆုၬ",
			"22": "<sup>22</sup> လီၫ.- လၧဆၧအဝၩ့လံနိၪ့အဖၧၩ့နီၪ, ဆၧအဝၩ့ဖိၪလ ဖၪအီၪဝ့ၫလံစီၪ့လီၫ. အဖၭထီၫမွဲအဖျါလံဆံၫ, ဒဲအဒၪ့ ဎၩ့အဖျါၥၧၫ့ဆံၫလီၫ. ဆၧလံနိၪ့နီၪန့ၫဎီၩ့လိၬအၥၭ",
			"23": "<sup>23</sup> လီၫ.- ဆၧအဒီၪ့လဒီၪ့အီၪဝ့ၫလၧအဖၧၩ့ဝၬဖီၩ့ဝ့ၫလၧ ဆၧလံနိၪ့အဖၧၩ့ဒၪလ့ၬ, ဒဲအၪ့ဎွံဆၧအလးလဖၪအီၪ ဝ့ၫလၧဆၧအဒီၪ့နီၪ အဖၫ့လၬ ဝၬဖီၩ့ဝ့ၫလဖၪနီၪလီၫ.",
			"24": "<sup>24</sup> တၭအဝ့ၫဒၪစံၭယၧၩ, အယီၩလဖၪယီၩမွဲၦအၪ့ဎွံဆၧ အလးထီးၦမၩဂံၪ့အခ့ၫအၡၩအဆၧနီၪ အၪ့ဎွံၦခမျၧး အဆၧလုလီၫ."
		},
		"47": {
			"1": "<sup>1</sup> လၧခဲၫ့ထဲၩ့အဝ့ၫဒၪဆိၬထၪ့ယၧၩ လၧဂံၪ့အတရၫ့ ထံၭတၭ,ယိခွါ, ထံၫထၪ့လၧဂံၪ့အတရၫ့အခၧၪ့အဖၫ့ လၬလၧမုထၪ့လခီၫလီၫ. အဂဲးဘဲၫယီၩ,ဂံၪ့အမ့ၬယၫ ဒိၭဝ့ၫလၧမုထၪ့လခီၫတၭ, ထံၫလၩ့ယွၩလၧဂံၪ့အနဲၩ့ ထံၭစူၪထွ့ၪလခီၫလၧဆၧလုအလးလၧမုခံၫ့လခီၫလီၫ.",
			"2": "<sup>2</sup> ထီးနီၪလဖၧၫ့ အဝ့ၫဆိၬထၪ့ယၧၩလၧတရၫ့အဖၧၩ့ၥၭ လၧမုဖၩလခီၫတၭ, ၥိၫ့ထၪ့ယၧၩ လၧဖၧၩ့ၥၭ လၧခီၫ့ လၧတရၫ့လၧခီၫ့လဖၧၩ့လၧအဖိးထၪ့လၧမုထၪ့လခီၫ တၭ, ယိခွါ,ထံၫထၪ့တၭ,လၩ့ယွၩဝ့ၫလၧစူၪထွ့ၪလခီၫ",
			"3": "<sup>3</sup> လီၫ.- ထီးၦအီၪလၧဖျံၩလၧအစူၪဖၧၩ့လဂၩနီၪစဲၪ့ထၪ့ လၧမုထၪ့လခီၫတၭ,ထိၪအဖျါလထီၫ့နီၪ, ၥိၫ့ထၪ့ယၧၩ",
			"4": "<sup>4</sup> လၧထံၫကျၩတၭ, ထံၫအီၪဘံၭခၪ့ယၫၥၭလီၫ.- အဆၧ ထိၪဒီၭ အဖျါလထီၫ့တၭ, ၥိၫ့ထၪ့ယၧၩ လၧထံၫကျၩ တၭ, ထံၫယိၬထၪ့ဘၭ ပခၪ့လုးခိၪလီၫ. ထိၪဒီၭဝ့ၫအ ဖျါလထီၫ့တၭ,ၥိၫ့ထၪ့ယၧၩလၧထံၫကျၩတၭ, ထံၫယိၬ",
			"5": "<sup>5</sup> ထၪ့ဘၭပယးဒံၩ့လီၫ.- ထိၪဒီၭအဖျါလထီၫ့တၭ, ထံၫ မွဲထံၫမိၡါ လၧပခၫ့ဂၬ လန့ဘၪ, အဂဲးဘဲၫယီၩ, ထံၫ ယိၬ, ထံၫလၧၦဘၪယါဝ့ၫ, ထံၫမိၡါ လၧၦခၫ့ဂၬလန့ ဘၪလီၫ.",
			"6": "<sup>6</sup> တၭအဝ့ၫဒၪစံၭယၧၩ, ၦၡၩအဖိၪခွၫဧ့, အယီၩနဒၪ ဘၪယူၭဧၪ. အဝ့ၫဆိၬထၪ့ယၧၩတၭ, ဒုၭထဲၩ့ထဲၩ့",
			"7": "<sup>7</sup> ယၧၩလၧထံၫမိၡါအနဲၩ့လီၫ. ထီးယထဲၩ့ထဲၩ့တၭ, ယိခွါ, ၥံၪ့အၪထံၭအီၪဝ့ၫလၧ ထံၫနဲၩ့နံၫခီၫလူၬလီၫ.",
			"8": "<sup>8</sup> အဝ့ၫစံၭယၧၩ, ထံၫလဖၪယီၩလၩ့ယွၩဝ့ၫ လၧခးလၧ မုထၪ့လခီၫတၭ, လၩ့ယွၩဝ့ၫလၧၡါမုနၧၫ့ဖၫတၭ, လၩ့ ယွၩလၧမၫဆမံၭဖၧၩ့တၭ, ထီၩ့လၧမၫဆမံၭဖၧၩ့အ",
			"9": "<sup>9</sup> ကၠီၩ့နီၪ ထံၫလဖၪမိဘျၪထဲၩ့ဝ့ၫလီၫ.- ဆၧမိမၩအၥၭ လၧကယဲဆၧၥၭလၧအမၧၫ့ဝ့ၫလၧအဂဲၫဝ့ၫလၧအလး လစီၪ့လါလါလၧထံၫမိၡါထီၩ့ဝ့ၫနီၪမိမၧၫ့ဝ့ၫလီၫ. တၭ ဒ့ၪၥံၪယၪၥံၪအၪအၪလ့ၬမိအီၪထီးနီၪလီၫ. အဂဲးဘဲၫ ယီၩမိဘျၪထဲၩ့ဝ့ၫလီၫ. တၭထီးထံၫမိၡါမိဂဲၫဝ့ၫလစီၪ့",
			"10": "<sup>10</sup> လါလါနီၪ,ကယဲဆၧလမံၩ့လါလါမိမၧၫ့ဝ့ၫလီၫ.- ဆၧ မၩအၥၭလၧၦမၩယၪလဖၪမိဆၧၫ့ထုၪ့လၧအနဲၩ့လၧ အံၪ့ဂံၫဒဲၫ, ဖိးလၧအံၪ့ဂလ့အံၫ့နီၪ ဆၧအလးလၧၦခွံၬ ၡၬၥံၪ မိအီၪဝ့ၫလီၫ. တၭဒ့ၪၥံၪယၫၥံၪ မိအီၪဘဲၫအ ဆၨၩဒၪဝ့ၫအၥိၭနီၪ, ဘဲၫမၫဆမံၭဖၭဒိၪအယၪအၥိၭ",
			"11": "<sup>11</sup> နီၪအၪအၪလ့ၬလီၫ.- အ့ၪမွဲဖံၬအလး, ဒဲလိၬဖၧၩ့လဖၪ နီၪမိဘျၪထဲၩ့အ့ၬ. ဆၧမိအီၪက့ၪလၩ့အဝ့ၫၥံၪလၧထံၫ",
			"12": "<sup>12</sup> လၪအဂးလီၫ.- လၧထံၫနဲၩ့လၧအယီၩလခီၫ, ဒဲလၧအ နီၪလခီၫနီၪၥံၪ့ကိၭမံၩ့ဒ့ၭ မိမဲၪထၪ့လၧဆၧအၪ့အဂး တၭ, အလၪလလၩ့ယံၭဘၪ ဒဲအဆၧၥၪလမိလူၬဘၪ, မိၥၪထၪ့ဆၧၥၪကိၭလၩအဘံၪ့ဒ့ၭလီၫ. အဂဲးဘဲၫယီၩ အထံၫလဖၪလၩ့ယွၩဝ့ၫလၧဆၧအလးဆံၫ့ဎံၪအဖၧၩ့ နီၪလီၫ. တၭဆၧၥၪမိအီၪလၧဆၧအၪ့အဂးတၭ, အ လၪနီၪမိအီၪလၧ ၥံၪ ဎၥံၪ့ဎွံၭ အဂးလီၫ.",
			"13": "<sup>13</sup> ကဆါယဟိဝၩစံၭဘဲၫယီၩ အယီၩမွဲဆၧအနဲၩ့ထံၭ လၧနၥံၪမိဘၪအၪ့နၩ့ဖၭ ထံၫၥံၪခးၥံၪနီၪ, ဘဲၫအံၫစရ့ လၭအဒီၪ့လဆံၫနံၫဒီၪ့အၥိၭ, စယိၥၭမိန့ဘၪအဂးနံၫ",
			"14": "<sup>14</sup> စီၪ့လီၫ.- နၥံၪမိန့ၥၫဆၧလဂၩဂၩဘဲၫအဂူၫဂၩအၥိၭ ဆုၬဆုၬလီၫ. ယယူၬထၪ့ယစူၪလၧယမိဖ့ၪလၫ့ဝ့ၫလၧ နၥံၪအဖါလဖၪလီၫ. ခးလဘံၪ့ယီၩမိလၩ့ဘၪလၧနၥံၪ",
			"15": "<sup>15</sup> အကျၩလၧနၥံၪန့ၥၫဆၧအဂးလီၫ.- အယီၩမွဲခးအနဲၩ့ ထံၭလၧမုဖၩလခီၫလၧ မၫဆမံၭဖၭဒိၪ လၧဖၧၩ့ၥၭလၧ",
			"16": "<sup>16</sup> ဟ့ၭၥလၫ့ ဘဲၫၦလ့ၩဝ့ၫလၧဇံဒၭ,- ဟၫမၭ, ဘရိၥၭ, စ့ၭဘြံအံၫ့ လၧအအီၪဝ့ၫ လၧဒမၭစကၧၭအနဲၩ့ထံၭ, လၧဟၫမၭအနဲၩ့ထံၭတၭး ဟ့ဇၫဟၭတကၧၫ့လၧ အအီၪဝ့ၫလၧဟီရၫ့ဆၧအနဲၩ့ထံၭလၧမၫဆမံၭလခီၫ",
			"17": "<sup>17</sup> နီၪမွဲဟၫဇၫအံနၫ့, အနဲၩ့ထံၭလီၫ.-ဒမၭစကၧၭအနဲၩ့ ထံၭတၭ, လၧမုဖၩနီၪ, ဒဲဟၫမၭအနဲၩ့ထံၭလီၫ. အနီၪ",
			"18": "<sup>18</sup> မွဲအနဲၩ့ထံၭလၧမုဖၩလခီၫနီၪလီၫ.- အနဲၩ့ထံၭလၧမု ထၪ့လခီၫနီၪ နၥံၪမိဘၪထိၪလၧဟီရၫ့ဒဲလၧဒမၭစကၧၭ အဘိၩ့ဆၧၩ့, ဒဲလၧဂံလအၭ,ဒဲခးအံၫစရ့လၭလၧယီၫ ဒၫ့အနဲၩ့, လၧအနဲၩ့ထံၭဖိးလၧမၫဆမံၭလၧမုထၪ့လ",
			"19": "<sup>19</sup> ခီၫလီၫ. အနီၪမွဲအနဲၩ့ထံၭလၧမုထၪ့လခီၫလီၫ. အနဲၩ့ ထံၭလၧမုခံၫ့လခီၫ, လၧမုခံၫ့နီၪမိအီၪလၧတၫမၫဖိးလၧ ထံၫအဆၧအဲၪ့လိၬလၧကၫဒ့ၭအဖၧၩ့ဖိးလၧထံၫမိၡါ လၧမၫဆမံၭဖၭဒိၪအနဲၩ့ထံၭလီၫ. အနီၪမွဲအနဲၩ့ထံၭ",
			"20": "<sup>20</sup> လၧမုခံၫ့လခီၫလီၫ.- အနဲၩ့ထံၭလၧ မုနုၬလခီၫနီၪမိမွဲ မၫဆမံၭဖၭဒိၪလၧအနဲၩ့ထံၭဖိးလၧၦဂဲၫစိၩ လၧဟၫ",
			"21": "<sup>21</sup> မၭလီၫ. အနီၪမွဲအနဲၩ့ထံၭလၧမုနုၬလခီၫလီၫ.- နၥံၪ မိဘၪအၪ့နၩ့ဖၭခးလဘံၪ့ယီၩအဆၧၫ့ဘဲၫအံၫစရ့လၭ",
			"22": "<sup>22</sup> အဒီၪ့လဖၪအၥိၭနီၪလီၫ.- ဆၧမိမၩအၥၭလၧနၥံၪဘၪ ဖၭဆၧတၭ, နၥံၪမိဘၪအၪ့နၩ့ဖၭခးအဆၧၫ့လၧဆၧန့ ၥၫအဂး, ဒဲလၧၦလခီၫဘၩ့မုးဖိၪ လၧအအီၪလၧနၥံၪ အကျၩ လၧအထၪ့ဖိၪ လၧနၥံၪအကျၩနီၪ အဂးလီၫ. အဝ့ၫၥံၪနီၪ မိမၩအၥၭဘဲၫၦအီၪဖျဲၪ လၧခးဖၧၩ့လၧၦ အံၫစရ့လၭဖိၪၥံၪအကျၩအၥိၭလီၫ. မိန့ၥၫဆၧလၧန",
			"23": "<sup>23</sup> ၥံၪအၥိၭလၧအံၫစရ့လၭအဒီၪ့လဖၪအကျၩလီၫ.- တၭ ဆၧမိမၩအၥၭလၧထီးဒၪ ဆၧအဒီၪ့လၧၦလခီၫဘၩ့မုး ဖိၪအီၪဝ့ၫလၧအကျၩနီၪ, နၥံၪမိဘၪဖ့ၪလၫ့ဝ့ၫ လၧအ ဆၧန့ၥၫထီးနီၪ, ကဆါယဟိဝၩစံၭဝ့ၫဒၪ."
		},
		"48": {
			"1": "<sup>1</sup> လၧမုဖၩလခီၫ လၧဟံၭၥလၫ့အနဲၩ့ထံၭ ထီးၦလ့ၩ ဝ့ၫလၧဟၫမၭ, ဟၭဇအံနၫ့, ဒမၭစကၧၭအနဲၩ့ထံၭ, လၧမုဖၩလခီၫ, လၧဟၫမၭအနဲၩ့ထံၭ ဒဲလၧမုထၪ့လ ခီၫဖိးလၧမုနုၬ လခီၫနီၪမွဲအဆၧတၭ, အနီၪမွဲဒၫ့အလး",
			"2": "<sup>2</sup> လီၫ.- လၧဒၫ့အနဲၩ့ထံၭနီၪလၧမုထၪ့လခီၫဖိးလၧမုနုၬ",
			"3": "<sup>3</sup> လခီၫနီၪ, အၭၡၧၫအလးလီၫ.- လၧအၭၡၧၫအနဲၩ့ထံၭ လၧမုထၪ့လခီၫဖိးလၧမုနုၬနီၪ, နၭၥလဲၫအလးလီၫ.",
			"4": "<sup>4</sup> လၧနၭၥလဲၫအနဲၩ့ထံၭနီၪလၧမုထၪ့လခီၫဖိးလၧမုနုၬ",
			"5": "<sup>5</sup> လခီၫနီၪ, မနၭစ့ၫအလးလီၫ.- လၧမနၭစ့ၫအနဲၩ့ထံၭ နီၪလၧမုထၪ့လခီၫဖိးလၧမုနုၬလခီၫနီၪ, အံဖြံၫ့အလး",
			"6": "<sup>6</sup> လီၫ.- တၭလၧအံဖြံၫ့အနဲၩ့ထံၭနီၪလၧမုထၪ့လခီၫဖိး",
			"7": "<sup>7</sup> လၧမုနုၬလခီၫနီၪ,ရုဘံၫ့အလးလီၫ.- လၧရုဘံၫ့အနဲၩ့ ထံၭနီၪလၧမုထၪ့လခီၫဖိးလၧမုနုၬလခီၫနီၪ, ယုဒၫအ လးလီၫ.",
			"8": "<sup>8</sup> လၧယုဒၫအနဲၩ့ထံၭ လၧမုထၪ့ဖိးလၧမုနုၬလခီၫနီၪ ဆၧမၩဘိၪ့လၧနၥံၪမၩဘိၪ့နီၪ မိအီၪအဒၪ့ဎၩ့မွဲနိၪထိၪ ဖီးဘီၩ့အဆိၩနံၫလၬယဲထီၫ့တၭ, အဖၭထီၫန့ၫဎီၩ့လၧ ဆၧအဂးလစီၪ့လၧမုထၪ့လခီၫ ဖိးလၧမုနုၬနီၪလီၫ. တၭဆၧအလးဆံၫ့ဎံၪမိအီၪဝ့ၫ လၧအၥၭကျၩလီၫ.",
			"9": "<sup>9</sup> ဆၧမၩဘိၪ့လၧနၥံၪမိဘၪမၩဘိၪ့ယဟိဝၩနီၪ အဖၭ ထီၫမိမွဲနိၪထိၪဖီးဘီၩ့အဆိၩနံၫလၬယဲထီၫ့, ဒဲအဒၪ့",
			"10": "<sup>10</sup> ဎၩ့နီၪအဆိၩလလၬလီၫ.- ဆၧမၩဘိၪ့ဆံၫ့ဎံၪနီၪမိအီၪ ဝ့ၫလၧအယီၩအဂး မိအီၪက့ၪလၧၦလုဆၧလဖၪအဂး နီၪ,လၧမုဖၩလခီၫအဖၭထီၫအဆိၩနံၫလၬယဲထီၫ့, ဒဲ လၧမုနုၬလခီၫအဒၪ့ဎၩ့အဆိၩလလၬ, ဒဲလၧမုထၪ့အ ဒၪ့ဎၩ့အဆိၩလလၬ ဒဲလၧမုခံၫ့လခီၫ အဆိၩနံၫလၬ ယဲထီၫ့နီၪလီၫ. ယဟိဝၩအလးဆံၫ့ဎံၪ မိအီၪဝ့ၫလၧ",
			"11": "<sup>11</sup> အၥၭကျၩလီၫ.- မိအီၪဝ့ၫလၧၦလုဆၧလဖၪအဂး,လၧ ဆၧအီၪက့ၪဆံၫ့ဎံၪဝ့ၫ, ဘၪဆဲၫ့လၧစဇၫဒီၭ အဖိၪခွၫ ၥံၪလၧအယိယူၭယဆၧခိၭနီၪတၭ, လၧဂၭဖျိၭဆၧထီး အထီလၧၦအံၫစရ့လၭဖိၪဂၭဖျိၭဆၧ ဘဲၫၦလံဝဲၫဖိၪ",
			"12": "<sup>12</sup> ၥံၪဂၭဖျိၭဆၧအၥိၭနီၪ, အဝ့ၫၥံၪဂၭဖျိၭအ့ၬ.- မိကဲၪထၪ့ ဆၧမၩဘိၪ့ဆံၫ့ဎံၪထုၬ လၧၦလံဝဲၫဖိၪအနဲၩ့လၧဂၪ့ခိၪ",
			"13": "<sup>13</sup> အဆၧမၩဘိၪ့ဆံၫ့ဎံၪအဖၧၩ့လီၫ.- အီၪဆဲၫဎၩ့လၧၦ လုဆၧလဖၪအနဲၩ့ထံၭနီၪ, ၦလံဝဲၫဖိၪမိအီၪလၧဆၧ လၧအဖၭထီၫအဆိၩနံၫလၬယဲထီၫ့, ဒဲအဒၪ့ဎၩ့အဆိၩ လလၬလီၫ. အဖၭထီၫထၧၫ့ဘီၩ့ယၫနီၪ မွဲအဆိၩနံၫ",
			"14": "<sup>14</sup> လၬယဲထီၫ့ ဒဲအဒၪ့ဎၩ့လလၬလီၫ.- အဝ့ၫၥံၪအၪ့ဆၫ ခွံၬဘၪအဝ့ၫအ့ၬး အၪ့လဲၩဘၪအဝ့ၫအ့ၬး ဒဲဖ့ၪလၫ့ခွံၬ ဘၪခးအဆၧၥၪဆိၫအ့ၬး အဂဲးဘဲၫယီၩမွဲဆၧဆံၫ့ဎံၪ လၧယဟိဝၩအဂးလီၫ.",
			"15": "<sup>15</sup> ဆၧအဆိၩယဲထီၫ့လၧအအီၪလၩ့ထး လၧဆၧဒၪ့ဎၩ့ အဖၫ့ခိၪ, အီၪဆဲၫဎၩ့လၧဆၧအဆိၩနံၫလၬယဲထီၫ့နီၪ, မိကဲၪထၪ့ဆၧအလး လဆံၫ့ဘၪ လၧဒိၩ့အဂး,လၧၦ အီၪဝ့ၫအလးအဂး, ဒဲလၧဆၧအလးအီၪ လၧဒိၩ့လၧ",
			"16": "<sup>16</sup> ခီၫ့အဂးလီၫ. ဒိၩ့နီၪမိအီၪဝ့ၫလၧအၥၭကျၩလီၫ.- အ ယီၩမွဲအထိၪဝ့ၫနီၪ, အဖၭထီၫလၧမုဖၩလခီၫ, မွဲအ ဆိၩလံထီၫ့ယဲယၩ, ဒဲလၧမုခံၫ့လခီၫအဆိၩလံထီၫ့ယဲ ယၩ,ဒဲလၧမုထၪ့လခီၫအဆိၩလံထီၫ့ယဲယၩ, ဒဲလၧမု",
			"17": "<sup>17</sup> နုၬလခီၫအဆိၩလံထီၫ့ယဲယၩလီၫ.- ဆၧအလးအီၪ ဝ့ၫလၧဒိၩ့လၧခီၫ့နီၪ အဆိၩနံၫယၩယဲဆံၫမိအီၪ လၧမု ဖၩလခီၫ, အဆိၩနံၫယၩယဲဆံၫလၧမုခံၫ့လခီၫ, ဒဲအ ဆိၩနံၫယၩယဲဆံၫလၧမုထၪ့လခီၫ, ဒဲအဆိၩနံၫယၩ",
			"18": "<sup>18</sup> ယဲဆံၫလၧမုနုၬလခီၫလီၫ.- ဆၧအီၪလၩ့ထးလၧအဖၭ ထီၫနီၪအီၪဆဲၫဎၩ့ လၧဆၧမၩဘိၪ့ဆံၫ့ဎံၪနီၪအဆိၩလ လၬ,လၧမုထၪ့လခီၫ, ဒဲအဆိၩလလၬလၧမုနုၬလခီၫ, အီၪဆဲၫဎၩ့လၧဆၧမၩဘိၪ့ဆံၫ့ဎံၪနီၪ, အဆၧအၪထၪ့ မိကဲၪထၪ့ဆၧအၪ့ လၧၦလၧအမၩဒိၩ့အဆၧမၩအဂး",
			"19": "<sup>19</sup> လီၫ.- ၦလၧအမၩဒိၩ့အဆၧမၩနီၪ, မိမၩဝ့ၫလၧအံၫစ",
			"20": "<sup>20</sup> ရ့လၭအဒီၪ့ထီးအလူၬအကျၩလီၫ.- ဆၧမၩဘိၪ့ထီး အလူၬနီၪ အဖၭထီၫမိမွဲအဆိၩနံၫလၬယဲထီၫ့နီၪ, ဒဲအ ဒၪ့ဎၩ့အဆိၩနံၫလၬယဲထီၫ့လီၫ. နၥံၪမိဘၪမၩဘိၪ့ ဆၧမၩဘိၪ့ဆံၫ့ဎံၪလၧဆၧလံနိၪ့အီၪ လၧဒိၩ့အဆၧဖီၪ့ ထၬလီၫ.",
			"21": "<sup>21</sup> ဆၧအီၪလၩ့ထးအလခီၫ, ဒဲလၧအလခီၫဒၪနီၪမွဲလၧ အၦဒိၪဖၭဒိၪအဂး, လၧအဆၧမၩဘိၪ့ဆံၫ့ဎံၪ ထီးအ လူၬ,ဒဲလၧဒိၩ့အဆၧဖီၪ့ထၬနီၪအီၪဆဲၫဎၩ့ လၧဆၧအ ဆိၩနံၫလၬယဲထီၫ့လၧဆၧအနဲၩ့ထံၭ လၧမုထၪ့လခီၫ, ဒဲအဆဲၫဎၩ့ လၧဆၧအဆိၩနံၫလၬယဲထီၫ့ လၧဆၧအ နဲၩ့ထံၭလၧမုနုၬလခီၫ, ဆဲၫဎၩ့ လၧၦဒိၪဖၭဒိၪအဂး လီၫ.တၭမွဲဆၧမၩဘိၪ့ဆံၫ့ဎံၪ, ဒဲဂံၪ့အလးဆံၫ့ဎံၪ မိ",
			"22": "<sup>22</sup> အီၪဝ့ၫလၧအၥၭကျၩလီၫ.- ဆၧအီၪလၩ့ထးလၧၦလံ ဝဲၫဖိၪအဆၧန့ၥၫ, ဒဲလၧဒိၩ့နီၪ အဆၧန့ၥၫလၧအအီၪ ဝ့ၫလၧၦဒိၪဖၭဒိၪအဆၧအကျၩနီၪ လၧအအီၪဝ့ၫလၧ ယုဒၫအနဲၩ့ထံၭ, ဒဲဘံၪ့ယမံၫ့အနဲၩ့ထံၭ အဘိၩ့ဆၧၩ့ နီၪမိကဲၪထၪ့ၦဒိၪဖၭဒိၪအဆၧလီၫ.",
			"23": "<sup>23</sup> ၦဒီၪ့ၥံၪလၧအအီၪလၩ့ထးလဖၪယီၩ, လၧမုထၪ့ လခီၫဖိးလၧမုနုၬလခီၫနီၪ, မွဲဘံၪ့ယမံၫ့အလးလီၫ.",
			"24": "<sup>24</sup> လၧဘံၪ့ယမံၫ့အနဲၩ့ထံၭနီၪ လၧမုထၪ့လခီၫဖိးလၧမု",
			"25": "<sup>25</sup> နုၬလခီၫနီၪ စံမအၧၫ့အလးလီၫ.- လၧစံမအၧၫ့အနဲၩ့ ထံၭလၧမုထၪ့လခီၫဖိး လၧမုနုၬလခီၫနီၪ, မွဲအံစခၫ",
			"26": "<sup>26</sup> အလးလီၫ.- လၧအံစခၫအနဲၩ့ထံၭလၧမုထၪ့လခီၫဖိးလၧ",
			"27": "<sup>27</sup> မုနုၬလခီၫနီၪ,မွဲဇ့ၭဘလၧၫ့အလးလီၫ.- လၧဇ့ၭဘလၧၫ့ အနဲၩ့ထံၭလၧမုထၪ့လခီၫဖိးလၧမုနုၬလခီၫနီၪ, မွဲဂၭအ",
			"28": "<sup>28</sup> လးလီၫ.- လၧဂၭအနဲၩ့ထံၭလၧမုခံၫ့လခီၫဖိးလၧမုခံၫ့ နီၪ,အနဲၩ့ထံၭမိအီၪဝ့ၫ လၧတၫမၫ ဖိးလၧထံၫဆၧအဲၪ့ လိၬလၧကၫဒ့ၭအဖၧၩ့ဖိးလၧထံၫမိၡါနီၪ လၧမၫဆမံၭဖၭ",
			"29": "<sup>29</sup> ဒိၪလီၫ.- လၧၦဖၭဆၧအဖၧၩ့နီၪ,အယီၩမွဲခးလဘံၪ့ လၧနၥံၪမိဘၪအၪ့နၩ့ဖၭ ဖ့ၪလၫ့အံၫစရ့လၭအဒီၪ့လဖၪ လၧအဆၧန့ၥၫအဂးတၭ, အယီၩမွဲအဝ့ၫၥံၪအလး လဖၪ,ကဆါယဟိဝၩစံၭဝ့ၫဒၪ.",
			"30": "<sup>30</sup> အယီၩမွဲဒိၩ့အဆၧစဲၪ့ထၪ့ခွံၬလဖၪ, လၧမုဖၩလခီၫ နီၪ,မိမွဲအနိၪထိၪဖီးဘီၩ့အဆိၩ လံထီၫ့ယဲယၩလီၫ.",
			"31": "<sup>31</sup> တၭဒိၩ့အတရၫ့အမံၩ့နီၪ, မိလၩ့ဎိၭလိၬအၥၭလၧအံၫ စရ့လၭအဒီၪ့လဖၪအမံၩ့နီၪလီၫ. လၧမုဖၩလခီၫနီၪ တရၫ့အီၪၥၧၫ့ဖၧၩ့, ရုဘံၫ့အတရၫ့လဖၧၩ့, ယုဒၫအတ",
			"32": "<sup>32</sup> ရၫ့လဖၧၩ့, လံဝဲၫအတရၫ့လဖၧၩ့လီၫ.- လၧမုထၪ့လ ခီၫနီၪမိမွဲအနိၪထိၪဖီးဘီၩ့ အဆိၩလံထီၫ့ယဲယၩတၭ, တရၫ့အီၪၥၧၫ့ဖၧၩ့, ယိၥၭအတရၫ့လဖၧၩ့, ဘံၪ့ယမံၫ့",
			"33": "<sup>33</sup> အတရၫ့လဖၧၩ့, ဒၫ့အတရၫ့လဖၧၩ့လီၫ.- လၧမုခံၫ့လ ခီၫနီၪမွဲအနိၪထိၪဖီးဘီၩ့အဆိၩလံထီၫ့ယဲယၩ, တရၫ့ အီၪၥၧၫ့ဖၧၩ့, စံမအၧၫ့အတရၫ့လဖၧၩ့, အံစခၫအတ",
			"34": "<sup>34</sup> ရၫ့လဖၧၩ့, ဇ့ၭဘလၧၫ့အတရၫ့လဖၧၩ့လီၫ.- လၧမုနုၬ လခီၫနီၪမိမွဲအနိၪထိၪဖီးဘီၩ့ အဆိၩလံထီၫ့ယဲယၩ တၭ,အတရၫ့အီၪၥၧၫ့ဖၧၩ့, ဂၭအတရၫ့လဖၧၩ့, အၭ ၡၧၫအတရၫ့လဖၧၩ့ ဒဲနၭၥလဲၫအတရၫ့လဖၧၩ့လီၫ.",
			"35": "<sup>35</sup> အနိၪထိၪဖီးဘီၩ့ဝၬဖီၩ့ဝ့ၫနီၪ မွဲအဆိၩလလၬဎိၭထီၫ့ လီၫ.တၭလၧမုလနံၩနီၪ လၧယၫလခီၫဒိၩ့နီၪအမံၩ့မိ ဘၪအီၪဝ့ၫ, ယဟိဝၩၡၪ့မၫ (ယဟိဝၩအီၪဝ့ၫထီး နီၪ) လီၫ."
		}
	}
};
module.exports = book;